    {id: 60, award_name: "A Nurse I Am Scholarship", subject_area: "Nursing", level: "Undergraduate", deadline: "2019-03-31", other_req: " Applicants must be enrolled or accepted for enrollment in an accredited LVN/LPN, RN degree (ADN or BSN), diploma, or RN-to-BSN program, and must begin/ have begun classes no later than Jan. 31, 2018. Students can be full or part-time. ", sponsor: "Cherokee Uniforms", amount: " $ 2,000 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.anurseiam.com", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2019-03-27 21:05:55", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "hobbsm"},
    {id: 61, award_name: "Beyond the Cure Ambassador Scholarship Program", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-03-30", other_req: " Applicants must be: A childhood cancer survivor under the age of 25 and diagnosed before the age of 18 with cancer or a high grade or anaplastic brain tumor; A citizen of the United States living within the country and attending school in the U.S.; Accepted into a post-secondary school in the Fall", sponsor: "The National Children's Cancer Society", amount: " $ 3,500 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.thenccs.org/scholarship", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2019-01-02 22:57:56", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
