    {id: 63, award_name: "The Ulman Cancer Fund for Young Adults", subject_area: "All fields", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-03-01", other_req: " The Ulman Cancer Fund for Young Adults is committed to helping young adults (15-39) continue their education after being affected by cancer through their own diagnosis or the diagnosis of a loved one. Many scholarships offered by UCF share similar applicant criteria. Applicants need only submit one application, which will be considered for any and all scholarships for which the student applies and is eligible. Applicants must have been between the ages of 15 and 39 during their own diagnosis/treatment or during the diagnosis/treatment of their parent or sibling.  Each scholarship winner is obligated to organize and run a bone marrow registry drive with the support of Delete Blood Cancer and There Goes My Hero.", sponsor: "The Ulman Cancer Fund for Young Adults", amount: " $ 2,500 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://ulmanfund.org/scholarships/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2019-01-11 18:39:24", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-05", updated_by: "walshm"},
    {id: 64, award_name: "Schweiger Memorial Scholarship ", subject_area: "Engineering", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-03-01", other_req: " The Fund provides annual scholarships to applicants wishing to pursue careers in construction and construction-related fields. The Memorial Fund awards annual scholarships to selected students at the Schweiger Memorial Scholarship Awards Banquet each Spring. ", sponsor: "Schweiger Memorial Scholarship Fund", amount: " varies ", state: "OR; WA", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.callaac.com/Scholarships/Scholarships.html", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2018-11-15 23:08:44", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-15", updated_by: "walshm"},
    {id: 66, award_name: "Bend Surgery Center Foundation Undergraduate Scholarship", subject_area: "Pre-Med; Nursing; Biology", level: "HS Senior", deadline: "2019-02-22", other_req: " Bend Surgery Center Foundation’s mission is to encourage and inspire interested and qualified Central Oregon students to pursue careers in health care by providing funding for educational opportunities. To be eligible to apply you must: be a Central Oregon high school senior accepted by date of award notification to an accredited college or university; have a minimum GPA of 3.0.", sponsor: "Bend Surgery Center Foundation", amount: " $ 1,000 ", state: "OR", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.bendsurgerycenterfoundation.org/Scholarships.html", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2018-10-18 19:49:30", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 67, award_name: "Blue Mountain Community Foundation Scholarships", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-03-01", other_req: " Approx. 50 scholarships with one application.  Students can be high school seniors or continuing college students seeking their first undergraduate degree who are residents of Walla Walla, Columbia, Garfield or Umatilla County (WA)  US citizenship is not required. Awards are restricted to students seeking their first undergraduate degree.", sponsor: "Blue Mountain Community Foundation", amount: "Varies", state: "WA", min_gpa: "None", contact: "financial.aid@example.edu", keywords: "", website: "https://www.bluemountainfoundation.org/grants-scholarships/scholarships/available-scholarship-applications/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2019-01-02 22:58:28", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 68, award_name: "Oregon Community Quarterback Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-03-01", other_req: " Achieve a high school diploma or GED in the state of Oregon; Committed to attending an Oregon university, college, or trade school for the academic year; Completed standardized testing required for program admission (SAT or ACT); Proof of Community Involvement/Volunteerism; Financial Need  ", sponsor: "Harrington Family Foundation", amount: " $ 4,000 ", state: "OR", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.harringtonfamilyfoundation.org", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2018-10-23 16:47:07", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 69, award_name: "National Institute of Health Scholarship", subject_area: "Biology; Psychology; Sociology; Premed; Chemistry", level: "Undergraduate", deadline: "2019-03-18", other_req: "The National Institutes of Health (NIH) Undergraduate Scholarship Program (UGSP) offers competitive scholarships to students from disadvantaged backgrounds who are committed to careers in biomedical, behavioral, and social science health-related research.  Must be enrolled or accepted for enrollment (transfer student) as a full-time student at an accredited, 4 year undergraduate institution; High School seniors are not eligible to apply; 3.3 GPA or higher (on 4.0 scale) or within the top 5 percent of your class; From a disadvantaged background - disadvantaged background means that your financial aid office has certified you as having 'exceptional financial need' (based on Family AGI and household size).  This scholarship has a service commitment.", sponsor: "US Dept of Health and Human Resources", amount: " up to $20,000 annually", state: "All", min_gpa: "3.30", contact: "financial.aid@example.edu", keywords: "", website: "https://www.training.nih.gov/programs/ugsp ", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2019-01-03 17:12:10", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 70, award_name: "The Denver Foundation", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-03-01", other_req: "Criteria varies by specific scholarship.  Many scholarships through the foundation also have a different deadline later in spring.", sponsor: "The Denver Foundation", amount: " varies ", state: "CO", min_gpa: "Varies", contact: "financial.aid@example.edu", keywords: "", website: "http://www.denverfoundation.org/Scholarships/Scholarships-at-the-Denver-Foundation", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2019-02-12 05:37:54", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 71, award_name: "Life Lessons Scholarship Program", subject_area: "All fields", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-03-01", other_req: "Life Lessons Scholarship Program is open to college students and college-bound high school seniors (between ages 17 - 24) who have experienced the death of a parent or legal guardian. ", sponsor: "Life Happens", amount: "$5,000 - $15,000", state: "All; PR", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.lifehappens.org/life-lessons-scholarship-program/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2019-02-12 05:40:07", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 72, award_name: "Student of Integrity Award Scholarships", subject_area: "All fields", level: "HS Senior", deadline: "2019-03-08", other_req: "•\t Resides in BBB’s service area - Nebraska, South Dakota, The Kansas Plains (all counties except: Franklin, Johnson, Leavenworth, Linn, Miami and Wyandotte) or Southwest Iowa (includes: Cass, Fremont, Harrison, Mills, Montgomery, Page, Pottawattamie and Shelby counties).\r\n These awards recognize students that personify values, leadership and integrity.", sponsor: "Better Business Bureau Foundation", amount: " $ 2,000 ", state: "NE; SD; KS; IA", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://www.bbb.org/nebraska/for-businesses/programs-services/bbb-awards-pages/student-of-integrity-award-scholarships/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2019-02-12 05:46:43", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "hobbsm"},
    {id: 73, award_name: "Arizona Homeschool Scholarship ", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-03-08", other_req: " Homeschooled student from Arizona, high school senior or continuing student. Applications are evaluated based on academic record, accomplishments, personal recommendations, leadership qualities, character, community activities, and service. Scholarship awards are generally equally divided between semesters and are dependent on proof of college registration as a full time student and a GPA of 3.0 or greater. ", sponsor: "Arizona Homeschool Scholarship Fund", amount: "Varies", state: "AZ", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://afhe.org/resources/scholarship-fund/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2019-01-11 18:40:01", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-05", updated_by: "walshm"},
    {id: 74, award_name: "VIP Women in Technology Scholarship", subject_area: "Computer Science; Information Technology", level: "HS Senior; Undergraduate; Graduate", deadline: "2018-04-01", other_req: " At the time of award, female students must be enrolled at, or accepted into, either a two or four-year college or university within the United States for the school year; These individuals must be planning a career in computer science, information technology, management information systems, computer engineering, or another related field.  The scholarship is awarded based on three criteria; a cumulative 3.0 GPA or higher, thoughtful answer to the essay question and level or participation in community service and/or extracurricular activities.", sponsor: "Visionary Integration Professionals", amount: "up to $2,500 ", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: "", website: "https://www.trustvip.com/community-support-service/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2019-02-12 05:48:46", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Feb 2019 still shows live 2018-2019 application", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 75, award_name: "National Foster Parent Association Youth Scholarships", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-04-05", other_req: " The National Foster Parent Association offers scholarships for foster youth, adopted youth, and biological youth of currently licensed foster parents, who wish to further their education beyond high school, including college or university studies, vocational/technical school or junior college.  The foster parents must be members of NFPA. ", sponsor: "National Foster Parent Association Scholarships", amount: " $ 500 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://nfpaonline.org/Scholarship", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2019-02-12 05:49:59", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-28", updated_by: "hobbsm"},
    {id: 79, award_name: "Montana Community Foundation", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-03-16", other_req: " Multiple scholarships with varying criteria for Montana students.  Many are renewable.", sponsor: "Montana Community Foundation", amount: " varies ", state: "MT", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.mtcf.org/Grants-Scholarships/Apply-for-a-Scholarship", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2019-01-02 22:58:44", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 80, award_name: "Microsoft disAbility Scholarship", subject_area: "Engineering; Computer Science; Business; Pre-Law; Marketing", level: "HS Senior", deadline: "2019-03-01", other_req: " Be a current high school senior with living with a disAbility (as defined by WHO), whether that be visual, hearing, mobility, cognitive, speech or other disAbility; Plan to attend an undergraduate program in a 2 or 4-year University/College or Technical College in the fall of the academic year following high-school graduation; Declare a major in engineering, computer science, computer information systems, law ,business ,or a related field (e.g. paralegal, pre-law, finance, business administration, or marketing); Demonstrate a passion for technology; Demonstrate leadership at school and/or in the community; Have a high school cumulative GPA of 3.0 or higher; Require financial assistance to attend college; Enrollment status must be full-time or half time.", sponsor: "Microsoft Corporation", amount: " $ 5,000 ", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.microsoft.com/en-us/diversity/programs/microsoftdisabilityscholarship.aspx", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2019-01-17 23:23:48", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "hobbsm"},
    {id: 82, award_name: "Grays Harbor Community Foundation Scholarships", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-03-01", other_req: " Must be a resident of Grays Harbor County OR Must have graduated from a Grays Harbor County high school; Must enroll as a full-time student (12 credits minimum) at an accredited college, university, or trade/vocational school; Is more likely to be considered with a cumulative grade point average of 3.0 (or its equivalent B average) in both high school and college, if applicable. Beyond meeting these basic requirements, each applicant should exhibit outstanding character, a proven work ethic, and the promise of useful citizenship. ", sponsor: "Grays Harbor Community Foundation", amount: " varies ", state: "WA", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://gh-cf.org/scholarships/application/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2019-01-03 17:10:59", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 83, award_name: "Building Industry Association of Clark County Scholarship", subject_area: "Engineering", level: "HS Senior; Undergraduate", deadline: "2019-05-03", other_req: "Students living in Clark County who plan to pursue a career in the building industry by attending a college, university, trade/technical school, or will be enrolled in a verified apprenticeship affiliated with the construction industry, are all encouraged to apply.", sponsor: " BIA of Clark County", amount: " varies ", state: "WA", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://biaofclarkcounty.org/event/scholarship/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2019-04-16 22:58:56", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-04", updated_by: "hobbsm"},
    {id: 84, award_name: "The Amy Heryford Ousley and James Heryford Ousley Educational Fund", subject_area: "All fields", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-03-15", other_req: " Students must have attended a Klamath County high school all four years and along with their parents or guardians have been residents of Klamath County during those four years. Students must have a good scholastic record (3.0 grade point average or better) and have a need for financial assistance. Current college students who graduated from a Klamath County High School and meet the other requirements are also eligible to apply. Students must enroll as and continue to be full-time students to receive funding.", sponsor: "Ousley Education Fund", amount: " varies ", state: "OR", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.ousleyedfund.org/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2019-01-17 23:25:25", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "hobbsm"},
    {id: 85, award_name: "Asian Reporter Foundation Scholarship", subject_area: "Minority", level: "HS Senior; Undergraduate", deadline: "2018-04-04", other_req: " Must be of Asian descent; must be resident of OR  Clark County, WA; must be a graduating high school student or current undergraduate student working towards a degree at an institute of higher education in OR or WA as a full time student; must demonstrate financial need; involvement in community or school related activities", sponsor: "Asian Reporter Foundation", amount: "up to $2,500", state: "OR; WA", min_gpa: "3.25", contact: "financial.aid@example.edu", keywords: "", website: "http://www.arfoundation.net/awards.html", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2019-03-27 21:11:33", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "Not offered spring 2019; check back for spring 2020 deadline.", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "hobbsm"},
    {id: 87, award_name: "Salem Health West Valley Foundation Scholarship", subject_area: "Pre-med; Nursing; Biology", level: "HS Senior; Undergraduate", deadline: "2019-03-29", other_req: " The West Valley Hospital Foundation scholarship application for students in medically-related fields of study is now available. Applicants must have a permanent residence in Polk County or be a current employee or family member of a current employee at Salem West Valley Hospital, and must have applied to a college in their field of study before applying for this scholarship.", sponsor: "Salem Health Foundations", amount: " varies ", state: "OR", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.salemhealth.org/home/salem-health-foundations/hospital-scholarships-", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2019-04-18 17:56:24", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "hobbsm"},
    {id: 89, award_name: "Puget Sound Engineering & Science Scholarship Fund", subject_area: "STEM field; Engineering; Science; Technology; Mathematics", level: "HS Senior; Undergraduate", deadline: "2019-04-12", other_req: " Applicant must be a High School Senior that is graduating from a private or public high school or be homeschooled located within one of the State of Washington counties bordering the Puget Sound, which include Whatcom, Skagit, Snohomish, King, Kitsap, Pierce, Thurston, Mason, Jefferson, Clallam, Island, and San Juan.", sponsor: "Puget Sound Engineering & Science Scholarship Fund", amount: " $ 1,000 - $3,000", state: "WA", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://psessf.org/ScholarshipApplication.html", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2019-03-27 21:14:12", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 91, award_name: "Paul Mills Scholarship", subject_area: "Business; Finance; Accounting", level: "HS Senior; Undergraduate", deadline: "2019-03-30", other_req: " The Paul S. Mills Scholarship program offers scholarships to students pursuing an undergraduate education in a financial service related field.  This may include finance, accounting, insurance or risk management, actuarial sciences, and related fields of business. Applicants for Paul S. Mills Scholarships must: Be United States citizens or legal residents living in one of the 50 U.S. states, the District of Columbia or U.S. Territories; Be a full or part-time student enrolled or accepted into an undergraduate college or university program; Be pursuing a course of study in a financial service field; Demonstrate financial need by submitting the FAFSA (Free Application for Federal Student Aid) or similar documentation of financial need", sponsor: "Foundation for Financial Service Professionals", amount: " $ 1,000 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.financialpro.org/foundation/Awards/psm.htm", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2019-02-12 05:56:49", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 92, award_name: "Foster Care 2 Success Scholarship", subject_area: "All fields", level: "HS Senior", deadline: "2019-03-31", other_req: " Applicants must: have been in public or private foster care for the 12 consecutive months leading up to and including their 18th birthday; OR have been adopted or placed into legal guardianship from foster care after their 16th birthday; OR they must have been orphaned for at least one year at the time of their 18th birthday; have been accepted into or expect to be accepted into an accredited, Pell-eligible college or other post-secondary school; be under the age of 25 on March 31 of the year in which they apply if they have not previously received scholarship funding from FC2S; have been in foster care or orphaned while living in the United States. U.S. citizenship is not required.", sponsor: "Foster Care 2 Success ", amount: "varies", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.fc2success.org/our-programs/information-for-students/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:03", updated_at: "2019-01-02 22:58:57", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
