    {id: 130, award_name: "Verbal Ink Transcription Services Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2018-04-15", other_req: " To be considered for this scholarship, the student must have a cumulative GPA above 3.0, must either be graduating high school or completing his or her first year of college in the spring, and must be enrolled in an accredited two or four year institution of higher learning for the following fall quarter/semester. As Verbal Ink is a language services company, all interested students must submit a 500-1,000 word essay on the following topic: Share a story about how language has helped you express your voice.", sponsor: "Verbal Ink", amount: " $ 1,500 ", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.verbalink.com/transcription-services-scholarship ", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-02-12 06:17:49", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Not offered in 19-20", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 131, award_name: "Coral Jean Cotterell Achievement Scholarship", subject_area: "Engineering", level: "Undergraduate", deadline: "2019-03-11", other_req: " Applicant must be a female SWE Collegiate Member in good standing; Applicant must be active within an existing SWE Collegiate or Collegiate Interest Section; Applicant must hold a minimum GPA of 3.0; Applicant must be a full-time undergraduate student  at University of Portland, OIT-Wilsonville, Portland State University, Portland Community College, Clackamas Community College, Mt. Hood Community College, Clark College, Washington State University - Vancouver or George Fox University.", sponsor: "Soceity of Women Engineers Columbia River Section", amount: "$1,000 - $1,500", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://columbiariver.swe.org/scholarships.html", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-03-27 21:26:28", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "hobbsm"},
    {id: 132, award_name: "Oregon Native American Chamber Scholarship", subject_area: "All fields", level: "Undergraduate", deadline: "2018-06-30", other_req: "Must be currently enrolled and attending an accredited community college or accredited four year college/university.  Eligibility is limited to undergraduate students who are residents of the state of Oregon or Clark County, Washington; Eligible applicants must be in good academic standing at their respective institution.  Any “first term” students must include their cumulative High School GPA, graduation rank and evidence of college/university enrollment; Submit a photocopy of current driver’s license and proof of Native American identification (must include your tribal enrollment number). ONAC scholarships award offers a Native American preference; Submit a sealed official college transcript. ", sponsor: "Oregon Native American Chamber ", amount: " $ 1,000 ", state: "OR; WA", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.onacc.org", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-05-30 21:51:20", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-04", updated_by: "robertsm"},
    {id: 133, award_name: "Sister Adele Memorial Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-05-24", other_req: "To encourage and provide individuals of farmworker families that live in Oregon with the opportunity to further their academic or technical education. Successful candidates must enroll during 2019-20 academic year in an accredited community college, 4-year college/university or trade school; Applicants must be from a farmworker household; Applicants must have a high school diploma or its equivalent (GED) or be pursuing/enrolled in a qualified academic program; No specific GPA is required.", sponsor: "CASA of Oregon", amount: "$1,000 - $2,500", state: "OR", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.casaoforegon.org/content/sister-adele-scholarship-0", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-04-18 18:03:00", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 135, award_name: "Medically Oriented Scholarship", subject_area: "Nursing; Pre-med", level: "HS Senior; Undergraduate", deadline: "2019-04-07", other_req: " Applicants must have been accepted to an accredited college or medically oriented program in the fields of radiology, physician, medicine, nursing, pathology, pharmacy, anesthesiology, therapy, surgery or nutrition. There is no age limitation and they can currently be attending classes in these fields. Applicants and/or parents must be residing in the Santiam Hospital service area, such as Stayton, Lyons, Mill City, Detroit, Scio, Jefferson, Aumsville, Gates, Idanha, Marion, Turner, West Stayton and Sublimity.", sponsor: "Santiam Hospital Auxiliary ", amount: " $ 1,000 ", state: "OR", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.santiamhospital.org/about_auxiliary.php", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-01-02 23:07:19", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 136, award_name: "Bluesky's Future of American Samoa Scholarship", subject_area: "Accounting; Business; Computer Science; Engineering; Finance; Marketing; Communications", level: "HS Senior", deadline: "2018-04-23", other_req: " You must be a bona fide local high school senior in American Samoa; To apply for an off-Island scholarship, you must verify that you are a US Citizen or US National; You must demonstrate that you have completed a minimum of 50 community service hours; Eligible areas of study are: Engineering, Marketing, Business Management, Human Resources, Communications, Accounting or Finance. You must have a minimum high school cumulative grade point average of 3.5, You must have a minimum combined SAT (Scholastic Aptitude Test) score of 1500 out of 2400 and/or a minimum ACT (American College Test) score of 20, and a minimum TOEFL score of 600.. ", sponsor: "Bluesky", amount: "$3,500", state: "AS", min_gpa: "3.50", contact: "financial.aid@example.edu", keywords: "", website: "http://www.bluesky.as", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-05-05 20:22:14", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "Not offered 19-20", respect_deadline: true, date_reopens: "2020-03-15", updated_by: "hobbsm"},
    {id: 139, award_name: "PFLAG National Scholarship Program", subject_area: "All fields", level: "HS Senior", deadline: "2018-04-02", other_req: "You are a graduating senior entering higher education for the first time this calendar year (if you graduated last year and took time off you are still eligible to apply). Self identify as gay, lesbian, bisexual, transgender, queer...or anywhere within the LGBTQ \"family,\" or as an ally. Demonstrate an interest in service to the LGBTQ community. Have applied to an accredited U.S. higher education institution. Cannot be receiving full tuition remission from other sources to fund the education (e.g., other full-tuition scholarships, established college trust fund, etc.)", sponsor: "Parents, Families and Friends of Lesbians and Gays ", amount: " $ 1,000 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://www.pflag.org/scholarship", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-04-18 18:06:12", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "As of October 2018, the PFLAG National Scholarship program is on hiatus.\r\n\r\nThat said, PFLAGers everywhere are dedicated to a bright future for LGBTQ+ youth, which is why so many of our PFLAG chapters have scholarship programs. See the list of chapter scholarships. ", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
