    {id: 145, award_name: "The Edmund Maxwell Foundation", subject_area: "All fields", level: "HS Senior", deadline: "2019-04-30", other_req: " A student’s eligibility for a scholarship is based on the student’s intent to seek a four-year degree at the accredited private institution of his or her choice, which receives its fundamental support from sources other than taxes; Students who plan to attend accredited private colleges or universities (not state funded colleges or universities) and who are bona fide residents of Western Washington may apply for a scholarship; It is anticipated that scholarships will be limited to entering freshmen, with combined math and reading SAT scores of over 1200 (or equivalent ACT scores); Student must have submitted a Free Application for Student Aid form (FAFSA) to the institution that he or she is planning to attend.  ", sponsor: "Edmund Maxwell Foundation", amount: " $ 5,000 ", state: "WA", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.maxwell.org/ ", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-01-02 23:08:13", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
