    {id: 149, award_name: "ASM Undergraduate Scholarships", subject_area: "Engineering", level: "Undergraduate", deadline: "2019-05-01", other_req: " To be eligible for all awards you must meet ALL of the following general eligibility requirements: Must be a Material Advantage student member; Must have an intended or declared major in metallurgy or materials science engineering; Applicants majoring in related science or engineering disciplines will be considered if they demonstrate a strong academic emphasis and interest in materials science; Must have completed at least 1 year of college to apply for all awards; University must have an accredited science and engineering program leading to a bachelor degree.", sponsor: "ASM Materials Education Foundation", amount: " varies ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.asminternational.org/foundation/students/undergraduate", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-01-02 23:08:53", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
