    {id: 153, award_name: "Bend Surgery Center Foundation Graduate Scholarships", subject_area: "Health Care", level: "Graduate", deadline: "2019-03-01", other_req: " To be eligible to apply you must have graduated from a public or private high school located in Central Oregon (Crook, Deschutes, Jefferson or north Klamath Counties) and enrolled in an institution for graduate study in a health care profession.", sponsor: "Bend Surgery Center Foundation", amount: " $ 5,000 ", state: "OR", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.bendsurgerycenterfoundation.org/Scholarships.html", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-10-18 19:50:15", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
