    {id: 158, award_name: "Nurse Corps Scholarship Program", subject_area: "Nursing", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-05-21", other_req: "Nursing Scholarship recipients MUST be willing and are required to fulfill their NSP service commitment at a health care facility with a critical shortage of nurses. Eligibility: US Citizens (born or naturalized), nationals or lawful permanent residents; Enrolled or accepted for enrollment in a professional nursing degree program (baccalaureate, graduate, associate degree, or diploma) at accredited school of nursing located in a US state or territory; Must be free from any Federal judgment liens; free from existing service commitments; not be delinquent on a Federal debt.  Funding preference depending on your financial need.", sponsor: "HRSA", amount: "full tuition/fees", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://bhw.hrsa.gov/loansscholarships/nursecorps/scholarship", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-04-09 18:17:41", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "hobbsm"},
