    {id: 167, award_name: "Pioneer District Garden Clubs Scholarship", subject_area: "Sciences", level: "HS Senior; Undergraduate", deadline: "2019-03-15", other_req: "Applicant must be a legal resident of Columbia, Washington or Yamhill Counties in the state of Oregon; Applicant must attend an accredited community college or four year college/university in the state of Oregon; Applicant must major in Horticulture, Floriculture, Landscape Design, Conservation,  Forestry, Botany, Agronomy, Plant Pathology, Environmental Control, City Planning, Land Management, Alternative Energy, or related subjects (Environmental Science, Environmental Engineering, or Environmental Policy and Ethics); Applicants must have at least a 3.0 GPA (on a 4.0 point scale) in order to apply. ", sponsor: "Pioneer District Garden Club", amount: " $ 1,500", state: "OR", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://oregongardenclubspioneer.97048.info/ItemsofInterest.aspx", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-02-12 22:29:17", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 168, award_name: "Oregon Scottish Rite Education Foundation Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-05-01", other_req: "Applicants for Scottish Rite Scholarship assistance must be bona fide residents of the State of Oregon entering as undergraduates at an accredited college, university of trade school. Grants are awarded on the evidence submitted that the applicant will succeed in higher education and excel in his or her subsequent career. Application forms are available from the Scottish Rite Education Foundation, Inc. at 709 SW 15th Ave., Portland OR 97205 or in the financial aid office.", sponsor: "Oregon Scottish Rite Education Foundation ", amount: "Varies", state: "OR", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://portlandscottishrite.org/education", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-02-12 22:30:35", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 171, award_name: "Kidney and Urology Foundation of America Scholarships", subject_area: "All fields", level: "HS Senior; Undergraduate; ", deadline: "2019-05-24", other_req: "The Kidney & Urology Foundation of America is proud to offer a scholarship and awards program for kidney and urology patients, family members and medical caregivers.", sponsor: "Kidney & Urology Foundation of America (KUFA)", amount: "Varies", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.kidneyurology.org/Patient_Resources/scholarships.php", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-04-16 22:31:53", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-16", updated_by: "hobbsm"},
    {id: 172, award_name: "Geraldine Stephenson Continuing Education Scholarship", subject_area: "Pre-Med; Nursing", level: "Undergraduate", deadline: "2019-05-31", other_req: "Majoring in a medical related field; Demonstrate financial need; Had their education originally interrupted due to either financial need or current/past family responsibilities, been out of school at least 5 years due to hardship; Applicant must be accepted in a medically related field of study in the state of Oregon, not just anticipating acceptance. Applicants must be United States citizens and meet Oregon residency requirements.", sponsor: "Legacy Meridian Park Medical Center Auxiliary", amount: " $ 6,500", state: "OR", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.legacyhealth.org/our-legacy/legacy-values/in-the-community/scholarships.aspx", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-02-12 22:33:35", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 176, award_name: "ESA Foundation Scholarship Program", subject_area: "Computer Science", level: "HS Senior; Undergraduate", deadline: "2018-04-26", other_req: "Applicants must be: Women or minority students, Pursuing degrees leading to careers in computer and video game arts (high school seniors must already be accepted into a program), Enrolling or enrolled in a full-time undergraduate course of study at an accredited four-year college or university in the United States, Maintaining a grade point average of 2.75 or above on a 4.0 scale (or its equivalent), and US citizens.", sponsor: "Entertainment Software Association (ESA) Foundation", amount: " $3,000 ", state: "All", min_gpa: "2.75", contact: "financial.aid@example.edu", keywords: "", website: "http://www.esafoundation.org/scholarship.asp", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-04-18 18:27:05", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "No available 1920. Check back another AY before deleting.", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
