    {id: 185, award_name: "Merchants Exchange of Portland Scholarship", subject_area: "Business", level: "Undergraduate", deadline: "2019-05-31", other_req: "  The applicant’s chosen field of study must be in Maritime Affairs and/or International Trade, and may be part of a 4-year or 2-year institutional degree program; The applicant must demonstrate academic achievement and have exemplary qualities in personal character. Financial need may be considered if other factors are equal; For 4-year Degree Students: The applicant must have completed the minimum credit hours equivalent to two academic years and be of Junior or Senior status, or a Graduate student at an accredited institution of higher learning; The applicant must maintain a minimum 2.5 GPA.  ", sponsor: "Merchants Exchange of Portland", amount: " varies ", state: "All", min_gpa: "2.50", contact: "financial.aid@example.edu", keywords: "", website: "http://www.pdxmex.com/scholarship", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-01-02 23:10:15", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 186, award_name: "American Foundation for the Blind Scholarship", subject_area: "All fields", level: "Undergraduate; Graduate", deadline: "2019-04-01", other_req: " Provide proof of legal blindness; most of AFB's scholarships are designated for specific fields of study, you will only be considered for the scholarships that you select on the application.", sponsor: "American Foundation for the Blind", amount: "Varies", state: "All", min_gpa: "None", contact: "financial.aid@example.edu", keywords: "", website: "https://www.afb.org/info/afb-2015-scholarship-application/5", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-12-14 17:18:30", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "walshm"},
    {id: 188, award_name: "Dorothy and Robert DeBolt Foster Youth Scholarship", subject_area: "Foster Youth", level: "HS Senior; Undergraduate", deadline: "2018-05-31", other_req: " Must be a youth adopted out of the California foster care system; must be accepted for admissions or be enrolled in an accredited program in the US; maximum age at time of application 25.  The selection of recipients will be based on several criteria, including: community service, participation in extracurricular activities, promise of success in the institution selected by the applicant, financial need and academic achievement.", sponsor: "Lilliput Families", amount: "Varies", state: "CA", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://www.lilliput.org/debolt-scholarship", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-05-30 21:48:18", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Doesn't appear active for 2019", respect_deadline: true, date_reopens: "2020-04-15", updated_by: "robertsm"},
    {id: 195, award_name: "Goodwin & Scieszka Innovation Scholarship", subject_area: "Pre-Law", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-06-01", other_req: " Applicant must be either a current law student at an accredited law school within the U.S. or at an accredited undergraduate university planning to attend law school; Applicants must have a minimum 2.8 GPA; Applicants must submit a copy of their transcript.", sponsor: "Law Offices of Goodwin & Scieszka", amount: "$ 500", state: "All", min_gpa: "2.80", contact: "financial.aid@example.edu", keywords: "", website: "http://www.1888goodwin.com/innovation-scholarship/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-04-18 18:30:18", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 196, award_name: "ONF Smith Scholarship ", subject_area: "Nursing", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-05-12", other_req: " Active enrollment in an accredited baccalaureate or graduate nursing program in the State of Oregon. The program must be accredited by a national nursing accreditation organization recognized by the United States Department of Education; a cumulative Grade Point Average (GPA) in nursing of 3.25 or greater for undergraduate applicants and 3.5 or greater for graduate applicants. The critical elements that the application review committee will evaluate are commitment to nursing practice in Oregon; leadership abilities and experiences; experiences with other cultures, minority groups, and underserved populations; and explanation of need for scholarship funds.", sponsor: "Oregon Nurses Foundation", amount: " $ 1,000 ", state: "OR", min_gpa: "3.25", contact: "financial.aid@example.edu", keywords: "", website: "http://www.oregonnursesfoundation.org/scholarships/smith-scholarship/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-04-18 20:01:06", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 198, award_name: "National Pathfinder Scholarship", subject_area: "All fields", level: "Undergraduate; Graduate", deadline: "2019-06-01", other_req: " College sophomores, juniors, and seniors, and students enrolled in a Master’s Program are eligible. Applicants must be U.S. citizens. Recent high school graduates and first year college women are not eligible to apply for the scholarship.", sponsor: "The National Federation of Republican Women", amount: " $ 2,500 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.nfrw.org/pathfinder", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-10-23 16:45:31", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 199, award_name: "Out to Innovate Scholarship (LGBTQ+)", subject_area: "STEM field", level: "Undergraduate; Graduate", deadline: "2019-06-01", other_req: " These scholarships are intended for undergraduate and graduate students pursuing degrees in science, technology, engineering,or mathematics (STEM) programs who are either lesbian, gay, bisexual, transgender, queer or an active ally of the LGBTQ+ community. Successful completion of a minimum of two years of post-high school education at an accredited college or university; Maintenance of a minimum grade point average (GPA) of 3.0 for the entirety of college/university enrollment; A declared major in an accredited STEM or STEM-related teaching field; Be an active supporter of and participant in programs or organizations that promote LGBTQ inclusion and visibility; Students must be eligible for fall term registration and must not be under disciplinary sanction.", sponsor: "National Organization of Gay and Lesbian Scientists and Technical Professionals Inc.", amount: " $ 5,000 ", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.noglstp.org/programs-projects/scholarships/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-05-05 21:26:18", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "hobbsm"},
