    {id: 201, award_name: "Global Lift Equipment Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-06-15", other_req: " Be currently attending or planning on attending a post-secondary institution in the fall; Student must have 2.5 GPA or above; Must be US or Canadian Resident; Submit a short story based on topic on website", sponsor: "Global Lift Equipment", amount: " $ 500 ", state: "All", min_gpa: "2.50", contact: "financial.aid@example.edu", keywords: "", website: "http://www.usedforkliftsoregon.com/used_inventory/2885/used_skytrak_telehandler_inventory_oregon.php", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-01-02 23:10:41", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 203, award_name: "FOARE Scholarships", subject_area: "All fields", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-06-12", other_req: " High school senior or continuing undergraduate/graduate students.  Application is open to all majors however students who have a connection to or are planning to work in the outdoor advertising industry may be given preference in the evaluation process.  All scholarships are awarded on the basis of academic excellence, career goals, and community/extracurricular activities.", sponsor: "Foundation for Outdoor Advertising Research and Education", amount: "Varies", state: "All ", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.oaaa.org/FOARE/FOAREScholarshipProgram.aspx", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-05-05 20:23:09", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-15", updated_by: "hobbsm"},
    {id: 209, award_name: "PES Scholarships", subject_area: "Electrial Engineering", level: "Undergraduate", deadline: "2019-06-30", other_req: " All PES Scholarship recipients are: Declared undergraduate students of electrical and computer engineering; Enrolled at accredited universities in the U.S., Puerto Rico, or Canada; High achievers with strong GPA and distinctive extracurricular commitments; Committed to exploring the power and energy field; Committed to enrolling in at least three power engineering courses; Eager to explore the field through career experiences; U.S. or Canadian citizens and permanent residents", sponsor: "IEEE Power & Energy Society", amount: "$2,000", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "https://ieee.communityforce.com/Funds/Search.aspx#4371597136646D517975544F5976596D4E73384E69673D3D", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-04-18 20:02:42", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
