    {id: 211, award_name: "Lift Parts Express Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-06-30", other_req: "Student must be between ages 16 -21; Students must be attending school in fall 2019; Students must write an essay on this year's topic; Student must have 3.0 GPA or above; Male and Female students are eligible; Must be US or Canadian Resident", sponsor: "Lift PartsExpress", amount: " $ 500 ", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.forkliftpartsoregon.com/forkliftparts.php", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-02-12 22:38:06", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 212, award_name: "Automotive Hall of Fame Scholarships", subject_area: "Engineering", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-06-30", other_req: "Submit a completed application form indicating a sincere interest in an automotive career;  Be accepted at an accredited college, university or trade school within the United States at the time of application; Student must be a United States citizen or in the United States on a Student Visa; Must be enrolled full-time; Must have 3.0 GPA or higher.", sponsor: "Automotive Hall of Fame ", amount: " varies ", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.automotivehalloffame.org/scholarships/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-02-12 22:39:09", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 213, award_name: "Lori Rhett Memorial Scholarship  ", subject_area: "All fields", level: "Undergraduate; Graduate", deadline: "2018-09-30", other_req: " Be matriculated undergraduate or graduate students with a cumulative GPA of 2.5 or better; Demonstrate significant leadership skills and abilities; Hold a significant leadership position on campus; Have made significant contributions via volunteer involvement, either on or off campus; Be enrolled in a college or university within the NACA West region; You must be a U.S. Citizen; High school students are not eligible.  Only the first 75 qualified applications will be considered.", sponsor: "NACA", amount: " varies ", state: "All", min_gpa: "2.50", contact: "financial.aid@example.edu", keywords: "", website: "https://thenaca.wufoo.com/forms/p11sqlyq0z68uoi/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-02-12 22:40:17", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "Checked main naca website as scholarship application hasn't been updated since last year and is still listed an active.  Feb. 2019 https://www.naca.org/FOUNDATION/Pages/Scholarships.aspx", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 215, award_name: "Psi Chi Scholarships", subject_area: "Psychology", level: "Undergraduate; Graduate", deadline: "2019-07-05", other_req: "Be an active Psi Chi member enrolled in an undergraduate psychology-related degree program with financial need.", sponsor: "Psi Chi: International Honor Society in Psychology", amount: "$3,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: "", website: "https://www.psichi.org/?PsiChischolars#.WxBwje4vzRY", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-05-29 20:59:24", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-06-01", updated_by: "hobbsm"},
    {id: 216, award_name: "Tylenol Scholarship Fund ", subject_area: "Pre-Med; Nursing; Biology", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-06-27", other_req: " The sponsor awards scholarships to residents of the fifty states, Puerto Rico and Washington D.C. If the applicant is an undergraduate student, you must have completed at least 1 year of undergraduate course study.  If the applicant is a graduate student, they must provide proof of enrollment to a graduate program in health education, medical school, public health, nursing and/or pharmacy.  Must have one or more years of school remaining.", sponsor: "Tylenol", amount: " $5000 - $10000 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.tylenol.com/page.jhtml?id=tylenol/news/subptyschol.inc  ", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-05-30 21:20:21", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 218, award_name: "Galactic Unite Bytheway Scholarship", subject_area: "STEM field", level: "HS Senior", deadline: "2018-06-01", other_req: " The Galactic Unite Bytheway Scholarship program will provide $7,500 scholarship to first-year female college student pursuing STEM degrees at any accredited four-year college or university in the United States. The award is renewable for four years. Candidates must be U.S. citizen", sponsor: "Virgin Galactic and Virgin Unite", amount: " $ 7,500 ", state: "All", min_gpa: "3.2", contact: "financial.aid@example.edu", keywords: "", website: "https://scholarships.uncf.org/Program/Details/65ddbf36-dc48-42ac-bb03-72f9963832c4", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-05-23 17:07:49", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "Check if avail 20210", respect_deadline: true, date_reopens: "2020-04-16", updated_by: "hobbsm"},
    {id: 219, award_name: "The Korean American Western Regional Chapter Scholarships", subject_area: "Minority", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-06-30", other_req: " Korean American student who will be a full time student at a school in one of the designated Western region states (Alaska, Arizona, California, Colorado, Hawaii, Idaho, Montana, Nevada, New Mexico, Oregon, Utah, Washington, and Wyoming ); Have a cumulative GPA of 3.0 or higher; Can demonstrate need for financial assistance", sponsor: "The Korean American Scholarship Foundation", amount: " varies ", state: "AK; AZ; CA; CO; HI; ID; MO; NV; NM; OR; UT; WA;WY", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.kasf.org/apply-wrc/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-05-05 21:27:52", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "hobbsm"},
    {id: 220, award_name: "Novus Biologicals Scholarship Program", subject_area: "Sciences", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-07-31", other_req: " Applicants must have a major declared in a medical science related field; Open worldwide; Enrolled or accepted for enrollment (baccalaureate, graduate, associate degree, or diploma) with a declared major in a science related field.  ", sponsor: "Novus Biologicals", amount: " $1,500 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://www.novusbio.com/scholarship-program.html", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-08-01 18:14:12", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Offered twice anually", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "robertsm"},
    {id: 221, award_name: "Daughters of Norway Scholarships", subject_area: "All fields", level: "Undergraduate", deadline: "2019-07-15", other_req: " A scholarship may only be granted to a student registered in a full-time program at an accredited institution of higher education, i.e. college, university, technical school or vocational school. The student shall have completed at least one (1) full year or have at least sophomore standing and have a grade point average of 2.7 or better. The recipient shall be a member of the Daughters of Norway or be related to a member. ", sponsor: "The Grand Lodge Daughters of Norway", amount: " $ 1,000 ", state: "WA", min_gpa: "2.70", contact: "financial.aid@example.edu", keywords: "", website: "http://www.daughtersofnorway.org/about/scholarships/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-02-12 22:41:37", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 230, award_name: "Jim & Anna Hyonjoo Lint Scholarship", subject_area: "All fields ", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-07-31", other_req: "In addition to a completed application, the student must submit the following: a 600- to 800-word essay explaining one of the goals or concepts of the Lint Center, especially as it relates to counterintelligence, national security, alliance building, and/or national defense;  a one-page personal essay that discusses what makes him/her the right recipient for this scholarship and helps the scholarship committee better understand him/her. ", sponsor: "Lint Center for National Security Studies", amount: " $ 1,500 ", state: "All ", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.lintcenter.org/scholarships/#jimanna", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-03-27 20:50:14", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 231, award_name: "Twin Star Credit Union Scholarships", subject_area: "All fields", level: "HS Senior; Undergraduate ", deadline: "2019-07-31", other_req: " Applicant must be a member of the Credit Union, in good standing; Application must be accompanied by a copy of school enrollment or acceptance letter and transcript.  ", sponsor: "Twin Star Credit Union", amount: " $ 2,000 ", state: "OR; WA", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://www.twinstarcu.com/scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-05-29 21:26:05", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-06-01", updated_by: "robertsm"},
    {id: 236, award_name: "NBCUniversal/ LNESC National Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2018-10-22", other_req: "Applicants must meet the following criteria to be considered:\r\nMust be a rising sophomore or junior enrolled full-time in an accredited college or university.\r\nMust be at least 18 years of age or older.\r\nMust have a cumulative grade point average of at least 3.0 on a 4.0 scale or the equivalent.\r\nMust be a U. S. Citizen or Legal Permanent Resident.\r\nMust have an interest in the media and entertainment industry; all majors are welcome. ", sponsor: "NBC & LNESC", amount: " $ 5,000 ", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.lnesc.org/?SEC=%7b3AEDB506-F425-4E58-B9F6-44867E2FD943%7d&Type=B_BASIC#!nbcuniversal-scholarship/cun4", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-09-21 16:00:51", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "walshm"},
    {id: 237, award_name: "George Watt Memorial Scholarship Essay Contest", subject_area: "All fields", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-07-01", other_req: " Graduate and undergraduate students from the United States and elsewhere are invited to submit an essay or thesis chapter about any aspect of the Spanish Civil War, the global political or cultural struggles against fascism in 1920s and 1930s, or the lifetime histories and contributions of the Americans who fought in support of the Spanish Republic from 1936 to 1938.  Submissions may be in Spanish or English.", sponsor: "Abraham Lincoln Brigade Archives", amount: " $250 - $1000", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.alba-valb.org/programs/essay-contest", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-02-12 22:42:59", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 239, award_name: "Nurses Make a Difference Scholarship", subject_area: "Nursing", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-08-01", other_req: " This scholarship is available for current students in an undergraduate nursing degree program at an accredited college or university or high school students who have been accepted into a college and plan to study nursing. All applicants must have a cumulative grade point average (GPA) of at least 3.0 and be a legal resident of the USA or hold a valid student visa. The winning applicant must provide verification of enrollment at an undergraduate school with a nursing program or acceptance into a school with an undergraduate nursing program. ", sponsor: "Cascade Healthcare Solutions", amount: " $ 1,000 ", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.cascadehealthcaresolutions.com/Chs_Scholarship_a/364.htm", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-02-12 22:43:46", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 241, award_name: "Patsy Takemoto Mink Scholarship", subject_area: "All fields", level: "Undergraduate; Graduate", deadline: "2019-08-01", other_req: "Must be a woman, at least 17 years of age; must be a mother, with minor children; must be pursuing a vocational degree/certificate; or an associate's degree; or a first bachelor's degree; or a professional/master's/doctoral degree; must be enrolled in a not-for-profit, accredited institution or program; must be low-income (annual family income less than $20,000 for a family of 2; less than $24,000 for a family of 3; less than $28,000 for a family of 4). Awardees will be selected based on 1) financial need; 2) personal circumstance; 3) educational path; 4) vocational or occupational goals; and 5) service or activist or civic goals.", sponsor: "Patsy Takemoto Mink Education Foundation", amount: " $ 5,000 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://www.patsyminkfoundation.org/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-05-30 21:18:42", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 244, award_name: "Fulfilling Our Dreams Scholarship Fund", subject_area: "Nursing; Doctor of Nursing Practice; Premed; Minority", level: "HS Senior; Undergraduate", deadline: "2018-06-15", other_req: " Only students from the Los Angeles Area may apply; be of Central American or other Latino ethnicity; Demonstrate proven financial need; Possess a minimum 2.5 GPA; Demonstrate a history of community involvement; Bachelors of Science in Nursing (BSN) to become a Registered Nurse (RN)", sponsor: "Salvadoran American Leadership & Education Fund", amount: " $ 1,000 ", state: "CA", min_gpa: "2.50", contact: "financial.aid@example.edu", keywords: "", website: "https://www.salef.org/scholarship", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-05-30 18:28:00", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "robertsm"},
    {id: 246, award_name: "AKAEAF Graduate Scholarships", subject_area: "All fields", level: "Graduate", deadline: "2019-08-15", other_req: " Be currently enrolled in an accredited degree-granting institution; have minimum GPA of 3.0; demonstrate community service and involvement.", sponsor: "Alpha Kappa Alpha Educational Advancement Foundation", amount: " varies ", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: "", website: "https://akaeaf.org/scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-04-18 20:06:05", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 251, award_name: "Beat the Odds", subject_area: "All fields", level: "HS Senior", deadline: "2019-09-16", other_req: " Enrolled in OR public high school and will graduate in spring/summer 2019; Have maintained at least a 3.0 GPA showing marked effort, improvement or success; Have succeeded in spite of hardships such as poverty, disability, homelessness, or personal tragedy; Has participated in activities that are helpful to others; Has a financial need. ", sponsor: "Stand for Children Leadership Center", amount: "$4,000 (renewable)", state: "OR", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://stand.org/oregon/beat-the-odds", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-05-29 21:29:52", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-06-01", updated_by: "robertsm"},
    {id: 253, award_name: "Barbara Rhomberg Excellence in Nursing Scholarship", subject_area: "Nursing", level: "Undergraduate", deadline: "2019-03-31", other_req: " Be enrolled full time in an undergraduate nursing program; be a non-traditional student (defined as a student that did not continue their education right after high school, at least a 3 year gap between high school and enrollment in college)", sponsor: "B4 Brands", amount: " $ 1,000 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://www.b4brands.com/br-nursing-scholarship/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-04-18 20:07:10", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 255, award_name: "Student of Integrity Scholarship", subject_area: "All fields", level: "HS Senior", deadline: "2019-10-10", other_req: " The Student of Integrity Award scholarships are not based on ethnicity or grade point average. These awards recognize students that personify values, leadership and integrity. Must reside in Minnesota or North Dakota.", sponsor: "Better Business Bureau Foundation", amount: " $ 2,500 ", state: "MN; ND", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://www.bbb.org/minnesota/torch-awards-for-ethics/student-of-integrity-scholarship/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-05-29 21:32:17", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-06-01", updated_by: "robertsm"},
    {id: 262, award_name: "AES Engineering Solutions Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-10-06", other_req: " Our belief is that achieving a high grade point average should not be the only criteria for determining who deserves to be helped. For that reason we are offering a scholarship that will be awarded on the basis of character, as determined by evaluated the essays that are submitted. Scholarships are intended for our future leaders across a wide spectrum of fields of study. This award is available to high school seniors and all students attending a post secondary educational facility.", sponsor: "AES Engineering Solutions", amount: " $ 500 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.aesengineers.com/scholarships.htm ", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-11-30 18:06:28", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 263, award_name: "Benjamin Gilman International Scholarship", subject_area: "Study Abroad; International Experience", level: "Undergraduate", deadline: "2019-03-05", other_req: "Undergraduate; Must be US Citizen; Must be a Pell Grant recipient; Must be studying abroad for at least 4 weeks in one country. \r\nThis application round is open to summer, fall and academic year study abroad applicants.", sponsor: "U.S. Department of State", amount: " varies", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://www.gilmanscholarship.org/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-01-24 18:14:48", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "two application cycles: Spring & early summer due October; Summer/Fall/AY due March. ", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 264, award_name: "Bridging Scholarship: Study Abroad in Japan", subject_area: "Study Abroad; International Experience", level: "Undergraduate", deadline: "2019-04-10", other_req: " The Bridging Project offers scholarships to American undergraduate students participating in study-abroad programs that are at least one semester long in Japan. Students studying in Japan on summer programs are not eligible to apply.", sponsor: "American Association of Teachers of Japanese", amount: " $ 2,500 - $4,000", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.aatj.org/studyabroad/japan-bridging-scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-02-12 22:45:04", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 267, award_name: "State Association Scholarship Daughters of the Pioneers of WA", subject_area: "All fields", level: "Undergraduate; Graduate", deadline: "2019-04-01", other_req: " A descendant of a person establishing residence in the original Oregon Territory; prior to November 11, 1889; A resident of Washington, Oregon, Idaho or Montana; A full-time student in an accredited college or university in Washington, Oregon, Idaho or Montana; An undergraduate or post-graduate student during the year of the scholarship. ", sponsor: "Daughters of the Pioneers of Washington", amount: " $ 1,000 ", state: "ID; MT; OR; WA", min_gpa: "None", contact: "financial.aid@example.edu", keywords: "", website: "https://wapioneerdaughters.org/scholorships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-01-24 18:15:22", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Listed as \"Seattle Chapter #1 Memorial Scholarship\" on website link.", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 268, award_name: "LULF Scholarships", subject_area: "All fields; Minority", level: "Undergraduate; Graduate", deadline: "2018-10-22", other_req: " Minimum cumulative GPA of 2.80 out of a 4.0 GPA scale; Currently enrolled in an eligible bachelor’s or master’s degree program at an accredited four-year college or university; Completed at least one full-time year of study for undergraduate applicants, and at least one full-time semester of study for graduate applicants; Must reside in the United States.  Applicants should have had an impact on improving or supporting the Latino/Hispanic community.", sponsor: "La Unidad Latina Foundation", amount: "$500 - $1,000", state: "All", min_gpa: "2.80", contact: "financial.aid@example.edu", keywords: "", website: "https://www.lulf.org/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-09-07 17:31:03", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "not sure if this is really the deadline, couldn't find it on website", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 269, award_name: "Women in Transportation Leadership Scholarship ", subject_area: "Engineering; Business; Technology", level: "HS Senior; Undergraduate; Graduate", deadline: "2018-10-22", other_req: " Open to all women; GPA of 3.0 or higher; Currently enrolled in or accepted to an undergraduate or graduate degree program in a transportation-related field such as transportation engineering, planning, finance, communications, or logistics in Oregon or SW Washington; Plans to pursue a career in a transportation-related field. ", sponsor: "WTS Portland Chapter", amount: " $2,000 - $7,000", state: "All ", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.wtsinternational.org/portland/scholarships/applications/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-09-19 18:20:27", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "generally they email us updated application each year too", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "walshm"},
    {id: 270, award_name: "Atlas Shrugged Essay Contest", subject_area: "All fields", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-09-19", other_req: "Contest is open to students worldwide, except where void or prohibited by law. Essays must be written in English only. Entrant must be a 12th-grader, college undergraduate or graduate student. Verification of school enrollment will be required for all winning entrants.", sponsor: "Ayn Rand Education foundation", amount: " $100 - $25,000 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://www.aynrand.org/students/essay-contests#atlasshrugged-1", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-02-12 22:46:48", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 271, award_name: "Students of Integrity Scholarship", subject_area: "All fields", level: "HS Senior", deadline: "2019-03-11", other_req: "$1000 Essay Scholarships = Write a 500-word essay discussing Why BBB and Trust are important to local businesses and communities. \r\n-OR-\r\n$5000 Video Scholarship = Produce a 90-second video discussing \"Why BBB and Trust are important to local businesses and communities.\"", sponsor: "Better Business Bureau Foundation", amount: "$1000-$5000", state: "AK; HI; ID; MT; OR; WA; WY", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: "", website: "https://bbb-scholarship.org/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-02-12 05:44:20", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-15", updated_by: "hobbsm"},
    {id: 272, award_name: "Horatio Alger Association State Scholarships", subject_area: "All fields ", level: "HS Senior ", deadline: "2019-10-25", other_req: " Be enrolled full time as a high school senior in the United States, progressing normally toward graduation, and planning to enter college no later than the fall following graduation; have a strong commitment to pursue and complete a bachelor's degree at an accredited institution located in the United States (students may start their studies at a two-year institution and then transfer to a four-year institution); critical financial need ($55,000 or less adjusted gross income per family is preferred; if higher, an explanation must be provided); involvement in co-curricular and community activities; demonstrate academic achievement (minimum grade point average of 2.0); be a resident of Oregon; and be a citizen of the United States", sponsor: "Horatio Alger Association", amount: " varies ", state: "All", min_gpa: "2.00", contact: "financial.aid@example.edu", keywords: "", website: "https://scholars.horatioalger.org/about-our-scholarship-programs/national-scholarships/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-07-31 23:13:52", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 274, award_name: "National Science Foundation Graduate Research Fellowship", subject_area: "Biology; Chemistry; Communication; Computer Science; Economics; Engineering; Environmental Science; Mathematics; Physics; Political Science; Psychology; Science; Sociology; STEM Education", level: "Graduate", deadline: "2017-11-03", other_req: "Applicants must intend to pursue a research-based Master's or Ph.D. program in an NSF-supported field, be enrolled in an eligible program at an accredited United States graduate institution, and have completed no more than twelve months of full-time graduate study", sponsor: "National Science Foundation", amount: " varies ", state: "Alll", min_gpa: "None ", contact: "scholars@up.edu", keywords: "", website: "http://www.nsfgrfp.org/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-04-17 18:24:46", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "2018/2019 deadline remains unavailable.", respect_deadline: true, date_reopens: "2018-08-01", updated_by: "honstu1"},
    {id: 275, award_name: "Be The Whale", subject_area: "All fields", level: "", deadline: "2019-04-15", other_req: " $1,000.00 Scholarship for High School Art Student. Current contest is for NM residents. \r\n", sponsor: "Be The Whale", amount: "$1,000", state: "CO", min_gpa: "None", contact: "financial.aid@example.edu", keywords: "", website: "http://www.bethewhale.com/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-04-18 21:04:08", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 276, award_name: "Coca-Cola Scholarship", subject_area: "All fields", level: "HS Senior", deadline: "2019-10-31", other_req: " Applicants must be: Current high school (or home-schooled) seniors attending school in the United States; U.S. Citizens; U.S. Nationals; U.S. Permanent Residents; Refugees; Asylees; Cuban-Haitian Entrants; or Humanitarian Parolees; Anticipating completion of high school diploma at the time of application; Planning to pursue a degree at an accredited U.S. post-secondary institution; Carrying a minimum 3.00 GPA at the end of their junior year of high school.", sponsor: "Coca-Cola Scholars Foundation", amount: " $ 20,000 ", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.coca-colascholarsfoundation.org/applicants/#programs", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-07-31 23:17:11", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 277, award_name: "Lucia Queen of Light Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2018-11-01", other_req: " Be a female, 16-20 years old and unmarried; Be US citizen or permanent residents; Have Danish; Finnish; Icelandic; Norwegian or Swedish heritage.  Must be from Portland and the surrounding areas.", sponsor: "Scandinavian Heritage Foundation", amount: " $ 2,500 ", state: "OR", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.scanheritage.org/#!lucia-scholarship/dy6d5", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-10-18 19:51:53", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 279, award_name: "Jack Kent Cooke Foundation College Scholarship", subject_area: "All fields ", level: "HS Senior", deadline: "2018-11-20", other_req: "Plan to graduate from a US high school in spring 2019.\r\nIntend to enroll in an accredited four-year college beginning in fall 2019.\r\nEarn a cumulative unweighted GPA of 3.5 or above.\r\nSAT combined critical reading and math score of 1200 (based on the old SAT scores) or above and/or ACT composite score of 26 or above.\r\nDemonstrate significant unmet financial need. We will consider applicants with family income up to $95,000. However, we anticipate that a majority of scholarship recipients will be eligible to receive a Pell grant.", sponsor: "Jack Kent Cooke Foundation", amount: "up to $40,000", state: "All ", min_gpa: "3.50", contact: "financial.aid@example.edu", keywords: "", website: "http://www.jkcf.org/scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-08-30 21:55:32", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-06", updated_by: "walshm"},
    {id: 280, award_name: "Prudential Spirit of Community Awards", subject_area: "All fields", level: "HS Senior", deadline: "2018-11-06", other_req: "Applications are judged based on initiative, effort, impact and personal growth.  Must have conducted a volunteer service activity within the past year.", sponsor: "Prudential", amount: " $ 1,000 ", state: "All", min_gpa: "None", contact: "financial.aid@example.edu", keywords: "", website: "http://spirit.prudential.com/view/page/soc/14782?lp=14779", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-08-29 22:25:38", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 281, award_name: "NCWIT Aspirations in Computing Scholarship", subject_area: "Computer Science; Female", level: "HS Senior", deadline: "2018-11-05", other_req: " US high school woman, age 13 or older (including US territories) who has a US tax identification or social security number.  Aspirations Award recipients are chosen for their outstanding aptitude and interest in computing, proven leadership ability, academic performance and plans for post-secondary education.", sponsor: "NCWIT", amount: " varies ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://www.aspirations.org/participate/high-school", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-08-29 22:27:37", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 284, award_name: "Rachel Royston Permanent Scholarship Foundation", subject_area: "Education", level: "Graduate", deadline: "2019-12-01", other_req: "Recipients must be women educators in Washington. Recipients must be pursuing a study beyond a B.A. at an accredited college. Recipients DO NOT need to be Delta Kappa Gamma members.", sponsor: "Delta Kappa Gamma Washington State Organization", amount: " varies ", state: "WA", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.dkgwa.org/royston-scholarship.html", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-08-01 18:13:11", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 286, award_name: "Daniels Fund Scholarship Program", subject_area: "All fields", level: "HS Senior", deadline: "2018-11-29", other_req: "Demonstrate financial need. Be a citizen or permanent resident of the United States. Be a resident of Colorado, New Mexico, Utah, or Wyoming. Be a high school senior graduating from a school in Colorado, New Mexico, Utah, or Wyoming. Earn a minimum SAT Math score of 470 and a minimum Evidence-Based Reading & Writing score of 450 or a minimum ACT score of 17 in each category (writing score not required). \r\n\r\n Daniels Scholars are selected because they embody the principles and values Bill Daniels defined as hallmarks of the program; strength of character, leadership potential, academic performance or promise, willingness to give back to the community, and a well-rounded personality.", sponsor: "Daniels Fund", amount: " varies ", state: "CO; NM; UT; WY", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.danielsfund.org/Scholarships/index.asp", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-09-21 15:57:40", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-30", updated_by: "walshm"},
    {id: 288, award_name: "Live Your Dream Award", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-11-15", other_req: " Provide the primary financial support for yourself and your dependents. Dependents can include children, spouse, partner, siblings and/or parents; Have financial need ;  Are enrolled in or have been accepted to a vocational/skills training program or an undergraduate degree program; Are motivated to achieve your education and career goals ; Reside in one of Soroptimist International of the Americas’ member countries/territories; Do not have a graduate degree; Are not a Soroptimist member, an employee of Soroptimist International of the Americas or immediate family of either.  Has a Social Security number or Tax ID number.", sponsor: "Soroptist International", amount: " $ 3,000 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.soroptimist.org/awards/apply.html", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-07-31 23:19:24", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 289, award_name: "AAHD Fredrick J. Krause Scholarship", subject_area: "Pre-Health Care; Nursing; Pre-med; Biology; Education; Engineering", level: "Undergraduate; Graduate", deadline: "2018-11-15", other_req: "Applicant must have a disability as defined by the American with Disabilities Act.\r\nApplicant must be enrolled full time as undergraduate student and completed one full year of college, and is currently in their 2nd year of study in a program at a college or university pursuing an undergraduate degree; or enrolled part time or full time in a graduate school, pursuing a post graduate degree.\r\nPreference will be given to students majoring in public health, disability studies, health promotion or a field related to disability and health.\r\nPreference will be given to students with a history of community service and/or volunteer activities.\r\nApplicant must be a US citizen or legal resident living in the United States and enrolled in an accredited United States university.", sponsor: "American Association on Health and Disability", amount: " $ 1,000 ", state: "All ", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.aahd.us/initiatives/scholarship-program/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-08-29 22:28:38", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 293, award_name: "Centennial Education Scholarship", subject_area: "Nursing", level: "Undergraduate", deadline: "2019-05-12", other_req: " Applicant must be accepted into or enrolled in an accredited nursing program in Oregon; Applicant must provide a Letter of Acceptance into the nursing program; A cumulative Grade Point Average (GPA) in nursing of 3.0 or greater. ", sponsor: "Oregon Nurses Foundation", amount: " $ 1,500 ", state: "OR", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.oregonnursesfoundation.org/scholarships/centennial-scholarship/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-02-12 22:48:48", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Two awards a year May and November", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "hobbsm"},
    {id: 294, award_name: "Italian Rail Scholarship for Study Abroad", subject_area: "Study Abroad; International Experience", level: "Undergraduate", deadline: "2019-06-30", other_req: "For use during FALL 2019 semester. Applications open 5/15/2019. Must be enrolled in second or third year undergraduate education program at a recognized US university or college; Must have been accepted and confirmed participation in Italy study abroad program (having paid deposit to hold place); Have at least a 3.0 cumulative GPA; Be on financial aid.", sponsor: "Italian Rail", amount: " $ 1,000 ", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.italiarail.com/scholarship", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-07-17 22:41:42", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "Look for winter/spring semester scholarships within same AY", respect_deadline: true, date_reopens: "2020-05-15", updated_by: "robertsm"},
    {id: 295, award_name: "Mesothelioma Cancer Alliance Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate; Graduate", deadline: "2020-03-31", other_req: " Those who have battled cancer at any point in their lives (not limited to mesothelioma); Those who have a parent, sibling, immediate family member or close friend that has battled or is currently fighting cancer. Must be enrolled full-time at an accredited two-year or four-year university, community college or junior college, or a graduate degree program; This scholarship is offered nationwide to United States citizens; Students must be in academic “Good Standing” and have a minimum Grade Point Average of 3.0 or higher to be eligible.", sponsor: "Mesothelioma Cancer Alliance", amount: " $ 4,000 ", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.mesothelioma.com/scholarship/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-05-30 21:17:06", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: " ", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 299, award_name: "Look Twice, Save a Life Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-12-01", other_req: " Current college student or anyone planning on attending college (or another form of higher education) in the upcoming school year; Student must have a valid driver’s license.   ", sponsor: "InsuranceProviders.com", amount: " $ 1,000 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.insuranceproviders.com/look-twice-save-a-life-scholarship", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-05-30 17:59:22", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-07-01", updated_by: "robertsm"},
    {id: 300, award_name: "The Ashley Soule Conroy Study Abroad Scholarship", subject_area: "Study Abroad; International Experience", level: "Undergraduate; Graduate", deadline: "2019-06-01", other_req: " Applicant must be planning to participate in full time study abroad program for at least 1 full semester outside the US; Study Abroad must occur in either fall or spring semester; Applicants must know in which study abroad program they will be participating; Must have minimum cumulative GPA of 3.0; Must be currently enrolled as an undergraduate student at 4 year college or university in the US and must have completed at least one year of college level course work (30 credit hours) at university; Applicant must demonstrate financial need.  October deadline is for spring semester study abroad, June deadline is for fall semester study abroad.", sponsor: "Ashley Foundation", amount: " $4,000 ", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.ashleysfoundation.org/for-applicants/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-05-05 21:28:56", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "DEADLINES TO APPLY\r\nFor Spring: October 1\r\nFor Fall: June 1", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "hobbsm"},
    {id: 301, award_name: "ASHRAE Scholarship Program ", subject_area: "Engineering", level: "Undergraduate", deadline: "2019-12-01", other_req: " Enrolled full time in an accredited undergraduate engineering program; potential service to the HVAC&R profession; financial need; leadership ability (activities, leadership roles, community service, etc.); work ethic (summer job, part-time jobs, etc.)", sponsor: "American Society for Heating, Refrigerating, and Air-Conditioning Engineers", amount: "varies", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "https://www.ashrae.org/communities/student-zone/scholarships-and-grants/ashrae-scholarship-program", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-05-29 21:36:15", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Submit only one application. You will be considered for each scholarship for which you qualify.", respect_deadline: true, date_reopens: "2020-06-01", updated_by: "robertsm"},
    {id: 302, award_name: "The Science Ambassador Scholarship", subject_area: "STEM field", level: "HS Senior; Undergraduate", deadline: "2018-12-11", other_req: " You must be a U.S. citizen or permanent resident and a full-time college student seeking a degree in a STEM field and identify as a woman in a way that's significant to you.  To apply, submit a three–minute video of yourself explaining a topic in science you are passionate about.", sponsor: "Cards Against Humanity", amount: " varies ", state: "All ", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.scienceambassadorscholarship.org/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-09-20 21:05:11", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "walshm"},
