    {id: 304, award_name: "Elks National Most Valuable Student Scholarships", subject_area: "All fields", level: "HS Senior", deadline: "2018-11-15", other_req: " Any high school senior who is a citizen of the United States is eligible to apply; Applicants need not be related to a member of the Elks; Applicants must be citizens of the United States on the date their applications are signed; permanent legal resident status does not qualify; Male and female students compete separately.  Applications will be judged on scholarship, leadership and financial need.", sponsor: "Elks National Foundation", amount: " varies ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.elks.org/ENF/scholars/mvs.cfm", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-08-29 22:31:00", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-08-15", updated_by: "walshm"},
    {id: 306, award_name: "Working Parent College Scholarship", subject_area: "All fields", level: "Undergraduate", deadline: "2019-08-16", other_req: " Is a full or part-time student who is in an accredited U.S. post-secondary educational institution (including, but not limited to, college, university or trade school, or similarly accredited program) with a current cumulative grade point average of 3.0 or higher at that institution; and Has worked an average of at least twelve (12) hours for each of the previous four (4) weeks at the time of applying; and Is a residential parent of at least one minor child; and Is a legal resident of the United States of America; and Is currently enrolled and furthering his or her education at an accredited U.S. post-secondary institution or program; and Is eighteen (18) years of age or older at the time of applying; and Completes and submits the official Application form within the relevant periods for the periodic scholarships to be awarded.    600 to 1000 word essay: Clearly outline three keys to successfully balancing parenthood, working, and excelling in school.", sponsor: "Job-Application.com", amount: " $ 1,000 ", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.job-applications.com/scholarships/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-05-30 21:14:56", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "offered twice a year. August and Dec deadline", respect_deadline: true, date_reopens: "2020-10-01", updated_by: "robertsm"},
