    {id: 309, award_name: "Foreclosure.com Scholarship Program", subject_area: "All fields", level: "Undergraduate", deadline: "2019-12-15", other_req: " Currently enrolled college students are eligible to apply by submitting and essay.", sponsor: "Foreclosure.com", amount: "up to $5,000", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.foreclosure.com/scholarship", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-05-05 21:29:27", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "hobbsm"},
    {id: 310, award_name: "Anne Ford Scholarship", subject_area: "All fields", level: "HS Senior", deadline: "2018-11-12", other_req: " Be a graduating high school senior who will be attending a four-year bachelor’s degree program in the fall; Have an overall grade point average (GPA) of 3.0 or higher on a 4-point scale (or equivalent); Demonstrate financial need; Provide most current documentation of an identified learning disability and/or ADHD; Be a United States citizen", sponsor: "National Center for Learning Disabilities", amount: " $ 2,500 (renewable)", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.ncld.org/scholarships-and-awards/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-08-24 16:51:09", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-08-15", updated_by: "geigerr"},
    {id: 311, award_name: "AXA Foundation Scholarships", subject_area: "All fields", level: "HS Senior", deadline: "2018-12-14", other_req: " Be United States citizens or legal residents living or claiming residency in one of the 50 United States, District of Columbia or Puerto Rico; Be current high school seniors who plan to enroll full-time in an accredited two-year or four-year college or university in the United States for the entire academic year; Demonstrate ambition and self-drive as evidenced by outstanding achievement in school, community or work-related activities", sponsor: "AXA Foundation", amount: " varies  ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://us.axa.com/axa-foundation/AXA-achievement-scholarship.html", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-08-29 22:32:07", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 312, award_name: "Jack Kent Cooke Undergraduate Transfer Scholarship", subject_area: "All fields ", level: "Undergraduate", deadline: "2018-11-27", other_req: " Be a current student at an accredited U.S. community college or two-year institution with sophomore status, or a recent graduate; Plan to enroll full time in a baccalaureate program at an accredited college or university in fall; Have a cumulative undergraduate grade point average of 3.5 or better on a scale of 4.0 (or the equivalent); Demonstrate significant unmet financial need; Have not previously attended a four-year institution.", sponsor: "Jack Kent Cooke Foundation", amount: "Up to $40,000 (renewable)", state: "All ", min_gpa: "3.50", contact: "financial.aid@example.edu", keywords: "", website: "http://www.jkcf.org/scholarship-programs/undergraduate-transfer/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-09-13 20:53:44", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-10", updated_by: "hobbsm"},
    {id: 313, award_name: "Burger King Scholars", subject_area: "All fields", level: "HS Senior", deadline: "2018-12-15", other_req: " Applicants must: Be living in the United States, Canada or Puerto Rico; Be graduating high school seniors (U.S. and Puerto Rico), graduating from grade 12 (Canada) or graduating from home school education in the U.S., Puerto Rico or Canada; Have a cumulative high school grade point average of 2.5 or higher on a 4.0 scale, or the equivalent; Plan to enroll full-time, without interruption, for the entire academic year at an accredited two- or four-year college, university or vocational-technical school in the U.S., Canada or Puerto Rico.  Only the first 50,000 submitted applications will be processed.", sponsor: "Burger King", amount: " varies ", state: "All", min_gpa: "2.50", contact: "financial.aid@example.edu", keywords: "", website: "https://www.scholarshipamerica.org/burgerkingscholars/information.php", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-10-18 19:53:46", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 316, award_name: "Charlie Corn Scholarship", subject_area: "Engineering", level: "HS Senior; Undergraduate", deadline: "2019-01-25", other_req: " Be a permanent resident of Guam, FSM, CNMI, or ROP or a dependent of active duty or reserve military personnel who are from Guam, FSM, CNMI, or ROP and exhibit a sincere interest in obtaining an engineering or architecture undergraduate degree and returning to Guam, FSM, CNMI, or ROP after graduation to begin their professional career.  1st or 2nd year students are eligible for a scholarship up to $3,500, 3rd and 4th year students are eligible for up to $5,000.  Note: As of posting the website says 2017-2018 however when you click the link, the information is for the 2018-19 award year.", sponsor: "The Guam Post of the Society of American Military Engineers (SAME)", amount: "up to $5,000", state: "GU; FSM; CNMI; ROP", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.same.org/Get-Connected/Find-a-Post/Guam/Scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-12-14 17:16:08", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-10", updated_by: "walshm"},
    {id: 318, award_name: "1Dental Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate; Graduate", deadline: "2018-12-21", other_req: " To apply, you must be enrolled in high school (seniors only), college or graduate school. Enrollment will be verified by 1Dental.com; 1Dental.com employees or relatives may not apply for this scholarship; 1Dental.com may disqualify any applicants whose submissions use inappropriate language or exhibit any behavior that can be deemed offensive; Applicants must be United States residents.", sponsor: "1Dental.com", amount: " $500", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.1dental.com/scholarship/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-10-18 19:55:55", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 319, award_name: "Michelson Scholarship ", subject_area: "All fields", level: "HS Senior", deadline: "2018-12-22", other_req: " This $1,000 award is available to all seniors who are members of an active chapter of CSF. Essay prompt will be posted November 1st each year. ", sponsor: "California Scholarship Federation", amount: " $ 1,000 ", state: "CA", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://csf-cjsf.org/csf-awards/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2018-10-18 19:57:14", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 320, award_name: "Touchmark Foundation Nursing Scholarships", subject_area: "Nursing", level: "HS Senior; Undergraduate", deadline: "2019-06-30", other_req: " The Foundation places particular emphasis on student applicants pursuing geriatric nursing studies. Scholarships are available to students who live or pursue their nursing education in the states listed: Oregon, Washington, Idaho, Montana, North Dakota, South Dakota, Minnesota, Wisconsin, Oklahoma or Alberta, Canada.", sponsor: "Touchmark Foundation", amount: " varies ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://touchmarkfoundation.org/programs/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:04", updated_at: "2019-01-24 18:17:08", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Two scholarship deadlines a year 6/30 ; 12/30", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
