    {id: 326, award_name: "Student-Caregiver Annual Scholarship", subject_area: "All fields", level: "Undergraduate; HS Senior; Graduate", deadline: "2019-06-30", other_req: "Caring.com is offering two $1,500 scholarships to two students attending an accredited U.S. college or university and caring for a loved one.  Must be a full-time student not on academic disciplinary status.", sponsor: "Caring.com", amount: " $1,000", state: "All", min_gpa: "None", contact: "financial.aid@example.edu", keywords: "", website: "https://www.caring.com/scholarship", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-05-30 18:26:44", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "Two scholarships a year.", respect_deadline: true, date_reopens: "2020-04-15", updated_by: "robertsm"},
