    {id: 333, award_name: "John F. Kennedy Profile in Courage Essay Contest", subject_area: "All fields", level: "HS Senior", deadline: "2019-01-18", other_req: "The contest is open to United States high school students in grades nine through twelve attending public, private, parochial, or home schools; U.S. students under the age of twenty enrolled in a high school correspondence/GED program in any of the fifty states, the District of Columbia, or the U.S. territories; and U.S. citizens attending schools overseas.", sponsor: "John F. Kennedy Presidential Library", amount: " $ 10,000 ", state: "All ", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.jfklibrary.org/Education/Profile-in-Courage-Essay-Contest/Eligibility-and-Requirements.aspx", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-08-29 22:34:27", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 334, award_name: "GE- Reagan Foundation Scholarship Program", subject_area: "All fields", level: "HS Senior", deadline: "2019-01-04", other_req: " Demonstrate at school, at the workplace, and within the community the attributes of leadership, drive, integrity, and citizenship; demonstrate financial need; be citizens of the United States of America; be high school seniors attending high school in the United States, applicants living on a U.S. Armed Forces base and attending high school outside the U.S. are eligible.  Home-schooled students are also eligible; plan to enroll in a full-time undergraduate course of study toward a bachelor’s degree at an accredited four-year college or university in the United States. ", sponsor: "GE - Reagan Foundation Scholarship  ", amount: " $10,000 (renewable)", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "https://www.reaganfoundation.org/education/scholarship-programs/ge-reagan-foundation-scholarship-program/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-10-18 23:13:25", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-16", updated_by: "walshm"},
    {id: 335, award_name: "Asian & Pacific Islander American Scholarship Program", subject_area: "Minority", level: "HS Senior; Undergraduate", deadline: "2019-01-10", other_req: " Be of Asian and/or Pacific Islander ethnicity as defined by US census; be enrolling as undergraduate student at  US accredited university; Be a citizen, national, or legal permanent resident of the United States. Citizens of the Republic of the Marshall Islands, Federated States of Micronesia and the Republic of Palau are also eligible to apply; must complete the FAFSA. ", sponsor: "Asian& Pacific Islander American Scholarship Fund", amount: " up to $15,000 ", state: "All", min_gpa: "2.70", contact: "financial.aid@example.edu", keywords: "", website: "http://www.apiasf.org/scholarship_apiasf.html", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-09-20 21:10:42", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-04", updated_by: "walshm"},
    {id: 337, award_name: "The Gates Scholarship", subject_area: "Computer Science; Education; Engineering; Library Science; Math; Science; Minority", level: "HS Senior", deadline: "2019-09-15", other_req: "To apply, students must be: A high school senior from at least one of the following ethnicities: African-American, American Indian/Alaska Native*, Asian & Pacific Islander American, and/or Hispanic American. Pell-eligible, a US citizen, national, or permanent resident and in good academic standing with a minimum cumulative weighted GPA of 3.3 on a 4.0 scale (or equivalent).", sponsor: "Bill & Melinda Gates Foundation", amount: "Full cost of attendance", state: "All", min_gpa: "3.30", contact: "financial.aid@example.edu", keywords: "", website: "https://www.thegatesscholarship.org/scholarship", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-07-17 22:42:54", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-07-15", updated_by: "robertsm"},
    {id: 338, award_name: "Kaiser Health Care Career Scholarship Program", subject_area: "Pre-Health Care; Nursing; Pre-med; Biology", level: "HS Senior", deadline: "2018-12-08", other_req: " Scholarships are awarded to at least one qualified high school senior at each of 133 eligible public high schools in the Kaiser Permanente Northwest service area, which spans from north of Longview, Washington to Eugene, Oregon.The scholarship program aims to facilitate the entrance of diverse and/or economically or socially disadvantaged students into college and the health care professions. Planning to pursue an education and career in a human medical or dental health care field. Planning to enroll at a U.S. accredited college or university as a full-time, degree or certificate-seeking first-year student in fall. ", sponsor: "Kaiser Permanente", amount: " $ 2,000 ", state: "OR; WA", min_gpa: "2.50", contact: "financial.aid@example.edu", keywords: "", website: "http://share.kaiserpermanente.org/article/northwest-health-care-career-scholarship-program/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-09-07 17:32:33", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-05", updated_by: "walshm"},
    {id: 340, award_name: "US Junior Chamber International Senate Foundation Scholarship", subject_area: "All fields", level: "HS Senior", deadline: "2019-01-11", other_req: " US citizen, graduating high school senior from a state that has a US JCI Senate Program (list on website – most states qualify).  ", sponsor: "US JCI Senate Foundation", amount: " $ 1,000 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.usjcisenate.org/index.php/scholarship-program", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-09-21 16:02:43", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "walshm"},
    {id: 341, award_name: "Doug Lemley Memorial Scholarship", subject_area: "Engineering; Technology", level: "HS Senior", deadline: "2019-02-22", other_req: " Applicants should be graduating seniors with a minimum 2.75 on a 4.0 scale or equivalent grade point average; Applicants should demonstrate two or more of the following qualities: leadership, achievements, volunteering, school or civic club membership, work experience; Applicants must be pursuing a degree or professional certificate in an accredited Institution of higher education; Applicants must maintain a minimum of 9 credit hours per term/semester; The applicant must be in the act of furthering their education in Facilities Mgt., Maintenance or Support Operations (Maintenance, Custodial, Grounds, or related fields), Engineering, or Technology. ", sponsor: "Oregon School Facilities Management Association", amount: " $ 1,000 ", state: "OR", min_gpa: "2.75", contact: "financial.aid@example.edu", keywords: "", website: "https://www.osfma.org/Student-Scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-02-12 22:51:54", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "hobbsm"},
    {id: 342, award_name: "Daughters of the American Revolution Scholarship - Beaverton Chapter ", subject_area: "Education", level: "Undergraduate", deadline: "2017-01-15", other_req: " The scholarship will be awarded to a college or university student with junior standing in the field of education for use during their senior year; The applicant must be a United States citizen and have been a resident of the state of Oregon sometime within the past five years; The applicant must have a cumulative GPA of at least 3.0. Contact the Office of Financial Aid for application.  ", sponsor: "Daughters of the American Revolution Beaverton Chapter", amount: " $ 500 ", state: "OR", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-02-12 05:10:00", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "We have application that was emailed to our office. ", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "hobbsm"},
    {id: 343, award_name: "Washington Crossing Foundation Scholarships", subject_area: "All fields", level: "HS Senior", deadline: "2019-01-15", other_req: " Competition open to all high school seniors who are U. S. citizens and are planning careers of service to the United States in local, state, or federal government. ", sponsor: "Washington Crossing Foundation", amount: " varies ", state: "All", min_gpa: "None", contact: "financial.aid@example.edu", keywords: "", website: "http://www.gwcf.org/SchlProgram.html", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-10-18 19:58:35", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 344, award_name: "Dell Scholars Program", subject_area: "All fields", level: "HS Senior", deadline: "2019-12-01", other_req: " Participating in a Michael & Susan Dell Foundation approved college readiness program in grades 11 and 12; Graduating from an accredited high school this academic year; Earning a minimum of a 2.4 GPA; Demonstrated need for financial assistance; Eligible to receive a federal Pell grant in first year of college; Planning to enroll full-time in a bachelor’s degree program at an accredited higher education institution in the fall directly after your graduation from high school", sponsor: "Michael & Susan Dell Foundation", amount: " varies ", state: "All", min_gpa: "2.40", contact: "financial.aid@example.edu", keywords: "", website: "http://www.dellscholars.org/scholarship/criteria/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-10-23 16:51:17", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
