    {id: 346, award_name: "LAESF Scholarships", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-01-22", other_req: "Are a permanent resident (366 consecutive days+) of Northern New Mexico in Los Alamos, Mora, Rio Arriba, San Miguel, Sandoval, Santa Fe, or Taos County. Have a minimum 3.25 cumulative unweighted grade point average (3.20 GPA does not meet this requirement). Receive scores of 19 ACT or 930 SAT (combined Math plus Critical Reading only). Are enrolling in or currently attend an accredited post-secondary educational institution\r\nPreference is not given to students with Laboratory affiliation.", sponsor: "Los Alamos National Laboratories Foundation", amount: " varies ", state: "NM", min_gpa: "3.25", contact: "financial.aid@example.edu", keywords: "", website: "https://www.lanlfoundation.org/programs/scholarships/general-4-year-undergraduate-scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-10-18 19:59:11", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 347, award_name: "Point Foundation's Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-01-28", other_req: " Must be “out” as a person who identifies within the LGBTQ spectrum with strong academic performance and proven leadership skills with a desire to make a difference in the world.  US Citizenship is NOT required but must attend school in the US. Must be enrolled or intending to enroll at an accredited college or university based in the United States, including Hawaii and Alaska, in the fall. Must be enrolled full-time for the full academic year. Must be enrolled in a degree-granting undergraduate or graduate/ doctoral program", sponsor: "Point Foundation - The National LGBTQ Scholarship Fund", amount: " varies ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://www.pointfoundation.org/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-10-23 16:53:26", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 348, award_name: "California Association of Collectors Educational Scholarship", subject_area: "All fields", level: "HS Senior", deadline: "2019-06-30", other_req: "Awarded to California high school juniors or seniors who will be attending any accredited public or private college, university, or trade school within 12 months of the scholarship award.", sponsor: "California Association of Collectors", amount: "up to $2,500", state: "CA", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://cacesf.org/index.html", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-05-05 20:24:05", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 350, award_name: "OSCPA Educational Foundation Scholarship", subject_area: "Accounting", level: "HS Senior; Undergraduate", deadline: "2019-01-14", other_req: " Full-time Oregon college/university undergraduate accounting majors, post baccalaureate and masters program students are eligible to apply for $1,000 - $3,000 scholarships. Must attend one of the accredited Oregon colleges or universities in the fall; Scholarships will be awarded based on student's academic performance, intent to enter the CPA profession and work within the state of Oregon.  Scholarships are for tuition and books; Minimum required GPA is 3.2 in accounting/business classes and an overall 3.2 GPA.  ", sponsor: "OSCPA Education Foundation", amount: "up to $3,000", state: "All", min_gpa: "3.20", contact: "financial.aid@example.edu", keywords: "", website: "https://www.orcpa.org/ed-foundation/scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-11-13 21:40:47", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-15", updated_by: "walshm"},
    {id: 352, award_name: "NOAA Ernest F. Hollings Scholarship", subject_area: "Education; Engineering; Math; Physics; Biology; Environmental Science; Computer Science; Nursing", level: "Undergraduate", deadline: "2019-02-15", other_req: "ELIGIBILITY: be a U.S. citizen; be currently enrolled or accepted as a full-time 2nd year student in a four-year academic program at an accredited college or university or university within the United States or U.S. territories; earn and maintain GPA of 3.0 in your major field of study; and have and maintain a declared major in a discipline including, but not limited to, oceanic, environmental, biological, and atmospheric sciences, mathematics, engineering, remote sensing technology, physical and social sciences including geography, physics, hydrology, geomatics, or teacher education that support NOAA's programs and mission.", sponsor: "National Oceanic and Atmospheric Association", amount: "varies ", state: "All", min_gpa: "3.00", contact: "scholars@up.edu", keywords: "", website: "http://www.noaa.gov/office-education/hollings-scholarship", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-02-12 05:51:24", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "hobbsm"},
    {id: 354, award_name: "Technology Addiction Awareness Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate; Graduate", deadline: "2020-01-30", other_req: " You must be a high school freshman, sophomore, junior, or senior or a current or entering college or graduate school student of any level. Home schooled students are also eligible. There is no age limit. You must also be a U.S. citizen or legal resident.", sponsor: "Digital Responsibility", amount: " $ 1,000 ", state: "All ", min_gpa: "None", contact: "financial.aid@example.edu", keywords: "", website: "http://www.digitalresponsibility.org/technology-addiction-awareness-scholarship/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-05-05 21:30:04", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2021-04-01", updated_by: "hobbsm"},
    {id: 356, award_name: "Microsoft Scholarship Program", subject_area: "STEM field", level: "HS Senior; Undergraduate", deadline: "2019-01-31", other_req: " This award is for international and U.S. students; Must be a full-time student; Must have a grade point average of 3.0 or higher; Must be making satisfactory progress toward a degree in computer science, computer engineering, or a related technical discipline, such as math or physics, with a demonstrated interest in computer science; Must be currently enrolled in a bachelor's degree program at a college/university; Must agree to complete summer internship at Microsoft ", sponsor: "Microsoft Corporation", amount: " varies ", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "https://careers.microsoft.com/us/en/usscholarshipprogram", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-11-30 18:07:37", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-19", updated_by: "walshm"},
    {id: 358, award_name: "Scholarship Foundation of Santa Barbara Scholarships", subject_area: "All fields", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-01-15", other_req: "Applicant must have attended at least four* of the six years between grades 7-12 AND graduate or receive a GED from a Santa Barbara County high school by June 2019; Applicant must be planning to attend full-time as an undergraduate, medical (M.D.), or graduate student at a Title IV-approved school; Applicant must be a U.S citizen, permanent resident, or AB 540 eligible ", sponsor: "Scholarship Foundation of Santa Barbara", amount: " varies ", state: "CA", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.sbscholarship.org/apply-for-a-scholarship/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-10-18 20:02:52", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 359, award_name: "The Simon Cancer Foundation Scholarship", subject_area: "All fields", level: "HS Senior", deadline: "2019-01-31", other_req: " Eligibility Requirements:  Enrolled in a 4 year University or College in Fall; University must be in the United States; Student who will be Freshman in the fall are eligible to apply; Applicants must sign an affidavit verifying they're had any type of cancer during their lifetime.", sponsor: "The Simon Cancer Foundation", amount: " varies ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.thescf.org/Scholarships.html", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-10-18 20:03:26", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 360, award_name: "The Cancer for College Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-01-31", other_req: " Must be a US resident enrolled in an accredited university or community college; Must be a cancer patient/cancer survivor; Perpetual scholarship recipients must be willing to attend regional events associated with scholarship awarded and available for selected interviews and or media coverage. Cancer for College reserves the right to use still or video images and/or statements of scholarship recipients in any promotional materials.  ", sponsor: "Cancer for College Foundation", amount: " $ 4,000 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.cancerforcollege.org ", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-10-23 16:58:07", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "open 11/1 to 1/31 each year. ", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 362, award_name: "Alisa's Angels Scholarships", subject_area: "All fields", level: "HS Senior", deadline: "2019-02-01", other_req: "Graduating high school seniors from Arizona (up to 6 scholarships). \r\nGraduating high school seniors from the Colorado Springs, Colorado area (up to 2 scholarships; see note below).\r\nThe scholarship may be used for any college, university, community college, or qualified trade schools. \r\n$2500 will be available the first year of school. The remainder will be available in following years if student is in good standing. The scholarship funds can only be used for books and tuition, and will be issued directly to the school.", sponsor: "Alisa's Angels Foundation", amount: " $ 5,000", state: "AZ, CO", min_gpa: "2.75", contact: "financial.aid@example.edu", keywords: "", website: "http://alisasangels.org/programs/scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-08-29 22:45:45", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
