    {id: 364, award_name: "California PTA Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-02-01", other_req: "Applicants must be PTA members graduating from a California high school between January 1 and June 30 of the current academic year.", sponsor: "California PTA", amount: " $ 750 ", state: "CA", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://capta.org/programs-events/scholarships/graduating-high-school-seniors/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-09-20 21:11:20", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "walshm"},
    {id: 365, award_name: "Al Forthan Memorial Scholarship", subject_area: "All fields", level: "HS Senior", deadline: "2019-02-04", other_req: " The Al Forthan Memorial Scholarship is awarded to an Oregon high school senior from a family affected by alcohol or drug addiction. ‘Affected by addiction’ is defined as follows: you were raised by a parent or guardian who experienced addiction or you abused alcohol or drugs and are now pursuing recovery.", sponsor: "Al Forthan Scholarship Foundation", amount: " $ 10,000 ", state: "OR", min_gpa: "None", contact: "financial.aid@example.edu", keywords: "", website: "https://alforthanscholarship.com/how-to-apply/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-11-30 18:15:35", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 366, award_name: "Boren Scholarship", subject_area: "All Fields; International Experience; Study Abroad", level: "Undergraduate", deadline: "2019-11-25", other_req: "This award is for critical language study in a country outside of Western Europe, Canada, Australia, or New Zealand; see the list of preferred languages and locations on the Boren website.\r\n\r\nINSTITUTIONAL ENDORSEMENT REQUIRED - Contact scholars@up.edu immediately if you are interested in applying for this award, as there may be an on-campus deadline prior to the posted deadline.\r\n\r\nELIGIBILITY: must be a high school graduate or have earned a GED; be matriculated in an undergraduate degree program located within the United States before and during award; applying to a study abroad program that meets home institution standards.  \r\n\r\nWork requirement: minimum one year service requirement.", sponsor: "National Security Education Program", amount: "varies ", state: "All", min_gpa: "None ", contact: "scholars@up.edu", keywords: "", website: "https://www.borenawards.org/scholarships/program-basics/boren-scholarship-basics", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-08-13 16:57:39", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "This award should have an institutional endorsement, so the campus deadline is marked as the Monday before Thanksgiving each year.", respect_deadline: true, date_reopens: "2018-09-01", updated_by: "leasor"},
    {id: 367, award_name: "Davidson Fellows Scholarships", subject_area: "All fields", level: "HS Senior", deadline: "2019-02-14", other_req: " Be 18 or younger as of Oct. 1, 2019; Be a U.S. citizen residing in the United States, or a Permanent Resident of the United States residing in the United States, or be stationed overseas due to active U. S. military duty; There is no minimum age for eligibility; The Davidson Institute is looking for students whose projects are at, or close to, the college graduate level with a depth of knowledge in their particular area of study. ", sponsor: "Davidson Institute for Talent Development", amount: " varies ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.davidsongifted.org/Fellows-Scholarship/How-to-Apply", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-12-14 00:23:36", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 368, award_name: "National Society Daughters of the American Revolution Scholarships", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-02-15", other_req: " All applicants must be citizens of the United States and must attend or plan to attend an accredited college or university in the United States.  DAR chapter sponsorship is not required; however, a chapter or state chairman may work with the applicant to put the information together to send to the DAR Scholarship Committee. Other qualifications based on individual scholarships. ", sponsor: "National Society Daughters of the American Revolution", amount: " varies ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.dar.org/national-society/scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-10-18 20:04:16", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 369, award_name: "Washington State Nursing Foundation", subject_area: "Nursing", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-02-08", other_req: " Undergraduate student applicants must be enrolled in an approved program leading to an associate or baccalaureate nursing degree, and must have completed at least 12 nursing credits. Graduate student applicants must be admitted to an approved graduate nursing program to be eligible to apply for a scholarship. Applicants must be either a resident of Washington State or enrolled in an approved RN program in Washington State.", sponsor: "Washington State Nursing Foundation", amount: " $ 1,000 ", state: "WA", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://www.wsna.org/wsnf/scholarship", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-10-23 16:58:46", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 371, award_name: "LAEF Scholarship", subject_area: "Minority", level: "HS Senior; Undergraduate; Graduate", deadline: "2018-11-20", other_req: " Applicants must meet the following eligibility criteria: Colorado Resident - determined by having a permanent address in Colorado; Hispanic Heritage and/or actively involved in the Hispanic community; Minimum 3.0 cumulative grade point average; Scholarship is available to undergraduate and graduate students. Scholarship recipients are required to fulfill 10 hours of community service during year of funding at your college/university. ", sponsor: "Latin American Education Foundation", amount: " varies ", state: "CO", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.laef.org/index.php?s=7566#urindex.php?s=7566-1", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-09-21 15:51:03", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-21", updated_by: "walshm"},
    {id: 373, award_name: "North Central Washington Community Foundation Scholarships", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-03-01", other_req: " Over 90 scholarships are available to students in the North Central Washington Region; criteria varies depending on scholarship", sponsor: "Community Foundation of North Central Washington", amount: " varies ", state: "WA", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.cfncw.org/scholarships/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-01-02 23:13:03", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 374, award_name: "Alzheimer's Awareness College Scholarship", subject_area: "All fields", level: "HS Senior", deadline: "2019-02-15", other_req: " Eligibility: United States citizenship or permanent residency; be currently enrolled in a public, independent, parochial, military, home-school or other high school in the United States; Must also enter a four-year accredited college or university within 12 months of the application deadline.", sponsor: "AFA Teens", amount: "$500 - $2500", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://alzfdn.org/young-leaders-of-afa/afa-teens/2608-2/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-11-13 21:45:59", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-15", updated_by: "walshm"},
    {id: 375, award_name: "Pierre Fraley Scholarship", subject_area: "French", level: "Undergraduate; Graduate", deadline: "2019-03-15", other_req: " To be eligible for the applicant must meet the criteria: The applicant must be a university student who will have completed the junior year before attending the summer program with a declared major in French, be taking a significant concentration of French with a declared major requiring fluency in foreign language, or be a French teacher with no more than 3 years teaching experience; The applicant must be applying to a summer program giving academic credit for a university level course of study; The program courses must be conducted in French; Preference will be given to residents of the tri-state area (PA-NJ-DE) or to out-of area students who are matriculated at a university in the tri-state area.", sponsor: "Alliance Francaise de Philadelphie", amount: " varies ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.afphila.com/page-1737827?", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-09-21 16:11:33", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 376, award_name: "American Welding Society Scholarships ", subject_area: "Civil Engineering", level: "HS Senior; Undergraduate", deadline: "2019-03-01", other_req: " The purpose of this scholarship is to provide financial assistance to an individual interested in pursuing a career in civil engineering, welding engineering, or welding engineering technology; Applicant must be a minimum of eighteen years of age; Applicant must have a high school diploma; Applicant must have a 3.0 overall grade point average; Student must be enrolled full or part time in an accredited college or university in the United States. ", sponsor: "American Welding Society", amount: " $ 2,500 ", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "https://www.aws.org/foundation/page/scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-11-30 18:20:36", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 377, award_name: "Society of Physics Students Scholarships", subject_area: "Education; Physics", level: "Undergraduate", deadline: "2019-03-15", other_req: " Must be a member of Sigma Pi Sigma; criteria specific to each scholarship", sponsor: "Sigma Pi Sigma", amount: " varies ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://www.spsnational.org/awards/scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-01-03 17:09:56", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-02", updated_by: "walshm"},
    {id: 378, award_name: "Military Commanders Scholarship Fund", subject_area: "Military Family", level: "HS Senior", deadline: "2019-02-16", other_req: "Applicants to the Military Commanders' Scholarship Fund must:\r\n1) be dependent children of active duty, reserve, National Guard or retired members of the United States military who hold valid Exchange & Commissary shopping privileges at the time of application,\r\n2) be high school seniors or graduates who plan to enroll for the first time in a full time undergraduate course of study at an accredited two-year or four-year college or university, and\r\n3) have a minimum cumulative 3.5 grade point average on a 4.0 scale, or the equivalent, at the time of application.\r\nOnly the first 100 aplications will be acknowledged and processed.", sponsor: "New York Chapter of the American Logistics Association", amount: " $ 5,000 ", state: "All ", min_gpa: "3.50", contact: "financial.aid@example.edu", keywords: "", website: "http://sms.scholarsapply.org/militarycommanders/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-11-13 21:46:39", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-15", updated_by: "walshm"},
    {id: 379, award_name: "Goldberg-Miller Public Finance Scholarship", subject_area: "Accounting; Business; Finance", level: "Graduate", deadline: "2019-01-18", other_req: " Current students enrolled full time in a graduate program that prepares students for careers in state and local government finance and expecting to enroll in spring 2018 semester", sponsor: "Government Finance Officers Association - Girard Miller Foundation", amount: " $15,000 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.gfoa.org/scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-11-01 18:18:04", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 380, award_name: "Frank Greathouse GFOA Scholarship", subject_area: "Accounting", level: "Undergraduate; Graduate", deadline: "2019-01-18", other_req: " Currently a full-time student in an undergraduate or graduate accounting program preparing for a career in state or local government finance; Undergraduate students must be in the process of completing at least their junior year by the time the scholarship is awarded; Citizen or permanent resident of the United States or Canada; Recommendation by someone who can speak to your commitment to the public sector.", sponsor: "Government Finance Officers Association", amount: " $10,000", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.gfoa.org/scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-11-01 18:18:36", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 381, award_name: "Jeffrey L Esser Career Development Scholarship", subject_area: "Accounting; Business; Finance", level: "Graduate", deadline: "2019-01-18", other_req: " Employed at least three years by one or more state or local governments; Recommendation by your employer and someone who can speak to your commitment to the public sector; Currently a part-time student pursuing a Bachelor's Degree.", sponsor: "Government Finance Officers Association", amount: " $5,000 - $15,000", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.gfoa.org/scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-11-01 18:20:06", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 382, award_name: "Minorities in Government Finance Scholarship", subject_area: "Accounting, Business, Economics, Finance, Political Science; Minority", level: " Undergraduate; Graduate", deadline: "2019-01-18", other_req: " Currently a full-time student in an upper level undergraduate or graduate student in public administration, governmental accounting, finance, political science, economics, or business administration (with specific focus on government or nonprofit management); Belong to one of the following groups (as defined by the U.S. Census Bureau): Black or African American, American Indian or Alaska Native, Asian, Native Hawaiian or Other Pacific Islander, Hispanic or Latino or Spanish Origin; Citizen or permanent resident of the United States or Canada; Recommendation by someone who can speak to your commitment to the public sector.", sponsor: "Government Finance Officers Association", amount: " $10,000", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.gfoa.org/scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-11-01 18:19:16", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 383, award_name: "Napa County Hispanic Network Scholarship", subject_area: "Minority", level: "HS Senior; Undergraduate", deadline: "2019-02-22", other_req: "Applicants must be first-generation college bound, Latino, low-income residents of Napa County (CA).  High school students should have a minimum overall GPA of 3.0. High-school students who are otherwise qualified but have below a 3.0 GPA may still be eligible for a \"Si Se Puede\" Scholarship if they have overcome hardship.  College students must have a minimum 2.5 GPA.  College-bound high school seniors or students currently attending a four-year university.", sponsor: "Napa County Hispanic Network", amount: " $ 500 ", state: "CA", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: "", website: "https://www.napacountyhispanicnetwork.org/form", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-01-24 18:18:01", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 384, award_name: "Martin Luther King, Jr. Memorial Scholarship ", subject_area: "Education; Minority", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-02-15", other_req: "In order to be eligible, an applicant must be pursuing a teaching related career in public education and be a member of a defined ethnic minority group (African American, American Indian, Asian/ Pacific Islander, or Hispanic); Applicants must also be: An active member of CTA, or A dependent child of an active, retired, or deceased CTA member, or  An active member of Student CTA.  ", sponsor: "California Teacher Association", amount: "up to $6,000", state: "CA", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://www.cta.org/scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-02-12 05:18:12", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "hobbsm"},
    {id: 385, award_name: "The Vegetarian Resource Group Scholarship", subject_area: "All fields", level: "HS Senior", deadline: "2019-02-20", other_req: " Entries may only be sent by students graduating from high school in spring 2019. Applicants will be judged on having shown compassion, courage, and a strong commitment to promoting a peaceful world through a vegetarian diet/lifestyle. ", sponsor: "The Vegetarian Resource Group", amount: " $5,000 - $10,000", state: "All", min_gpa: "None", contact: "financial.aid@example.edu", keywords: "", website: "http://www.vrg.org/student/scholar.htm", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-08-29 22:46:59", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 386, award_name: "Donald E Pizzini Memorial Nurse Scholarship", subject_area: "Nursing ", level: "HS Senior; Undergraduate", deadline: "2019-02-28", other_req: " Must pursue study on a full-time or part-time basis in a nursing program relevant to the long term care field; Applicants shall have maintained a 3.0 GPA or better in their previous studies; high school GPA shall be considered for first year students; pursue a nursing program designed to lead to an appropriate degree or certification; Must be a U.S. citizen or possess a Permanent Resident Visa; Must reside in Montana and plan to work, or remain working, in the long term care nursing field in Montana. ", sponsor: "Montana Health Care Association Scholarship Fund", amount: " $1,000 ", state: "MT", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.mthealthcare.org/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-12-14 17:20:22", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "walshm"},
    {id: 387, award_name: "MHI Scholarship", subject_area: "Computer Science; Engineering", level: "Undergraduate; Graduate", deadline: "2019-01-15", other_req: " Junior or senior students for the school year or graduate students with a 3.0 min. GPA.  Student should be studying material handling, supply chain or logistics.  Eligible programs of study include: industrial, mechanical, manufacturing, electrical and civil engineering, computer engineering, computer science, business administration with an emphasis in production management, industrial distribution, supply chain, or logistics.", sponsor: "Material Handling Education Foundation", amount: " varies ", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.mhi.org/mhefi/scholarship", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-11-13 21:47:45", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 388, award_name: "LAGRANT Foundation Graduate Scholarship", subject_area: "Business; Communications; English; Marketing; Minority", level: "Graduate", deadline: "2019-02-28", other_req: "Must be a U.S. citizen, permanent resident or DACA recipient. \r\nMust be a member of one of the following ethnic groups: African American/Black, Asian American/Pacific Islander, Hispanic/Latino or Native American/Alaska Native.\r\nMust be a full-time student at a four-year, accredited institution within the U.S., carrying a total of 9 units or more per semester/quarter.\r\nMust have a minimum of 3.2 GPA.\r\nMUST major in a field of study that has an emphasis in advertising, marketing or public relations.\r\nMust have a MINIMUM OF TWO ACADEMIC SEMESTERS or ONE-YEAR left to complete his/her Master’s degree from the time the scholarship is awarded in May 2019.", sponsor: "LAGRANT FOUNDATION", amount: " $3,750", state: "All", min_gpa: "3.20", contact: "financial.aid@example.edu", keywords: "", website: "https://www.lagrantfoundation.org/Graduate%20Scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-09-20 21:14:00", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-08-15", updated_by: "walshm"},
    {id: 389, award_name: "LAGRANT Foundation Undergraduate scholarship", subject_area: "Business; Communications; English; Fine Arts; Sociology; Minority", level: "Undergraduate", deadline: "2019-02-28", other_req: " Must be a U.S. citizen, permanent resident or DACA recipient.\r\nMust be a member of one of the following ethnic groups: African American/Black, Asian American/Pacific Islander, Hispanic/Latino or Native American/Alaska Native.\r\nMust be a full-time student at a four-year, accredited institution within the U.S., carrying a total of 12 units or more per semester/quarter.\r\nMust have a minimum of 3.0 GPA.\r\nMUST major in a field of study that has an emphasis on advertising, marketing or public relations.\r\nMust have at least one year to complete his/her degree from the time the scholarships are awarded in May 2019.", sponsor: "LAGRANT FOUNDATION", amount: " $ 2,500 ", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "https://www.lagrantfoundation.org/Undergraduate%20Scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-09-20 21:22:49", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-08-15", updated_by: "walshm"},
    {id: 391, award_name: "Eastern Washington Section of the Society of Women Engineers AREVA Inc. Scholarship", subject_area: "Engineering", level: "Undergraduate", deadline: "2019-02-15", other_req: "Be a student a returning undergraduate student in an accredited school with an intention to enter any engineering field; Be in a position to accept the scholarship toward undergraduate or graduate engineering studies in an accredited school in the fall following presentation of the award; Attend an engineering school in Washington, Oregon or Idaho. ", sponsor: "AREVA, Inc", amount: " $ 1,000 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://scholarships.swe.org/applications/login.asp", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-04-18 21:24:32", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "freshmen application opens 3/1/19 ; undergraduate opens 12/1/19", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "hobbsm"},
    {id: 392, award_name: "America Society of Mechanical Engineers Scholarships", subject_area: "Engineering", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-03-01", other_req: " ASME student membership is required; Applicants must be accepted and enrolled full-time in an ABET accredited school for the entire upcoming academic year; ASME Scholarships have only one application to complete for all scholarships in this group.", sponsor: "America Society of Mechanical Engineers", amount: " varies ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://www.asme.org/career-education/scholarships-and-grants/scholarship-and-loans", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-11-30 18:23:52", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 393, award_name: "The National Italian American Foundation Scholarships", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-03-01", other_req: " To be considered for a NIAF scholarship, a student must meet the following criteria: Be a member of NIAF or have a parent or guardian who is a member of NIAF; Be enrolled in an US accredited institution of higher education;  Have a grade-point average of at least 3.5 out of 4.0 (or the equivalent); Be a United States citizen or a permanent resident alien; For the purposes of the NIAF Scholarship Program, to be “Italian American” the student must have at least one ancestor who has immigrated from Italy.", sponsor: "The National Italian American Foundation", amount: " $ 2,000 ", state: "All", min_gpa: "3.50", contact: "financial.aid@example.edu", keywords: "", website: "https://www.niaf.org/programs/scholarships-overview/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-11-30 18:24:33", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 394, award_name: "Federal Employee Education & Assistance Fund", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-03-25", other_req: "Children under the age of 25 of full- or part-time permanent federal civilian or postal workers employed with the federal government for more than three years, as well as the employees themselves and their spouses.   High school senior or continuing undergraduate.  3.0 minimum GPA.", sponsor: "FEEA", amount: " varies ", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.feea.org/programs/scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-01-11 18:47:26", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-10", updated_by: "walshm"},
    {id: 395, award_name: "Association of Raza Educators Scholarships (undocumented)", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-03-12", other_req: "Must demonstrate leadership in extra-curricular activities; a commitment to improve the conditions of your community, financial need, and most importantly you must demonstrate a high level of community involvement. Must be a student/community member residing in San Diego at time of applying. Must be an Undocumented/ AB 540/ Deferred Action for Childhood Arrival (DACA) student or  an active community member. Must be enrolled in an accredited College or University for fall 2018 with a full-time schedule. Must have an overall GPA of 2.5 or above.", sponsor: "Association of Raza Educators San Diego", amount: " $ 5,000 ", state: "CA", min_gpa: "2.50", contact: "financial.aid@example.edu", keywords: "", website: "http://aresandiego.weebly.com/scholarship.html", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-02-12 22:53:48", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "hobbsm"},
