    {id: 398, award_name: "James Madison Fellowship", subject_area: "Education; Political Science; History ", level: "Undergraduate; Graduate", deadline: "2018-03-01", other_req: "ELIGIBILITY: Be a teacher, or plan to become a teacher, of American history, American government, or social studies at the secondary school level (grades 7–12); Possess a bachelor's degree or plan to receive a bachelor's degree no later than August 31 of the year in which you are applying.\r\nWORK REQUIREMENT: After receiving the master's degree, each Fellow must teach American history, American government, or social studies in grades 7–12 for one full year for each academic year of aid received under a fellowship, preferably in the state from which the recipient won the fellowship. ", sponsor: "James Madison Fellowship", amount: " varies ", state: "All ", min_gpa: "None ", contact: "scholars@up.edu", keywords: "", website: "http://www.jamesmadison.gov/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-04-17 18:28:14", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-09-01", updated_by: "honstu1"},
    {id: 399, award_name: "Children of Warriors National Presidents' Scholarship", subject_area: "Military Family", level: "HS Senior", deadline: "2019-03-01", other_req: " Candidates for this award shall be daughters, sons, grandsons, granddaughters, great-granddaughters, great-grandsons of veterans who served in the Armed Forces during eligibility dates for membership in The American Legion. Applicants must be in their senior year of high school. Applicant must complete 50 hours of volunteer service within the community during his/her high school years.  ", sponsor: "American Legion Auxiliary", amount: "$5,000", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://www.alaforveterans.org/Scholarships/Children-of-Warriors-National-Presidents--Scholarship/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-09-21 16:12:50", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 400, award_name: "Deana's Wish Memorial Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2020-03-01", other_req: "US Citizen, entering or continuing college who has been diagnosed with, or had an immediate family member (parent, grandparent, sibling, child) who has been affected by esophageal or stomach cancer.  3.0 min. GPA, SAT min 1100 or ACT min 24.", sponsor: "The DHL Foundation", amount: " $ 2,000 ", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "https://www.dlhfoundation.org/scholarship.html", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-05-03 19:09:18", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "hobbsm"},
    {id: 402, award_name: "American Legion Scholarship for Non-Traditional Students", subject_area: "All fields", level: "Undergraduate", deadline: "2019-03-01", other_req: " Applicant must be a member of The American Legion, American Legion Auxiliary, or Sons of The American Legion and shall have paid dues for the two preceding years and for the calendar year in which application is made. Applicant must be: non-traditional student returning to the classroom after some period of time in which his/her formal education was interrupted; a non-traditional student who is just beginning his/her education at a later point in life", sponsor: "The American Legion Auxiliary Department of Oregon", amount: " $ 2,000 ", state: "OR", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://www.alaforveterans.org/Scholarships/Non-Traditional-Student-Scholarship/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-10-18 22:35:27", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
