    {id: 405, award_name: "Sons of Italy Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-03-01", other_req: "Applicants must be wholly or partly of Italian ancestry. Selection will be based on scholastic record, activities evidencing leadership, financial need, written personal goals statement, Essay of Italian Origin, and letters of recommendation. ", sponsor: "Sons of Italy Western Foundation", amount: " varies ", state: "CA", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.osiaca.org/Scholarships/How-To-Apply", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-11-13 21:48:37", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-15", updated_by: "walshm"},
    {id: 406, award_name: "The Washington Apple Education Foundation Scholarships", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-03-01", other_req: "Students raised in families with ties to Washington’s tree fruit industry are eligible to apply.  Ties to the industry are created through immediate family member or personal employment in an apple, cherry or pear orchard or warehouse in Washington, immediate family ownership of an apple, cherry or pear orchard or warehouse in Washington or immediate family employment in a company directly serving the apple, cherry or pear industry in Washington.  Additionally, students with a desire to work for the tree fruit industry may also qualify.", sponsor: "The Washington Apple Education Foundation", amount: " varies ", state: "WA", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://waef.org/scholarships/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-10-18 22:36:00", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 407, award_name: "ACS Scholars Program", subject_area: "Chemistry; Minority", level: "HS Senior; Undergraduate", deadline: "2019-03-01", other_req: " To be considered for a scholarship through the ACS Scholars Program, candidates must: Be African-American, Hispanic/Latino, or American Indian; Be a U.S. citizen or permanent U.S. resident; Be a full-time student at a high school or accredited college, university, or community college; Demonstrate high academic achievement in chemistry or science (Grade Point Average 3.0, 'B' or better); Demonstrate financial need according to the Free Application for Federal Student Aid form (FAFSA) and the Student Aid Report (SAR) form; Be a graduating high school senior or college freshman, sophomore or junior intending to or already majoring in chemistry, biochemistry, chemical engineering or a chemically-related science OR intending to or already pursuing a degree in chemical technology; Be planning a career in the chemical sciences.", sponsor: "American Chemical Society", amount: "Varies", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "https://www.acs.org/content/acs/en/funding-and-awards/scholarships/acsscholars.html", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-10-23 18:03:52", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 408, award_name: "OSAC Scholarships ", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-03-05", other_req: " Must be an Oregon Resident; One application for over 500 scholarships for OR Residents; Other criteria will vary depending on scholarships selected.", sponsor: "Oregon Student Access and Completion Commission", amount: " varies ", state: "OR", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.oregonstudentaid.gov/scholarships.aspx", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-03-01 20:20:31", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "hobbsm"},
    {id: 409, award_name: "Marine Corps Scholarship Funds", subject_area: "Military Family", level: "HS Senior; Undergraduate", deadline: "2019-03-01", other_req: " APPLICANTS MUST BE THE CHILD OF ONE OF THE FOLLOWING: Active duty or reserve U.S. Marine; Veteran U.S. Marine who has received an honorable discharge, or who was killed while serving in the U.S. Marine Corps; Active duty or reserve U.S. Navy Corpsman who is serving, or has served, with a U.S. Marine unit; Veteran U.S. Navy Corpsman who served with a U.S. Marine unit and has received an honorable discharge, or was killed while serving in the U.S. Navy as a Corpsman attached to a Marine unit. Additionally, applicants must meet the following eligibility criteria: GPA of at least 2.0 (on a 4.0 scale); Family adjusted gross income that does not exceed $94,000. Non-taxable allowances are not included in determining adjusted gross income; Planning to attend an accredited undergraduate college or career training school in the upcoming academic year.", sponsor: "Marine Corps", amount: " varies ", state: "All", min_gpa: "2.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.mcsf.org/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-01-02 23:31:35", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 411, award_name: "National Press Photographers Foundation Scholarships", subject_area: "All fields", level: "Undergraduate; Graduate", deadline: "2018-12-01", other_req: " Currently enrolled full-time in an accredited four-year school in the US or Canada.  Prove evidence of an aptitude for photojournalism as well as academic ability and financial need.  You may enter up to 10 total entries.  An entry is defined as a single picture, a multiple picture story, or a website link at which you have done significant interactive programming or design. ", sponsor: "National Press Photographers Foundation", amount: "$2,000", state: "All", min_gpa: "2.80", contact: "financial.aid@example.edu", keywords: "", website: "http://nppf.org/scholarship-competition/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-09-21 16:15:19", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 412, award_name: "Frame My Future Scholarship", subject_area: "All fields", level: "Undergraduate; Graduate", deadline: "2019-04-01", other_req: " Attending a US college or university full time; A legal U.S. resident.", sponsor: "DiplomaFrame.com", amount: " $ 1,000 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://www.diplomaframe.com/contests/frame-my-future-scholarship-contest-2017.aspx", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-11-30 18:25:44", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 414, award_name: "Aimco Cares Opportunity Scholarship", subject_area: "All fields", level: "HS  Senior; Undergraduate", deadline: "2019-04-20", other_req: " Current resident of affordable housing (Section 8, Rent Supplement, Rental Assistance Payments, or Low Income Housing Tax Credit program), US citizen or legal permanent resident with a valid Social Security Number, graduating high school senior, GED recipient or undergraduate with a 2.5 minimum GPA who is taking at least 3 classes per term.  Must have demonstrated community leadership through volunteer work at school or in the community.", sponsor: "NLHA Education Fund", amount: " varies ", state: "All", min_gpa: "2.50", contact: "financial.aid@example.edu", keywords: "", website: "https://nlhascholars.communityforce.com/Funds/Search.aspx", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-11-30 18:26:15", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
