    {id: 416, award_name: "Italian Catholic Federation College Scholarship", subject_area: "All fields", level: "HS Senior", deadline: "2019-03-15", other_req: "To apply, students must achieve a total cumulative GPA (3½ years) of at least 3.2 and meet one of the following:Are Roman Catholic and of Italian Descent and live within the Roman Catholic Dioceses of Arizona, California, Illinois and Nevada, only where Branches of the Federation are established; or, Are Roman Catholic but need not be of Italian Descent or live where Branches of the Federation are established if either Roman Catholic parent, guardian or grandparent is a member of the 'Italian Catholic Federation.'", sponsor: "Italian Catholic Federation", amount: " $400", state: "AZ; CA; IL; NV", min_gpa: "3.2", contact: "financial.aid@example.edu", keywords: "", website: "http://www.icf.org/scholarships/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-11-30 18:44:42", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 419, award_name: "Lighthouse Guild Scholarship", subject_area: "All fields", level: "Undergraduate; Graduate", deadline: "2019-03-31", other_req: "Our scholarships help legally blind young adults make a successful transition to college, support their post-graduate education, and facilitate career development. Scholarships are based on strong academic accomplishments and merit, and provide additional financial support to help students make a successful transition from high school to a college or university of their choice. Candidates are not required to demonstrate financial need. Provide proof of legal blindness; Provide proof of U.S. citizenship. ", sponsor: "National Association of Parents of Children with Visual Impairments", amount: " $ 10,000 ", state: "All", min_gpa: "None", contact: "financial.aid@example.edu", keywords: "", website: "http://www.lighthouseguild.org/programs-services/scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-11-01 18:24:28", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 422, award_name: "National Federation of the Blind Scholarship Program", subject_area: "All fields; Disability", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-03-31", other_req: " Must be legally blind in both eyes; Must be residing in the United States, the District of Columbia, or Puerto Rico; Must be pursuing or planning to pursue a full-time, postsecondary course of study in a degree program at a United States' institution; Must participate in the entire NFB national convention and in all scheduled scholarship program activities.  ", sponsor: "National Federation of the Blind ", amount: " varies ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.nfb.org/scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-10-23 18:08:04", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 423, award_name: "Women's Italian-American Civic League Scholarships", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-02-13", other_req: " Applicant must be of Italian ancestry and a graduate of a Utah high school.  The scholarship is awarded based on ACT/SAT scores, high school ability, and extracurricular activities.  Scholarships are awarded by both Men’s and Women’s Chapters of the Italian American Civic League. You are encouraged to apply for each chapter’s scholarship. However, one recipient may not receive both scholarships.", sponsor: "Women's Italian-American Civic League", amount: " varies  ", state: "UT", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://italianamericancivicleague.com/scholarships/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-01-11 18:48:00", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-10", updated_by: "walshm"},
    {id: 424, award_name: "Leo Adler Foundation Scholarships", subject_area: "All fields", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-04-01", other_req: " Graduate of North Powder High School in Union County, Oregon and all high schools in Baker County, Oregon. Full time students must enroll in a program at an accredited college, university, technical or trade school. The recipient must be enrolled in and complete at least 12 credit hours per term/semester (9 credit hours for graduate students) AND have maintained a 2.0 GPA each term/semester. ", sponsor: "Leo Adler Foundation", amount: "Varies", state: "OR", min_gpa: "2.00", contact: "financial.aid@example.edu", keywords: "", website: "http://leoadler.org/scholarships/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-02-12 22:54:48", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
