    {id: 427, award_name: "Desk and Derrick Educational Trust Scholarships", subject_area: "Engineering", level: "Undergraduate", deadline: "2019-04-01", other_req: " U. S. or Canadian citizen who has completed two years or is currently enrolled in the second year of undergraduate studies with a minimum 3.2 GPA.  Applicants must be pursuing a degree related to qualifying full-time employment in the petroleum, energy or allied industries, or research and development of alternative fuels and have financial need.", sponsor: "Desk and Derrick Educational Trust", amount: " varies ", state: "All", min_gpa: "3.20", contact: "financial.aid@example.edu", keywords: "", website: "http://theeducationaltrust.org/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-01-02 23:41:28", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 428, award_name: "FIRST Scholarship ", subject_area: "STEM field; science; technology; engineering; math", level: "HS Senior", deadline: "2019-04-01", other_req: "Be a newly entering University of Portland student for 2019-2020 academic year who has participated in the FIRST Robotics Competition in high school. Must be admitted to UP within a STEM (science, technology, engineering or math) major and have a 3.2 high school GPA and a minimum combined SAT score of 1170 or ACT score of 24. UP username is required for access to the application. Please contact the Office of Financial Aid if you do not know your username. Scholarship can be renewed each year as long as the student maintains a minimum cumulative college GPA of 2.7, is still a STEM major and is otherwise making satisfactory academic progress. ", sponsor: "University of Portland ", amount: " $ 3,000 renewable", state: "All", min_gpa: "3.2", contact: "financial.aid@example.edu", keywords: "", website: "https://qafederation.ngwebsolutions.com/idp/startSSO.ping?PartnerSpId=IdpUPortlandLDAP&TargetResource=https://dynamicforms.ngwebsolutions.com/ShowForm.aspx?RequestedDynamicFormTemplate=912f63e6-a2cc-4cdf-86d8-bd7ed3171d60", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-03-29 18:23:55", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "hobbsm"},
