    {id: 430, award_name: "Signet Classics Scholarship Essay Contest", subject_area: "All fields", level: "HS Senior", deadline: "2020-04-22", other_req: "Open to 11th and 12th grade full-time matriculated students who are attending high schools located in the fifty United States and the District of Columbia, or home-schooled students between the ages of 16-18 who are residents of the fifty United States and the District of Columbia.", sponsor: "Peguin Group Inc", amount: "$1,000", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://us.penguingroup.com/static/pages/services-academic/essayhome.html ", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-07-31 23:20:49", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-07-01", updated_by: "robertsm"},
    {id: 431, award_name: "Neil Churchill Memorial Scholarship", subject_area: "All fields", level: "Graduate", deadline: "2019-04-20", other_req: " Current resident of affordable housing (Section 8, Rent Supplement, Rental Assistance Payments, or Low Income Housing Tax Credit program), US citizen or legal permanent resident with a valid Social Security Number, student enrolling in or currently enrolled in graduate level course work. 3.0 minimum GPA requirement.  Applicant should demonstrate sound community leadership through volunteer work in the community or at college/university.", sponsor: "NLHA Education Fund", amount: " varies ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://nlhascholars.communityforce.com/Funds/Search.aspx", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-12-14 17:21:55", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "walshm"},
    {id: 432, award_name: "AFCEA STEM Major Scholarships", subject_area: "Computer Engineering; Computer Science; Electrical Engineering; Mathematics; Physics; Robotics Engineering; Statistics", level: "Undergraduate; Graduate", deadline: "2019-04-12", other_req: " Undergraduate candidates must be at least second-year college students enrolled as sophomores or juniors in four-year institutions at the time of application. A current overall GPA of 3.0 or higher on a 4.0 scale. Graduate-level candidates must currently be enrolled in their second semester, a current overall GPA of 3.5 or higher on a 4.0 scale in their current program at an accredited U.S. college or university required at the time of application. Applications will be accepted from current eligible undergraduate and graduate-level students majoring in STEM fields to include Cyber Security, Intelligence and Homeland Security-related disciplines.  Online programs are eligible.", sponsor: "AVAYA", amount: "Varies", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "https://www.afcea.org/site/?q=foundation/scholarships/stem-majors", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-01-24 18:19:00", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 433, award_name: "AFCEA War Veterans Scholarships - Military", subject_area: "STEM; Military Veteran", level: "Undergraduate", deadline: "2019-04-12", other_req: " U.S. citizen currently enrolled and attending a four-year accredited college or university in the United States as a sophomores or juniors at the time of application; Enrolled part time or full time in an eligible degree program; An overall 3.0 GPA is required; STEM fields. Served in Afghanistan and/or Iraq War (from 2003 to present).", sponsor: "AFCEA NOVA", amount: "$2,500", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.afcea.org/site/?q=foundation/scholarships/war-veterans", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-01-02 23:43:03", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 434, award_name: "The Gloria Barron Prize for Young Heroes", subject_area: "All fields", level: "HS Senior", deadline: "2019-04-15", other_req: "The Barron Prize welcomes applications from public-spirited young people who are, on our April 15 deadline:\r\nbetween the ages of 8 and 18 (not yet age 19)\r\npermanent residents of and currently residing in the U.S.A. or Canada\r\ncurrently working on an inspiring service project or have done so within the past 12 months\r\nworking as an individual to lead their service work. The Barron Prize does not accept applications from large groups of young people.\r\nThe Barron Prize does not discriminate against its applicants based on race, color, ethnicity, national origin, creed, religion, gender, sexual orientation, or disability.", sponsor: "T.A. Barron", amount: " $ 5,000 ", state: "All ", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.barronprize.org/how-apply", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-01-11 18:50:43", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-11", updated_by: "walshm"},
    {id: 436, award_name: "Senior Care Innovation Scholarship", subject_area: "Pre-Med; Nursing; Biology; Social Sciences", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-05-01", other_req: "The annual scholarship award is for five students enrolled in a certificate, associate’s degree, bachelor’s degree or graduate level program in a medical, nursing, social sciences or other related major which will prepare the student for a career in working with seniors. The student must be planning on pursuing a career that involves working with senior citizens. The applicant must also be attending classes at an accredited college or university at the time of application.", sponsor: "A Place For Mom", amount: " $ 2,000 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.aplaceformom.com/scholarship", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-02-12 22:56:41", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 442, award_name: "The Mikkelson Foundation Student Scholarship Program", subject_area: "Biology; Engineering; Math; Sciences", level: "HS Senior ", deadline: "2019-04-12", other_req: " The Mikkelson Foundation Scholarship is awarded to an outstanding graduate of a Colorado high school who has been accepted to pursue a course of study or instruction at an accredited college or university granting undergraduate and/or graduate degrees. Eligibility requirements for The Mikkelson Foundation Scholarship: The applicant must be graduating from a Colorado high school in 2018; The applicant will be studying engineering, mathematics, or the natural sciences at an accredited four year college or university; The applicant must have an unweighted GPA of at least 3.7; The applicant must have a cumulative SAT score of at least 1200 or a composite ACT score of at least 28.", sponsor: "The Mikkelson Foundation", amount: " $ 3,000 ", state: "CO", min_gpa: "3.70", contact: "financial.aid@example.edu", keywords: "", website: "http://mikkelsonfoundation.org/students.html#urstudents.html-1", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-11-30 18:45:25", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 444, award_name: "The Fountainhead Essay Contest ", subject_area: "All fields", level: "HS Senior", deadline: "2019-04-25", other_req: " Entrant must be in the 11th or 12th grade; Essay must be no fewer than 800 and no more than 1,600 words in length and double-spaced; One entry per student; Employees of the Ayn Rand Institute, its board of directors and their immediate family members are not eligible for this contest. Past first-place winners are not eligible for this contest.  ", sponsor: "Ayn Rand Education Foundation", amount: " varies ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://www.aynrand.org/students/essay-contests#rules", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-09-21 16:17:45", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 445, award_name: "Pointe Pest Control Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-04-29", other_req: " Applications for scholarship can be submitted by any high school senior or college freshman from the state of Oregon. Answer essay prompt on website.", sponsor: "Pointe Pest Control", amount: " $ 750 ", state: "OR", min_gpa: "", contact: "financial.aid@example.edu", keywords: "", website: "https://pointepest.com/oregon-scholarship-application/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-10-23 18:08:28", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 447, award_name: "Dr. Mitch Cohen Memorial Scholarship Fund", subject_area: "Pre-Medical; Sciences; Biology; Chemistry; Nursing", level: "HS Senior", deadline: "2019-04-30", other_req: " Be entering a medically related field of study in an accredited program. \r\nA graduating senior attending a school district in East Grays Harbor County including Elma High School, Montesano High School, East Grays Harbor High School or Olympic Christian Academy of McCleary.\r\nMust have a cumulative high school GPA of 3.0 or higher.", sponsor: "Summit Pacific Medical Centers", amount: " varies ", state: "WA", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: "", website: "https://summitpacificmedicalcenter.org/foundation/scholorship-program/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-10-23 18:16:24", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
