    {id: 454, award_name: "NCCF Cancer Survivor Scholarship Program", subject_area: "All fields", level: "HS Senior; Undergraduate; Graduate", deadline: "2019-05-15", other_req: " Eligibility: Applicants must meet all of the requirements listed below: Must be a cancer survivor or current patient; Must be between the ages of 18-35. An exception will be made if you are 17 and entering college in the fall following application; US citizen or permanent resident; Attending or planning to attend an accredited college, university or vocational institution in pursuit of an associate, bachelor, master’s, doctorate or certificate.  Applicants will be evaluated based on: displaying a \"will win\" attitude with respect to their cancer experience, quality of essay, financial need, overall story of cancer survivorship, commitment to education, and quality of recommendations.", sponsor: "National Collegiate Cancer Foundation", amount: " $ 1,000 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://collegiatecancer.org/scholarships/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-05-05 21:31:01", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 455, award_name: "American Legion Auxiliary Nursing Scholarships", subject_area: "Nursing; Military Family", level: "HS Senior; Undergraduate", deadline: "2019-05-01", other_req: " Be a child, grandchild or great-grandchild of a veteran who served in the Armed Forces during eligibility dates for membership in The American Legion (4/6/1917-11/11/1918, 12/7/1941-12/31/1946, 6/25/1950-1/31/1955, 2/28/1961-5/7/1975, 8/24/1982-7/31/1984, 12/20/1989-1/31/1990, 8/2/1990-present) who is a resident of Idaho. ", sponsor: "American Legion Auxiliary of Idaho", amount: " $ 1,000 ", state: "ID", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://idahoala.org/14301.html", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-11-30 18:46:05", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 458, award_name: "B. Davis Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate; ", deadline: "2020-05-22", other_req: " This Scholarship is available to all high school juniors and seniors as well as all students currently registered in any post secondary institution; There is no age restriction; Write an essay of less than 1000 words on topic on website.", sponsor: "Student Award Search Aid", amount: " $ 1,000 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.studentawardsearch.com/scholarships.htm", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-07-31 23:22:01", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 462, award_name: "Rover College Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-05-01", other_req: "You need to be a resident of the United States.\r\nYou must be a graduating high school senior or currently a freshman, sophomore, or junior in college. We reserve the right to verify date of high school graduation and/or college enrollment.\r\nIf you're a graduating high school senior, your GPA must be 3.0 or above.\r\nIf you're in college, your GPA must be 2.5 or above.\r\nYou can’t be related to anyone on the Rover staff, but you can be related to someone who's a pet sitter or dog walker on Rover.", sponsor: "Rover.com", amount: " $ 1,000 ", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: "", website: "http://www.rover.com/blog/rover-college-scholarship/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-11-30 18:46:24", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 463, award_name: "AAC's Behavioral Health Academic Scholarship", subject_area: "Psychology; Nursing; Social Work; Sciences", level: "Undergraduate; HS Senior; Graduate", deadline: "2019-04-30", other_req: " High school graduate; Open to full or part-time undergraduate or college graduate students; Must be entering or enrolled in behavioral health, nursing, counseling, psychology, social work, marriage/family therapy, or other program focusing on treating mental health and/or substance abuse issues.", sponsor: "America's Addiction Centers", amount: "Up to $5,000", state: "All", min_gpa: "None", contact: "financial.aid@example.edu", keywords: "", website: "http://americanaddictioncenters.org/behavioral-health-academic-scholarship/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2019-02-12 22:57:48", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "hobbsm"},
    {id: 465, award_name: "Betty Rendel Scholarship", subject_area: "Political Science; Economics", level: "Undergraduate", deadline: "2019-06-01", other_req: " The three annual scholarships are designed for college undergraduate women who are currently majoring in political science, government or economics. The recipients are chosen from applicants from across the nation. The scholarships are given to women who have successfully completed at least two years of college coursework and are U.S. Citizens. ", sponsor: "The National Federation of Republican Women", amount: " $ 1,000 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.nfrw.org/rendel", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:05", updated_at: "2018-10-18 22:36:27", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
