    {id: 505, award_name: "Candlelighters Higher Education Scholarship ", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-04-01", other_req: "Criteria includes: The applicant must be pursuing an undergraduate, technical or vocational education. The applicant must be a graduating high school senior or an enrolled post-secondary student at the time of application. If a high school senior, the applicant must have, at least, a 3.0 GPA. However, if the applicant has an I.E.P., or accommodations in place, then the required GPA is 2.0. If the applicant is currently attending a post-secondary school, the required GPA is 2.0. The applicant must have, or have had, cancer prior to age 21.\r\nThe applicant must be a member of Candlelighters For Children With Cancer and be a resident of Oregon or SW Washington.", sponsor: "Candlelighters Higher Education Scholarship Foundation", amount: "$2,500", state: "OR; WA", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: "", website: "https://www.candlelightersoregon.org/index.php/programs/teen", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:06", updated_at: "2019-02-15 00:16:52", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 510, award_name: "Pacific Northwest Grain and Feed Association Scholarship", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-04-02", other_req: " To qualify for these cash awards, applicants must be high school seniors, college freshmen and/or sophomores who have either been accepted, or are currently enrolled in a 2- or 4-year accredited college or university, and who are either working for, or have family members working with, the Pacific Northwest Grain and Feed industry.", sponsor: "Pacific Northwest Grain and Feed ", amount: "up to $2,000", state: "ID; OR; WA", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "https://www.pnwgfa.org/scholarship/", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:06", updated_at: "2019-02-15 00:19:13", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 511, award_name: "Promising Futures Scholarship Program", subject_area: "Business", level: "HS Senior; Undergraduate", deadline: "2019-04-19", other_req: " Oregon high school seniors planning to attend or college freshman currently registered as a full time student at an accredited Oregon community college, college or university; Student with a declared major compatible with school business management; Student who has been an Oregon resident for at least one year; Accepted for admission as a full time student (as defined by the recipient's attending school); Involvement in school/community activities; A minimum 3.0 overall GPA.", sponsor: "Oregon Association of School Business Officials", amount: " varies ", state: "OR", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: "", website: "http://www.oasbo.com/scholarship_program.htm", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:06", updated_at: "2019-04-18 21:44:21", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
