    {id: 514, award_name: "Cancer Survivors' Fund", subject_area: "All fields", level: "HS Senior; Undergraduate", deadline: "2019-03-01", other_req: " To be eligible, an applicant must satisfy the following requirements: The applicant must be a cancer survivor or currently diagnosed with cancer, and does not have to be receiving treatment to qualify; The applicant is enrolled in or accepted for enrollment in an accredited undergraduate school; The Fund requires the recipient of a scholarship to submit a copy of an acceptance letter from the college/university of their choice or a letter of good standing from the registrar; A letter from your attending physician verifying your medical history and current medical situation must also be submitted; The applicants must agree to do volunteer work to use their cancer experience to help other young cancer patients and survivors coping with a life threatening or life-altering event.", sponsor: "Yeshim Yonter", amount: " $1,000 ", state: "All", min_gpa: "None ", contact: "financial.aid@example.edu", keywords: "", website: "http://www.cancersurvivorsfund.org/ScholarshipEligibilityRequirements.htm", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:06", updated_at: "2019-02-15 00:20:29", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 516, award_name: "Association for Women in Sports Media Scholarship", subject_area: "Journalism; Female", level: "", deadline: "2018-10-15", other_req: "Female college students, who have completed one year of college and are interested in sports media careers.  Will be placed in a summer internship as well as receive a $1,000 scholarship and complimentary registration and lodging at AWSM's annual convention.  Interns will have the opportunity to work at places such as ESPN, CNN, the Golf Channel, USA Softball, PRO Sports Communications, USA TODAY Sports, Sports Illustrated and MLB.com. Internship hosts are subject to change each year.", sponsor: "AWSM", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: "", website: "http://awsmonline.org/internships-scholarships", opportunity_type: "Scholarship", created_at: "2016-02-17 21:00:06", updated_at: "2018-09-07 17:35:20", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
