    {id: 520, award_name: "American Society of Naval Engineers Scholarship", subject_area: "Engineering ", level: nil, deadline: "2019-03-04", other_req: "Undergraduate student applying for support for their final year of an engineering program who is interested in pursuing a career in naval engineering.  Eligible programs of study include naval architecture, marine engineering, ocean engineering, mechanical engineering, structural engineering, civil engineering, environmental engineering, electrical engineering, applied mathematics and physics.  Selection criteria includes academic record, work history, professional promise, interest in naval engineering, extracurricular activities and recommendations.  US citizenship is required and financial need may also be considered.", sponsor: "American Society of Naval Engineers ", amount: "$3,000", state: "All", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.navalengineers.org/students/scholarships/Pages/ASNELandingPage.aspx", opportunity_type: "Scholarship", created_at: "2016-02-19 19:03:57", updated_at: "2019-01-02 23:52:45", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
