    {id: 523, award_name: "Caldwell Western Heritage Foundation Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-20", other_req: "High school senior or current college student from southwestern Idaho or eastern Oregon with a 3.0 minimum GPA.  Must have shown an interest in farm, agriculture, or rodeo.", sponsor: "Caldwell Western Heritage Foundation", amount: "$2,000", state: "ID; OR", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.caldwellnightrodeo.com/p/about/westernheritagescholarship", opportunity_type: "Scholarship", created_at: "2016-02-23 20:33:39", updated_at: "2019-01-11 18:48:16", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-10", updated_by: "walshm"},
    {id: 524, award_name: "California Chafee Grant for Foster Youth", subject_area: "Foster Youth", level: nil, deadline: "2020-07-01", other_req: "Current or former foster youth who was a dependent or ward of the court, living in foster care, between the ages of 16 and 18 in California.  Cannot have reached your 22nd birthday as of July 1st of the award year.  Recipients must maintain satisfactory academic progress (SAP), be enrolled at least half time and demonstrate financial need.", sponsor: "California Student Aid Comission", amount: "$5,000", state: "CA", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.chafee.csac.ca.gov/", opportunity_type: "Scholarship", created_at: "2016-02-23 20:36:21", updated_at: "2019-07-17 21:53:32", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-07-01", updated_by: "robertsm"},
    {id: 525, award_name: "Charles, Lela and Mary Slough Foundation Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-01", other_req: "Texas resident who is a graduate of a Texas high school and is a US citizen with financial need.  Must not have exceeded more than 112 semester college credits.  Must have a 3.0 minimum GPA to renew and be enrolled full-time.", sponsor: "Charles, Lela and Mary Slough Foundation ", amount: "$5,000", state: "TX", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.midland.edu/enrollment-aid/paying-college/scholarships/slough.php", opportunity_type: "Scholarship", created_at: "2016-02-23 20:59:35", updated_at: "2018-12-14 17:44:28", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-20", updated_by: "walshm"},
    {id: 526, award_name: "CIA Undergraduate Scholarship Program", subject_area: "All fields", level: nil, deadline: "2019-07-31", other_req: "Student must work for the CIA for 1.5 times the period receiving scholarship (e.g. 2 years of scholarship = 3 years employment commitment) and must work in the Washington D.C. area on summer break (transportation and housing allowance provided).  Must be 18 years of age by date of application to scholarship program. \r\n Must be a US citizen with a 1000 SAT (new official score) or 1500 SAT (1000 math & critical reading, 500 writing) or 21 ACT score for high school students with a 3.0 minimum GPA for high school or college students.  Financial need as demonstrated by a household income ceiling of $70,000 for a family of 4 and $80,000 for a family of 5 or more, if you were not listed as a dependent on a tax return the previous year, the household ceiling income is $35,000.  Must meet the same employment standards as permanent employees, successfully completing both security and medical processing.", sponsor: "CIA", amount: "up to $18,000", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.cia.gov/careers/student-opportunities/undergraduate-scholarships.html", opportunity_type: "Scholarship", created_at: "2016-02-23 21:08:58", updated_at: "2019-04-18 21:47:06", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
