    {id: 531, award_name: "Dale Krueger Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-01", other_req: "High school senior or first time college student under the age of 21 at the time of application who will/has graduate/d from a  public high school in Gresham-Barlow, Reynolds or Centennial school district.  Financial need is considered.  Renewable when meets 2.0 or 2.5 GPA requirements depending on grade level.\r\n", sponsor: "Dale Krueger", amount: "varies", state: "OR", min_gpa: "2.00", contact: "financial.aid@example.edu", keywords: nil, website: "http://dalekruegerscholarship.com/dk/scholarship/", opportunity_type: "Scholarship", created_at: "2016-02-23 23:38:11", updated_at: "2019-01-02 23:53:02", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
