    {id: 536, award_name: "Edwards Lifesciences Scholarship", subject_area: "STEM field", level: nil, deadline: "2019-04-19", other_req: "Current high school senior residing in Orange County, CA or Salt Lake County, UT or be a child (or in the guardianship) of an Edwards Lifesciences employee who is a US citizen or legal resident with a 3.0  minimum GPA and financial need.  Scholarships are awarded based on academic record, demonstrated leadership and participation in school and community activities, honors, work experience, statement of goals and aspirations and unusual personal or family circumstances.\r\n", sponsor: "Edwards Lifesciences Foundation", amount: "$2,500", state: "CA; UT", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.edwards.com/aboutus/scholarship", opportunity_type: "Scholarship", created_at: "2016-02-24 18:39:50", updated_at: "2019-05-04 20:16:21", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-11", updated_by: "hobbsm"},
    {id: 537, award_name: "Wells Fargo Veterans Scholarship Program", subject_area: "Military Family", level: nil, deadline: "2019-02-28", other_req: "Must be an honorably-discharged veteran or spouse of a disabled veteran who has served in the U.S. military, including the Reserves and National Guard.  Must be Pell-eligible and have completed the FAFSA.  Must also use any military education benefit for which they are eligible.", sponsor: "Wells Fargo", amount: "Varies", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.scholarsapply.org/wellsfargoveterans/", opportunity_type: "Scholarship", created_at: "2016-02-24 18:48:31", updated_at: "2019-01-24 19:08:22", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-20", updated_by: "walshm"},
    {id: 539, award_name: "Far West Agribusiness Association Scholarship", subject_area: "All fields", level: nil, deadline: "2018-04-13", other_req: "Full-time students who are dependents of employees from Far West Agribusiness Association (FWAA) member companies (list on website) and are pursuing an undergraduate degree from a college or university in the United States are eligible to apply.es.\r\n", sponsor: "Far West Agribusiness Association", amount: "$1,000", state: "ID; OR; NV; UT; WA", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "http://fwaa.org/scholarships/", opportunity_type: "Scholarship", created_at: "2016-02-24 18:53:41", updated_at: "2019-05-05 20:27:03", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Not offered 19-20", respect_deadline: true, date_reopens: "2020-03-15", updated_by: "hobbsm"},
    {id: 543, award_name: "Aging Matters Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-15", other_req: "Must be attending (or plan to attend) full-time.  Applicant must meet one of 3 criteria: 1) Currently cares for an aging loved one, 2) works within the senior community, or 3) intends to pursue a career that will have an impact on the elder population.", sponsor: "SeniorCare.com", amount: "$1,500", state: "Any", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.seniorcare.com/scholarship/", opportunity_type: "Scholarship", created_at: "2016-02-24 19:39:58", updated_at: "2018-10-18 22:37:07", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 545, award_name: "Bay Alarm Medical Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-30", other_req: "Write a 500-1,000 word essay answering prompt on website regarding seniors.\r\nStudent must be involved in a community service effort/volunteer opportunity where you work with the elderly OR participate in caregiving duties for an elderly relative living in your home.", sponsor: "Bay Alarm Medical", amount: "up to $2,500", state: "All", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.bayalarmmedical.com/scholarship", opportunity_type: "Scholarship", created_at: "2016-02-24 19:48:23", updated_at: "2019-03-27 21:32:34", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
    {id: 546, award_name: "Regions Riding Forward Scholarship Essay Contest", subject_area: "All fields", level: nil, deadline: "2019-02-28", other_req: "Submit a 500 word or less essay about an African-American who has inspired and motivated you.", sponsor: "Regions", amount: "$3,500 - $5,000", state: "AL; AR; FL; GA; IA; IL; IN; KY; LA; MS; MO; NC; SC; TN; TX; VA", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.regions.com/ridingforward", opportunity_type: "Scholarship", created_at: "2016-02-24 19:53:16", updated_at: "2019-01-24 18:22:14", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 548, award_name: "General Henry H. Arnold Education Grant Program - Military", subject_area: "Military Family", level: nil, deadline: "2019-04-30", other_req: "Dependent or spouse of an Air Force member in one of the following categories: Active duty, Title 10 AGR/Reserve on extended active duty, Title 32 AGR performing active duty through December 1, 2019, retired due to length of active duty service or disability, retired AGR/Reserve with 20+ satisfactory service years creditable for retired pay, or deceased while on active duty or in retired status.  Will be a full-time college student in the next academic year with a minimum 2.0 GPA.\r\n", sponsor: "Air Force Aid Society", amount: "varies", state: "All", min_gpa: "2.00", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.afas.org/education-grants", opportunity_type: "Scholarship", created_at: "2016-02-24 20:52:22", updated_at: "2019-01-24 18:23:02", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 550, award_name: "George and Mary Josephine Hamman Foundation Scholarship", subject_area: "All fields", level: nil, deadline: "2018-02-15", other_req: "High school senior from the Houston, TX area (Brazoria, Chambers, Fort Bend, Galveston, Harris, Liberty, Montgomery or Waller Counties) who is a citizen of the US.  The scholarship is awarded based on academics and financial need. Renewable for all 4 years.\r\n", sponsor: "George and Mary Josephine Hamman Foundation ", amount: "$4,500", state: "TX", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "http://hammanfoundation.org/scholarship-guidelines/", opportunity_type: "Scholarship", created_at: "2016-02-24 21:01:12", updated_at: "2018-10-29 22:53:06", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 551, award_name: "Hadden Scholarships", subject_area: "All fields", level: nil, deadline: "2019-02-28", other_req: "High school senior who is a US citizen and is planning to attend a four-year US college or university.  Applicants must show a 3.5+ GPA and should have financial need.  In addition, the Foundation strongly encourages extra-curricular and community activities on the part of its applicants demonstrating a strong desire to help others.\r\n", sponsor: "Youth Foundation", amount: "Varies", state: "All ", min_gpa: "3.50", contact: "financial.aid@example.edu", keywords: nil, website: "http://fdnweb.org/youthfdn/grant-guidelines/", opportunity_type: "Scholarship", created_at: "2016-02-24 22:14:20", updated_at: "2019-01-24 19:08:34", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-20", updated_by: "walshm"},
    {id: 553, award_name: "Incight Scholarships", subject_area: "All fields", level: nil, deadline: "2019-04-01", other_req: "You must be a resident of Oregon or Washington. You must have a documented disability, this can be any type of disability as it is defined by the ADA, DSM-V, IDEA, or other governing body. You must maintain full-time enrollment throughout the academic year. If you receive an accommodation which defines full-time enrollment as less than 12 credit hours, Incight will accept your applications.\r\n", sponsor: "Incight", amount: "$500", state: "OR; WA", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.incight.org/scholarship", opportunity_type: "Scholarship", created_at: "2016-02-24 22:30:06", updated_at: "2019-02-15 00:28:53", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
