    {id: 557, award_name: "James Dodge Baseball Memorial Scholarship", subject_area: "All fields", level: nil, deadline: "2019-07-31", other_req: "High school senior from Idaho who is a baseball player and exhibits integrity, a strong work ethic, an independent spirit, and commitment.\r\n", sponsor: "James Dodge Memorial Scholarship Fund", amount: "Varies", state: "ID", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "http://jamesadodgememorial.com/application/", opportunity_type: "Scholarship", created_at: "2016-02-24 23:29:26", updated_at: "2019-05-06 23:18:15", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "hobbsm"},
    {id: 559, award_name: "Alaska Engineering Education Foundation Scholarship", subject_area: "Engineering", level: nil, deadline: "2019-01-18", other_req: "Alaska high school senior who wishes to pursue a degree in engineering.  Scholarships are awarded state-wide and at the regional level.", sponsor: "Alaska Engineering Education Foundation", amount: "$1,000", state: "AK", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "http://alaskaeef.org/scholarships/", opportunity_type: "Scholarship", created_at: "2016-02-25 00:22:46", updated_at: "2018-11-30 18:51:17", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 560, award_name: "At-Large High School Scholarship", subject_area: "Minority", level: nil, deadline: "2019-06-30", other_req: "Must be member of at least one of the eligible classes of recipients: 1) A Northern Alaska Inupiat Native of at least 1/4 blood quantum currently residing in the Arctic Slope Region OR 2) An original 1971 shareholder of the Arctic Slope Regional Corporation OR 3) A direct lineal descendant of an original 1971 shareholder of the Arctic Slope Regional Corporation.  You must also be at least 17 years old.  Two award opportunities: Anagi Leadership and Ivalu Scholarship.", sponsor: "Arctic Education Foundation", amount: "varies", state: "AK", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.arcticed.com/", opportunity_type: "Scholarship", created_at: "2016-02-25 00:27:36", updated_at: "2019-05-06 23:20:20", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "AEF 907-852-9404 or send an email to: arcticed@asrc.com", respect_deadline: true, date_reopens: "2020-03-15", updated_by: "hobbsm"},
    {id: 561, award_name: "Koniag Education Foundation", subject_area: "Minority", level: nil, deadline: "2019-03-15", other_req: "Alaskan Native shareholder or descendant (may be adopted) of the Koniag Region.", sponsor: "Koniag Education Foundation", amount: "Varies", state: "AK", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://koniageducation.org/find-scholarships/", opportunity_type: "Scholarship", created_at: "2016-02-25 00:29:45", updated_at: "2018-12-14 00:25:38", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "full for 1819 will offer again next year. ", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 562, award_name: "Oregon State Child Care Grant", subject_area: "All fields", level: nil, deadline: "2020-05-31", other_req: "Be an Oregon resident with a child or legal dependent age 12 and under in need of child care, or, if over age 12, who satisfies the requirements of special needs.  Be enrolled or accepted for enrollment as an undergraduate at an Oregon postsecondary institution.  May not be in default on any federal Title IV loan or owing a refund on federal Title IV funds previously disbursed.", sponsor: "Office of Student Access and Completion (OSAC)", amount: "Varies", state: "OR", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.oregonstudentaid.gov/child-care-grant.aspx", opportunity_type: "Scholarship", created_at: "2016-02-25 18:14:13", updated_at: "2019-01-24 18:23:20", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 563, award_name: "Deceased or Disabled Public Safety Officer Grant Program", subject_area: "All fields", level: nil, deadline: "2020-08-01", other_req: "Must be an Oregon resident who is or will be enrolled full-time as an undergraduate student at an Oregon university.  Applicants for awards must be a dependent (child or stepchild) of a public safety officer in the state of Oregon, as defined by ORS 237.610, who was killed or disabled in the line of duty.  Must be under 25 years of age at the time of submitting the application and not have a prior baccalaureate degree.", sponsor: "Office of Student Access and Completion (OSAC)", amount: "varies", state: "OR", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.oregonstudentaid.gov/ddpso-grant.aspx", opportunity_type: "Scholarship", created_at: "2016-02-25 18:19:19", updated_at: "2019-08-01 16:51:16", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 564, award_name: "Oregonians Credit Union College Scholarship Program", subject_area: "All fields", level: nil, deadline: "2019-05-31", other_req: "You must be a current member of Oregonians Credit Union and either planning to enroll or already enrolled as a full-time student.", sponsor: "Oregonians Credit Union", amount: "$1,000", state: "OR", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.oregonianscu.com/scholarship/index.htm", opportunity_type: "Scholarship", created_at: "2016-02-25 18:22:19", updated_at: "2019-03-27 21:33:28", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
    {id: 566, award_name: "Greenfield Peace Writing Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-04", other_req: "Oregon high school student (11th or 12th grade) submitting an original essay, poem, or narrative work (maximum 600 words) in response to prompt on website.", sponsor: "Oregon Physicians for Social Responsibility", amount: "up to $1,000", state: "OR", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.oregonpsr.org/greenfield_peace_writing_scholarship", opportunity_type: "Scholarship", created_at: "2016-02-25 18:32:01", updated_at: "2019-01-24 18:23:41", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 567, award_name: "Arizona Education and Training Voucher (ETV) Program", subject_area: "Foster Youth", level: nil, deadline: "2019-08-30", other_req: "Current or former foster youth who: was in foster care on or after your 16th birthday, OR was adopted from foster care with the adoption finalized after your 16th birthday.  Your personal assets (bank account, home, etc.) cannot be over $10,000.  Funding for program is limited and available on a first-come, first-served basis to eligible students.", sponsor: "Federal government", amount: "$5,000", state: "AZ", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.fc2sprograms.org/arizona/", opportunity_type: "Scholarship", created_at: "2016-02-25 18:40:52", updated_at: "2018-08-29 22:56:09", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 568, award_name: "Lowell Kalapa Scholarship Program", subject_area: "All fields", level: nil, deadline: "2019-03-31", other_req: "All students (new or continuing) who are members or dependents of members of Hawaii State Federal Credit Union, who are planning on attending an accredited University or College full time.\r\n", sponsor: "Hawaii State Federal Credit Union", amount: "$1,000", state: "HI", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.hawaiistatefcu.com/member-resources/scholarship", opportunity_type: "Scholarship", created_at: "2016-02-25 23:08:17", updated_at: "2019-01-02 23:54:04", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 569, award_name: "Make A Difference Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-16", other_req: "Customer in good standing (current or within the past two years) of Rent-A-Center, or spouse or dependent child living in the customer’s household, or dependent child, 25 or younger of a Rent-A-Center employee.  Must be studying to obtain their first bachelor’s degree (current student or high school senior) with a 2.0 minimum GPA.  Scholarship is awarded based on academic record, demonstrated leadership and participation in school and community activities, honors, work experience, statement of goals and aspirations and unusual personal or family circumstances.  Financial need is not considered.\r\n", sponsor: "Rent-A-Center, Inc.", amount: "$1,000", state: "All", min_gpa: "2.00", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.scholarsapply.org/makeadifference/", opportunity_type: "Scholarship", created_at: "2016-02-25 23:11:01", updated_at: "2019-03-27 21:34:39", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
    {id: 570, award_name: "Mas Family Cuban Scholarships", subject_area: "Business; Communications; Economics; Engineering; Journalism; Minority", level: nil, deadline: "2018-12-15", other_req: "Student was born in Cuba or is of direct Cuban descent with a 3.5 minimum GPA and is financially needy.  Scholarships are awarded based on the applicant’s academic performance, leadership qualities, potential to contribute to the advancement of a free society, and the likelihood of success in their chosen career.\r\n", sponsor: "Mas Family ", amount: "$8,000", state: "All", min_gpa: "3.50", contact: "financial.aid@example.edu", keywords: nil, website: "http://masscholarships.org/#requirements", opportunity_type: "Scholarship", created_at: "2016-02-25 23:50:04", updated_at: "2018-10-18 22:38:40", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 572, award_name: "MG James Ursano Scholarship Program", subject_area: "Military Family", level: nil, deadline: "2019-04-01", other_req: "Student must be pursuing their first undergraduate degree and be enrolled full time as an undergraduate student for the entire academic year at a school accredited by the U.S. Department of Education. (Because financial need is already met, students attending service academies are not eligible.). Student must maintain a cumulative GPA of 2.0 on a 4.0 scale; Student must be a dependent of a Soldier on federal active duty, a retired Soldier, or a deceased active or deceased retired Soldier.\r\n", sponsor: "Army Emergency Relief", amount: "varies", state: "All", min_gpa: "2.00", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.aerhq.org/Apply-for-Scholarship/Dependent-Children", opportunity_type: "Scholarship", created_at: "2016-02-25 23:57:26", updated_at: "2019-01-24 18:59:58", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-04", updated_by: "walshm"},
    {id: 573, award_name: "NAWIC Scholarship Boise Chapter", subject_area: "Business; Engineering; Technology", level: nil, deadline: "2019-04-30", other_req: "Current full-time college student enrolled in a construction-related degree program who is an Idaho resident.  NAWIC members and their immediate family members are not eligible.  3.0 minimum GPA required.\r\n", sponsor: "National Association of Women in Construction", amount: "varies", state: "ID", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: nil, website: "https://nawicboise.org/scholarship-application/", opportunity_type: "Scholarship", created_at: "2016-02-26 00:23:25", updated_at: "2019-04-18 21:48:03", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
    {id: 574, award_name: "Pfund Scholarship (LGBTQIA)", subject_area: "All fields", level: nil, deadline: "2019-01-15", other_req: "As the regional lesbian, gay, bisexual, transgender, queer, intersex, Two-Spirit and allied grassroots community foundation serving the upper Midwest, PFund Foundation recognizes that dedicated, connected, and supported generations of LGBTQIA leaders are central to the resilience and health of our communities. Our scholars embody both courage and commitment to advancing change.  In order to qualify, applicants should meet one or more the following requirements:\r\n\r\n• Applicants must identify as LGBTQI or allies strongly invested in LGBTQI communities\r\n• Applicants may NOT be a current PFund Foundation staff or board member\r\n• Applicants must live or attend scholastic programs in Iowa, Minnesota, North Dakota, South Dakota, or Wisconsin\r\n• Applicants must be 17 years of age or older.", sponsor: "Pfund Foundation", amount: "Varies", state: "IA; MN; ND; SD; WI", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "http://pfundfoundation.org/our-grantmaking/apply-for-a-pfund-scholarship/", opportunity_type: "Scholarship", created_at: "2016-02-26 19:33:06", updated_at: "2018-11-13 21:55:37", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-15", updated_by: "walshm"},
    {id: 575, award_name: "Public Employee Memorial Scholarship Fund", subject_area: "All fields", level: nil, deadline: "2019-03-15", other_req: "Children and spouses of local and state government employees who have died in the line of duty may apply for the ICMA-RC Public Employee Memorial Scholarship Fund. The applicant must provide a letter from the deceased employee's place of work. The applicant must currently attend or plan to attend school full-time at an accredited two-year community college, four-year accredited university, or vocational school at the time of application. Study can be at the undergraduate, graduate, or technical level. Awards are granted without regard to race, color, creed, religion, age, gender, disability, or national origin.\r\n", sponsor: "ICMA- RC", amount: "varies", state: "All", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.icmarc.org/prebuilt/micro/vantagescholar/apply.html", opportunity_type: "Scholarship", created_at: "2016-02-26 20:24:16", updated_at: "2018-12-14 17:25:56", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "walshm"},
    {id: 577, award_name: "Women's Overseas Service League Scholarships", subject_area: "All fields", level: nil, deadline: "2019-03-01", other_req: "Are committed to advancement in military or other public service careers; Have demonstrated such commitment through life experiences; Have successfully completed a minimum of 12 semester (or 18 quarter) hours of study in any institution of higher education with a minimum 2.5 grade point average; Are admitted for study in an institution of higher learning in a program leading to an academic degree (Associate Degree or higher). The program may be professional or technical in nature; Agree to enroll for a minimum of six semester (or nine quarter) hours of study each academic period. Agree to maintain academic standards.\r\n", sponsor: "Women's Overseas Service League ", amount: "$500 - $1,000 (renewable)", state: "All", min_gpa: "2.50", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.wosl.org/scholarships.htm", opportunity_type: "Scholarship", created_at: "2016-02-26 20:36:46", updated_at: "2018-12-14 17:26:37", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "walshm"},
    {id: 578, award_name: "The Alert Scholarship", subject_area: "All fields", level: nil, deadline: "2020-07-01", other_req: "High school senior from Alaska, Colorado, Idaho, Minnesota, Montana, North Dakota, Oregon, South Dakota, Washington or Wyoming with a 2.5 or higher GPA.  Submit an essay about a personal encounter you or someone you know has had with drug and/or alcohol abuse.  Winning essays from each region will be published in their magazine. There is no deadline, awards are made on an ongoing basis.\r\n", sponsor: "ALERT: The Drug & Alcohol Abuse Prevention Magazine", amount: "$500", state: "AK; CO; ID; MN; MT; NE; ND; OR; SD; WA; WY", min_gpa: "2.50", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.alertmagazine.org/scholarship.php", opportunity_type: "Scholarship", created_at: "2016-02-29 23:41:16", updated_at: "2019-07-17 21:56:04", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "There is no deadline, awards are made on an ongoing basis.", respect_deadline: true, date_reopens: "2020-07-01", updated_by: "robertsm"},
    {id: 579, award_name: "Stokes Educational Scholarship Program", subject_area: "Computer Science; Electrical Engineering", level: nil, deadline: "2018-10-31", other_req: "High school senior who is a US citizen with a minimum 3.0 GPA and a minimum 1200 SAT (600 Evidence-Based Reading and Writing, 600 math) or ACT of 25 with demonstrated leadership abilities.  Must be planning to major in computer science or electrical engineering.  With the Stokes Educational Scholarship Program, you will attend college full-time, receive up to $30,000 per year for tuition and mandatory fees, and work during the summer at NSA for 12 weeks in areas that are related to your course of study.  You’ll acquire real-world experience and receive a year-round salary.  You must maintain a 3.0 GPA after your freshman year.  You are also required to work in your area of study for NSA after your college graduation for at least 1 ½ times the length of your study.  If you leave NSA employment earlier, you must reimburse the government for your tuition.\r\n", sponsor: "NSA", amount: "up to $30,000", state: "All", min_gpa: "3.000", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.intelligencecareers.gov/icstudents.html?Agency=NSA", opportunity_type: "Scholarship", created_at: "2016-02-29 23:57:48", updated_at: "2018-10-01 22:04:09", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 580, award_name: "SEG Scholarships", subject_area: "Environmental Science; Geology; Physics; Science; Mathematics; Engineering; Computer Science", level: nil, deadline: "2019-03-01", other_req: "Will be enrolled as an undergraduate or higher in the fall in a program of study that focuses on geosciences or related sciences (such as physics, math, engineering, computer science) and your academic record shows you're an above average student.\r\n", sponsor: "Society of Exploration Geophysicists", amount: "Varies", state: "All", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "http://seg.org/Scholarships", opportunity_type: "Scholarship", created_at: "2016-03-01 00:13:36", updated_at: "2018-10-18 22:38:17", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 581, award_name: "Scholarship America Dream Award", subject_area: "All fields", level: nil, deadline: "2018-10-15", other_req: "Be at least 17 years of age.\r\nBe U.S. citizens, U.S. permanent residents (holders of a Permanent Resident card), or individuals granted deferred action status under the Deferred Action for Childhood Arrivals program (DACA).\r\nHave received a high school diploma or the equivalent from a U.S. school by September 2018.\r\nHave completed or expect to successfully complete a minimum of one full year of postsecondary education by June 2019.\r\nPlan to enroll in full-time undergraduate study at the sophomore year level or higher at an accredited two- or four-year college, university or vocational-technical school in the United States for the entire 2019-20 academic year.\r\nBe studying to obtain an associate's or first bachelor's degree.\r\nHave a minimum cumulative grade point average of 3.0 on a 4.0 scale (or its equivalent).\r\nDemonstrate financial need.", sponsor: "Scholarship America", amount: "$5,000", state: "All", min_gpa: "3.00", contact: "financial.aid@example.edu", keywords: nil, website: "https://scholarshipamerica.org/dreamaward/", opportunity_type: "Scholarship", created_at: "2016-03-01 00:17:05", updated_at: "2018-08-29 22:58:15", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 582, award_name: "San Antonio Area Scholarship Foundation", subject_area: "All fields", level: nil, deadline: "2019-02-15", other_req: "Scholarships for students from the San Antonio, TX area; Other criteria varies depending on scholarship. \r\n", sponsor: "San Antonio Area Foundation", amount: "varies", state: "TX", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.saafdn.org/Scholarships/ApplyforaScholarship.aspx", opportunity_type: "Scholarship", created_at: "2016-03-01 00:22:42", updated_at: "2018-12-21 19:23:02", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 583, award_name: "Richard G. Cortez Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-01", other_req: "High school senior or continuing college student (undergraduate or graduate) from Idaho of Hispanic descent with a 2.5 minimum GPA.  Recipient must enroll full-time in the fall semester.   Recipients will be selected based on academic performance, essay, extracurricular/work activities which reflect leadership, initiative, motivation, etc., and recommendations.  Award recipient must volunteer during the annual golf tournament in the summer.\r\n", sponsor: "Hispanic Business Association", amount: "varies", state: "ID", min_gpa: "2.50", contact: "financial.aid@example.edu", keywords: nil, website: "http://jalapenoopen.com/hba-home/scholarship-application/", opportunity_type: "Scholarship", created_at: "2016-03-01 00:30:13", updated_at: "2019-01-24 18:24:17", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 588, award_name: "National Health Service Corps Scholarship", subject_area: "Nursing; Dental", level: nil, deadline: "2018-05-10", other_req: "You can apply to the Scholarship Program if you are committed to primary care and accepted to or enrolled in an accredited U.S. school in one of the following primary care disciplines: Physicians (MD or DO); Dentists; Nurse Practitioners; Certified Nurse-Midwives; Physician Assistants. The scholarship pays tuition, fees, other educational costs, and provides a living stipend in return for a commitment to work at least 2 years at an NHSC-approved site in a medically under served community. For each year of financial support (up to four years), the student agrees to serve one year (minimum two years) at an NHSC-approved site in a high-need urban, rural, or frontier community across the nation.", sponsor: "US Department of Health and Human Services", amount: "Full Need", state: "All", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "https://nhsc.hrsa.gov/scholarships/", opportunity_type: "Scholarship", created_at: "2016-03-04 20:26:37", updated_at: "2019-05-30 21:50:18", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-05", updated_by: "robertsm"},
    {id: 595, award_name: "ABC Humane Wildlife Control & Prevention, Inc.’s Academic Scholarship", subject_area: "STEM field", level: nil, deadline: "2019-07-01", other_req: "Scholarship is for women in STEM fields. To apply for the scholarship, applicant must be a student currently enrolled at a college or university recognized by the U.S. Department of Education in the United States. Applicants must be studying or planning to study the fields of science (excluding social sciences i.e. economics), engineering, mathematics, or technology.", sponsor: "ABC Humane Wildlife Control & Prevention, Inc.", amount: "$1,000", state: "All", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "http://abcwildlife.com/abc-humane-wildlife-control-prevention-inc-s-academic-scholarship", opportunity_type: "Scholarship", created_at: "2016-03-04 21:16:31", updated_at: "2018-10-29 22:54:50", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 596, award_name: "Fulbright U.S. Student Program", subject_area: "All fields; International Experience", level: nil, deadline: "2019-10-08", other_req: "INSTITUTIONAL ENDORSEMENT REQUIRED - Contact scholars@up.edu immediately if you are interested in applying for this award, as there may be an on-campus deadline prior to the posted deadline. The Fulbright U.S. Student Program provides grants to spend a year abroad after college graduation to do research, attend graduate-level courses, or teach English abroad. Must be a U.S. citizen at the time of application and must have a bachelor-level degree before the grant starts.", sponsor: "U.S. State Department", amount: "Varies", state: "All", min_gpa: "None", contact: "scholars@up.edu", keywords: nil, website: "http://us.fulbrightonline.org", opportunity_type: "Scholarship", created_at: "2016-03-11 22:53:40", updated_at: "2019-05-29 20:42:54", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "hobbsm"},
    {id: 597, award_name: "Cobell Scholarship", subject_area: "Minority", level: nil, deadline: "2019-03-31", other_req: "The Cobell Scholarship is available to any full-time and degree-seeking American Indian or Alaskan Native student pursuing a vocational certificate or diploma, associate's, bachelor's, master's, doctoral, professional degree or certificate.  All applicants must demonstrate an unmet financial need. Criteria and deadline vary based on scholarship.", sponsor: "Indigenous Education, Inc.", amount: "Varies", state: "All", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "http://cobellscholar.org/", opportunity_type: "Scholarship", created_at: "2016-03-23 15:51:56", updated_at: "2019-01-02 23:56:39", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 603, award_name: "Dr. Arnita Young Boswell Scholarship", subject_area: "Minority", level: nil, deadline: "2019-02-28", other_req: "The purpose of this scholarship is to recognize and honor African-American female and male students who have demonstrated academic excellence, concern for their community and the Black family, and a desire to continue their studies to completion.  The required factors may be demonstrated through participation in religious, community high school/college, and political activities.", sponsor: "National Hook-Up of Black Women, Inc.", amount: "Varies", state: "All", min_gpa: "2.75", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.nhbwinc.com/scholarship.html", opportunity_type: "Scholarship", created_at: "2016-03-29 15:40:44", updated_at: "2019-01-02 23:56:57", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 607, award_name: "DutchCrafters Amish Furniture Heritage Scholarship", subject_area: "All Fields", level: nil, deadline: "2019-05-01", other_req: "Must apply for federal financial aid (file a FAFSA).  Students from all disciplines and fields of study are invited to apply.  Scholarship recipients are selected based on the following factors: academic achievement and financial aid; GPA of 3.0 or higher; and the essay component of the application.  All scholarship recipients may be subject to a criminal background check.  Recipients shall not commit any act that indicates dishonesty or moral turpitude or that otherwise could materially injure the DutchCrafters reputation.", sponsor: "DutchCrafters Amish Furniture", amount: "$500", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.dutchcrafters.com/heritage-scholarship", opportunity_type: "Scholarship", created_at: "2016-03-29 16:28:28", updated_at: "2019-04-18 21:49:16", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 609, award_name: "The Herbert Lehman Education Fund Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-01", other_req: "Graduating high school senior, first year college student, or a student transferring into an accredited four year college are eligible to apply.  Applicants should have financial need, a record of academic achievement, and a demonstrated commitment to public service.  The mission of the Herbert Lehman Fund is to help transform the promise of racial equality into a social, economic and political reality for all people by supporting talented undergraduate students who need financial help to stay in school and successfully complete their bachelor's degree.", sponsor: "NAACP Legal Defense and Educational Fund", amount: "$2,000", state: "All", min_gpa: "None", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.naacpldf.org/herbert-lehman-education-fund-scholarship", opportunity_type: "Scholarship", created_at: "2016-03-29 16:47:40", updated_at: "2018-12-14 17:27:18", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "walshm"},
    {id: 614, award_name: "President's Scholarship in Honor of Lisa Beedon", subject_area: "Business", level: nil, deadline: "2018-05-15", other_req: "Female, U.S. citizen who will be at least a college junior in the fall term and studying business. Only the first 100 applications will be considered.", sponsor: "Stephen Bufton Memorial Educational Fund", amount: "$10,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.sbmef.org/Site/Scholarships.cfm", opportunity_type: "Scholarship", created_at: "2016-03-31 16:29:54", updated_at: "2019-04-18 21:51:44", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "Not offered when checked 4/2019", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "hobbsm"},
    {id: 619, award_name: "PA BPW Foundation Scholarship", subject_area: "Business", level: nil, deadline: "2019-11-01", other_req: "Must be a PA resident for the prior 2 years and accepted into a program offered by an accredited post high school education institution.  Financial need is required.", sponsor: "Business and Professional Women of Pennsylvania", amount: "Varies", state: "PA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.bpwpa.org/PA-BPW-FOUNDATION-SCHOLARSHIP-APPLICATION", opportunity_type: "Scholarship", created_at: "2016-04-28 17:14:20", updated_at: "2019-07-17 21:57:43", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "May 1st and November 1st deadline", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "robertsm"},
    {id: 620, award_name: "Business and Professional Women of North Carolina", subject_area: "All Fields", level: nil, deadline: "2019-04-15", other_req: "Female student in good academic standing with a 2.5 or higher GPA.  Applicant must be a US citizen and a resident of North Carolina.  Applicant should have a career plan after completion of schooling and provide a summary of career goals, previous honors or community activities and justify a need for the scholarship.", sponsor: "North Carolina Business and Professional Women's Foundation", amount: "up to $1,500", state: "NC", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://bpw-nc.org/details_about_each_scholarship", opportunity_type: "Scholarship", created_at: "2016-04-28 17:18:25", updated_at: "2019-05-05 20:27:59", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 622, award_name: "Florence A. Finlayson Scholarship", subject_area: "Business", level: nil, deadline: "2019-06-15", other_req: "Be a resident of Maryland majoring in Business with at least a 2.5 GPA and financial need.", sponsor: "Business and Professional Women of Maryland", amount: "$525", state: "MD", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.bpwmaryland.org/scholarship_finlayson.asp", opportunity_type: "Scholarship", created_at: "2016-04-28 17:27:16", updated_at: "2019-05-30 20:58:32", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 623, award_name: "Business and Professional Women of Iowa Foundation Educational Scholarship Program", subject_area: "All fields", level: nil, deadline: "2019-03-29", other_req: "Non-traditional student (graduated high school 5 or more years ago) who now wants to start or resume a college education.  Resident of Iowa with demonstrated financial need, scholastic ability, leadership skills and career goals.", sponsor: "Business and Professional Women of Iowa Foundation", amount: "$1,000", state: "IA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.bpw-iowa.org/bpw-iowa-foundation-scholarship", opportunity_type: "Scholarship", created_at: "2016-04-28 17:38:08", updated_at: "2019-02-23 00:23:16", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 625, award_name: "Brower Youth Award for Environmental Leadership", subject_area: "All Fields", level: nil, deadline: "2019-05-01", other_req: "Youth environmental change leaders ages 13 to 22 (as of July 1, 2019) living in North America (including Mexico, Canada, some Caribbean Islands) and US “Territories” are encouraged to apply.", sponsor: "Earth Island Institue", amount: "$3,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.broweryouthawards.org/apply/", opportunity_type: "Scholarship", created_at: "2016-05-04 15:59:54", updated_at: "2019-02-23 00:26:04", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 626, award_name: "Cameron Impact Scholarship", subject_area: "All fields", level: nil, deadline: "2019-09-13", other_req: "High school senior who is a motivated leader with a strong work ethic and social acumen.  Scholars rise to the occasion and are both candid and confident.  Demonstrate active participation in community service and in civic-minded arenas, exhibiting an appreciation for the world outside themselves and a belief in their own capacity to effect change on scales both large and small.  Excel in a broad variety of extracurricular activities.  This includes but is not limited to; athletics, academic clubs, music lessons, performance art, and philanthropic organizations.", sponsor: "The Bryan Cameron Education Foundation", amount: "Full tuition, fees, books", state: "All", min_gpa: "3.7", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.bryancameroneducationfoundation.org/home", opportunity_type: "Scholarship", created_at: "2016-05-04 16:08:21", updated_at: "2019-04-18 21:53:57", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 627, award_name: "Live Mas Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-21", other_req: "This scholarship is for the innovators, creators and dreamers who want to share their passion and receive support to pursue this passion through a higher education outlet. The scholarship is not need or obstacle based; it is a passion based scholarship program.  You must be between 16 and 24 and be willing to work with the Taco Bell Foundation through the award process.", sponsor: "Taco Bell Foundation", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.livemasscholarship.com/#home", opportunity_type: "Scholarship", created_at: "2016-05-04 16:26:21", updated_at: "2019-01-24 18:24:36", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 631, award_name: "The Against The Grain Artistic Scholarship", subject_area: "Performing arts; Journalism; Communications; Music; Drama; Minority", level: nil, deadline: "2019-05-06", other_req: "Must be of at least 50% Asian and/or Pacific Islander ethnicity.  Have demonstrated leadership abilities through participation in community service, extracurricular, or other activities.  Majoring in the visual/performing arts (film, theater, fashion, photography, graphic design, dance, music, journalism, mass communications, etc.)  Applications are judged in the following categories: quality of content submission, academic performance, leadership/community service experience and contribution, letters of recommendation, and phone/in-person committee interview.", sponsor: "Against the Grain", amount: "$1000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.againstthegrainproductions.com/atg-artistic-scholarship/", opportunity_type: "Scholarship", created_at: "2016-05-04 16:48:48", updated_at: "2019-03-27 22:46:58", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 632, award_name: "Groundbreaker Leadership Scholarship", subject_area: "Minority", level: nil, deadline: "2019-05-06", other_req: "Must be of at least 50% Asian and/or Pacific Islander ethnicity.  Must be either a high school senior or a college student who will be enrolled for the upcoming academic calendar.  Have demonstrated visionary leadership abilities through innovative means that is blazing a trail for others to follow and changing lives in the Asian American community.", sponsor: "Against the Grain", amount: "$1,500", state: "All", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.againstthegrainproductions.com/groundbreaker-leadership-scholarship/", opportunity_type: "Scholarship", created_at: "2016-05-04 16:52:44", updated_at: "2019-03-27 22:46:04", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 635, award_name: "Leavitt Machinery Scholarship", subject_area: "All fields", level: nil, deadline: "2019-05-31", other_req: "Must be a US or Canadian resident who is either currently enrolled or expects to be enrolled in a degree program (2 years in length or greater) by September.", sponsor: "Leavitt", amount: "$500", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.forklifttraininginseattle.com/apply.php", opportunity_type: "Scholarship", created_at: "2016-05-04 17:03:12", updated_at: "2019-01-02 23:57:19", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 636, award_name: "The Stephen Phillips Memorial Scholarship", subject_area: "All fields", level: nil, deadline: "2019-05-01", other_req: "A scholarship for permanent residents of New England states, with financial need, who display academic achievement, a commitment to serving others, a strong work ethic and leadership qualities.", sponsor: "The Stephen Phillips Memorial Scholarship Fund", amount: "Varies (renewable)", state: "CT; MA; ME; NH; RI; VT", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://phillips-scholarship.org/new-applicants/", opportunity_type: "Scholarship", created_at: "2016-05-04 17:12:13", updated_at: "2019-01-02 23:57:36", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 637, award_name: "Jane Austen Essay Contest", subject_area: "All fields", level: nil, deadline: "2019-06-03", other_req: "Students interested in the life and works of Jane Austen are encouraged to enter.  The Essay Contest is open to students world-wide and students must be enrolled at least part-time (six credits per term as an undergraduate or 3 as a graduate).", sponsor: "Jane Austen Society of North America", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.jasna.org/essaycontest/index.html", opportunity_type: "Scholarship", created_at: "2016-05-04 17:16:27", updated_at: "2019-01-02 23:57:53", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 638, award_name: "CHCI - United Health Foundation Scholar Intern Program", subject_area: "Nursing; Primary Care Health", level: nil, deadline: "2019-05-13", other_req: "Applicants must be U.S. citizens, lawful permanent residents, or individuals who are lawfully authorized to work (DACA must posses an Employment Authorization Document at time of application).  Full-time enrollment in a Bachelor's or Graduate/Professional degree program that will lead to a career as a primary care health professional.  Demonstrate financial need and consistent, active participation in public and/or community service activities.  During the first year of their scholarship, scholar-interns must complete a paid internship experience. Students are required to secure their own placement at a local community-based health organization. Upon completion of 80 hours of internship work, scholars receive a $1,000 stipend in addition to their scholarship.", sponsor: "Congressional Hispanic Caucus Institute", amount: "$7,000 (renewable)", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://chci.org/programs/chci-united-health-foundation-scholar-intern-program/", opportunity_type: "Scholarship", created_at: "2016-05-04 17:41:24", updated_at: "2019-05-06 23:23:04", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 640, award_name: "Bella Ballroom Excellence in Performing Arts Scholarship", subject_area: "Music, Performing Arts, Theater", level: nil, deadline: "2019-11-15", other_req: "In order to further Bella Ballroom’s mission to provide opportunities to young, emerging artists, we are proud to sponsor an annual scholarship contest. This contest is open to current U.S. undergraduate students. The winner will receive a one-time $1,000 scholarship.\r\nTo Be Eligible to Apply: Must be currently enrolled with an accredited U.S. college, university, or trade school; Must be a current undergraduate majoring in dance, theater, music, performing arts or related field; Must have a minimum GPA of 3.0. Applicants must submit a video showcasing their talents in the performing arts. Videos must be no longer than 2 minutes. Professional videos are not required, but videos should have clear audio and visuals of the performance. ", sponsor: "Bella Ballroom Dance Studio", amount: "$1,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://bellaballroom.com/scholarship/", opportunity_type: "Scholarship", created_at: "2016-05-04 17:47:06", updated_at: "2019-02-26 22:25:28", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 642, award_name: "Gen and Kelly Tanabe Scholarship", subject_area: "All fields", level: nil, deadline: "2019-07-31", other_req: "This scholarship is open to any current high school student, college student, graduate school student or returning adult student. Applicants must be permanent residents of the United States. Currently in school or planning to start school within the next 12 months.", sponsor: "Gen and Kelly Tanabe", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.genkellyscholarship.com/index.html", opportunity_type: "Scholarship", created_at: "2016-05-04 17:52:02", updated_at: "2019-01-24 18:25:00", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-08-15", updated_by: "walshm"},
    {id: 643, award_name: "Hispanic Scholarship Fund ", subject_area: "Minority; Hispanic; STEM; All fields", level: nil, deadline: "2020-02-15", other_req: "Must be of Hispanic Heritage, a US Citizen, permanent legal resident, DACA or eligible Non-Citizen (as defined by FAFSA).  High school students must have a 3.0 minimum GPA, college and graduate students must have a 2.5 minimum GPA.  Complete the FAFSA or state-based financial aid application (if applicable). Plan to enroll full-time in an accredited, not-for-profit, four-year university, or graduate school, during the fall of a scholarship cycle (year).", sponsor: "Hispanic Scholarship Fund", amount: "Varies", state: "All", min_gpa: "2.5 - 3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://hsf.net/en/scholarships/programs/general-college-scholarships", opportunity_type: "Scholarship", created_at: "2016-05-04 17:54:05", updated_at: "2019-02-26 22:29:45", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "hobbsm"},
    {id: 647, award_name: "American Indian Services Scholarships", subject_area: "Minority", level: nil, deadline: "2019-11-01", other_req: "1/4 enrolled member of a Federally Recognized Native American Tribe.  Undergraduate student with no more than 150 semester credits.  Must fill out a FAFSA. Apply each semester.", sponsor: "American Indian Services", amount: "Varies", state: "All", min_gpa: "2.25", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.americanindianservices.org/students/ais-scholarship/", opportunity_type: "Scholarship", created_at: "2016-05-04 18:24:53", updated_at: "2019-08-01 18:07:29", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "Deadlines:\r\n2/1 for summer; app opens 11/2\r\n5/1 for fall; app opens 2/2\r\n8/1 also fall; app opens 5/2\r\n11/1 for spring; app opens 8/2\r\n", respect_deadline: true, date_reopens: "2019-11-02", updated_by: "robertsm"},
    {id: 649, award_name: "Horace & Susie Revels Cayton Scholarship", subject_area: "Public Relations; Minority", level: nil, deadline: "2019-05-15", other_req: "Criteria: Minority status (African American, Asian American, Hispanic/Latino American, Native American, Pacific Islander); Interest and aptitude in public relations demonstrated by courses taken, activities and/or internships; \r\nFull-time sophomore or junior pursuing a career in public relations who will be a full-time junior or senior at a Washington state college or university (Washington state students attending college out-of-state also may apply if they graduated from a Washington high school or have a parent who currently lives in Washington state year-round.); Academic achievement; Financial need (FAFSA not required); Have overcome barriers in pursuit of personal or academic goals.", sponsor: "Public Relations Society of America: Puget Sound Chapter", amount: "$2,500", state: "WA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://prsapugetsound.org/about/scholarships/", opportunity_type: "Scholarship", created_at: "2016-05-04 19:28:27", updated_at: "2019-04-18 21:57:07", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 650, award_name: "C.I.P. Scholarship", subject_area: "All fields", level: nil, deadline: "2019-05-31", other_req: "Students age 17 years or older who plan to start a program of higher education within the next 12 months or who are currently enrolled in a program of higher education. Applicants may be full- or part-time students and attend a campus-based or online program. Applicants must be citizens or permanent residents of the United States.", sponsor: "College is Power", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.collegeispower.com/scholarship.cfm", opportunity_type: "Scholarship", created_at: "2016-05-04 19:31:14", updated_at: "2019-02-27 20:18:44", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 651, award_name: "Platt Family Scholarship - Essay Contest", subject_area: "All fields", level: nil, deadline: "2019-07-31", other_req: "The scholarship essay contest is designed for students who are FULL TIME, undergraduate students in an AMERICAN COLLEGE OR UNIVERSITY during the Spring 2019 semester. The July 31 deadline is designed to give these students time to finish their essays, if need be, after final exams. You do not have to be an American citizen, but you do need to be attending an AMERICAN COLLEGE OR UNIVERSITY during the eligibility period.", sponsor: "The Lincoln Forum", amount: "$1,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.thelincolnforum.org/scholarship-essay-contest", opportunity_type: "Scholarship", created_at: "2016-05-04 19:51:46", updated_at: "2019-03-27 21:41:17", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
    {id: 652, award_name: "Frank J. Richter Scholarship", subject_area: "All fields", level: nil, deadline: "2019-07-01", other_req: "To be eligible for consideration, an applicant must: Be enrolled at the time of application as a full-time undergraduate or graduate student at an accredited college or university. Preference will be given to those applicants enrolled in the transportation field and all applicants will be considered. Demonstrate successful completion of the previous year’s study by maintaining at least a 2.75 accumulated grade point average. Accumulate enough credits from accredited school(s) in time for the Fall Semester to have obtained at least a sophomore level standing at the college or university of enrollment.", sponsor: "American Association of Railroad Superintendents", amount: "$1,000", state: "All ", min_gpa: "2.75", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.supt.org/FrankJRichter", opportunity_type: "Scholarship", created_at: "2016-05-04 20:00:17", updated_at: "2019-04-18 21:58:07", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 653, award_name: "The Kaplan Group Annual Scholarship", subject_area: "Accounting, Business, Entrepreneurship, Economics, Finance, Law, Management", level: nil, deadline: "2019-08-11", other_req: "The Kaplan Group is offering a $1,000 scholarship to any undergraduate or graduate student pursuing a business or law-oriented degree program. Minimum GPA Requirement: 2.50; Eligible Fields of Study: MBA, Finance, Accounting, Law, Management, Entrepreneurship, Economics, Business Administration; Eligible Schools: Any accredited  2 year or 4 year college or university in the USA including graduate programs", sponsor: "The Kaplan Group", amount: "$1,000", state: "All", min_gpa: "2.50", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.kaplancollectionagency.com/scholarship/", opportunity_type: "Scholarship", created_at: "2016-05-04 20:02:55", updated_at: "2019-05-30 18:17:46", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-15", updated_by: "robertsm"},
    {id: 655, award_name: "EFWA Scholarships", subject_area: "Accounting; Business", level: nil, deadline: "2019-04-30", other_req: "Multiple scholarships available for women who are pursuing degrees in accounting. Other criteria varies based on the scholarship. ", sponsor: "The Educational Foundation for Women in Accounting", amount: "varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.efwa.org/scholarships.php", opportunity_type: "Scholarship", created_at: "2016-05-04 20:10:21", updated_at: "2018-11-30 19:00:29", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 656, award_name: "Career Development Grant", subject_area: "All fields", level: nil, deadline: "2019-11-15", other_req: "Applicants must be U.S. citizens or permanent residents whose last degree was received before June 30, 2014. Funds are available for tuition, fees, books, supplies, local transportation, and dependent care.\r\n\r\nGrants provide support for course work beyond a bachelor’s degree, including a master’s degree, second bachelor’s degree, certification program, or specialized training in technical or professional fields. Course work must be taken at an accredited two- or four-year college or university in the United States or at a technical school that is fully licensed or accredited by the U.S. Department of Education. Funds are not available for doctorate-level work.", sponsor: "American Association of University Women", amount: "varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.aauw.org/what-we-do/educational-funding-and-awards/career-development-grants/", opportunity_type: "Scholarship", created_at: "2016-05-04 20:28:15", updated_at: "2019-08-01 16:52:58", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 659, award_name: "Jackie Robinson Foundation Scholarship", subject_area: "All fields", level: nil, deadline: "2019-02-01", other_req: "To be eligible for a Jackie Robinson Foundation Scholarship, an applicant must: Be a graduating high school senior; Plan to attend an accredited and approved four-year institution within the United States; Show leadership potential; Demonstrate a dedication to community service; Present evidence of financial need; Be a United States citizen; Have a minimum SAT score of 1,000 combined on the math and critical reading sections or a composite ACT score of 21; Not possess a degree from a 2 or 4–year College when applying for the scholarship. The Jackie Robinson Foundation prides itself on its diverse pool of Scholars; and uses the U.S. Census Bureau definition of minority. If you feel that you are part of a minority group, we encourage you to apply.", sponsor: "The Jackie Robinson Foundation", amount: "$28,000", state: "All ", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.jackierobinson.org/apply/", opportunity_type: "Scholarship", created_at: "2016-05-04 20:48:46", updated_at: "2018-10-29 22:55:09", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 660, award_name: "LIVE OUT LOUD Young Trailblazers Scholarship", subject_area: "All fields ", level: nil, deadline: "2019-03-31", other_req: "The LIVE OUT LOUD Educational Scholarship was created to provide financial support for Lesbian, Gay, Bisexual, Transgender, and Queer (LGBTQ) youth who are pursuing a college degree.  Through this scholarship, LGBTQ youth can apply for funds to pay for educationally related expenses to pursue a degree from an accredited college, university, or technical/vocational program.This award is open only to Graduating High School seniors who identify as LGBTQ. Applicants need to be from the Tri-State area including New York, Connecticut, and New Jersey.", sponsor: "Live Out Loud", amount: "$10,000", state: "NJ, NY, CT", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.liveoutloud.info/programs/scholarship/", opportunity_type: "Scholarship", created_at: "2016-05-04 20:54:27", updated_at: "2019-02-27 20:20:47", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 661, award_name: "The NYWICI Foundation Scholarship Program", subject_area: "Communications; English; Journalism; Marketing; Public Relations", level: nil, deadline: "2019-01-25", other_req: "U.S. citizens or Permanent Residents who live in NY, NJ, CT, or PA; High school seniors who are permanent residents of and attend a high school in one of these states and will graduate; College undergraduate and graduate students who are permanent residents of one of these states. \r\nNOTE:  As long as they fulfill the permanent home residency requirements, applicants are eligible even if they attend or plan to attend an accredited U.S. college/university located outside of NY, NJ, CT, or PA .  \r\n\r\nAn applicant must: be majoring, planning to declare a major, or pursuing an advanced degree in a communications-related field at an accredited college/university in the U.S. Communications-related fields include, but are not limited to, advertising, broadcasting, communications, digital media, English, film, journalism, marketing, public relations, or publishing; have an overall GPA of 3.2 or better (or the recalculated high school equivalent). ", sponsor: "NY Women in Communications Foundation", amount: "varies", state: "CT; NY; NJ; PA", min_gpa: "3.2", contact: "financial.aid@example.edu", keywords: nil, website: "http://scholarships.nywici.org/", opportunity_type: "Scholarship", created_at: "2016-05-04 20:58:23", updated_at: "2018-11-15 23:45:16", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-15", updated_by: "walshm"},
    {id: 662, award_name: "The Princeton Prize in Race Relations", subject_area: "All fields", level: nil, deadline: "2019-01-31", other_req: "In order to recognize, support, and encourage the young people of our country who have demonstrated a commitment to advancing the cause of positive race relations, Princeton University sponsors an annual awards program for high school students. If you are a high school student involved in an activity that is helping to improve race relations in your school or community, we want to hear from you.", sponsor: "Princeton University", amount: "$1,000", state: "AL; CA; CO;CT; FL; GA; IL; MA; MD; MS; MO; NJ; NY; TN; TX; WA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://pprize.princeton.edu/", opportunity_type: "Scholarship", created_at: "2016-05-04 21:03:56", updated_at: "2018-09-26 21:39:27", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 663, award_name: "Ron Brown Scholarship", subject_area: "Minority", level: nil, deadline: "2020-01-09", other_req: "Interested applicants are strongly encouraged to apply for the Ron Brown Scholar Program provided you meet the following requirements: Must be Black/African American; Must excel academically; Must exhibit exceptional leadership potential; Must participate in community service activities; Demonstrate financial need; Be a US citizen or hold a permanent resident visa card; Be a current high school senior at the time of your application.", sponsor: "Ron Brown Scholar Program", amount: "$10,000 (renewable)", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.ronbrown.org/", opportunity_type: "Scholarship", created_at: "2016-05-04 21:27:39", updated_at: "2019-08-01 16:54:31", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 664, award_name: "Fukunaga Scholarship", subject_area: "Business; Accounting; Finance; Marketing; Economics; Management", level: nil, deadline: "2019-03-01", other_req: "Graduate from a Hawaii high school or home school program who will be pursuing (or is currently pursuing) an undergraduate degree in business or a related area at an accredited four-year university.  The Foundation awards scholarships to the most deserving applicants on the basis of academic standing, leadership ability, commitment to pursue a degree in business, and financial need.  Applicant must be a resident of Hawaii and plan to eventually return to Hawaii or the Pacific Islands region and contribute to its growth and welfare.", sponsor: "Servco", amount: "$4,500 (renewable)", state: "HI", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://servco.com/philanthropy/scholarships.php", opportunity_type: "Scholarship", created_at: "2016-05-06 16:19:50", updated_at: "2018-11-30 19:00:53", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 665, award_name: "California-Hawaii Elks Scholarship for Students with Disabilities", subject_area: "All fields; Disability", level: nil, deadline: "2019-03-15", other_req: "Individuals applying must be a United States citizen and a resident of California or Hawaii; have a physical impairment, neurological impairment, visual impairment, hearing impairment, and/or speech-language disorder; and be a senior in high school, a high school graduate, or have passed the General Educational Development (GED) Examination or the California High School Proficiency Examination (CHSPE).  Application is at bottom of webpage.", sponsor: "California-Hawaii Elks Major Project", amount: "$1,000 - $2,000", state: "CA; HI", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://chea-elks.org/youth-activities/scholarships/", opportunity_type: "Scholarship", created_at: "2016-05-06 16:26:04", updated_at: "2018-12-14 17:28:09", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-15", updated_by: "walshm"},
    {id: 666, award_name: "Big Island Press Club Scholarship", subject_area: "Journalism", level: nil, deadline: "2019-04-01", other_req: "To qualify, applicants must:\r\n\r\nHave residential ties to the Big Island;\r\nExpress a clear interest in and aptitude for a career in journalism or a related field;\r\nBe pursuing a degree in journalism or a related field and enrolled full time at an accredited college or university;\r\nMaintain a strong record of academic achievement.", sponsor: "Big Island Press Club", amount: "Varies", state: "HI", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.bigislandpressclub.org/scholarships/", opportunity_type: "Scholarship", created_at: "2016-05-06 16:32:53", updated_at: "2019-03-27 21:42:33", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
    {id: 667, award_name: "The Associated Chinese University Women Scholarship", subject_area: "Minority", level: nil, deadline: "2018-04-28", other_req: "ACUW scholarship applicants must be persons of Chinese ancestry or interested in Chinese culture. Applicants must be U.S. citizens or permanent residents and also be residents of the State of Hawaii. They must demonstrate high scholastic achievement, good character, involvement in school and/or community service and financial need. A personal interview may be requested", sponsor: "The Associated Chinese University Women", amount: "$2,500", state: "HI", min_gpa: "3.8", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.acuwhawaii.org/scholarship", opportunity_type: "Scholarship", created_at: "2016-05-06 16:42:42", updated_at: "2019-04-18 22:00:31", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "Not offered 1920 AY", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 668, award_name: "Daniel Moriarty Scholarship", subject_area: "History; Environmental Science; Botany; Biology", level: nil, deadline: "2019-04-30", other_req: "Required: Must have been a Hawaii resident within the last five years studying botany, zoology, history or related subjects concerning the Hawaiian environment.  Preferred qualifications (not required): from Kaua'i, an undergraduate upperclassman actively participating in environmental clubs and organizations.", sponsor: "Kilauea Point Natural History Association", amount: "up to $4,000", state: "HI", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.kilaueapoint.org/scholarships/", opportunity_type: "Scholarship", created_at: "2016-05-06 17:00:00", updated_at: "2019-05-05 20:28:43", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 669, award_name: "Pauahi Foundation", subject_area: "All Fields", level: nil, deadline: "2019-02-08", other_req: "Be a classified, degree-seeking student. \r\nBe attending an institution in Hawai`i or the continental U.S.\r\nBe attending school as a full-time student unless specifically noted in the Scholarship Listing. \r\nBe attending a two- or four-year accredited* institution. ", sponsor: "Pauahi Foundation", amount: "Varies", state: "HI", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.pauahi.org/program-overview/", opportunity_type: "Scholarship", created_at: "2016-05-06 17:17:32", updated_at: "2019-01-02 23:59:01", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 670, award_name: "Prince Kuhio Scholarship", subject_area: "Journalism; Education; Minority", level: nil, deadline: "2018-05-31", other_req: "Preference to students of Hawaiian or part-Hawaiian ancestry.\r\nEnrollment full-time in an accredited two- or four-year institution of higher education.\r\nHigh school seniors or college students may apply.\r\nCommunity service or volunteer work highly desirable.", sponsor: "Prince Kuhio Hawaiian Civic Club", amount: "Up to $1,000 (renewable)", state: "HI", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.pkhcc.org/scholarship/", opportunity_type: "Scholarship", created_at: "2016-05-06 17:20:28", updated_at: "2019-05-30 20:57:41", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Not active as of 5/31/19", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 674, award_name: "Honeywell Scholarship", subject_area: "STEM; Science; Technology; Math; Engineering", level: nil, deadline: "2019-03-15", other_req: "Current college freshman with critical financial need ($55,000 or less adjusted gross income per family) with integrity and perseverance in overcoming adversity.", sponsor: "Honeywell and Horatio Alger", amount: "$10,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://scholars.horatioalger.org/scholarships/about-our-scholarship-programs/targeted-scholarships/", opportunity_type: "Scholarship", created_at: "2016-05-06 18:09:54", updated_at: "2019-01-24 18:25:19", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 675, award_name: "MyBioSource Scholarship Program", subject_area: "STEM; All fields", level: nil, deadline: "2019-06-28", other_req: "Must be enrolled as an undergraduate or graduate student for the fall semester. Separate scholarships and applications for for STEM, majors, STEM majors, and for Students with Disabilities Scholarship.", sponsor: "MyBioSource.com", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.mybiosource.com/page.php?name=scholarship", opportunity_type: "Scholarship", created_at: "2016-05-06 18:25:57", updated_at: "2019-02-27 20:24:33", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 676, award_name: "Arborjet Taking Root Scholarship", subject_area: "Environmental Science", level: nil, deadline: "2019-06-14", other_req: "Applicants to the Arborjet Taking Root Scholarship Program must -\r\nBe citizens or legal residents of the United States.\r\nBe high school seniors.\r\nPlan to enroll in full-time undergraduate study at an accredited two-year or four-year college or university for the entire academic year.\r\nPlan to pursue a forestry course of study or related major (e.g., Forestry, Plant Sciences, Horticulture, Entomology, Environmental Science or other related major).", sponsor: "Arborjet", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://scholarsapply.org/arborjet/", opportunity_type: "Scholarship", created_at: "2016-05-10 19:27:10", updated_at: "2019-05-30 20:56:30", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 678, award_name: "Past Presidents' Legacy Scholarship", subject_area: "Engineering; Biology; Environmental Science; Communication", level: nil, deadline: "2019-02-15", other_req: "current college sophomores or juniors who will be college juniors or seniors beginning fall 2018, or graduate students with a minimum cumulative 3.0 grade point average on a 4.0 scale (or equivalent) GPA who are enrolled in a full-time undergraduate or graduate course of study at an accredited four-year college or university\r\n\r\nApplicant must be pursuing a program of study that is related to the hydropower industry: Engineering, sciences (biology, fisheries, and hydrology), communications, or environmental studies.", sponsor: "National Hydropower Association", amount: "$2,500", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.hydro.org/awards/past-presidents-legacy-scholarship/", opportunity_type: "Scholarship", created_at: "2016-05-10 21:03:12", updated_at: "2019-01-03 17:12:32", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-02", updated_by: "walshm"},
    {id: 680, award_name: "Rick Management Association (RMA) Foundation Scholarship", subject_area: "Accounting; Business; Finance; Economics", level: nil, deadline: "2018-10-21", other_req: "Current undergraduate student who has completed at least two years of college and is pursuing a degree in accounting, business, finance, economics, banking or a related area of business and is interested in working in the banking industry after graduation.", sponsor: "RMA", amount: "varies", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.scholarsapply.org/rma/", opportunity_type: "Scholarship", created_at: "2016-05-10 21:08:49", updated_at: "2018-09-20 21:01:56", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-10", updated_by: "walshm"},
    {id: 682, award_name: "Binc Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-05", other_req: "The Binc Scholarship Program is open to bookstore employees, bookstore owners, former Borders employees and dependents* of bookstore employees, owners and former Borders employees who plan to enroll in full or part-time undergraduate or graduate study at an accredited two or four-year college, university or vocational-technical school for at least half of the academic year. \r\n\r\n*Dependents include children under the age of 25, spouses and qualified same-sex partners.", sponsor: "Book Industry Charitable Foundation (Binc)", amount: "varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.scholarshipamerica.org/binc/", opportunity_type: "Scholarship", created_at: "2016-05-10 21:14:55", updated_at: "2019-01-24 19:00:17", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-16", updated_by: "walshm"},
    {id: 683, award_name: "Edison Scholars Program", subject_area: "Chemistry; Computer Science; Engineering; Environmental Science; Mathematics; Physics", level: nil, deadline: "2018-12-01", other_req: "Applicants must meet all of the following criteria:\r\nbe a high school senior with a cumulative grade point average of 3.0 on a 4.0 scale or the equivalent.\r\nlive in Southern California Edison's (SCE) service territory.\r\nplan to attend a full-time undergraduate course of study at an accredited four-year college or university in the U.S. for the 2018/2019 academic year.\r\nplan to enroll in an eligible major in computer and information services, engineering, engineering technology, management information systems, mathematics, natural resources and conservation, or physical sciences.\r\ndemonstrate financial need.", sponsor: "Edison International", amount: "$10,000 (renewable)", state: "CA", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.scholarsapply.org/edisonscholars/", opportunity_type: "Scholarship", created_at: "2016-05-10 21:19:16", updated_at: "2019-02-12 05:08:35", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "hobbsm"},
    {id: 685, award_name: "James L. and Nellie M. Westlake Scholarship", subject_area: "All fields", level: nil, deadline: "2019-02-01", other_req: "Renewable scholarships are offered for full-time study at an accredited four-year institution of the student’s choice. Applicants must:\r\nBe Missouri residents.\r\nBe graduating seniors at Missouri high schools who plan to enroll in a full-time undergraduate course of study at an accredited four- year college or university. \r\nOR\r\nHave completed one or two full years at a Missouri community college with sufficient credits to permit transfer to an accredited four-year college or university at the sophomore or junior level, respectively.\r\nDemonstrate limited financial resources with an expected family contribution (EFC from FAFSA) of $7,000 or less and a family adjusted gross income of $50,000 or less.\r\nAwards will cover the cost of tuition, plus approximately $2,000 additional to cover the costs of fees, books, and supplies. ", sponsor: "James L. and Nellie M. Westlake", amount: "Tuition and books", state: "MO", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.scholarsapply.org/westlake/", opportunity_type: "Scholarship", created_at: "2016-05-10 21:24:31", updated_at: "2018-12-14 00:26:13", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 686, award_name: "The Gilder Lehrman History Scholar Award", subject_area: "History", level: nil, deadline: "2019-04-15", other_req: "All applicants must demonstrated academic excellence and a commitment to public service, leadership, and/or community involvement.\r\nAll applicants must be considered students in an accredited college or university.\r\nCollege freshmen and sophomores must show significant interest in American history in both their high school and college coursework and extracurriculars.\r\nCollege juniors and seniors must be a history major or an American studies major with an American history concentration.", sponsor: "The Gilder Lehrman Institute of American History", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.gilderlehrman.org/programs-exhibitions/history-scholar-award", opportunity_type: "Scholarship", created_at: "2016-05-16 17:40:12", updated_at: "2018-10-18 22:40:16", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-30", updated_by: "walshm"},
    {id: 687, award_name: "Loreen Arbus Foundation Scholarship", subject_area: "Journalism; English; Communication", level: nil, deadline: "2018-06-27", other_req: "The scholarship is open to female undergraduate and graduate students studying media, journalism, English, communications and related fields. Applicants must submit a 750-1,000 word essay on a suggested topic.  The winning applicant is encouraged to attend AWMF’s Gracies Awards Luncheon on June 27, 2017 in New York City to receive the scholarship.", sponsor: "Alliance for Women in Media and Loreen Arbus Foundation", amount: "$2,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://allwomeninmedia.org/foundation/scholarships/", opportunity_type: "Scholarship", created_at: "2016-05-16 17:47:49", updated_at: "2019-05-04 20:17:54", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "hobbsm"},
    {id: 689, award_name: "Media Fellows Program", subject_area: "Mass communication; Journalism; Marketing; Business; Political Science", level: nil, deadline: "2019-07-12", other_req: "College juniors and seniors in good academic standing are invited to apply.\r\n\r\nOpen to full-time undergraduate students whose major or minor prepares them for a career in strategic public policy advertising research, management, planning and buying. These include, but are not limited to, mass communications, journalism, marketing (business or mass communications), and political science.\r\n\r\nApplicants must have a minimum GPA of 3.0 in their major concentration.", sponsor: "Washington Media Scholars Foundation", amount: "Varies", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.mediascholars.org/media-fellows/", opportunity_type: "Scholarship", created_at: "2016-05-16 18:02:02", updated_at: "2019-02-27 20:27:04", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "multiple scholarships each year", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 690, award_name: "Danny and Drew Essay Contest", subject_area: "All fields", level: nil, deadline: "2019-06-01", other_req: "US Citizens currently enrolled in an accredited American university or college.", sponsor: "Perkins Levin", amount: "$1,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://perkinslevin.com/scholarship/", opportunity_type: "Scholarship", created_at: "2016-05-17 21:36:05", updated_at: "2019-01-02 23:59:30", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 691, award_name: "ExceptionalNurse.com Scholarships", subject_area: "Nursing", level: nil, deadline: "2019-06-01", other_req: "Full-time nursing student with a documented disability.", sponsor: "ExceptionalNurse.com", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.exceptionalnurse.com/scholarship.php", opportunity_type: "Scholarship", created_at: "2016-05-17 21:42:17", updated_at: "2019-01-02 23:59:51", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 692, award_name: "Kids' Chance of Washington Scholarship", subject_area: "All fields", level: nil, deadline: "2019-11-01", other_req: "This scholarship is available to spouses or children of injured Washington workers whose injury, while at work in Washington State, resulted in a permanent inability to return to work (a pension under the claim) or death.\r\nMoney is available for college undergraduates, technical school students, high school students participating in a Running Start program, or other accredited schools. Although applications will be accepted year-round, priority will be given to applications received by June 1 or November 1 of each year.\r\n", sponsor: "Kids' Chance of Washington", amount: "Varies", state: "WA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://kidschancewa.com/application/", opportunity_type: "Scholarship", created_at: "2016-05-17 22:03:42", updated_at: "2019-07-17 22:02:22", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "robertsm"},
    {id: 693, award_name: "Kids' Chance of Oregon", subject_area: "All fields", level: nil, deadline: "2020-06-30", other_req: "Applicant must be between the ages of 16 – 25 years old.\r\nApplicant must be the child or legal dependent of a worker killed or permanently and totally disabled in a commensurable work-related accident or occupational disease with an Oregon employer.\r\nStudent applicant and/or deceased/injured worker are not required to be a legal resident of Oregon.\r\nApplicant must be enrolled, accepted or applying for acceptance as a full-time or part-time student at a university, college or technical school or Oregon registered apprentice program.\r\nAcademic achievement, aptitude and community service of the applicant are considered.\r\n\r\nApply for funding a minimum of two months before funding is needed - rolling deadline.", sponsor: "Kids' Chance of Oregon", amount: "Varies", state: "OR", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.kidschanceoforegon.com/scholarship-application/", opportunity_type: "Scholarship", created_at: "2016-05-17 22:09:38", updated_at: "2019-07-17 22:05:23", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Apply for funding minimum of two months before needed - rolling application deadline.", respect_deadline: true, date_reopens: "2020-07-01", updated_by: "robertsm"},
    {id: 694, award_name: "Kids' Chance California", subject_area: "All fields", level: nil, deadline: "2020-07-01", other_req: "Child or legal dependent of a worker seriously injured or killed on the job with an accepted workers’\r\ncompensation case from California. Insurance representative can help with WCAB case number.\r\n• Between 16–25 years old without a bachelor’s degree, but will accept if you have started a degree.\r\n• Enrolled, accepted or applying as a full or part-time student at a university, college, or vocational\r\nschool. The school does not have to be in California.\r\n• Financial need based on the Federal Expected Family Contribution—FAFSA criteria:\r\nhttps://fafsa.ed.gov.\r\n• Student applicants and/or injured worker are not required to be a legal resident of California or\r\nrequired to live in California when applying. \r\n", sponsor: "Kids' Chance California", amount: "Varies", state: "CA", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.kidschanceca.org/scholarships.html", opportunity_type: "Scholarship", created_at: "2016-05-17 22:13:24", updated_at: "2019-07-17 22:36:50", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-07-02", updated_by: "robertsm"},
    {id: 695, award_name: "Mark A. Forester Scholarship", subject_area: "All fields", level: nil, deadline: "2018-06-01", other_req: "Any student who is currently enrolled in an accredited American university or college, or will be enrolled for the Fall/Summer semester of 2018, can apply for the Mark A. Forester scholarship.\r\n\r\nTo enter, the student must write a 300-500-word essay explaining how they go about honoring America's military heroes.\r\n\r\nThe $1000 award will only be usable for tuition and book costs and the check will be written to the winner's school of choice.", sponsor: "The Mark Forester Foundation", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.rockymountainmattress.com/company/mark-a-forester-scholarship.php", opportunity_type: "Scholarship", created_at: "2016-05-17 22:16:01", updated_at: "2019-02-27 20:32:59", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Award not offered in 2019", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 696, award_name: "National Pan American Golf Association Scholarship", subject_area: "All fields", level: nil, deadline: "2018-06-01", other_req: "Be a high school graduate how graduated in the upper half of your graduating class with financial need.  Enroll in a program that leads to a degree or certificate.", sponsor: "Pan American Golf Association", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://nationalpaga.org/npaga-scholarship-application/", opportunity_type: "Scholarship", created_at: "2016-05-17 22:21:45", updated_at: "2019-02-27 21:25:50", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "not offered in 2019", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 697, award_name: "Paumanauke Native American Indian Scholarship", subject_area: "Minority", level: nil, deadline: "2019-06-01", other_req: "Our intention is to encourage and assist Native American Indians to complete their education. Tribally enrolled Native American Indians attending colleges, universities and accredited post-secondary educational institutions on a full time basis, are eligible for consideration.", sponsor: "Paumanauke Native American Festival", amount: "$500-750", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://paumanauke.org/pnaf_003.htm", opportunity_type: "Scholarship", created_at: "2016-05-17 22:25:16", updated_at: "2019-02-27 21:37:22", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 699, award_name: "Association of Former Intelligence Officers Scholarships", subject_area: "Engineering; Science; Physics; Biology; Computer Science; Foreign Language", level: nil, deadline: "2019-06-01", other_req: "For Undergraduate scholarships, applicants must be entering their junior or senior year by the summer of 2018.\r\nFor Graduate scholarships, applications must be submitted no earlier than your senior undergraduate year and no later than your second year of graduate studies.\r\nEvaluation criteria include merit, character, serious academic commitment, and relevance of your studies to national security interests and career ambitions.", sponsor: "Association of Former Intelligence Officers", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.afio.com/13_scholarships.htm", opportunity_type: "Scholarship", created_at: "2016-05-18 17:10:41", updated_at: "2019-03-27 21:44:54", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "hobbsm"},
    {id: 700, award_name: "American Ground Water Trust Scholarships", subject_area: "Environmental Science; Engineering; Science", level: nil, deadline: "2019-06-01", other_req: "For students entering their Freshman year in a full-time undergraduate academic program of study at a four-year accredited university or college located in the United States.\r\nApplicants must intend to pursue a career in a ground water related field.\r\nApplicants must have a minimum 3.0 GPA in high school.\r\nThe college / university selected for study must offer appropriate courses.\r\nThe applicant must either have completed a science / environmental project at high school which directly involved ground water resources or, have had vacation / out of school work experience that is related to the environment and natural resources.\r\nApplicants must be US citizens or legal residents of the United States.", sponsor: "American Ground Water Trust", amount: "Varies", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.agwt.org/content/scholarships", opportunity_type: "Scholarship", created_at: "2016-05-18 17:18:15", updated_at: "2019-05-05 20:49:15", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-15", updated_by: "hobbsm"},
    {id: 701, award_name: "Got a Spine Scholarship", subject_area: "All fields", level: nil, deadline: "2019-06-02", other_req: "Must attend a college of university full-time and had a GPA of 2.5 or greater during their last academic year.  Be a U.S. or Canadian resident.", sponsor: "Arctic Chiropractic Fairbanks", amount: "$500", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.arcticchiropracticfairbanks.com/chiropractor_fairbanks.php", opportunity_type: "Scholarship", created_at: "2016-05-18 17:26:27", updated_at: "2018-11-13 22:06:38", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-15", updated_by: "walshm"},
    {id: 702, award_name: "Kerope Zildjian Concert Percussion Scholarship", subject_area: "Music", level: nil, deadline: "2018-06-22", other_req: "This scholarship recognizes an outstanding student percussionist, who is currently enrolled in an undergraduate music program. \r\n", sponsor: "Kerope Zildjian", amount: "$3,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://zildjian.com/campaign/kerope-zildjian-concert-scholarship", opportunity_type: "Scholarship", created_at: "2016-05-18 17:57:37", updated_at: "2019-05-30 20:55:18", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Not active as of 5/30/19", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 705, award_name: "Helen Gee Chin Scholarship", subject_area: "All Fields", level: nil, deadline: "2019-06-15", other_req: "Applicants to the Helen Gee Chin Scholarship Foundation Scholarship Program must:\r\nBe a U.S. citizen;\r\nPlan to enroll full-time as an undergraduate at an accredited U.S. four-year college or university for the entire academic year;\r\nHave studied one or more of the Chinese Martial Arts – Kung Fu, Wu Shu, or Tai Chi – for a minimum of 5 [five] years; and\r\nHave a “B” average grade or better.", sponsor: "Helen Gee Chin Scholarship Foundation", amount: "$3,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.hgcscholarshipfoundation.org/home/eligibility", opportunity_type: "Scholarship", created_at: "2016-05-18 18:14:04", updated_at: "2019-05-06 23:27:15", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "hobbsm"},
    {id: 706, award_name: "Native American Scholarship", subject_area: "Education; Social Service; Social Work; Sociology; Psychology; Minority", level: nil, deadline: "2019-06-15", other_req: "Be an enrolled tribal member.\r\nPlan to work with a tribe or nation in the field of Education or Social Service. Career goals should involve working with Native Americans.\r\nBe accepted in, or already attend an accredited college or university, enrolled in an undergraduate program and preferably entering or in his/her Junior year.\r\nMaintain a 3.0 average and carry at least 10 (ten) quarter hours or 8 (eight) semester hours. This allows for a work/study program and is required for consideration.", sponsor: "Continental Society Daughters of Indian Wars", amount: "$5,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.csdiw.org/scholarships.html", opportunity_type: "Scholarship", created_at: "2016-05-18 18:17:00", updated_at: "2019-05-07 03:39:36", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "hobbsm"},
    {id: 707, award_name: "Sharps Essay Contest", subject_area: "Nursing", level: nil, deadline: "2019-05-31", other_req: "U.S. or Canadian citizen who has been accepted or is currently enrolled full-time in an undergraduate program for healthcare-related studies.", sponsor: "Sharps Compliance", amount: "$1,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.sharpsinc.com/scholarship-program", opportunity_type: "Scholarship", created_at: "2016-05-18 18:25:56", updated_at: "2019-05-30 21:47:21", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-15", updated_by: "robertsm"},
    {id: 708, award_name: "Babe Ruth League College Scholarship", subject_area: "All fields", level: nil, deadline: "2019-06-30", other_req: "You must have participated in a Cal Ripken Baseball, Babe Ruth Baseball or Babe Ruth Softball League anytime during the ages of 4-18.  Babe Ruth League College Scholarships are awarded based on an applicant's academic achievement, participating activities, community involvement, and the contents of the essay.", sponsor: "Babe Ruth League", amount: "varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.baberuthleague.org/scholarships/babe-ruth-league-scholarship.aspx", opportunity_type: "Scholarship", created_at: "2016-05-18 18:41:01", updated_at: "2019-04-18 22:03:26", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 709, award_name: "Delete Cyberbullying Scholarship", subject_area: "All fields", level: nil, deadline: "2019-06-30", other_req: "A U.S. citizen or permanent resident attending or planning to attend an accredited U.S. college or university for undergraduate or graduate studies.  Selection is based on the written essay and focused on creativity, content and a commitment to the cause of deleting cyber-bullying.", sponsor: "DeleteCyberbullying.org", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.deletecyberbullying.org/scholarship/", opportunity_type: "Scholarship", created_at: "2016-05-18 18:46:35", updated_at: "2019-04-18 22:04:24", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 711, award_name: "Living with Dyslexia", subject_area: "All fields", level: nil, deadline: "2019-07-16", other_req: "Student with dyslexia who will be attending college in the fall semester.", sponsor: "Gemm Learning", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.gemmlearning.com/about/scholarship-opportunities", opportunity_type: "Scholarship", created_at: "2016-05-18 18:55:37", updated_at: "2019-05-05 20:50:35", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-15", updated_by: "hobbsm"},
    {id: 712, award_name: "Sinclair Broadcast Diversity Scholarship", subject_area: "Journalism; Broadcasting; Marketing; Communication; Minority", level: nil, deadline: "2019-04-14", other_req: "College sophomore or junior at time of application who is studying in the areas of broadcasting, journalism, or marketing and is an ethnic minority. Must either be enrolled at a four-year undergraduate college or university in California, Washington, Oregon, Idaho, or Montana *OR* your permanent address must be within one of those states if your school is outside of that region.\r\n", sponsor: "Sinclair Broadcast Group", amount: "up to $5,000", state: "CA; WA; OR; ID; MT", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://sbgi.net/scholarship/", opportunity_type: "Scholarship", created_at: "2016-05-18 23:21:17", updated_at: "2019-02-28 18:07:04", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 713, award_name: "U.S. Bank Student Union Scholarship", subject_area: "All fields", level: nil, deadline: "2019-10-25", other_req: "Our Scholarship program is available to college-bound high school seniors or current undergraduate college students enrolled by September 1, 2019 at an eligible two- or four-year college or university.  Residents of all states except FL and NY are eligible.", sponsor: "U.S. Bank", amount: "varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.usbank.com/community/financial-education/scholarship.html", opportunity_type: "Scholarship", created_at: "2016-05-19 21:12:08", updated_at: "2019-05-07 04:14:14", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "hobbsm"},
    {id: 714, award_name: "Bridgat Scholarship", subject_area: "All fields", level: nil, deadline: "2018-12-31", other_req: "Full-time undergraduate going to school in the U.S. or Canada, regardless of nationality.  Winners will be selected based on personal statement and resume which demonstrate applicant's academic performance and leadership participation in cross cultural activities.  Financial need is NOT considered.", sponsor: "Bridgat", amount: "$4,500", state: "All", min_gpa: "2.7", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.bridgat.com/scholarships.html", opportunity_type: "Scholarship", created_at: "2016-05-19 21:16:16", updated_at: "2018-09-21 16:23:27", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 716, award_name: "PACCO Regular College Scholarship Program", subject_area: "Minority", level: nil, deadline: "2019-03-15", other_req: "High school senior or current college student of Filipino descent who is a legal resident of Oregon or SW Washington.  PACCO scholarship recipients will be selected based on number of community volunteer service hours; leadership awards and honors; recommendations; essay and financial need.", sponsor: "Philippine American Chamber of Commerce of Oregon", amount: "$500", state: "OR; WA", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.pacco.org/programs.html", opportunity_type: "Scholarship", created_at: "2016-05-25 23:06:53", updated_at: "2019-02-28 18:09:49", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 717, award_name: "GFWC Oregon Fine Arts Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-13", other_req: "Oregon high school senior who will be attending college in the Fall. One award is given in each of the following four categories: vocal music, instrumental music, art, and essay contest.", sponsor: "Oregon Federation of Women's Clubs", amount: "Varies", state: "OR", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://oregongfwc.org/fine-arts-scholarships.html", opportunity_type: "Scholarship", created_at: "2016-05-25 23:15:13", updated_at: "2019-01-03 00:00:47", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 718, award_name: "ASHRAE Freshman Engineering Scholarship", subject_area: "Engineering", level: nil, deadline: "2019-05-01", other_req: "A one-year scholarship available to a full-time engineering or pre-engineering student entering their sophomore year at a post-secondary educational institution and pursuing a Bachelor of Science or Engineering degree in a course of study which has been traditionally a curriculum for the profession of HVAC&R profession. \r\nApplicants must:\r\nBe a student member of ASHRAE or have started an ASHRAE student branch at their school prior to the application deadline.", sponsor: "American Society of Heating, Refrigerating, and Air-Conditioning Engineers", amount: "$5,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.ashrae.org/communities/student-zone/scholarships-and-grants/scholarship-program", opportunity_type: "Scholarship", created_at: "2016-06-01 18:05:05", updated_at: "2019-01-03 00:02:21", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 719, award_name: "ASHRAE High School Senior Scholarship", subject_area: "Engineering", level: nil, deadline: "2019-05-01", other_req: "High school senior who has been accepted into an engineering program.", sponsor: "American Society of Heating, Refrigerating, and Air-Conditioning Engineers", amount: "$3,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.ashrae.org/membership--conferences/student-zone/scholarships-and-grants/high-school-senior-scholarships", opportunity_type: "Scholarship", created_at: "2016-06-01 18:08:29", updated_at: "2019-01-03 00:02:41", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 720, award_name: "Voice of Democracy", subject_area: "All fields", level: nil, deadline: "2019-10-31", other_req: "The Voice of Democracy Program is open to students in grades 9-12 (on the October 31 deadline), who are enrolled in a public, private or parochial high school or home study program in the United States and its territories.  ", sponsor: "Veterans of Foreign Wars (VFW)", amount: "Up to $30,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.vfw.org/VOD/", opportunity_type: "Scholarship", created_at: "2016-06-02 21:57:22", updated_at: "2019-05-30 20:52:05", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 721, award_name: "Howard Vollum American Indian Scholarship", subject_area: "Science; Computer Science; Engineering; Mathematics; Minority", level: nil, deadline: "2019-03-01", other_req: "For American Indian students. \r\nMust be a resident of Clackamas, Multnomah or Washington counties in Oregon, or Clark County, Washington. \r\nPlanning to major or majoring in science, computer science, engineering or mathematics, focused on a career as a professional (or a teacher) in these fields.\r\n", sponsor: "Oregon Community Foundation", amount: "Varies", state: "OR; WA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.oregoncf.org/grants-scholarships/scholarships", opportunity_type: "Scholarship", created_at: "2016-06-02 22:32:22", updated_at: "2018-08-29 23:05:11", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 722, award_name: "Darlene Hooley Scholarship for Oregon Veterans", subject_area: "Military", level: nil, deadline: "2019-04-01", other_req: "For Oregon National Guard and Oregon Reservists who have served and been deployed overseas in the post-9/11 conflict, also known as the Global War on Terror. Recipients may be attending school either full-time or half-time.  Application accepted on a continuous basis. \r\n\r\nTo find application, click on \"Scholarships Through OCF\" and find \"Darlene Hooley Scholarship for Oregon Veterans\" in the application list.\r\n", sponsor: "Oregon Community Foundation", amount: "Varies", state: "OR", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.oregoncf.org/grants-scholarships/scholarships", opportunity_type: "Scholarship", created_at: "2016-06-02 22:34:24", updated_at: "2019-05-07 04:22:31", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "hobbsm"},
    {id: 725, award_name: "Foot Locker Scholars Athletes", subject_area: "All fields", level: nil, deadline: "2018-12-14", other_req: "Be entering college in the Fall of 2019 as a Freshman at a four-year school for an undergraduate degree. Be currently involved in high school sports, intramural sports, or community based sports. Have a minimum GPA of 3.0. Be a U.S. citizen or permanent legal resident.\r\n", sponsor: "Foot Locker", amount: "$5,000 (renewable)", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://footlockerscholarathletes.com/about", opportunity_type: "Scholarship", created_at: "2016-06-02 23:02:09", updated_at: "2018-09-21 15:52:26", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-25", updated_by: "walshm"},
    {id: 726, award_name: "Pride Foundation LGBTQ Scholarships", subject_area: "All fields", level: nil, deadline: "2019-01-11", other_req: "Over 60 Scholarships. Only 1 Application.\r\nThanks to the generosity of our community, Pride Foundation is able to offer a diversity of scholarships, which encourage students of different backgrounds and educational interests to apply. We offer over 50 different types of scholarships, but students only need to complete one application. Most scholarships are available for ally or questioning students as well. All funds promote leadership and diversity in the LGBTQ community. Scholarships are organized in four distinct categories: academic pursuits, community leadership, cultural identities, and geography.", sponsor: "Pride Foundation", amount: "Varies", state: "AK; ID; MT; OR; WA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://pridefoundation.org/find-funding/scholarships/application/", opportunity_type: "Scholarship", created_at: "2016-06-02 23:11:27", updated_at: "2018-10-18 19:43:13", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 727, award_name: "Cabrillo Civic Clubs of California Scholarship", subject_area: "Minority", level: nil, deadline: "2019-03-15", other_req: "Must be a graduating senior from a California high school and be of Portuguese descent.  Applicant must have participated in at least three extra-curricular activities while in high school.", sponsor: "Cabrillo Civic Clubs", amount: "$500", state: "CA", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.cabrillocivicclubs.org/scholarship.asp", opportunity_type: "Scholarship", created_at: "2016-06-03 19:02:47", updated_at: "2019-01-03 00:02:59", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 729, award_name: "Society of American Military Engineers Los Angeles Post Scholarship", subject_area: "Engineering; Math; Science;", level: nil, deadline: "2018-05-11", other_req: "Each year, the Society of American Military Engineers Los Angeles Post awards scholarships ranging from $1,000 to $2,500 to deserving graduating high school students who plan to enter college and major in math, engineering, or a natural science.\r\n\r\nScholarship Eligibility Requirements:\r\n\r\nLos Angeles County high school student\r\nGraduating in Spring 2016\r\nAccepted to a US college in an accredited program in math, engineering, science, or engineering or science technology program\r\nStart college program by September ", sponsor: "Society of American Military Engineers Los Angeles Post", amount: "Varies", state: "CA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.same.org/Get-Connected/Find-a-Post/Los-Angeles/Scholarships", opportunity_type: "Scholarship", created_at: "2016-06-08 21:57:07", updated_at: "2019-05-05 20:51:36", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Not offered 19-20", respect_deadline: true, date_reopens: "2020-03-15", updated_by: "hobbsm"},
    {id: 730, award_name: "Unigo $10K Scholarship", subject_area: "All fields", level: nil, deadline: "2019-12-31", other_req: "Applicants must:\r\n\r\nBe thirteen (13) years of age or older at the time of application.\r\nBe legal residents of the fifty (50) United States or the District of Columbia.\r\nBe currently enrolled (or enroll no later than the fall of 2022) in an accredited post-secondary institution of higher education.\r\nSubmit an online short written response (250 words or less) for the question:\r\n\"Weighing the expected investment and return, is college worth it for you? Why?\"", sponsor: "Unigo", amount: "$10,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.unigo.com/scholarships/our-scholarships/Unigo-10k-Scholarship", opportunity_type: "Scholarship", created_at: "2016-06-09 21:13:07", updated_at: "2019-01-03 00:03:19", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 732, award_name: "Ocean Awareness Student Contest", subject_area: "All Fields", level: nil, deadline: "2019-06-17", other_req: "6th-12th grade student (or International equivalent).  Submit an original work in one of four categories (art, poetry, prose, or film) relating to ocean pollution (exact prompt on website). ", sponsor: "Bow Seat Ocean Awareness Programs", amount: "up to $1,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.fromthebowseat.org/contest.php", opportunity_type: "Scholarship", created_at: "2016-06-09 21:28:49", updated_at: "2018-09-21 18:11:51", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 733, award_name: "Express Medical Supply Scholarship", subject_area: "All fields", level: nil, deadline: "2019-06-30", other_req: "Open to full or part-time college students. Create a meme - details on webpage.", sponsor: "Express Medical Supply", amount: "$500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.exmed.net/t-scholarships.aspx", opportunity_type: "Scholarship", created_at: "2016-06-09 21:57:34", updated_at: "2019-02-28 18:11:52", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 741, award_name: "TicketCity Scholarship", subject_area: "All fields", level: nil, deadline: "2018-12-01", other_req: "US Citizen or permanent resident\r\nEnrolled as full-time Freshman, Sophomore, or Junior student (at the time of application) at an accredited 4-year United States University\r\nStudents must have completed 12 hours at an accredited 4-year United States University by February 15th, 2018\r\nMust be able to verify enrollment\r\nEmployees and affiliates of TicketCity and immediate families not eligible\r\nMinimum 2.5 GPA", sponsor: "TicketCity", amount: "$3,000", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.ticketcity.com/ticketcity-annual-college-scholarship-program.html", opportunity_type: "Scholarship", created_at: "2016-06-10 17:17:07", updated_at: "2019-05-30 21:27:48", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "Not active as of 5/30/19", respect_deadline: true, date_reopens: "2020-06-01", updated_by: "robertsm"},
    {id: 742, award_name: "Center for Alcohol Policy Essay Contest", subject_area: "All fields", level: nil, deadline: "2020-01-17", other_req: "The contest is open to all persons who are over the age of 18 as of December 2018. Students, academics, practicing attorneys, policymakers and members of the general public are encouraged to submit essays.", sponsor: "Center for Alcohol Policy", amount: "up to $5,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.centerforalcoholpolicy.org/essay-contest/", opportunity_type: "Scholarship", created_at: "2016-06-10 17:26:23", updated_at: "2019-08-01 16:55:42", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 745, award_name: "Community Foundation of Southern Arizona", subject_area: "All fields", level: nil, deadline: "2019-03-15", other_req: "Graduating or previously graduated from a high school in Cochise, Pima, or Santa Cruz Counties or Graham, Greenlee, Pima or Yuma Counties that lie south of the Gila River.  Must attend/plan to attend college full-time as an undergraduate student.  The primary criteria for selection are financial need and potential for academic success.", sponsor: "Community Foundation of Southern Arizona", amount: "$3,000", state: "AZ", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://cfsaz.org/grants-scholarships/scholarships-faqs/", opportunity_type: "Scholarship", created_at: "2016-06-17 16:08:51", updated_at: "2019-01-11 18:49:07", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-02", updated_by: "walshm"},
    {id: 756, award_name: "Simple Texting College Scholarship", subject_area: "All fields", level: nil, deadline: "2020-01-11", other_req: "Getting accepted to college is an emotional moment. You experience triumph, relief, joy, and accomplishment and, for most of us, it’s a moment we want to share. In 800 words or less, tell us who you texted first to let them know that you had been accepted to college and why it was important to share that moment with them. You must be between the ages of 16 and 22.", sponsor: "Simple Texting", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://simpletexting.com/simple-texting-college-scholarship/", opportunity_type: "Scholarship", created_at: "2016-06-17 17:22:32", updated_at: "2019-08-01 16:59:09", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 757, award_name: "Colonial Ghosts Marketing Scholarship", subject_area: "Marketing", level: nil, deadline: "2018-12-15", other_req: "Include an essay explaining your education goals and pans after graduating college.  Explain why you deserve to win and what the scholarship means to you. This scholarship gives preference to veterans.", sponsor: "Colonial Ghosts", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://colonialghosts.com/about/scholarship/", opportunity_type: "Scholarship", created_at: "2016-06-17 17:36:56", updated_at: "2018-09-21 18:13:36", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 761, award_name: "American Indian Graduate Center Fellowship", subject_area: "Minority", level: nil, deadline: "2019-06-01", other_req: "Pursuing a post-baccalaureate graduate or professional degree as a full time student at an accredited institution in the U.S.;\r\nAble to demonstrate financial need through submission of the AIGC Financial Need Form (FNF), and;\r\nAn enrolled member of a federally recognized American Indian or Alaska Native group, or provide documentation of descent (possess one-fourth degree verifiable federally recognized Indian blood) as verified through submission of a Tribal Eligibility Certificate (TEC).", sponsor: "AIGC", amount: "$1,000 - $5,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.aigcs.org/scholarships/graduate-fellowships/", opportunity_type: "Scholarship", created_at: "2016-06-17 17:59:09", updated_at: "2019-02-28 18:14:21", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 762, award_name: "Wells Fargo American Indian Graduate Scholarship Program", subject_area: "Business; Accounting; Management; Finance; Information Technology; Minority", level: nil, deadline: "2019-06-01", other_req: "Be an enrolled member of a United States federally recognized American Indian tribe or Alaska Native group, verified through submission of a TEC;\r\nBe pursuing a career and degree in fields relating to banking, resort management, gaming operations, management and administration, including accounting, finance, information technology and human resources;\r\nBe a an incoming graduate or professional school student at a U.S. accredited college or university as full-time and degree-seeking student with an average GPA of a 3.00 on a 4.00 scale, and;\r\nDemonstrate financial need through submission of an AIGC Financial Need Form (FNF).", sponsor: "Wells Fargo", amount: "Varies", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.aigcs.org/scholarships/graduate-fellowships/", opportunity_type: "Scholarship", created_at: "2016-06-17 18:01:47", updated_at: "2019-01-24 18:25:33", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 763, award_name: "Accenture American Indian Scholarship Fund", subject_area: "Engineering; Computer Science; Operations Management; Finance; Marketing; Business; Minority", level: nil, deadline: "2019-05-01", other_req: "Each academic year, Accenture selects students who demonstrate character, personal merit and commitment to the American Indian community locally and/or nationally. Merit is demonstrated through leadership in school, civic and extracurricular activities, academic achievement, and motivation to serve and succeed. Eligibility requirements include the following:\r\n\r\nBe an enrolled member of a U.S. federally recognized American Indian tribe or Alaska Native group, verified through submission of the AIGC Tribal Eligibility Certificate (TEC) form;\r\nBe seeking a degree and career in fields of study including: various engineering, computer science, operations management, management, finance, marketing and other business oriented fields;\r\nBe entering a U.S. accredited college or university as a full-time, degree seeking college undergraduate freshmen. High School transcript must have a cumulative GPA of 3.25 or greater, on a 4.0 scale at the end of the seventh semester.\r\nDemonstrate character, personal merit and commitment to the American Indian Community locally and/or nationally. Merit is demonstrated through leadership in school, civic and extracurricular activities, academic achievement, and motivation to serve and succeed.", sponsor: "Accenture", amount: "Varies", state: "All", min_gpa: "3.25", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.aigcs.org/scholarships/undergraduate-scholarships/", opportunity_type: "Scholarship", created_at: "2016-06-17 18:08:00", updated_at: "2019-04-18 22:05:14", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 764, award_name: "AMVETS National Scholarship", subject_area: "Military Family", level: nil, deadline: "2019-04-30", other_req: "For high school seniors: may be a child or grandchild of a veteran or active duty service member/Guard or Reserve.\r\n\r\nFor continuing students, Must provide evidence of active duty status or veteran status having served honorably\r\nMust have a high school diploma or GED\r\nMust demonstrate financial need\r\nMust be enrolled or accepted for enrollment to an eligible program\r\nMust not be in default on a federal student loan\r\nMust not be convicted under state or federal law for sale of or possession of illegal drugs\r\nMust agree to authorize AMVETS to publicize your scholarship award, if you are selected\r\n", sponsor: "AMVETS", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.amvets.org/amvets-in-action/scholarships/", opportunity_type: "Scholarship", created_at: "2016-06-17 18:51:28", updated_at: "2019-01-24 18:27:03", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 769, award_name: "Tau Beta Pi Scholarships", subject_area: "Engineering", level: nil, deadline: "2019-04-01", other_req: "Must be Tau Beta Pi member (Engineering Honor Society) and planning to be a full-time undergraduate student at least one semester the following academic year.", sponsor: "Tau Beta Pi", amount: "$2,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.tbp.org/scholarships.cfm", opportunity_type: "Scholarship", created_at: "2016-06-28 22:35:55", updated_at: "2019-01-24 18:27:19", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 770, award_name: "Outrigger Duke Kahanamoku Scholarship", subject_area: "All fields", level: nil, deadline: "2019-12-01", other_req: "Demonstrate financial need.\r\nBe a full time college undergraduate currently attending an accredited college or university.\r\nParticipate competitively as an amateur in the sports of canoeing, surfing, kayaking, swimming, water polo or volleyball and have a record of accomplishments and intend to compete in college.\r\nBe a resident of Hawai`i.\r\nHave a minimum cumulative GPA of 3.0.", sponsor: "Outrigger Duke Kahanamoku Foundation", amount: "Varies", state: "HI", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://dukefoundation.org/scholarships-and-grants/", opportunity_type: "Scholarship", created_at: "2016-06-28 22:39:32", updated_at: "2018-09-20 21:28:25", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "walshm"},
    {id: 772, award_name: "Youth On Course Scholarship", subject_area: "All fields", level: nil, deadline: "2019-02-18", other_req: "Be enrolled as a full-time senior in a Northern California high school.  Applicants do NOT need to be a member of Youth on Course or play golf, but those that are affiliated will be given priority.  All applicants must prove financial need and merit.", sponsor: "Youth on Course", amount: "Varies", state: "CA", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://youthoncourse.org/scholarships/", opportunity_type: "Scholarship", created_at: "2016-06-28 22:49:13", updated_at: "2019-01-03 00:04:01", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 773, award_name: "Northwest Farm Credit Services Customer Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-01", other_req: "Applicants must be a child of a current customer or employee and are selected based on school and community involvement, scholastic performance and educational goals.", sponsor: "Northwest Farm Credit Services", amount: "$2,000", state: "AK; ID; OR; WA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.northwestfcs.com/Stewardship/Youth/Customer-Undergraduate-Scholarships", opportunity_type: "Scholarship", created_at: "2016-06-28 22:55:07", updated_at: "2019-01-03 00:04:21", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 774, award_name: "Idaho FFA Foundation Scholarship Program", subject_area: "All fields", level: nil, deadline: "2019-02-08", other_req: "Applicant must be currently enrolled as a member of their local Idaho FFA Chapter and the Idaho FFA Association.", sponsor: "Idaho FFA", amount: "Varies", state: "ID", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.idffafoundation.org/scholarships.html", opportunity_type: "Scholarship", created_at: "2016-06-28 23:19:30", updated_at: "2019-01-03 00:04:37", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 775, award_name: "National Dairy Herd Information Association (DHIA) Scholarship Program", subject_area: "All fields", level: nil, deadline: "2019-11-30", other_req: "Applicants will be evaluated on the basis of: scholastic achievements, leadership, community activities and work experience, experience and knowledge of DHIA, and responses to questions on the application. Scholarships are awarded to incoming and continuing, full-time undergraduate students at technical, two-year and four-year institutions. Eligibility is defined as a family member or employee of a herd on DHI test, or a family member of an employee or employee of a DHI affiliate. The DHI affiliate for the herd or affiliate employee must be a member of National DHIA (listed on application).", sponsor: "National Dairy Herd Information Association (DHIA)", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.dhia.org/scholarship.asp", opportunity_type: "Scholarship", created_at: "2016-06-28 23:27:36", updated_at: "2019-08-01 17:00:13", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 776, award_name: "America's Farmers Grow Ag Leaders", subject_area: "Biochemistry; Biology; Communications; Computer Science; Electrical Engineering: Environmental Science; Journalism; Marketing; Mathematics; Mechanical Engineering", level: nil, deadline: "2019-02-06", other_req: "Must be from one of the 1,331 eligible counties (listed on website), be under the age of 23, and be endorsed by two farmers.  Must be pursuing or intending to pursue a degree related to agriculture in one of the majors listed. FFA membership is not required.", sponsor: "Monsanto Fund", amount: "$1,500", state: "AL; AZ; AR; CA; CO; DE; FL; GA; ID; IL; IN; IA; KS; KY; LA; MD; MI; MN; MS; MO; MT; NE; NJ; NM; NY; NC; ND; OH; OK; OR; PA; SC; SD; TN; TX; VT; VA; WA; WI; WY", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.americasfarmers.com/community-outreach/grow-ag-leaders/", opportunity_type: "Scholarship", created_at: "2016-06-29 16:14:17", updated_at: "2018-11-29 23:54:01", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-15", updated_by: "walshm"},
    {id: 777, award_name: "National FFA Scholarship Program", subject_area: "All fields", level: nil, deadline: "2019-02-06", other_req: "Most but not all scholarships require membership in FFA (Future Farmers of America) and require you to be under 23 at time of application.", sponsor: "FFA and various corporate sponsors", amount: "Varies", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.ffa.org/scholarships", opportunity_type: "Scholarship", created_at: "2016-06-29 16:19:51", updated_at: "2018-11-15 23:22:59", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-15", updated_by: "walshm"},
    {id: 778, award_name: "Goldwater Scholarship", subject_area: "Biology; Chemistry; Computer Science; Engineering; Environmental Science; Mathematics; Physics; Psychology; STEM Fields", level: nil, deadline: "2019-11-25", other_req: "ELIGIBILITY: full-time, matriculated sophomore or junior pursuing a degree at an accredited institution of higher education during the following academic year, and intend to pursue research careers in mathematics, the natural sciences, engineering, or psychological sciences.\r\n\r\nINSTITUTIONAL ENDORSEMENT REQUIRED - Contact scholars@up.edu immediately if you are interested in applying for this award, as there may be an on-campus deadline prior to the posted deadline.", sponsor: "Barry Goldwater Scholarship and Excellence in Education Foundation", amount: "$7,500", state: "All", min_gpa: "3.0", contact: "scholars@up.edu", keywords: nil, website: "https://goldwater.scholarsapply.org/", opportunity_type: "Scholarship", created_at: "2016-07-05 19:08:37", updated_at: "2019-08-13 16:31:45", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "This award has a campus deadline. We will publish a deadline of the Monday of Thanksgiving week, but students should contact the USE office ASAP.", respect_deadline: true, date_reopens: nil, updated_by: "leasor"},
    {id: 779, award_name: "Gates Cambridge Scholarship", subject_area: "All fields; International Experience", level: nil, deadline: "2017-10-11", other_req: "This award provides funding for graduate study at Cambridge University. Ideal candidates have demonstrated academic excellence, leadership potential, a commitment to improving the lives of others, and are a good academic fit with Cambridge. An institutional endorsement is not required, but applicants are strongly encouraged to work with the Undergraduate Scholarly Engagement office.", sponsor: "Gates Cambridge Trust", amount: "varies", state: "All", min_gpa: "3.7", contact: "scholars@up.edu", keywords: nil, website: "http://www.gatescambridge.org/", opportunity_type: "Scholarship", created_at: "2016-07-05 19:27:49", updated_at: "2018-04-17 18:21:46", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "2018 deadline remains unavailable.", respect_deadline: true, date_reopens: "2018-09-01", updated_by: "honstu1"},
    {id: 780, award_name: "Truman Scholarship", subject_area: "All fields", level: nil, deadline: "2019-11-25", other_req: "This scholarship supports the graduate education and professional development of outstanding young people who are change agents committed to public service leadership. \r\n\r\nELIGIBILITY: must be a junior year, planning a career in government, military, education, or nonprofit, and a U.S. citizen or national by the date the scholarship is awarded.\r\n\r\nINSTITUTIONAL ENDORSEMENT REQUIRED - Contact scholars@up.edu immediately if you are interested in applying for this award, as there may be an on-campus deadline prior to the posted deadline.", sponsor: "Harry S. Truman Scholarship Foundation", amount: "$30,000", state: "All", min_gpa: "3.0", contact: "scholars@up.edu", keywords: nil, website: "http://www.truman.gov/", opportunity_type: "Scholarship", created_at: "2016-07-05 19:37:03", updated_at: "2019-08-13 16:33:35", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "This award has a campus deadline. We will publish a deadline of the Monday of Thanksgiving week, but students should contact the USE office ASAP.", respect_deadline: true, date_reopens: nil, updated_by: "leasor"},
    {id: 781, award_name: "Marshall Scholarship", subject_area: "All fields; International Experience", level: nil, deadline: "2018-10-01", other_req: "This award provides funding for two years of masters or doctoral work in the UK for excellent students. Applicants are evaluated on academic merit, leadership potential, and ambassadorial potential. \r\n\r\nELIGIBILITY: applicants must hold their first undergraduate degree from an accredited four-year college in the United States, must not have graduated from their first undergraduate college more than 2.5 years before the application deadline, and must not hold certain degrees from the UK.\r\n\r\nINSTITUTIONAL ENDORSEMENT REQUIRED - Contact scholars@up.edu immediately if you are interested in applying for this award, as there will be an on-campus deadline Spring 2018.", sponsor: "Marshall Aid Commemoration Commission", amount: "varies", state: "All", min_gpa: "3.7", contact: "scholars@up.edu", keywords: nil, website: "http://www.marshallscholarship.org/", opportunity_type: "Scholarship", created_at: "2016-07-05 19:57:40", updated_at: "2018-04-17 18:19:56", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-09-01", updated_by: "honstu1"},
    {id: 782, award_name: "Udall Scholarship", subject_area: "All fields", level: nil, deadline: "2020-01-31", other_req: "While all fields are eligible to apply, the Udall Foundation awards scholarships to college sophomores and juniors for leadership, public service, and a commitment to a career related to the environment, or to tribal public policy, or to American Indian health care.\r\n\r\nINSTITUTIONAL ENDORSEMENT REQUIRED - Contact scholars@up.edu immediately if you are interested in applying for this award, as there may be an on-campus deadline prior to the posted deadline.", sponsor: "Udall Foundation", amount: "$7,000", state: "All", min_gpa: "3.0", contact: "scholars@up.edu", keywords: nil, website: "http://www.udall.gov/OurPrograms/Scholarship/Scholarship.aspx", opportunity_type: "Scholarship", created_at: "2016-07-05 20:32:40", updated_at: "2019-08-13 16:32:27", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "This award has a campus deadline. We will publish a deadline of January 30, but students should contact the USE office ASAP.", respect_deadline: true, date_reopens: nil, updated_by: "leasor"},
    {id: 783, award_name: "Critical Language Scholarship Program", subject_area: "All fields; International Experience", level: nil, deadline: "2018-11-16", other_req: "This fellowship is a fully-funded overseas language and cultural immersion program, studying a critical need language in a country that speaks the language being studied. No prior experience  is necessary for some languages.  Award recipients are selected on the basis of merit with consideration for: academic record and potential to succeed in a rigorous academic setting; ability to adapt to a different cultural environment; plan for continuation of study of the language; and plan to use the language in future career.\r\n\r\nELIGIBILITY: must be a matriculated student at the time of application and 18 years old by the time the program starts.", sponsor: "U.S. Department of State Bureau of Educational and Cultural Affairs", amount: "varies", state: "All", min_gpa: "None", contact: "scholars@up.edu", keywords: nil, website: "http://clscholarship.org/", opportunity_type: "Fellowship", created_at: "2016-07-05 20:47:07", updated_at: "2018-03-20 19:31:04", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-09-01", updated_by: "honstu1"},
    {id: 784, award_name: "Leidos STEM Scholarship", subject_area: "STEM; Science; Technology; Engineering; Mathematics", level: nil, deadline: "2018-06-30", other_req: "Leidos STEM Scholarship was established by UNCF and Leidos Holdings Inc. to provide merit-based scholarships to assist students majoring in STEM related fields. Eligible applicants must meet the following requirements:\r\n\r\nMaintain a minumum cumulative GPA of 2.50 or better on a 4.0 scale;\r\nMajor in any STEM-related Fields;\r\nBe undergraduate attending an HBCU or any other accredited four-year instittion in the fall 2018.", sponsor: "Leidos Holdings Inc.", amount: "Varies", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://scholarships.uncf.org/Program/Details/96ac2ba5-76e4-4aae-b166-19472fe06747", opportunity_type: "Scholarship", created_at: "2016-07-06 22:00:24", updated_at: "2019-05-23 17:09:15", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "Check if offered 20-21", respect_deadline: true, date_reopens: "2020-05-30", updated_by: "hobbsm"},
    {id: 787, award_name: "Davies-Jackson Scholarship", subject_area: "Economics; English; French; German; History; Music; Philosophy; Political Science; Psychology; Sociology; Spanish", level: nil, deadline: "2019-10-15", other_req: "Award for first-generation students to study at Cambridge University for two years after completing their undergraduate degree at UP. Please email scholars@up.edu to meet with and advisor for assistance applying for this award.", sponsor: "The Davies-Jackson Scholarship Program", amount: "varies", state: "All", min_gpa: "3.7", contact: "scholars@up.edu", keywords: nil, website: "http://www.cic.edu/programs-and-services/programs/pages/davies-jackson-scholarship.aspx", opportunity_type: "Scholarship", created_at: "2016-07-07 00:28:50", updated_at: "2019-08-13 16:29:59", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: nil, updated_by: "leasor"},
    {id: 788, award_name: "NW Priority Credit Union Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-08", other_req: "Must be a primary credit union member for at least one year.", sponsor: "NW Priority Credit Union", amount: "$1,000", state: "OR; WA", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.nwprioritycu.org/scholarship-2019/", opportunity_type: "Scholarship", created_at: "2016-07-13 22:28:10", updated_at: "2019-01-03 00:05:16", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 789, award_name: "St. Helens Community Credit Union Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-31", other_req: "Applicant must be a member of St. Helens Community Credit Union with accounts in good standing at the time of application.\r\nApplicant must be a graduating high school senior.\r\nApplicant must have a grade-point average (GPA) of 3.0 or higher.  Winners are selected based on video submission, academic achievement and community involvement/extracurricular activities.", sponsor: "St. Helens Community Credit Union", amount: "Varies", state: "OR", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.shcu.org/scholarship/", opportunity_type: "Scholarship", created_at: "2016-07-13 22:32:56", updated_at: "2019-01-24 18:27:45", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 790, award_name: "First Tech Federal Credit Union Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-31", other_req: "Be a First Tech member in good standing\r\nPlan to enroll or already be enrolled as a full-time student at an accredited institution for the fall quarter/semester\r\nHave a minimum 3.5 cumulative grade point average", sponsor: "First Tech Federal Credit Union", amount: "$5,000", state: "OR", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.firsttechfed.com/Discover-First-Tech/Discover-First-Tech/Scholarships", opportunity_type: "Scholarship", created_at: "2016-07-13 22:52:29", updated_at: "2019-02-28 18:16:04", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 791, award_name: "Elie Wiesel Prize in Ethics", subject_area: "All fields", level: nil, deadline: "2018-12-14", other_req: "They are registered undergraduate full-time juniors or seniors at accredited four-year colleges or universities in the United States during the fall semester, or they fulfill the guideline requirements and are studying abroad during the school year, as long as they are registered as full-time juniors or seniors at their home schools in the U.S., or they are international or non-citizen students who fill the guideline requirements and are attending schools in the U.S.", sponsor: "The Elie Wiesel Foundation for Humanity", amount: "$5,000", state: "All", min_gpa: "", contact: "Financial Aid", keywords: nil, website: "http://www.eliewieselfoundation.org/prizeinethics.aspx", opportunity_type: "Scholarship", created_at: "2016-07-15 21:15:02", updated_at: "2018-09-21 18:15:26", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 794, award_name: "Indian Health Services Scholarship", subject_area: "Nursing, Pre-Med; Pre-Health; Minority", level: nil, deadline: "2019-03-28", other_req: "Applicants must also meet specific eligibility requirements:  Be a member or descendant of a federally recognized, state-recognized or terminated American Indian Tribe or Alaska Native village. Be a high school graduate or the equivalent. Have a minimum 2.0 GPA. Be capable of completing a health profession degree program. Intend to serve Indian people as a health professional in your chosen discipline.  There is a service commitment tied to this scholarship.", sponsor: "Indian Health Services ", amount: "varies", state: "All", min_gpa: "2.0", contact: "Financial Aid", keywords: nil, website: "https://www.ihs.gov/scholarship/applynow/", opportunity_type: "Scholarship", created_at: "2016-07-15 21:37:09", updated_at: "2019-01-03 00:05:30", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 796, award_name: "Oregon Space Grant Consortium Scholarship", subject_area: "Engineering, Mathematics, Science, Technology; STEM Education; MAT", level: nil, deadline: "2019-05-24", other_req: "Applicants must be currently enrolled and in good academic standing at a member institution (UP qualifies). \r\n Scholarships are open to undergraduate students who meet the following eligibility criteria:\r\n• Student is enrolled in a minimum of 12 credit hours per term at an affiliated 4-year institution at the time of application and remains enrolled for the duration of the award (through spring 2020).\r\n• Student is enrolled in STEM, STEM education coursework or an MAT program during the 2019-20 academic year\r\n• Student maintains good academic standing\r\n• Student is a U.S. Citizen", sponsor: "Oregon NASA Space Grant Consortium", amount: "$3,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://spacegrant.oregonstate.edu/scholarships-and-undergraduate-fellowships", opportunity_type: "Scholarship", created_at: "2016-07-15 21:45:32", updated_at: "2019-05-05 20:53:11", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 797, award_name: "Olin E. Teague Memorial Scholarship", subject_area: "Engineering, Science; STEM", level: nil, deadline: "2019-10-11", other_req: "The scholarship, in the amount of $4,000.00, is awarded to a graduating high school senior at an accredited U.S. high school. The student must be a U.S. Citizen. This scholarship program is intended to encourage talented young people to pursue careers in aerospace fields.", sponsor: "National Space Club and Foundation", amount: "$4,000", state: "All", min_gpa: "", contact: "Financial Aid", keywords: nil, website: "http://www.spaceclub.org/education/olin-teague.html", opportunity_type: "Scholarship", created_at: "2016-07-15 21:48:12", updated_at: "2019-08-01 17:01:20", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 799, award_name: "Leaders Save Lives Scholarship Program", subject_area: "All fields", level: nil, deadline: "2019-08-31", other_req: "Organize a blood drive during summer or winter break (dates on website) and if your blood drive collects at least 25 pints you are entered to win a scholarship.", sponsor: "American Red Cross", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.redcrossblood.org/leaderssavelives", opportunity_type: "Scholarship", created_at: "2016-07-20 23:24:45", updated_at: "2018-08-29 23:08:24", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 800, award_name: "P.E.O. Program for Continuing Education", subject_area: "All fields", level: nil, deadline: "2019-11-15", other_req: "Female who has had at least 24 consecutive months as a non-student sometime in her adult life and is within 24 consecutive months of completing her educational program.  Applications are accepted no less than 10 weeks prior to the start of the term and no more than four months prior.  If you do not have a local chapter willing to sponsor you, there is a form at the bottom of the page you can use to request a chapter to sponsor you.", sponsor: "P.E.O.", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.peointernational.org/pce-eligibility-requirements", opportunity_type: "Scholarship", created_at: "2016-07-21 15:57:13", updated_at: "2019-01-03 00:06:03", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: " Applications are accepted no less than 10 weeks prior to the start of the term and no more than four months prior so September - mid-November for spring, January - mid-March for summer and April - mid-June for fall.", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 801, award_name: "American Indian Full Circle Scholarship Program", subject_area: "Minority", level: nil, deadline: "2019-05-31", other_req: "American Indian or Alaskan Native who is registered as a member of a federal or state recognized tribe, or a descendant of at least one grandparent or parent who is an enrolled tribe member (Alaska Natives may use Native Corporation membership).  Some scholarships require a higher GPA than 2.0.  Scholarships are generally based upon merit or demonstrated financial need.", sponsor: "American Indian College Fund", amount: "Varies", state: "All", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://collegefund.org/student-resources/scholarships/", opportunity_type: "Scholarship", created_at: "2016-07-21 16:46:24", updated_at: "2019-01-03 00:06:32", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 802, award_name: "Association on American Indian Affairs Scholarships", subject_area: "Minority", level: nil, deadline: "2019-07-01", other_req: "Be enrolled with his or her respective Tribe, either federally recognized or non-federally recognized Tribe, from the continental US or Alaska. \r\nSubmit a copy ofTribal enrollment (there is no minimum blood quantum requirement for eligibility). This can be a copy of the student's Tribal I.D. card or a copy of an official letter from the Tribe.\r\nBe enrolled as full-time student. \r\n​Have a minimum 2.5 out of 4.0 GPA.\r\nAttend an accredited institution and be seeking an Associate's Degree or higher (AAIA does not fund certificate programs or seminaries). ", sponsor: "Association on American Indian Affairs", amount: "Varies", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.indian-affairs.org/scholarships.html", opportunity_type: "Scholarship", created_at: "2016-07-21 16:50:56", updated_at: "2019-04-18 22:06:53", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Scholarship Applications for Fall 2019 - Spring 2020 will be available and accepted starting May 31, 2019.  The deadline for applications is July 1, 2019", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 803, award_name: "American Indian Education Fund Undergraduate Scholarship", subject_area: "Minority", level: nil, deadline: "2019-04-04", other_req: "Native American, Alaska Native, or Native Hawaiian (student or one parent must be enrolled and have documentation).\r\nAttending an accredited 2 or 4 year college/university or technical/vocational school.\r\nMust be enrolled as a full-time student.\r\nGPA between 2.5 - 3.5 is desirable, however, ALL current or future undergraduate students are encouraged to apply, an ACT score of 14 or above is desirable.", sponsor: "American Indian Education Fund", amount: "$2,000", state: "All", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.nativepartnership.org/site/PageServer?pagename=aief_services_scholarships_undergrad", opportunity_type: "Scholarship", created_at: "2016-07-21 16:58:55", updated_at: "2019-02-28 18:17:16", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 804, award_name: "American Indian Education Fund Graduate Scholarships", subject_area: "Minority", level: nil, deadline: "2019-04-04", other_req: "American Indian/Alaskan Native/Native Hawaiian students who are enrolled in their tribe (or parent is enrolled) and is  pursuing a Masters or Doctoral degree.  Must be enrolled between 6-18 credit hours per term.  Online courses are not eligible. GPA between 2.5-3.5 is desirable, however, all current graduate students are encouraged to apply. ", sponsor: "American Indian Education Fund", amount: "$1,000 - 2,000", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.nrcprograms.org/site/PageServer?pagename=aief_services_scholarships_graduate", opportunity_type: "Scholarship", created_at: "2016-07-21 17:02:14", updated_at: "2019-02-28 18:18:35", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 805, award_name: "Harvey Samuelsen Scholarship", subject_area: "All Fields", level: nil, deadline: "2019-06-28", other_req: "Be a resident of a Bristol Bay CDQ community (Aleknagik, Clarks Point, Dillingham, Egegik, Ekuk, Ekwok, King Salmon, Levelock, Manokotak, Naknek, Pilot Point, Port Heiden, Portage Creek, South Naknek, Togiak, Twin Hills, Ugashik) with a high school diploma or GED and financial need.  Be registered as a full-time student at an accredited school.  Undergraduates must have a minimum 2.0 cumulative GPA, graduate students must have a minimum 3.0 cumulative GPA.", sponsor: "Bristol Bay Economic Development Corporation", amount: "Varies", state: "AK", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.bbedc.com/?page_id=151", opportunity_type: "Scholarship", created_at: "2016-07-21 18:16:31", updated_at: "2019-05-30 20:50:44", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 808, award_name: "Black United Fund of Oregon Scholarships", subject_area: "Minority", level: nil, deadline: "2019-03-03", other_req: "Student MUST identify as African-American, African Diaspora, Black, or Afro Decent. Student MUST be a graduating high school senior, entering their first full-time year at the college or university of their choice. Student should have a GPA of 2.0 to 3.0 (on a 4.0 scale). Note: Students with higher or lower GPAs are welcomed and encouraged to apply, but priority will be given to students with GPAs in the 2.0 to 3.0 range. \r\n", sponsor: "Black United Fund of Oregon", amount: "$1,500 - $3,000", state: "OR; WA", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.bufor.org/empower-scholarships/", opportunity_type: "Scholarship", created_at: "2016-07-26 23:27:53", updated_at: "2018-11-15 23:25:11", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-15", updated_by: "walshm"},
    {id: 809, award_name: "National Hispanic Health Professional Scholarship", subject_area: "Nursing", level: nil, deadline: "2019-09-26", other_req: "Will award 26 scholarships to graduate students in dental, medical, nursing, pharmacy, policy, and public health, who exhibit exceptional academic performance, documented leadership activities, and have a commitment to a career providing healthcare services to the Hispanic community in the US.", sponsor: "National Hispanic Health Foundation", amount: "Varies", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://nhmafoundation.org/programs/the-nhhf-scholarship/", opportunity_type: "Scholarship", created_at: "2016-07-27 23:06:38", updated_at: "2019-05-30 20:49:51", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 810, award_name: "Corinne Jeannine Schillings Girl Scout Scholarship", subject_area: "Foreign Language; Spanish; French; German", level: nil, deadline: "2019-05-17", other_req: "The Foundation awards scholarships to undergraduate college/university women who have attained at least the honor of Silver Award Girl Scout, and who plan to or are currently pursuing a major/minor in foreign language at a four year college/university.  The scholarship provides $1,500 per academic year.  The scholarship may be renewed three times following the initial award, for a total $6,000 maximum award. Scholarship renewal is not automatic, however.  Awardees must maintain a “B” or better grade point average overall and in a foreign language (3.0 on a 4.0 scale, or 4.0 on a 5.0 scale), and submit the renewal application and all required attachments each year.", sponsor: "Corinne Jeannine Schillings Foundation", amount: "$1,500", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.cjsfoundation.org/html/application.html", opportunity_type: "Scholarship", created_at: "2016-07-27 23:15:26", updated_at: "2019-05-05 20:54:54", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-15", updated_by: "hobbsm"},
    {id: 811, award_name: "Corinne Jeannine Schillings Girl Scout Study Abroad Scholarship", subject_area: "Study Abroad; International Experience", level: nil, deadline: "2019-12-09", other_req: "APPLICATION FOR SPRING STUDY ABROAD OPENS 10/15. The Foundation supports undergraduate college/university Silver or Gold Award Girl Scouts who plan to study abroad, irrespective of major/minor.  The Scholarship provides $1,000 directly to the awardee upon verification that they have begun their study abroad experience.  The Scholarship to Study Abroad IS NOT renewable.  Applications may be submitted for studying abroad during first semester, second semester, summer, or the full academic year.  Awardees must maintain at least a “B” or higher grade point overall (3.0 on a 4.0 scale or 4.0 on a 5.0 scale).", sponsor: "Corinne Jeannine Schillings Foundation", amount: "$1,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.cjsfoundation.org/html/travel_study.html", opportunity_type: "Scholarship", created_at: "2016-07-27 23:20:28", updated_at: "2019-05-05 20:59:58", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Application period for full-year, summer and fall travel is March 15 to mid-May\r\nApplication period for spring semester is 10/15 - mid-December", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
