    {id: 813, award_name: "Academics and Arts Scholarships", subject_area: "Minority", level: nil, deadline: "2019-02-23", other_req: "Graduating African American high school senior who has demonstrated scholastic potential, high achievement, and leadership ability.  Must a 3.0 minimum cumulative GPA and be a resident of the the Portland metro area (Multnomah County, Washington County, or Clackamas Coutny) or Vancouver, WA (Clark County).  Two types of scholarships are available, one for Academics and one for the Arts.", sponsor: "Portland Chapter of The Links, Inc.", amount: "varies", state: "OR; WA", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://portlandlinksinc.org/2019-scholarship-application/", opportunity_type: "Scholarship", created_at: "2016-07-28 17:23:14", updated_at: "2019-01-03 00:07:51", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
