    {id: 817, award_name: "Reach for the Gold Book Scholarship", subject_area: "Minority", level: nil, deadline: "2018-05-31", other_req: "Must be a female student of color. Woman of color identifies with any of the following ethnic backgrounds: Hispanic / Latina, Native American / Alaskan Native, Arab or Middle Eastern, Asian or Pacific Islander, or Black / African American. Must be a senior in high school or secondary school, graduating by end of June 2018.\r\nMust reside in the United States; Citizen or Non-Citizen - Open to all regardless of immigration status.\r\nMust be entering an accredited 4-year college or university program as a first year student by the fall 2018 semester. Must have a minimum 3.4 on a 4.0 GPA scale. Must have a minimum (math, writing, and critical reading) SAT score of 1200, or a minimum ACT Composite score of 24.", sponsor: "Omega Phi Beta Sorority", amount: "$1,000", state: "All", min_gpa: "3.4", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.omegaphibeta.org/national-initiatives/scholarships-grants/", opportunity_type: "Scholarship", created_at: "2016-07-28 21:56:13", updated_at: "2019-05-30 20:43:55", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 819, award_name: "Charles M. Bair Memorial Scholarship", subject_area: "All Fields", level: nil, deadline: "2020-03-15", other_req: "Applicants must have completed high school in Meagher or Wheatland County, Montana or be a current resident of Meagher or Wheatland County.  Awards are made on the basis of academic achievement, moral character, and financial need.", sponsor: "Bair Family Trusts", amount: "Tuition, Fees, Books, Room and Board", state: "MT", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.charlesmbairtrusts.org/scholarship.html", opportunity_type: "Scholarship", created_at: "2016-08-11 15:54:32", updated_at: "2019-08-01 17:02:12", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 820, award_name: "Spokane Indians and Banner Bank Scholarship Program", subject_area: "All Fields", level: nil, deadline: "2019-05-03", other_req: "Students graduating from high school in Spokane County (WA) and Kootenai County (ID) are eligible to fill out the application that will be judged on scholarship, leadership, community involvement and character.  Scholarship winners will also be invited to enjoy a Spokane Indians baseball game with their immediate family and be recognized during an on-field ceremony.", sponsor: "Spokane Indians and Banner Bank", amount: "$500", state: "ID; WA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.milb.com/content/page.jsp?ymd=20160303&content_id=166093996&fext=.jsp&sid=t486&vkey=", opportunity_type: "Scholarship", created_at: "2016-08-11 16:02:06", updated_at: "2019-03-27 21:43:36", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
    {id: 828, award_name: "Ally Digital Media Scholarship", subject_area: "All fields", level: nil, deadline: "2019-12-31", other_req: "Draw a doodle on \"Social Media 2018-19\" or write a well-informed, inspiration piece on the same topic. All works must be original or you risk disqualification The scholarship amount is non-transferable to anyone other than the current participant. The scholarship is only available to students for the academic year.", sponsor: "Ally Digital Media", amount: "$500", state: "All", min_gpa: "none", contact: "Financial Aid", keywords: nil, website: "https://www.allydigitalmedia.com/scholarship.php", opportunity_type: "Scholarship", created_at: "2016-08-11 17:30:28", updated_at: "2019-05-30 17:46:35", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-06-15", updated_by: "robertsm"},
    {id: 829, award_name: "PeaceHealth Southwest Medical Center's Foundation Health Career Scholarship", subject_area: "Nursing", level: nil, deadline: "2019-04-12", other_req: "Applicants must have a minimum cumulative GPA of 3.0 as a part-time or full-time student.\r\nApplicants must be employed at least 6 months by PeaceHealth Southwest. (PHMG and SSC are not eligible candidates.) Applicants must provide the PeaceHealth Southwest Medical Center Scholarship Committee with a completed application, including uploading all required documents listed in the section below. Junior Volunteer applicants must be graduating seniors. Students of dentistry, naturopathy, chiropractic, massage therapy, acupuncture, and other professions not currently available at PeaceHealth Southwest Medical Center are not eligible for consideration.", sponsor: "PeaceHealth", amount: "Varies", state: "WA", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://peacehealth.org/foundation/sw-washington/about-the-foundation/Pages/Health-Career-Scholarships", opportunity_type: "Scholarship", created_at: "2016-08-11 18:06:24", updated_at: "2019-04-18 22:09:16", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Application not open when put in database, check requirements carefully before posting.", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 830, award_name: "Automotive Aftermarket Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-31", other_req: "Full time students at an accredited U.S. college or university or an ASE/NATEF Certified post-secondary automotive, heavy duty, or collision repair school. Graduating high school seniors planning to be full time students at any of the above. No GPA requirement ", sponsor: "Global Automotive Aftermarket Symposium", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.automotivescholarships.com/apply_online.cfm", opportunity_type: "Scholarship", created_at: "2016-08-11 18:18:04", updated_at: "2018-08-29 23:09:57", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 833, award_name: "Shawn Carter Foundation Scholars", subject_area: "All fields", level: nil, deadline: "2019-04-30", other_req: "Applicants must be 25 years or younger and have a compelling desire to pursue higher education in spite of personal, socio-economic setbacks.  Awardees are hardworking, resilient and determined individuals who what to make positive contributions to their local and global communities.", sponsor: "Shawn Carter Scholarship Fund", amount: "Varies", state: "All", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.shawncartersf.com/scholarship-fund/#eligibility", opportunity_type: "Scholarship", created_at: "2016-08-11 22:36:20", updated_at: "2019-05-07 04:23:51", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "hobbsm"},
    {id: 834, award_name: "Branson Shows Inspired Scholarship", subject_area: "All fields", level: nil, deadline: "2018-10-15", other_req: "Must be between the ages of 16 and 19. Submit a 500 - 2,000 word essay (prompt on website)", sponsor: "bransonshowtickets.com", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.bransonshowtickets.com/company/scholarship.aspx", opportunity_type: "Scholarship", created_at: "2016-08-19 16:43:45", updated_at: "2018-08-24 18:14:55", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-08-15", updated_by: "geigerr"},
    {id: 835, award_name: "FormSwift Scholarship Program", subject_area: "All fields", level: nil, deadline: "2019-09-15", other_req: "Create a business plan infographic about one of the suggested topics (on website).", sponsor: "FormSwift", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://formswift.com/startup-scholarship", opportunity_type: "Scholarship", created_at: "2016-08-19 16:46:44", updated_at: "2019-05-07 04:26:17", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "4 awards offered per year =\r\n3/15/2020 spring\r\n6/15/2019 summer\r\n9/15/2019 fall\r\n12/15/2019 winter", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "hobbsm"},
    {id: 836, award_name: "College JumpStart Scholarship", subject_area: "All fields", level: nil, deadline: "2019-10-17", other_req: "High school 10th - 12th grader, college student or non-traditional student who is committed to using education to better your life and that of your family and/or community.  Scholarship is awarded based on merit, financial need is not considered.", sponsor: "College JumpStart", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.jumpstart-scholarship.net/", opportunity_type: "Scholarship", created_at: "2016-08-19 16:51:50", updated_at: "2019-05-30 22:30:09", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "2 awards annually (April and October deadlines)", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "robertsm"},
    {id: 838, award_name: "George Montgomery/NRA Youth Wildlife Art Contest", subject_area: "All fields", level: nil, deadline: "2018-10-31", other_req: "The George Montgomery/NRA Youth Wildlife Art Contest offers young artists interested in hunting and wildlife an outlet to use their creative talent, practice artistic techniques, and refine wildlife identification skills through the creation of original works. This contest encourages youth to nurture their interest for the visual arts, hunting, and wildlife conservation. It also reinforces the positive effects of hunting and wildlife conservation with the public at large. \r\n\r\nStudents grades 1 through 12 (including home-schooled children) are eligible to enter and all entries must portray North American game birds or animals that may be legally hunted or trapped.", sponsor: "NRA", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://artcontest.nra.org/", opportunity_type: "Scholarship", created_at: "2016-08-19 17:01:35", updated_at: "2018-08-29 23:11:48", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 839, award_name: "Jacqueline Harrison Memorial Scholarship", subject_area: "All fields", level: nil, deadline: "2018-10-01", other_req: "This scholarship is for students whose parents or themselves were victims of a violent crime.  Candidates are awarded based on academic and community involvement, potential for academic success and financial need.", sponsor: "Jacqueline Harrison Scholarship Fund", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://imsimplyd.com/jacqueline-harrison-memorial-scholarship-fund/", opportunity_type: "Scholarship", created_at: "2016-08-19 17:08:56", updated_at: "2019-05-30 20:43:07", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Not active as of 5/30/19", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 840, award_name: "Students with Heart", subject_area: "All fields", level: nil, deadline: "2019-10-01", other_req: "This scholarship is for students with a cardiac disease or deformity.", sponsor: "Students with Heart Foundation", amount: "Up to $6,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.studentswithheart.org/scholarships.html", opportunity_type: "Scholarship", created_at: "2016-08-19 17:23:27", updated_at: "2019-07-17 22:09:13", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-07-01", updated_by: "robertsm"},
    {id: 843, award_name: "American Bullion Scholarship", subject_area: "All fields", level: nil, deadline: "2019-10-31", other_req: "Applicant must be a legal resident of the United States or hold a valid U.S. student visa who is currently enrolled as a full-time undergraduate student at an accredited college or university in the US.", sponsor: "americanbullion.com", amount: "$1000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.americanbullion.com/scholarship/", opportunity_type: "Scholarship", created_at: "2016-08-19 18:42:19", updated_at: "2019-05-07 04:27:31", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "hobbsm"},
    {id: 844, award_name: "Buildium Women in Technology", subject_area: "STEM; Science; Technology; Engineering; Mathematics", level: nil, deadline: "2019-04-15", other_req: "You must be a female enrolled in an accredited undergraduate or graduate degree program in the United States or Canada, studying Science, Technology, Engineering, or Mathematics (STEM). Applicants must be 18 years of age or older and in good academic standing with their college or university.", sponsor: "Buildium", amount: "$2,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.buildium.com/women-in-technology-scholarship/", opportunity_type: "Scholarship", created_at: "2016-08-19 18:48:54", updated_at: "2019-04-18 22:10:31", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Two awards per year - 10/1 to 11/1 and 3/15 to 4/15", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "hobbsm"},
    {id: 848, award_name: "Wells Fargo American Indian Scholarship", subject_area: "Accounting, Finance, Information Technology, Business; STEM; Minority", level: nil, deadline: "2019-06-01", other_req: "Be pursuing a career and degree in fields relating to banking, resort management, gaming operations, management and administration, including accounting, finance, information technology and human resources;\r\nMust be an enrolled member of a federally recognized American Indian tribe or Alaska Native group OR provide documentation of ancestry to possession of one-fourth degree Indian blood of a federally recognized tribe.\r\nBe a college junior or senior at a U.S. accredited college or university as full time and degree seeking student maintaining an average GPA of a 3.00 on a 4.00 scale at the time of application;\r\nDemonstrate financial need through submission of the AIGC Financial Need Form (FNF).\r\n Exclusive consideration is paid to degree candidates in the Science, Technology, Engineering and Mathematics (STEM) fields (may include:  Medical and Life Sciences; Engineering and Physical Sciences; Mathematics and Computational Sciences, Earth, Environmental and Agriculture Sciences; and Technology) to be verified through the submission of current transcripts or proof of acceptance to an eligible program.", sponsor: "Wells Fargo", amount: "up to $5,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.aigcs.org/scholarships/undergraduate-scholarships/", opportunity_type: "Scholarship", created_at: "2016-08-24 16:34:20", updated_at: "2019-02-28 18:34:03", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 849, award_name: "Wells Fargo Scholarship for Undergraduate American Indian and Alaska Native Students", subject_area: "Minority", level: nil, deadline: "2019-05-01", other_req: "The Wells Fargo Scholarships for Undergraduate American Indian and Alaska Native Students will fund full-time and degree-seeking college freshmen, sophomores, juniors and seniors who hold a current GPA of 2.7 or higher with up to $5,000 for one year of study in any chosen major at any accredited institution in the United States.The Wells Fargo Scholarships for Undergraduate American Indian and Alaska Native Students will fund full-time and degree-seeking college freshmen, sophomores, juniors and seniors who hold a current GPA of 2.7 or higher with up to $5,000 for one year of study in any chosen major at any accredited institution in the United States.", sponsor: "Wells Fargo", amount: "up to $5,000", state: "All", min_gpa: "2.7", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.aigcs.org/scholarships/undergraduate-scholarships/", opportunity_type: "Scholarship", created_at: "2016-08-24 16:36:33", updated_at: "2019-02-28 18:35:24", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 850, award_name: "Healthcare Education Awards for Yamhill County Residents", subject_area: "Nursing", level: nil, deadline: "2019-04-15", other_req: "Applicant must be US Citizen with residence in Yamhill County, OR or Willamina.  High school seniors must have a minimum 3.5 GPA, current college students a 3.3.", sponsor: "Willamette Valley Medical Center", amount: "Varies", state: "OR", min_gpa: "3.3", contact: "financial.aid@example.edu", keywords: nil, website: "http://willamettevalleymedical.com/about-us/volunteer-and-giving-opportunities/healthcare-education-awards/", opportunity_type: "Scholarship", created_at: "2016-08-24 19:11:00", updated_at: "2019-04-18 22:11:22", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 851, award_name: "National Independent Automobile Dealers Association", subject_area: "All fields", level: nil, deadline: "2019-03-22", other_req: "Be classified as a high school senior during the current school year and legally residing in one of the 4 regions listed on the website. Have maintained an outstanding academic achievement record as reflected by an official high school transcript. Demonstrate an aptitude for college work as measured by SAT or ACT scores.\r\n", sponsor: "NIADA", amount: "$3,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.niada.com/foundation_scholarship.php", opportunity_type: "Scholarship", created_at: "2016-08-24 19:17:13", updated_at: "2018-10-29 22:58:41", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 853, award_name: "San Diego County Salute to Education", subject_area: "All fields", level: nil, deadline: "2019-02-15", other_req: "Any high school senior who is a candidate for graduation in the spring semester, attends an accredited public or private school in San Diego County and is a resident of San Diego County who has not received a full four year scholarship may apply for a San Diego County Salute to Education scholarship. Students who receive a full four year scholarship are not eligible to receive a San Diego County Salute to Education scholarship.", sponsor: "San Diego County Ford Dealers", amount: "$1,000", state: "CA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.salutetoeducation.com/", opportunity_type: "Scholarship", created_at: "2016-08-24 21:46:29", updated_at: "2018-11-30 19:03:59", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 855, award_name: "Sons of Norway Scholarships", subject_area: "All fields; Study Abroad; International Experience", level: nil, deadline: "2019-01-15", other_req: "Multiple scholarships with differing criteria and different deadlines.", sponsor: "Sons of Norway", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.sofn.com/foundation/scholarships/", opportunity_type: "Scholarship", created_at: "2016-08-25 18:12:53", updated_at: "2018-11-07 22:08:33", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-05", updated_by: "walshm"},
    {id: 856, award_name: "Alaska Peace Officers Association Scholarships", subject_area: "All fields", level: nil, deadline: "2019-04-15", other_req: "Several chapters offer scholarships with various deadlines between middle of March to April 15. Some give preference to students planning to pursue law enforcement as a career.", sponsor: "Alaska Peace Officers", amount: "Varies", state: "AK", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.apoaonline.org/scholarships.html", opportunity_type: "Scholarship", created_at: "2016-08-25 18:28:59", updated_at: "2019-02-28 18:36:33", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 857, award_name: "Alaska Native Tribal Health Consortium Scholarship", subject_area: "Nursing; Computer Science; Medical Engineering; Minority", level: nil, deadline: "2018-06-15", other_req: "Alaska Native or American Indian student who is a permanent Alaska resident and interested in working in a health care related field.", sponsor: "Alaska Native Tribal Health Consortium", amount: "$5,000", state: "AK", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://anthc.org/scholarship-opportunities/", opportunity_type: "Scholarship", created_at: "2016-08-25 18:47:05", updated_at: "2019-05-30 20:42:00", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "robertsm"},
    {id: 859, award_name: "Navy-Marine Corps Relief Society Grant ", subject_area: "Military Family", level: nil, deadline: "2019-05-01", other_req: "Be a child (under age 23) of an active duty, retired or deceased Sailor or Marine or be a spouse of an active duty or retired Sailor or Marine. \r\nBe registered in DEERS (Defense Eligibility Enrollment Reporting System).\r\nBe enrolled, or planning to enroll, as a full-time student for the entire academic year (Aug-Jun) and pursuing initial undergraduate degree at a post-secondary, technical, or vocational institution that is:\r\nLocated in the United States and accredited by a regional/national accrediting agency recognized by the U.S. Secretary of Education and a participant in the U.S. Department of Education Title IV Financial Aid Programs.\r\nHave a cumulative 2.0 or better GPA on a 4.0 grade scale.\r\nDEMONSTRATE FINANCIAL NEED.", sponsor: "Navy-Marine Corps Relief Society", amount: "Up to $3,000", state: "All", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.nmcrs.org/pages/education-loans-and-scholarships", opportunity_type: "Scholarship", created_at: "2016-08-25 21:54:56", updated_at: "2018-11-01 18:23:40", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 861, award_name: "Salem Health Foundation Scholarship", subject_area: "Nursing", level: nil, deadline: "2019-03-29", other_req: "Applicants must have a permanent residence in Marion or Polk County or be a current employee or immediate family member of a current employee at Salem Health, and at the time of application must be accepted into or have applied to a formal training program in a healthcare field.  Depending on the specific program of study, there may be one to two years of prerequisite courses to complete prior to applying for the actual program; these prerequisite studies are not eligible for scholarship assistance.", sponsor: "Salem Health Foundation", amount: "Varies", state: "OR", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.salemhealth.org/home/salem-health-foundations/hospital-scholarships-", opportunity_type: "Scholarship", created_at: "2016-08-25 23:42:13", updated_at: "2019-03-27 20:52:47", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "hobbsm"},
    {id: 863, award_name: "DIPAC Ladd Macaulay Memorial Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-22", other_req: " Ladd Macaulay Memorial Scholarships are open to all graduates of high schools in Juneau, Haines, Skagway, Hoonah, Chatham, and Kake School Districts, and graduating home school students residing in Juneau, Lynn Canal, or northern Chatham Straits area. Must attend college or university full time.", sponsor: "Douglas Island Pink and Chum (DIPAC)", amount: "$2,000", state: "AK", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.dipac.net/dipac-scholarships/", opportunity_type: "Scholarship", created_at: "2016-08-26 21:33:50", updated_at: "2019-01-24 18:28:29", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 865, award_name: "Swiss Benevolent Society Scholarships", subject_area: "All Fields", level: nil, deadline: "2019-04-30", other_req: "Applicants must: be of Swiss descent by demonstrating that applicant or at least one parent is a Swiss national, registered with the Swiss Consulate General of San Francisco (or carry a valid Swiss passport), have resided in  Counties in Northern California (list available on website) for a minimum of three years preceding the date of initial application, have applied for admission to any accredited institution of higher learning in the United States offering a baccalaureate or graduate degree. (In exceptional cases, students attending a community college or an accredited vocational school in California may be considered.),be a full time student: 12 undergraduate or 9 graduate units per term.", sponsor: "Swiss Benevolent Society of San Francisco", amount: "Varies", state: "CA", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.sbssf.com/scholarships/", opportunity_type: "Scholarship", created_at: "2016-08-31 16:56:06", updated_at: "2019-01-11 18:49:36", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-10", updated_by: "walshm"},
    {id: 866, award_name: "Honolulu Police Community Foundation Scholarship", subject_area: "All fields", level: nil, deadline: "2019-01-31", other_req: "Must have been a resident of Honolulu, HI for the 12 months preceding application unless you have been attending college on the mainland, in which case your permanent residence must be Honolulu.", sponsor: "Honolulu Police Community Foundation", amount: "Varies", state: "HI", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://honolulupolicecommunityfoundation.org/ScholarshipHPCF.html", opportunity_type: "Scholarship", created_at: "2016-08-31 17:09:12", updated_at: "2018-08-29 23:12:56", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 867, award_name: "The Aleut Foundation Scholarships", subject_area: "Minority", level: nil, deadline: "2019-06-30", other_req: "Multiple scholarships for students with Aleut bloodlines. 3 deadlines per year, June 30 for the whole school year, November 30 for the spring semester and April 30 for the summer term.", sponsor: "The Aleut Foundation", amount: "Varies", state: "AK", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.thealeutfoundation.org/education/educational-scholarships/", opportunity_type: "Scholarship", created_at: "2016-08-31 17:36:37", updated_at: "2019-05-30 21:46:31", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Three deadlines, June 30 for AY, November 30 for spring semester, April 30 for summer.", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "robertsm"},
    {id: 868, award_name: "Austrian Teaching Assistantship Program", subject_area: "All Fields; German; Education; International Experience", level: nil, deadline: "2018-01-15", other_req: "USTA recipients serve as English teaching assistants in Austria to make learning a foreign language a lively cross-cultural encounter for their students and receive a modest living stipend.\r\n\r\nEligibility requirements: participants must have a working knowledge of German (intermediate-mid or above according to the ACTFL guidelines) and they must be 29 years old or younger at the time of application. Graduating seniors may apply; however, they must complete their undergraduate degrees before starting their teaching assistantship.", sponsor: "Austrian-American Educational Commission Fulbright Commission", amount: "varies", state: "All", min_gpa: "None", contact: "scholars@up.edu", keywords: nil, website: "https://www.usta-austria.at/", opportunity_type: "Fellowship", created_at: "2016-08-31 19:05:33", updated_at: "2018-04-17 22:05:05", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-10-01", updated_by: "honstu1"},
    {id: 869, award_name: "George J. Mitchell Scholarship", subject_area: "All Fields; International Experience", level: nil, deadline: "2018-09-28", other_req: "The George J. Mitchell Scholarship was designed to introduce and connect generations of future American leaders to the island of Ireland, while recognizing and fostering intellectual achievement, leadership, and a commitment to community and public service.\r\nThe Mitchell Scholarship Program provides tuition, accommodation, a stipend for living expenses and travel while undertaking a year-long masters program in Ireland. Applicants are judged on three criteria: academic excellence and scholarship, leadership, and a sustained commitment to community and public service. \r\n\r\nELIGIBILITY: 18 years of age or older, but not yet 30 on September 30 of the year of application; Have a bachelor’s degree from an accredited college or university before beginning study as a Mitchell Scholar. \r\n\r\nINSTITUTIONAL ENDORSEMENT REQUIRED - Contact scholars@up.edu immediately if you are interested in applying for this award, as there may be an on-campus deadline prior to the posted deadline.", sponsor: "US-Ireland Alliance ", amount: "varies", state: "All", min_gpa: "3.8", contact: "scholars@up.edu", keywords: nil, website: "http://www.us-irelandalliance.org/content/3/en/George%20Mitchell%20Scholarship%20Program%20|%20US-Ireland%20Alliance.html", opportunity_type: "Fellowship", created_at: "2016-08-31 19:18:24", updated_at: "2018-04-13 22:30:40", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-07-01", updated_by: "honstu1"},
    {id: 870, award_name: "DAAD Undergraduate Programs (German Academic Exchange Service)", subject_area: "All Fields; German; International Experience", level: nil, deadline: "2018-01-31", other_req: "DAAD offers programs for undergraduate students to apply for scholarships, funding study, senior thesis research and/or internships in Germany. This committee looks for students who are currently second and third year students and will be in their third and fourth year during their stay in Germany; seeking DAAD support for a 4-10 month period in Germany during the German academic year; possess outstanding academic records and personal integrity, as evinced by both their grades and letters of recommendation; have well-defined study, research or internship plans for their stay in Germany; submit the DAAD language evaluation form with their application, although German language competency is not mandatory; demonstrate an interest in contemporary German and European affairs and who explain the significance of their project in Germany to their future studies, research or professional goals; are enrolled, full-time students in an undergraduate degree-granting program at an accredited North American college or university; will return to the US or Canada after the scholarship period to complete their bachelor's degree. The application process varies by the specific program. Applicants will need to join the DAAD portal in order to submit their application.", sponsor: "Deutscher Akademischer Austausch Dienst", amount: "varies", state: "All", min_gpa: "None", contact: "scholars@up.edu", keywords: nil, website: "https://www.daad.org/en/find-funding/undergraduate-opportunities/undergraduate-scholarship/", opportunity_type: "Scholarship", created_at: "2016-08-31 19:37:40", updated_at: "2018-04-17 19:27:34", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-12-01", updated_by: "honstu1"},
    {id: 871, award_name: "German Chancellor Fellowship", subject_area: "All Fields; International Experience", level: nil, deadline: "2018-09-15", other_req: "This fellowship provides support for students and alumni with demonstrated leadership experience to spend a year working on a project you have developed yourself with a host of your choice in Germany.\r\n\r\nELIGIBILITY: U.S., Russian, Chinese, Brazilian, or Indian national, received bachelor's degree less than 12 years before the beginning of the fellowship.", sponsor: "The Humboldt Foundation and The Chancellor of the Federal Republic of Germany", amount: "a monthly fellowship of € 2,150, €2,450 or €2,750, depending on your qualifications; additional financial support for items such as family members accompanying you, travel expenses or a German language course", state: "All", min_gpa: "None", contact: "scholars@up.edu", keywords: nil, website: "https://www.humboldt-foundation.de/web/german-chancellor-fellowship.html", opportunity_type: "Fellowship", created_at: "2016-08-31 19:45:27", updated_at: "2018-03-20 19:46:53", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-07-01", updated_by: "honstu1"},
    {id: 872, award_name: "NIH Oxford-Cambridge Scholars Program", subject_area: "All fields; Biology, Biochemistry, Chemistry, Pre-Health, STEM Fields", level: nil, deadline: "2017-12-01", other_req: "The NIH Oxford-Cambridge Scholars Program seeks students of the highest academic caliber who are seeking to obtain a Ph.D. in the biomedical sciences. Students may participate in an MD/PhD program track. Applicants must send in a resume/C.V., additional information on scholarships received and potential mentors at the NIH and Oxford and/or Cambridge whose research you are interested in, and letters of recommendation. ", sponsor: "National Institutes of Health Oxford-Cambridge Scholars Program", amount: "Full tuition and fees covered; stipend, medical benefits, and travel allowance for all four years of the prgram are funded by NIH mento", state: "All", min_gpa: "None", contact: "scholars@up.edu", keywords: nil, website: "http://oxcam.gpp.nih.gov/", opportunity_type: "Scholarship", created_at: "2016-08-31 19:56:41", updated_at: "2018-04-13 22:17:57", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "2018/2019 deadline not available.", respect_deadline: true, date_reopens: "2018-08-01", updated_by: "honstu1"},
    {id: 873, award_name: "Rhodes Scholarship", subject_area: "All Fields; International Experience", level: nil, deadline: "2017-10-04", other_req: "This award provides funding for graduate study at Oxford University. Ideal candidates have demonstrated academic excellence, leadership potential, and a commitment to improving the lives of others.\r\n\r\nELIGIBILITY: must be a U.S. citizen or permanent resident, at least 18 but not yet 24 years of age at the time of application, and have completed a bachelor's degree by the time the program starts.\r\n\r\nINSTITUTIONAL ENDORSEMENT REQUIRED - Contact scholars@up.edu immediately if you are interested in applying for this award, as there may be an on-campus deadline prior to the posted deadline.", sponsor: "The Rhodes Trust", amount: "varies", state: "All", min_gpa: "3.8", contact: "scholars@up.edu", keywords: nil, website: "http://www.rhodesscholar.org/", opportunity_type: "Scholarship", created_at: "2016-08-31 20:27:03", updated_at: "2018-04-17 19:30:11", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "2018 deadline not available.", respect_deadline: true, date_reopens: "2018-06-01", updated_by: "honstu1"},
    {id: 874, award_name: "Rotary Foundation Global Grants", subject_area: "All fields; International Experience", level: nil, deadline: "2017-08-31", other_req: "Global grants can fund humanitarian projects, scholarships for graduate-level academic studies, and groups of professionals who travel abroad either to teach local professionals about their field or to learn more about it themselves. Applications must clearly describe how your project, scholarship, or vocational training team: is sustainable, includes measurable goals, aligns with one of Rotary's areas of focus, responds to real community needs, actively involves Rotarians and community members, and meets the eligibility requirements in the grants terms and conditions. ELIGIBILITY: You must apply through a qualified club and district. ", sponsor: "The Rotary Foundation", amount: "At least $30,000", state: "All", min_gpa: "None", contact: "scholars@up.edu", keywords: nil, website: "https://www.rotary.org/myrotary/en/take-action/apply-grants/global-grants", opportunity_type: "Fellowship", created_at: "2016-08-31 21:16:15", updated_at: "2018-04-13 21:56:51", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Cannot find more recent deadline.", respect_deadline: true, date_reopens: "2018-06-20", updated_by: "honstu1"},
    {id: 875, award_name: "Paul & Daisy Soros Fellowships for New Americans", subject_area: "All fields", level: nil, deadline: "2019-11-01", other_req: "Each year thirty New Americans (immigrants or the children of immigrants) who have demostrated creativity, originality, initiative, and sustained accomplishment in their academic career thus far receive funding for one or two years of graduate school. \r\n\r\nELIGIBILITY: age 30 or younger at the application deadline, have New American Status as defined in the Soros eligibility guidelines, and who is pursuing a graduate degree full-time in the United States. ", sponsor: "Paul & Daisy Soros Fellowship", amount: "Varies", state: "All", min_gpa: "", contact: "scholars@up.edu", keywords: nil, website: "https://www.pdsoros.org/", opportunity_type: "Scholarship", created_at: "2016-08-31 21:22:19", updated_at: "2019-05-16 23:24:54", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-11", updated_by: "hobbsm"},
    {id: 877, award_name: "ABA Legal Opportunity Scholarship ", subject_area: "All fields; Pre-Law; Political Science ", level: nil, deadline: "2018-04-06", other_req: "Racial and ethnic minority students encouraged to apply. The award provides $5,000 annually for three years of law school. Strong candidates are those who have overcome adversity, proven themselves through academic success and public service, and demonstrated the tenacity to excel within the profession.\r\n\r\nELIGIBILITY: must be entering an ABA accredited law school as a first-year law student in the fall.", sponsor: "American Bar Association ", amount: "$15,000", state: "All", min_gpa: "2.5", contact: "scholars@up.edu", keywords: nil, website: "http://www.americanbar.org/groups/diversity/diversity_pipeline/projects_initiatives/legal_opportunity_scholarship.html", opportunity_type: "Scholarship", created_at: "2016-08-31 21:47:16", updated_at: "2018-04-13 21:45:17", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-10-01", updated_by: "honstu1"},
    {id: 878, award_name: "AIF Clinton Fellowship for Service", subject_area: "All Fields", level: nil, deadline: "2018-01-16", other_req: "General knowledge of the development field and development issues in India is expected of candidates, as well as the ability to demonstrate a humble appreciation of other cultures and circumstances, and a willingness to acclimate to these differences. Indian language skills are not required, but considered a highly valuable asset. \r\nELIGIBILITY: Candidates must be a U.S. or Indian citizen, or a U.S. permanent resident, be between the ages of 21 and 34 on September 1, 2018 and have completed an undergraduate degree before the start of the program on September 1, 2017. As part of the application process, applicants will need to answer short essay questions and participate in an interview. ", sponsor: "American India Foundation", amount: "Flight and monthly stipend ", state: "All", min_gpa: "N/A", contact: "scholars@up.edu", keywords: nil, website: "http://aif.org/clinton-fellowship/", opportunity_type: "Fellowship", created_at: "2016-08-31 21:57:16", updated_at: "2018-04-17 19:39:16", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-10-01", updated_by: "honstu1"},
    {id: 879, award_name: "American Scandinavian Foundation Grant", subject_area: "All Fields", level: nil, deadline: "2018-11-01", other_req: "Applicants must have a well-defined research, study or creative arts project that makes a stay in Scandinavia essential.\r\n\r\nApplicants must have completed their undergraduate education by the start of their project in Scandinavia.\r\n\r\nTeam projects are eligible, but each member must apply as an individual, submitting a separate, fully-documented application.", sponsor: "American-Scandinavian Foundation", amount: "varies", state: "All", min_gpa: "", contact: "scholars@up.edu", keywords: nil, website: "http://www.amscan.org/fellowships-and-grants/fellowshipsgrants-to-study-in-scandinavia/", opportunity_type: "Fellowship", created_at: "2016-08-31 22:02:08", updated_at: "2018-04-11 23:23:38", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-08-01", updated_by: "honstu1"},
    {id: 880, award_name: "APSA Minority Fellowship", subject_area: "All fields; Political Science", level: nil, deadline: "2018-03-15", other_req: "This is a fellowship for candidates from underrepresented backgrounds applying to or in the early stages of doctoral programs in political science.", sponsor: "American Political Science Association ", amount: "$4000", state: "All", min_gpa: "N/A", contact: "scholars@up.edu", keywords: nil, website: "http://www.apsanet.org/mfp", opportunity_type: "Scholarship", created_at: "2016-08-31 22:15:10", updated_at: "2018-04-11 23:15:59", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-06-01", updated_by: "honstu1"},
    {id: 881, award_name: "APSA Ralph Bunche Summer Institute", subject_area: "All fields; Political Science ", level: nil, deadline: "2018-01-24", other_req: "This program is designed to introduce to the world of doctoral study in political science those undergraduate students from under-represented racial and ethnic groups or those interested in broadening participation in political science and pursuing scholarship on issues affecting under-represented groups. Applicants will need to fill out an application, send three letters of recommendation and official college transcripts. Eligibility: Applicants must be college/university juniors.", sponsor: "American Political Science Association ", amount: "", state: "All", min_gpa: "N/A", contact: "scholars@up.edu", keywords: nil, website: "http://www.apsanet.org/rbsi-programinfo", opportunity_type: "Fellowship", created_at: "2016-08-31 22:44:13", updated_at: "2018-04-11 23:13:56", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-10-31", updated_by: "honstu1"},
    {id: 882, award_name: "Asian Pacific American Institute for Congressional Studies Fellowship", subject_area: "All fields; Political Science", level: nil, deadline: "2017-02-21", other_req: "This program offers paid, full-time legislative and public policy fellowships in Washington, D.C. The Fellowship provides exceptional graduates and young professionals an opportunity to work on policy issues as staff members of a congressional office. The program aims to build leadership skills, encourage political civic engagement, and foster a strong interest in public service careers.\r\n\r\nELIGIBILITY: must complete undergraduate degree by program start date and possess lawful evidence of employment authorization in the U.S.", sponsor: "Asian Pacific American Institute for Congressional Studies", amount: "varies", state: "All", min_gpa: "None", contact: "scholars@up.edu", keywords: nil, website: "http://apaics.org/congressional-fellows/", opportunity_type: "Fellowship", created_at: "2016-08-31 23:03:24", updated_at: "2018-04-17 19:45:26", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "2018/2019 deadline not available.", respect_deadline: true, date_reopens: "2018-10-01", updated_by: "honstu1"},
    {id: 883, award_name: "Bill Emerson National Hunger Fellowship", subject_area: "All Fields", level: nil, deadline: "2018-08-31", other_req: "This program helps fellows gain field experience fighting hunger and poverty through placements in community based organizations across the country and provides policy experience through placements in Washington, D.C.", sponsor: "Congressional Hunger Center", amount: "", state: "All", min_gpa: "N/A", contact: "scholars@up.edu", keywords: nil, website: "http://www.hungercenter.org/fellowships/emerson/how/", opportunity_type: "Fellowship", created_at: "2016-08-31 23:09:08", updated_at: "2018-04-11 23:01:16", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Could not find application deadline or detailed information about eligibility requirements.", respect_deadline: true, date_reopens: "2018-09-01", updated_by: "honstu1"},
    {id: 884, award_name: "Breakthrough Collaborative", subject_area: "All fields ", level: nil, deadline: "2018-02-22", other_req: "This is an opportunity designed for candidates interested in pursuing a career in education.", sponsor: "", amount: "", state: "All", min_gpa: "", contact: "scholars@up.edu", keywords: nil, website: "https://www.breakthroughcollaborative.org/teach/apply", opportunity_type: "Fellowship", created_at: "2016-08-31 23:20:05", updated_at: "2018-03-20 21:24:32", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Not a lot of info on requirements. It seems that you only need to go through the application process- essays, recommendations, ect. ", respect_deadline: true, date_reopens: "2018-09-01", updated_by: "honstu1"},
    {id: 889, award_name: "Victims of Drunk Driving Scholarship", subject_area: "All fields", level: nil, deadline: "2019-05-31", other_req: "In order to qualify for the Encore Protection Victims of Drunk Driving Scholarship, applicants must be:\r\n\r\nThe victim of a drunk driving accident;\r\nThe child or dependent of a victim of a drunk driving accident; OR\r\nThe spouse of a victim of a drunk driving accident.\r\n\r\nIn addition, applicants must:\r\n\r\nBe currently attending or have been accepted to an accredited college or university\r\nHave a 3.0 GPA or higher\r\n", sponsor: "Encore Protection ", amount: "$1,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.encoreprotection.com/scholarship-program/", opportunity_type: "Scholarship", created_at: "2016-09-01 16:38:35", updated_at: "2018-11-30 19:05:15", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 892, award_name: "The Future Leaders in Retail Scholarship", subject_area: "Marketing; Advertising; Business Management", level: nil, deadline: "2018-12-15", other_req: "Applicants will be judged based on outstanding academic achievement (a minimum GPA of 3.5) and submission of a 500- to 900-word essay titled “How I Will Impact the Retail Industry.”\r\n\r\nThe essay should address how you see yourself positively impacting the U.S. retail industry in the coming decades, and how consumers and retailers alike may benefit from your work and leadership.", sponsor: "Deal Crunch", amount: "$1,000", state: "All", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.dealcrunch.com/scholarship/", opportunity_type: "Scholarship", created_at: "2016-09-01 17:06:37", updated_at: "2019-08-01 17:04:56", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "Not available as of 08/19", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "robertsm"},
    {id: 901, award_name: "NorthPoint Recovery College Scholarship", subject_area: "All fields", level: nil, deadline: "2018-11-01", other_req: "Applicants are asked to prepare a 500 - 1,000 word essay that talks about the ways in which substance abuse addiction have affected your life.  Must be 18 and older as well as currently a student in the US.", sponsor: "NorthPoint Recovery", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.northpointrecovery.com/college-scholarship.php", opportunity_type: "Scholarship", created_at: "2016-09-01 19:20:56", updated_at: "2019-05-30 20:40:08", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "No active as of 5/30/19", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "robertsm"},
    {id: 904, award_name: "Depression Treatment Education Scholarship", subject_area: "All fields", level: nil, deadline: "2018-12-15", other_req: "Please submit an essay (1,000 word minimum) and tell us about your educational goals and plans after graduation. Tell us why you feel you deserve to win this scholarship and what it would mean to you if you won.", sponsor: "Paradigm Malibu", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://paradigmmalibu.com/annual-depression-treatment-education-scholarship/", opportunity_type: "Scholarship", created_at: "2016-09-01 19:29:51", updated_at: "2018-09-21 18:23:58", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 905, award_name: "California Capital Fellows Programs", subject_area: "All Fields, Political Science", level: nil, deadline: "2018-02-12", other_req: "Capital Fellows are placed at some of the highest levels of California state government and assist state legislators, senior-level executive staff, and court administrators with a broad range of public policy issues and projects. There are four fellowship programs offered within the Capital Fellows Programs. \r\nELIGIBILITY\r\n20 years of age or older by Sept. 1 of the fellowship year\r\nBachelor’s degree in any major and a demonstrated interest in state government and public service\r\n", sponsor: "Center for California Studies", amount: "$2,627 monthly stipend and other benefits", state: "All", min_gpa: "N/A", contact: "scholars@up.edu", keywords: nil, website: "http://www.csus.edu/calst/programs/", opportunity_type: "Fellowship", created_at: "2016-09-07 18:40:29", updated_at: "2018-04-06 22:11:37", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-09-01", updated_by: "honstu1"},
    {id: 906, award_name: "Charles B. Rangel International Affairs Fellowship", subject_area: "All Fields, Political Science, Programs related to Foreign Service ", level: nil, deadline: "2017-09-21", other_req: "The Rangel Program prepares young people for careers as diplomats in the Foreign Service of the U.S. Department of State. Applicants must be planning to enter a two year graduate program in the fall. ", sponsor: "Howard University", amount: "up to $37,500", state: "All", min_gpa: "3.2", contact: "scholars@up.edu", keywords: nil, website: "http://www.rangelprogram.org/", opportunity_type: "Scholarship", created_at: "2016-09-07 18:53:41", updated_at: "2018-04-06 22:28:42", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-07-01", updated_by: "honstu1"},
    {id: 907, award_name: "Charles B. Rangel International Affairs Summer Enrichment Program", subject_area: "All fields, Political Science ", level: nil, deadline: "2018-02-01", other_req: "Six-week summer program that provides undergraduate students with greater knowledge of current issues, trends, and career opportunities in international affairs.", sponsor: "Howard University", amount: "covers costs for tuition, travel, housing, and two meals per day and provides a stipend of $3,200. ", state: "All", min_gpa: "3.2", contact: "scholars@up.edu", keywords: nil, website: "http://www.rangelprogram.org/summer-enrichment-program/", opportunity_type: "Fellowship", created_at: "2016-09-07 19:19:23", updated_at: "2018-04-06 22:44:30", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-09-01", updated_by: "honstu1"},
    {id: 908, award_name: "Congress-Bundestag Youth Exchange (CBYX) for Young Professionals", subject_area: "All Fields, International Experience, German", level: nil, deadline: "2018-12-01", other_req: "The CBYX for Young Professionals program provides funding for travel, course fees, and a living stipend for the program. The program consists of three phases: two months of intensive German language training, four months of classes in one’s academic or career field at a university, technical or professional school, and a five-month internship in one’s career field.\r\n\r\nELIGIBILITY: must posses a high school diploma, be between 18 and 24 years old at the start of the program, and have a strong interest in German and world affairs. ", sponsor: "The German Bundestag and U.S. Department of State", amount: "Varies", state: "All", min_gpa: "N/A", contact: "scholars@up.edu", keywords: nil, website: "http://culturalvistas.org/programs/abroad/congress-bundestag-youth-exchange-young-professionals/", opportunity_type: "Fellowship", created_at: "2016-09-07 19:26:44", updated_at: "2018-04-11 22:39:52", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-08-01", updated_by: "honstu1"},
    {id: 909, award_name: "DOE Computational Science Graduate Fellowship", subject_area: "All fields; STEM, Biology, Chemistry, Physics, Mathematics, Computer Science, Enviromental Science", level: nil, deadline: "2018-01-17", other_req: "There are specific eligibility requirements on their website that detail at what academic levels the applicants may be at to be eligible to apply.", sponsor: "Department of Energy's Office of Science and the National Nuclear Security Administration", amount: "yearly stipend of $36,000", state: "All", min_gpa: "N/A", contact: "scholars@up.edu", keywords: nil, website: "https://www.krellinst.org/csgf/", opportunity_type: "Scholarship", created_at: "2016-09-07 19:32:21", updated_at: "2018-04-11 22:35:37", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-10-01", updated_by: "honstu1"},
    {id: 910, award_name: "DOE NNSA Stewardship Science Graduate Fellowship ", subject_area: "STEM, Physics", level: nil, deadline: "2018-01-10", other_req: "Applicants must be planning full-time, uninterrupted study toward a doctoral degree at an accredited U.S. university. Those eligible to apply include senior undergraduate students and first- and second-year graduate students focusing their studies on high energy density physics, nuclear science, or properties of materials under extreme conditions and hydrodynamics.", sponsor: "US DOE and NNSA ", amount: "yearly stipend of $36,000", state: "All", min_gpa: "N/A", contact: "scholars@up.edu", keywords: nil, website: "https://www.krellinst.org/ssgf/", opportunity_type: "Scholarship", created_at: "2016-09-07 19:42:19", updated_at: "2018-04-17 19:55:25", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-09-01", updated_by: "honstu1"},
    {id: 911, award_name: "El Pomar Fellowship", subject_area: "All Fields", level: nil, deadline: "2017-01-17", other_req: "The award is a selective, two-year post-undergraduate leadership training program that is designed to bring together highly qualified individuals with personal initiative and determination, from diverse backgrounds and interests, in order to develop them into effective leaders for the public, private, and nonprofit sectors. The Fellowship seeks to develop professional skills and educate Fellows in the role of philanthropy in the nonprofit sector, while offering direct management experience.\r\n\r\nELIGIBILITY: must complete undergraduate degree by program start date, have a connection and explicit interest in serving the state of Colorado, must exemplify the highest standards of professionalism and behavior, possess strong written and verbal skills.", sponsor: "El Pomar Foundation", amount: "Varies", state: "All", min_gpa: "None", contact: "scholars@up.edu", keywords: nil, website: "https://www.elpomar.org/fellowship/", opportunity_type: "Fellowship", created_at: "2016-09-07 19:53:07", updated_at: "2018-04-17 20:02:01", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "2018/2019 deadline currently unavailable.", respect_deadline: true, date_reopens: "2018-09-01", updated_by: "honstu1"},
    {id: 912, award_name: "Fannie and John Hertz Foundation Graduate Fellowship", subject_area: "All fields; STEM, Biology, Chemistry, Physics, Mathematics", level: nil, deadline: "2018-10-28", other_req: "Applicants must be students of the applied physical and biological sciences, mathematics, and engineering who are willing to morally commit to make their skills available to the United States in time of national emergency.\r\n\r\nApplicants may be college seniors wishing to pursue PhD degree in any of the fields of particular interest to the Foundation, as well as graduate students already in the process of doing so.", sponsor: "The Hertz Foundation", amount: "varies", state: "All", min_gpa: "N/A", contact: "scholars@up.edu", keywords: nil, website: "http://hertzfoundation.org/default.aspx", opportunity_type: "Fellowship", created_at: "2016-09-07 20:01:45", updated_at: "2018-04-17 21:19:26", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "Deadline is Fall 2018. Exact date of above deadline is based on previous deadline posted.", respect_deadline: true, date_reopens: "2018-08-15", updated_by: "honstu1"},
    {id: 913, award_name: "Ford Foundation Fellowship", subject_area: "All Fields; Education", level: nil, deadline: "2018-12-14", other_req: "Awards will be made for study in research-based Ph.D. or Sc.D. programs. Predoctoral, Dissertation, and Postdoctoral fellowships will be awarded in a national competition.", sponsor: "The National Academies of Sciences, Engineering, and Medicine", amount: "", state: "All", min_gpa: "N/A", contact: "scholars@up.edu", keywords: nil, website: "http://sites.nationalacademies.org/PGA/FordFellowships/index.htm", opportunity_type: "Scholarship", created_at: "2016-09-07 20:19:57", updated_at: "2018-04-04 22:59:11", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-09-01", updated_by: "honstu1"},
    {id: 914, award_name: "Frank Huntington Beebe Fund", subject_area: "All Fields; Music", level: nil, deadline: "2017-12-18", other_req: "This grant is to be used by musicians who are traveling abroad. Musicians need to be \"based in the United States.\" Applicants must not have reached the age of 30 by July 1, 2017", sponsor: "The Frank Huntington Beebe Fund for Musicians", amount: " $22,000", state: "All", min_gpa: "N/A", contact: "scholars@up.edu", keywords: nil, website: "http://www.beebefund.org/index.htm", opportunity_type: "Fellowship", created_at: "2016-09-07 20:31:51", updated_at: "2018-04-04 22:47:37", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-08-01", updated_by: "honstu1"},
    {id: 915, award_name: "Google Policy Fellowship", subject_area: "All Fields", level: nil, deadline: "2018-03-20", other_req: "This program offers students interested in Internet and technology policy the opportunity to spend the summer discussing Internet policy and working at public interest organizations.", sponsor: "Google", amount: "$7,500", state: "All", min_gpa: "N/A", contact: "scholars@up.edu", keywords: nil, website: "https://www.google.com/policyfellowship/", opportunity_type: "Fellowship", created_at: "2016-09-07 20:38:15", updated_at: "2018-04-04 22:38:12", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-06-01", updated_by: "honstu1"},
    {id: 916, award_name: "Harriet Hale Woolley Scholarship", subject_area: "All fields; Music, Fine Arts, Medicine ", level: nil, deadline: "2018-01-31", other_req: "This scholarship is awarded to artists and musicians who plan to pursue their studies in Paris. A scholarship is also available to one medical post-graduate specializing in psychiatry with an internship in a Parisian hospital. \r\nELIGIBILITY: Candidates must be between 21 and 29 years of age. \r\n\r\n", sponsor: "Fondation des États-Unis", amount: "€10,000 stipend ", state: "All", min_gpa: "", contact: "scholars@up.edu", keywords: nil, website: "http://www.feusa.org/harriet-hale-woolley-scholarship/", opportunity_type: "Scholarship", created_at: "2016-09-07 20:41:14", updated_at: "2018-04-11 21:58:27", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-10-01", updated_by: "honstu1"},
    {id: 917, award_name: "Herbert Scoville Jr. Peace Fellowship", subject_area: "All Fields, Political Science, History", level: nil, deadline: "2018-10-01", other_req: "This program invites recent college and graduate school alumni to apply for full-time, six-to-nine month fellowships in Washington, DC. Candidates should have experience with public-interest activism or advocacy as well as strong academics.\r\n\r\nELIGIBILITY: Candidates are required to have completed a baccalaureate degree by the time the fellowship commences. Preference is given to United States citizens, although a fellowship to a foreign national residing in the U.S. is awarded periodically.", sponsor: "", amount: "$3100 monthly salary and travel expenses", state: "All", min_gpa: "N/A", contact: "scholars@up.edu", keywords: nil, website: "http://scoville.org/", opportunity_type: "Fellowship", created_at: "2016-09-07 20:47:02", updated_at: "2018-04-17 20:17:37", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "Fall 2019 Fellowship–January 7, 2019", respect_deadline: true, date_reopens: "2018-09-01", updated_by: "honstu1"},
    {id: 920, award_name: "Don and Roy Splawn Charitable Foundation West Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-10", other_req: "We seek those candidates that exhibit true integrity, complete respect of and dignity for the human element. They must be willing to persevere, toil and give back to their community during and especially after graduation. The profoundness of our judgments are reflected in the future.\r\nThe receipt of a Scholarship Grant offers such student an opportunity to improve his or her own future and that of the student's family and community. The Don and Roy Splawn Charitable Foundation West offers a Scholarship Grant of up to $1,000.00 to eligible students who demonstrate significant dedication to their school, family and community. Students who live independently or whose parent(s)/guardian(s) struggle financially are encouraged to apply for consideration.", sponsor: "Don and Roy Splawn Charitable Foundation West, Inc.", amount: "$1,000", state: "CA", min_gpa: "2.6", contact: "financial.aid@example.edu", keywords: nil, website: "https://online.foundationsource.com/public/home/splawnscholarship", opportunity_type: "Scholarship", created_at: "2016-09-07 22:07:53", updated_at: "2019-02-28 18:58:27", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 921, award_name: "California Latino Legislative Caucus Foundation Scholarships", subject_area: "All fields", level: nil, deadline: "2019-06-01", other_req: "Applications are evaluated based on academic performance, personal statements, extracurricular activities, leadership positions held, special awards and honors received and work history.", sponsor: "California Latino Legislative Caucus Foundation", amount: "$1,000", state: "CA", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.cllcf.org/scholarship-program", opportunity_type: "Scholarship", created_at: "2016-09-07 22:15:34", updated_at: "2019-05-05 21:00:40", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-15", updated_by: "hobbsm"},
    {id: 922, award_name: "The Gaines-Jones Education Foundation Scholarship", subject_area: "Minority", level: nil, deadline: "2019-04-20", other_req: "Applicants must be from Southwest Georgia (Baker, Calhoun, Colquitt, Decatur, Dougherty, Early, Grady, Lee, Miller, Mitchell, Seminole, Terrell, Thomas or Worth counties) OR the San Francisco Bay, CA area (Marin, Sonoma, Contra Costa, Alameda or San Francisco counties) and be African-American with financial need.", sponsor: "The Gaines-Jones Education Foundation", amount: "up to $2,000", state: "CA; GA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://gaines-jones.org/scholarship-criteria/", opportunity_type: "Scholarship", created_at: "2016-09-07 22:23:02", updated_at: "2019-02-28 18:59:43", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 923, award_name: "InspirASIAN Scholarships", subject_area: "All fields", level: nil, deadline: "2019-01-31", other_req: "All full-time graduating high school seniors in good academic standing (minimum unweighted GPA 3.40 on 4-point scale), of any ethnic or cultural background, who plans to attend an accredited college or university (2-year and 4-year) in Fall.\r\nApplicants who are United States citizens or permanent residents of the United States.", sponsor: "InspirASIAN", amount: "Up to $2,000", state: "AZ; CA; CO; FL; GA; HI; IL; IN; MI; MO; NV; NJ; OH; TX; WA; WI; DC; MD; VA", min_gpa: "3.4", contact: "financial.aid@example.edu", keywords: nil, website: "https://inspirasian.us/programs/scholarship-program/", opportunity_type: "Scholarship", created_at: "2016-09-07 22:28:02", updated_at: "2018-11-30 19:06:08", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 924, award_name: "Oregon Dove Scholarship", subject_area: "All fields", level: nil, deadline: "2019-01-25", other_req: "A female high school senior, in the Portland metro area (Washington County, Multnomah County, Clackamas County or Clark County (WA)), planning to enter a 4 year college or university in the fall following graduation with a cumulative GPA of 3.0 or higher or a GED score of 525. The Pi Alpha Zeta Chapter reviews scholarship applications and awards the scholarship to students based on the quality of the application, student need, and community involvement.", sponsor: "Zeta Phi Beta Sorority, Inc. - Pi Alpha Zeta Chapter", amount: "$500", state: "OR; WA", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.zphibpdx.com/oregon-dove-scholarship.html", opportunity_type: "Scholarship", created_at: "2016-09-09 17:10:45", updated_at: "2018-12-14 17:31:11", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "walshm"},
    {id: 926, award_name: "New Hampshire Charitable Foundation Scholarships", subject_area: "All fields", level: nil, deadline: "2019-04-12", other_req: "Various scholarships for students from New Hampshire.", sponsor: "New Hampshire Charitable Foundation", amount: "Varies", state: "NH", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.nhcf.org/how-can-we-help-you/apply-for-a-scholarship/", opportunity_type: "Scholarship", created_at: "2016-09-09 17:56:42", updated_at: "2019-02-28 19:13:44", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 927, award_name: "Fisher Cats Foundation Scholarships", subject_area: "All fields", level: nil, deadline: "2019-05-01", other_req: "The Fisher Cats Foundation is proud to support our youth through the Fisher Cats Foundation Scholar-Athlete Scholarships. Each year, the foundation awards $2,500 scholarships to ten New Hampshire students and two Massachusetts students. Fisher Cats Foundation Scholar-Athlete Scholarship recipients will be selected using criteria that includes academic performance, athletic achievement and active citizenship.", sponsor: "Fisher Cats Foundation", amount: "$2,500", state: "NH; MA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.milb.com/content/page.jsp?ymd=20100408&content_id=9145250&sid=t463&vkey=team4", opportunity_type: "Scholarship", created_at: "2016-09-09 18:00:35", updated_at: "2019-02-28 19:27:35", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 928, award_name: "Mendez Family Scholarships", subject_area: "Business; Engineering; Pre-Health", level: nil, deadline: "2019-05-01", other_req: "Must be an actively enrolled business, engineering or pharmacy undergraduate, graduate, or post-graduate student in an accredited USA university and have evidence of your current, on-going, servant leadership in a community, campus, or workplace setting.  Rolling deadline.", sponsor: "Mendez Scholarships Non-Profit", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://mendezscholars.org/", opportunity_type: "Scholarship", created_at: "2016-09-09 18:20:27", updated_at: "2019-05-30 17:42:52", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-06-02", updated_by: "robertsm"},
    {id: 929, award_name: "Tillman Scholar", subject_area: "Military Family", level: nil, deadline: "2019-02-28", other_req: "Veteran and active-duty military service members who were Honorably discharged of pre- and/or post-9/11\r\nservice from all branches of the U.S. Military,including the National Guard and Reserve OR Current spouses of veterans or active-duty service members, including surviving spouses.  Must be pursuing a degree as a full-time student.  Recipients are selected based on their record of personal achievement, academic and career ambitions, demonstration of service to others in the community, desire to continue to serve others and make a positive impact in your community, leadership potential, essay and record of military service and/or community impact as a military spouse.", sponsor: "Pat Tillman Foundation", amount: "Varies", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://pattillmanfoundation.org/apply-to-be-a-scholar/", opportunity_type: "Scholarship", created_at: "2016-09-09 18:35:10", updated_at: "2019-01-24 18:28:49", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 930, award_name: "Humanity in Action Fellowship", subject_area: "All fields", level: nil, deadline: "2018-01-08", other_req: "Applicants must be currently enrolled undergraduate students (sophomores, juniors and seniors) or recent graduates. Programs will take place in Amsterdam, Atlanta, Berlin, Copenhagen, Detroit, Sarajevo and Warsaw in 2018.", sponsor: "Humanity In Action", amount: "", state: "All", min_gpa: "", contact: "scholars@up.edu", keywords: nil, website: "http://www.humanityinaction.org/programs/14-humanity-in-action-fellowship", opportunity_type: "Fellowship", created_at: "2016-09-12 18:10:30", updated_at: "2018-03-23 22:54:30", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-10-01", updated_by: "honstu1"},
    {id: 931, award_name: "International Radio and Television Society Summer Fellowship", subject_area: "All fields", level: nil, deadline: "2018-12-03", other_req: "Applicants must be college juniors, seniors, or graduate students as of April 2018.", sponsor: "IRTS Foundation", amount: "", state: "All", min_gpa: "", contact: "scholars@up.edu", keywords: nil, website: "http://irtsfoundation.org/", opportunity_type: "Fellowship", created_at: "2016-09-12 18:13:29", updated_at: "2018-03-23 22:37:40", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-09-01", updated_by: "honstu1"},
    {id: 932, award_name: "Japan Exchange and Teaching (JET) Programme", subject_area: "All Fields; International Experience", level: nil, deadline: "2018-09-12", other_req: "Through the JET Programme, people from participating countries are invited to Japan and appointed to work as ALTs, CIRs or SEAs by local governments or private schools in Japan for one year. Recruitment and selection of participants is conducted by the Japanese Ministry of Foreign Affairs through its embassies and consulates overseas. Individuals interested in becoming JET participants should contact the Japanese Embassy or Consulate General in their country of citizenship.\r\n\r\nELIGIBILITY: Applicants must hold a Bachelor’s degree or higher, or obtain such qualifications by the designated arrival date.\r\n\r\nSpecific deadlines for applications vary by country", sponsor: "", amount: "", state: "All", min_gpa: "N/A", contact: "scholars@up.edu", keywords: nil, website: "http://jetprogramme.org/en/", opportunity_type: "Fellowship", created_at: "2016-09-12 18:18:48", updated_at: "2018-04-17 20:51:53", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-09-01", updated_by: "honstu1"},
    {id: 933, award_name: "Josephine de Kármán Fellowship", subject_area: "All Fields", level: nil, deadline: "2018-01-31", other_req: "Applicants must be currently enrolled in a university or college located within the United States. Only candidates for the PhD who will defend their dissertation in or about June 2019 and undergraduates entering their senior year (will receive bachelors degree in or about June 2019) are eligible for consideration.", sponsor: "Josephine de Karman Fellowship Trust", amount: " $25,000 for graduate students and $15,000 for undergraduate students", state: "All", min_gpa: "N/A", contact: "scholars@up.edu", keywords: nil, website: "http://www.dekarman.org/", opportunity_type: "Scholarship", created_at: "2016-09-12 18:25:08", updated_at: "2018-04-17 20:41:35", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-10-01", updated_by: "honstu1"},
    {id: 934, award_name: "Knowles Math and Science Teaching Fellowship Program", subject_area: "STEM, Biology, Chemistry, Physics, Mathematics ", level: nil, deadline: "2018-09-12", other_req: "Applicants must be entering their first or second year as teacher of record during the 2018–2019 academic year; have earned a degree in a major related to the mathematics or science discipline; have earned or will earn a valid state teaching credential/certificate/license that enables them to teach mathematics or science in grades 9–12 in the United States no earlier than January 1, 2013 and no later than September 1, 2018.\r\n", sponsor: "", amount: "N/A", state: "All", min_gpa: "N/A", contact: "scholars@up.edu", keywords: nil, website: "http://kstf.org/", opportunity_type: "Fellowship", created_at: "2016-09-12 18:33:40", updated_at: "2018-04-17 21:00:33", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Can't find deadline details. Above deadline is educated guess based on previously posted 2016 deadline.", respect_deadline: true, date_reopens: "2018-08-01", updated_by: "honstu1"},
    {id: 936, award_name: "NAACP Earl Warren Scholarship", subject_area: "All Fields, Political Science  ", level: nil, deadline: "2018-05-01", other_req: "Ideal candidates are rising law students who are committed to racial justice and the public interest. Eligible law students include those entering their first or second year of full-time legal study at an accredited law school. The award includes $10,000 per year, over three years.", sponsor: "NAACP Legal Defense and Educational Fund", amount: "$30,000", state: "All", min_gpa: "", contact: "scholars@up.edu", keywords: nil, website: "http://www.naacpldf.org/earl-warren-scholarship", opportunity_type: "Scholarship", created_at: "2016-09-12 18:56:05", updated_at: "2018-03-21 23:18:39", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-11-30", updated_by: "honstu1"},
    {id: 937, award_name: "National Defense Sciences and Engineering Graduate Fellowship", subject_area: "All fields; STEM, Biology, Chemistry, Physics, Mathematics, Computer Science, Electrical Engineering, Mechanical Engineering, Civil Engineering, Psychology", level: nil, deadline: "2018-01-15", other_req: "Applicants must have received or be on track to receive their bachelor's degrees by Summer 2018. Applicants must also intend to pursue a doctoral degree in order to receive program support. If you are awarded, you must start your tenure in the fall of that year. Fellowships awarded in the spring of 2018 must start in September 2018. Deferrals may be considered on a case by case basis.\r\n\r\nNDSEG Fellows must be enrolled full-time and must be pursuing graduate study at a U.S. institution; the NDSEG Fellowship does not pay for tuition at any non-U.S. institution.", sponsor: "", amount: "", state: "All", min_gpa: "N/A", contact: "scholars@up.edu", keywords: nil, website: "http://www.ndsegfellowships.org/eligibility", opportunity_type: "Scholarship", created_at: "2016-09-12 19:10:47", updated_at: "2018-04-17 21:11:36", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "Most recent deadline not available. Above deadline is an educated guess based on deadline previously posted. ", respect_deadline: true, date_reopens: "2018-10-01", updated_by: "honstu1"},
    {id: 938, award_name: "North American Language and Culture Assistants in Spain", subject_area: "All Fields; International Experience; Spanish", level: nil, deadline: "2018-04-13", other_req: "The award provides a living stipend for language and culture assistants who, in return, work a minimum of 12 class periods per week at assigned school(s).\r\n\r\nELIGIBILITY: must complete undergraduate degree by program start date, hold a U.S. or Canadian passport, speak English or French as your first language, and be able to pass a medical evaluation and background check.  ", sponsor: "Ministry of Education, Culture, and Sport of Spain", amount: "Varies", state: "All", min_gpa: "None", contact: "scholars@up.edu", keywords: nil, website: "http://www.mecd.gob.es/eeuu/convocatorias-programas/convocatorias-eeuu/auxiliares-conversacion-eeuu.html", opportunity_type: "Fellowship", created_at: "2016-09-12 19:18:21", updated_at: "2018-03-21 22:49:31", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2017-10-01", updated_by: "honstu1"},
    {id: 939, award_name: "Public Policy and International Affairs Junior Summer Institute", subject_area: "All Fields", level: nil, deadline: "2018-11-01", other_req: "Candidates should have junior or senior standing at an accredited US college as well as an interest in pursuing a career in public or international affairs. This program, located at Princeton University, works to prepare individuals from diverse backgrounds for careers in public policy and graduate study. ", sponsor: "", amount: "", state: "", min_gpa: "", contact: "scholars@up.edu", keywords: nil, website: "http://wws.princeton.edu/admissions/ppia-junior-summer-institute", opportunity_type: "Fellowship", created_at: "2016-09-12 19:23:17", updated_at: "2018-03-21 22:44:02", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-09-01", updated_by: "honstu1"},
    {id: 940, award_name: "Samuel Huntington Public Service Award", subject_area: "All Fields; Public Service", level: nil, deadline: "2018-01-18", other_req: "This program allows a graduating college senior to complete one year of public service in the location of their choice.", sponsor: "National Grid", amount: "$15,000", state: "All", min_gpa: "", contact: "scholars@up.edu", keywords: nil, website: "https://www.nationalgridus.com/Our-Company/Community-Presence/The-Samuel-Huntington-Public-Service-Award", opportunity_type: "Fellowship", created_at: "2016-09-12 19:26:18", updated_at: "2018-03-23 21:39:32", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-10-01", updated_by: "honstu1"},
    {id: 941, award_name: "Teaching Assistant Program in France (TAPIF)", subject_area: "All Fields; French; International Experience", level: nil, deadline: "2019-01-15", other_req: "This award provides a stipend and health insurance in return for assistants teaching 12 hours per week in up to 3 schools. Classes are conducted in English. Teaching assistants conduct all or part of a class, typically leading conversations in English.", sponsor: "French Ministry of Education", amount: "Varies", state: "All", min_gpa: "None", contact: "scholars@up.edu", keywords: nil, website: "http://highereducation.frenchculture.org/teach-in-france", opportunity_type: "Fellowship", created_at: "2016-09-12 19:30:39", updated_at: "2018-03-21 22:23:31", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-10-01", updated_by: "honstu1"},
    {id: 942, award_name: "Thomas R. Pickering Graduate Fellowship Program", subject_area: "All Fields, Economics, French Studies, German Studies, Global Busines, Political Science, Sociology, Spanish", level: nil, deadline: "2019-09-17", other_req: "This award provides financial support, mentoring and professional development to prepare participants academically and professionally for a career in the U.S. Department of State Foreign Service. Women, members of minority groups historically underrepresented in the Foreign Service, and students with financial need are encouraged to apply. \r\n\r\nELIGIBILITY: U.S. citizen, seeking admission to graduate school the fall following application submission, 3.2 minimum GPA, intend to enroll in a two-year, full-time master’s degree program at a U.S. based graduate institutions in an academic field relevant to the work of the Foreign Service, be able to June orientation in Washington D.C. and be able to fulfill summer internship obligations.", sponsor: "U.S. Department of State", amount: "Varies", state: "All", min_gpa: "3.2", contact: "scholars@up.edu", keywords: nil, website: "https://pickeringfellowship.org/graduate-fellowship/overview-and-eligibility/", opportunity_type: "Scholarship", created_at: "2016-09-12 19:35:22", updated_at: "2019-08-13 16:51:42", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: " ", respect_deadline: true, date_reopens: nil, updated_by: "leasor"},
    {id: 943, award_name: "Undergraduate Research Opportunities Programme (UROP) International of RWTH Aachen University", subject_area: "All Fields, International Experience", level: nil, deadline: "2017-01-15", other_req: "The program is ten weeks and provides two weeks of intensive German language course and an introduction to research and culture, followed by an eight-week research internship in one of the departments of RWTH Aachen University. All communication will be in English. Scholarship are offered to roughly half of the selected participants.\r\n\r\nELIGIBILITY: U.S. or Canadian citizen or permanent resident.", sponsor: "RWTH Aachen University", amount: "Varies", state: "All", min_gpa: "3.2", contact: "scholars@up.edu", keywords: nil, website: "http://www.rwth-aachen.de/cms/root/Forschung/Forschen-an-der-RWTH/Angebote-fuer-Studierende/UROP/~wmy/UROP-INternational/lidx/1/", opportunity_type: "Undergraduate Research", created_at: "2016-09-12 19:39:44", updated_at: "2016-12-16 00:14:47", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2017-09-01", updated_by: "leasor"},
    {id: 944, award_name: "Woodrow Wilson Teaching Fellowship", subject_area: "All fields; STEM, Biology, Chemistry, Physics, Mathematics ", level: nil, deadline: "2018-10-17", other_req: "Ideal candidates have a STEM background. The fellowship involves teaching in high-need secondary schools in Georgia and New Jersey.", sponsor: "The Woodrow Wilson National Fellowship Foundation", amount: "$30,000", state: "All", min_gpa: "3.0", contact: "scholars@up.edu", keywords: nil, website: "http://woodrow.org/fellowships/ww-teaching-fellowships/", opportunity_type: "Fellowship", created_at: "2016-09-12 19:45:23", updated_at: "2018-04-06 22:57:55", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-09-01", updated_by: "honstu1"},
    {id: 947, award_name: "Women's Army Corp Veterans' Association Scholarship", subject_area: "Military Family", level: nil, deadline: "2019-02-02", other_req: "Must be a relative (child, grandchild, niece or nephew) of an Army Service Woman and is based upon academic achievement and leadership as expressed through co-curricular activities and community involvement.", sponsor: "Women's Army Corps Veterans Association", amount: "$1,500", state: "All", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.armywomen.org/pdf/_10ScholarApp.pdf", opportunity_type: "Scholarship", created_at: "2016-09-15 17:06:28", updated_at: "2018-10-29 23:00:13", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 948, award_name: "Army Women's Foundation Legacy Scholarship", subject_area: "Military Family", level: nil, deadline: "2019-01-09", other_req: "Applicant must be a woman who has served or is serving honorably in the U.S. Army, U.S. Army Reserve, Army National Guard or the child of a woman who served honorably in the U.S. Army, U.S. Army Reserve or Army National Guard.  Undergraduate students must have completed 30 or more credit hours of course work.  Graduate students must have achieved an undergraduate degree with a cumulative GPA of 3.0 and must be enrolled or accepted into a graduate level program (masters or doctoral).  Scholarships are based on merit, academic potential, community service, letters of recommendation, and need.", sponsor: "Army Women's Foundation", amount: "$2,500", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.awfdn.org/scholarships/general-information/", opportunity_type: "Scholarship", created_at: "2016-09-15 17:10:57", updated_at: "2018-10-18 22:43:39", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 950, award_name: "Generation Google Scholarship", subject_area: "Computer Science; Computer Engineering; Minority", level: nil, deadline: "2018-12-06", other_req: "Be currently enrolled as an undergraduate or graduate student at a university for the 2018-19 academic year\r\nIntend to be enrolled in or accepted as a full-time student at a university in the United States or Canada for the 2019-20 academic year.\r\nMaintain a strong academic performance.\r\nBe pursuing a degree in computer science, computer engineering or a degree in a closely related technical field.\r\nExemplify leadership and demonstrate passion for improving representation of underrepresented groups in computer science and technology.\r\nThe program is open to qualified undergraduate and graduate university students who meet the above criteria and we strongly encourage students from historically underrepresented groups, including Black/African American, Hispanic/Latino, American Indian, or Filipino/Native Hawaiian/Pacific Islander, to apply.", sponsor: "Google", amount: "$10,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://buildyourfuture.withgoogle.com/scholarships/generation-google-scholarship/#!?detail-content-tabby_activeEl=university-students", opportunity_type: "Scholarship", created_at: "2016-09-15 17:30:06", updated_at: "2019-05-30 21:28:48", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "current college student deadline December 1st, high school senior application becomes available in January deadline in March. ", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "robertsm"},
    {id: 951, award_name: "Google Lime Scholarship Program", subject_area: "Computer Science; Computer Engineering", level: nil, deadline: "2018-12-09", other_req: "Currently enrolled in an undergraduate or graduate program with strong academic performance.  Applicants must have a visible or invisible disability (definition on website) and exemplify leadership and a commitment to and passion for computer science and technology.", sponsor: "Google", amount: "$10,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.limeconnect.com/programs/page/google-lime-scholarship", opportunity_type: "Scholarship", created_at: "2016-09-15 17:36:11", updated_at: "2018-10-18 22:44:33", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 952, award_name: "Women Techmakers Scholars Program", subject_area: "Computer Science; Computer Engineering", level: nil, deadline: "2018-12-06", other_req: "Identify as female. Currently be enrolled as a college student and intend to be enrolled in the next academic year.  Demonstrate a strong academic record and exemplify leadership and demonstrate passion for increasing the involvement of women in computer science.", sponsor: "Google", amount: "$10,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.google.com/anitaborg/us/", opportunity_type: "Scholarship", created_at: "2016-09-15 17:47:29", updated_at: "2018-10-18 22:45:31", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 953, award_name: "National Association of Negro Business and Professional Women's Clubs Scholarships", subject_area: "Minority", level: nil, deadline: "2019-03-01", other_req: "Multiple scholarships for African American females.", sponsor: "NANBPWC", amount: "Varies", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.nanbpwc.org/index-11.html", opportunity_type: "Scholarship", created_at: "2016-09-15 18:00:31", updated_at: "2019-01-03 00:09:49", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 955, award_name: "Ivey Engineering Inc. Scholarship Contest", subject_area: "All fields", level: nil, deadline: "2019-06-01", other_req: "You should presently be a senior in high school;Or be transitioning from high school to a college or university; Or be already enrolled in a college or university inside the United States or Canada.\r\n", sponsor: "Ivey Engineering Inc.", amount: "$500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.iveyengineering.com/about-us/scholarship/", opportunity_type: "Scholarship", created_at: "2016-09-19 22:29:06", updated_at: "2019-05-29 21:52:32", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Two offerings a year: May 1/ Nov 1", respect_deadline: true, date_reopens: "2020-06-01", updated_by: "robertsm"},
    {id: 959, award_name: "Ampronix College Scholarship", subject_area: "All fields", level: nil, deadline: "2019-05-31", other_req: "Must be a resident of the United States\r\nMust be enrolled as an undergraduate at a university\r\nMust have performed at least 20 hours of community service in the last year", sponsor: "Ampronix Imaging Technology ", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.ampronix.com/ampronix-college-scholarship", opportunity_type: "Scholarship", created_at: "2016-09-19 22:58:57", updated_at: "2019-08-01 17:06:22", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "Not updated as of 08/19", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "robertsm"},
    {id: 960, award_name: "CrowdReviews.com Transparency Scholarship", subject_area: "All fields", level: nil, deadline: "2018-12-15", other_req: "This scholarship was created for students who are interested in the study of online reviews, crowdsourcing, crowdfunding, and other peer to peer driven platforms that result in the benefit of website visitors. Applicant must be an undergraduate or a graduate student attending a college or university in the U.S. Applicants must be able to provide proof of enrollment. Applicants must write an essay of approximately 700-1000 words stating how the scholarship syncs up with the Applicant’s personal goals and what the Applicant’s plans are after college graduation. Applicant must have a cumulative GPA of 3.0. A copy of your transcript is required.", sponsor: "CrowdReviews.com ", amount: "$5,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.crowdreviews.com/scholarship-program", opportunity_type: "Scholarship", created_at: "2016-09-19 23:06:57", updated_at: "2018-09-21 18:28:34", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 961, award_name: "Hawaiian Civic Club Scholarship", subject_area: "All fields", level: nil, deadline: "2019-05-18", other_req: "Must be a resident of Hawaii.  Priority is given to members and family members of the Hawaiian Civic Club of Honolulu and/or applicants of Hawaiian ancestry.", sponsor: "Hawaiian Civic Club of Honolulu", amount: "Varies", state: "HI", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.hcchonolulu.org/scholarship-program/", opportunity_type: "Scholarship", created_at: "2016-09-23 17:43:26", updated_at: "2019-05-05 21:01:43", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-15", updated_by: "hobbsm"},
    {id: 963, award_name: "Champions for Christ Scholarship", subject_area: "All fields", level: nil, deadline: "2019-07-02", other_req: "The “Champions for Christ Foundation” was founded to provide scholarship money to deserving students who have surrendered their lives to full-time Christian service. ", sponsor: "Champions for Christ Foundation", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://championsforchrist.us/", opportunity_type: "Scholarship", created_at: "2016-09-23 19:06:01", updated_at: "2019-05-29 22:04:50", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-06-01", updated_by: "robertsm"},
    {id: 964, award_name: "Maryknoll Student Essay Contest", subject_area: "All fields", level: nil, deadline: "2018-11-16", other_req: "In his most recent letter, Rejoice and Be Glad, Pope Francis reminds us, “We are all called to be holy by living our lives with love. That does not require extraordinary deeds but everyday acts of kindness.”\r\n\r\nWe ask students to tell a true story of when they saw someone sharing God’s love through an act of kindness and how that inspired them to act in a similar way.", sponsor: "Maryknoll", amount: "Up to $1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://maryknollsociety.org/publications/essay-contest/", opportunity_type: "Scholarship", created_at: "2016-09-23 19:11:51", updated_at: "2018-08-24 18:16:33", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-08-15", updated_by: "geigerr"},
    {id: 965, award_name: "Islamic Society of North America Scholarships", subject_area: "All fields", level: nil, deadline: "2019-03-15", other_req: "Various scholarships for Muslim students with differing requirements.", sponsor: "Islamic Society of North America", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.isna.net/scholarships/", opportunity_type: "Scholarship", created_at: "2016-09-23 19:20:08", updated_at: "2018-11-30 19:06:42", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "walshm"},
    {id: 966, award_name: "Help a Hero Scholarship for Veterans", subject_area: "Military Veteran", level: nil, deadline: "2019-11-15", other_req: "Be a citizen of the United States;\r\nBe retired or honorable discharged veteran, active duty, or a member of the National Guard or Reserve;\r\nHave completed Basic Training and follow-on training (Advanced Individual Training, Technical school, etc.);\r\nHave or separated with a military rank of E-5 or below;\r\nDemonstrate a need for financial assistance;\r\nParticipate in, be accepted to or currently enrolled in a VA approved program or school at an accredited postsecondary institution;\r\nIf selected, authorize the Veterans of Foreign Wars (VFW) and Sport Clips, Inc. to announce and publish award of your scholarship. If awarded a scholarship, the recipient’s name, city, state, photograph and essay may be used for promotional purposes by the VFW and Sport Clips, Inc. without further consent from the recipient ", sponsor: "SportClips and Veterans of Foreign Wars", amount: "Up to $5,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.vfw.org/scholarship/", opportunity_type: "Scholarship", created_at: "2016-09-23 20:59:18", updated_at: "2019-08-01 17:08:00", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "Applications for the fall semester will be accepted January 1 through April 30.\r\nApplications for the spring semester will be accepted August 1 through November 15.", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "robertsm"},
    {id: 967, award_name: "Coast Guard Foundation Scholarship", subject_area: "Military Family", level: nil, deadline: "2019-03-15", other_req: "Eligible Students:\r\n\r\nUnmarried dependent children of enlisted men and women of the U.S. Coast Guard that are:\r\nActive duty, retired, or deceased.\r\nCoast Guard Reserve currently on extended active duty 180 days or more.\r\nStudents applying to college or currently in college may apply if working towards their first undergraduate degree program, are listed in Coast Guard DEERS, and are under the age of 24 when applying.", sponsor: "Coast Guard Foundation", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://1coastguardfoundationscholars.communityforce.com/Funds/Search.aspx#4371597136646D517975544F5976596D4E73384E69673D3D", opportunity_type: "Scholarship", created_at: "2016-09-23 21:08:37", updated_at: "2019-03-11 17:46:39", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 968, award_name: "Six Star Greatness is Earned Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-30", other_req: "OUR IDEAL CANDIDATE:\r\n\r\nCurrently attending post-secondary education institution or a high school student planning to attend starting fall 2019 (18 to 22 years of age).\r\nMinimum of 3.0 GPA.\r\nA leader on campus and excels as the \"overall student\".\r\nDemonstrated strong work ethic in the community, in the classroom and on the field.\r\n", sponsor: "Six Star Pro Nutrition", amount: "$15,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.sixstarpro.com/scholarship/", opportunity_type: "Scholarship", created_at: "2016-09-23 22:16:17", updated_at: "2018-08-29 22:17:45", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-08-21", updated_by: "walshm"},
