    {id: 972, award_name: "Customized Girl Annual Scholarship", subject_area: "All fields", level: nil, deadline: "2019-12-31", other_req: "Create an original and unique statement you would like on a t-shirt.  Males and females are welcome to apply.", sponsor: "Customized Girl", amount: "$500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.customizedgirl.com/?page=top50", opportunity_type: "Scholarship", created_at: "2016-09-23 22:45:11", updated_at: "2019-05-30 20:39:15", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 977, award_name: "Manon Rheaume Foundation Scholarships", subject_area: "All fields", level: nil, deadline: "2019-08-01", other_req: "Must be a female under the age of 19 who has expressed a desire to pursue their dreams in athletics.  Preference will be given to those applicants who have little or no other\r\nscholarship support available. In addition, the applicant must:\r\n1) demonstrate potential for future success;\r\n2) have a GPA of 3.0 or above based on a 4.0 scale;\r\n3) participate in school and/or community activities;\r\n4) participate in athletic activities and demonstrate a commitment to pursuing\r\na career in athletics; and\r\n5) demonstrate leadership qualities.\r\nCharacter traits of a constructive attitude, the ability to relate well to others and high moral\r\ncharacter will also be considered.", sponsor: "Manon Rheaume Foundation", amount: "Varies", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.manonrheaumefoundation.org/scholarship", opportunity_type: "Scholarship", created_at: "2016-09-26 17:13:23", updated_at: "2019-05-30 20:37:35", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 978, award_name: "Women's Western Golf Foundation Scholarship", subject_area: "All fields", level: nil, deadline: "2019-01-30", other_req: "Female high school senior who is an active participant in the sport of golf (golf ability is not a criterion for selection) with a 3.5 GPA or above.  She should be outstanding in character, integrity and leadership and require financial assistance to attend a four year college.", sponsor: "Women's Western Golf Foundation (WWGF)", amount: "$2,500 (renewable)", state: "All", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://wwga.org/WWGA.org/Scholarship_Information.html", opportunity_type: "Scholarship", created_at: "2016-09-26 17:20:20", updated_at: "2018-09-21 18:29:38", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 979, award_name: "Marion Motley Scholarship", subject_area: "Accounting; Business; Communications; Education; Finance; Information Technology; Journalism; Marketing; Management", level: nil, deadline: "2018-10-01", other_req: "The Cleveland Browns Foundation Marion Motley Scholarship Program is an exciting opportunity for a motivated student whose long-term career goal could include working in education or for a professional sports organization in any of a variety of capacities.\r\n\r\nStudents must be enrolled in a high school located in Northeast Ohio, on track to graduate at the end of the 2018-2019 academic year, and planning to enroll in a two-year or four-year college in 2019 in order to apply.\r\n\r\nThey also must meet the following minimum qualifications: 2.5 cumulative grade point average through junior year in high school, 18 ACT or 940 SAT (highest math and highest verbal) and meet the College Now income guidelines listed on website. ", sponsor: "Cleveland Browns Foundation", amount: "$2,500 (renewable)", state: "OH", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://app.smarterselect.com/programs/49482-College-Now-Greater-Cleveland", opportunity_type: "Scholarship", created_at: "2016-09-26 17:28:17", updated_at: "2019-05-29 22:13:35", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-06-01", updated_by: "robertsm"},
    {id: 982, award_name: "Southwestern Tack Scholarship Program", subject_area: "All fields", level: nil, deadline: "2019-09-01", other_req: "High school senior or current college student who is achieving academic success and has participated in horse events within the past year.", sponsor: "Southwestern Equine", amount: "$500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://southwesterntack.com/southwestern-tack-scholarship-program/", opportunity_type: "Scholarship", created_at: "2016-09-26 17:43:19", updated_at: "2019-05-07 04:31:46", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "hobbsm"},
    {id: 989, award_name: "Iranian Scholastic Achievement Scholarship", subject_area: "All fields", level: nil, deadline: "2018-06-30", other_req: "Must be of Iranian descent. Scholarships based on both merit and financial need. ", sponsor: "Momeni Foundation", amount: "$1,000", state: "All", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.momenifoundation.org/Apps.html", opportunity_type: "Scholarship", created_at: "2016-09-26 19:13:14", updated_at: "2019-03-11 17:47:23", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 991, award_name: "EMPOWER Scholarship", subject_area: "Nursing; Premed; Minority", level: nil, deadline: "2019-04-15", other_req: "This scholarship is open to ethnically diverse students who are pursuing a career in a medical or rehabilitation field and are active in their community. Must have financial need.", sponsor: "Courage Kenny Foundation", amount: "Varies", state: "MN; WI", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.allinahealth.org/Courage-Kenny-Rehabilitation-Institute/Programs-and-services/Volunteer-opportunities/EMPOWER-Scholarships/", opportunity_type: "Scholarship", created_at: "2016-09-26 19:27:50", updated_at: "2019-01-24 18:29:33", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 993, award_name: "Medical Scholarship for Student of ASEAN Heritage", subject_area: "Nursing; Science; Biology; Mathematics; Premed; Minority", level: nil, deadline: "2019-12-31", other_req: "Must be of ASEAN Heritage (Brunei Darussalam, Cambodia, Indonesia, Lao PDR, Malaysia, Myanmar, Singapore, Thailand, Philippines and Vietnam).", sponsor: "Regeneration Center of Thailand", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://stemcellthailand.org/scholarship/", opportunity_type: "Scholarship", created_at: "2016-09-26 22:10:18", updated_at: "2019-08-01 17:09:55", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 994, award_name: "American Indian Nurse Scholarship", subject_area: "Nursing; Minority", level: nil, deadline: "2019-06-01", other_req: "The American Indian Nurse Scholarship Award Program was started by the NSCDA in 1927 to give students of American Indian descent the opportunity to pursue careers in nursing. The students are expected to return to work among their people to help improve health care. Some students work on reservations, and others find employment in hospitals in areas largely populated by American Indians.  Must be 1/4 American Indian and enrolled in a tribe, if not enrolled, the student will be considered if they can prove direct tribal ancestry.  Must have financial need and not be receiving an Indian Health Service Scholarship.", sponsor: "National Society of The Colonial Dames of America", amount: "up to $3,000 renewable", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://nscda.org/student-resources/scholarship-opportunities/", opportunity_type: "Scholarship", created_at: "2016-09-26 22:17:00", updated_at: "2019-05-30 21:32:16", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Scholarship deadlines twice a year, 06/01 for fall term and 12/01 for spring term.", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "robertsm"},
    {id: 995, award_name: "Ritchie-Jennings Memorial Scholarship", subject_area: "Accounting; Business; Finance; Criminal Justice", level: nil, deadline: "2019-01-30", other_req: "Scholarship applicants must currently be enrolled full-time and similarly enrolled during the 2019-2020 academic year at an accredited, four-year college or university. Applicants must have a declared major or minor in accounting, business administration, finance or criminal justice and demonstrate a desire to pursue a career in fraud examination or similar anti-fraud profession.", sponsor: "Association of Certified Fraud Examiners", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.acfe.com/scholarship.aspx", opportunity_type: "Scholarship", created_at: "2016-09-26 22:30:20", updated_at: "2018-09-21 15:43:13", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 996, award_name: "Women In Accounting Scholarships", subject_area: "Accounting", level: nil, deadline: "2019-04-30", other_req: "Female student, commitment to the goal of pursuing a degree in Accounting in preparation for a career as an accounting or finance professional, including evidence of continued commitment to this goal after receiving the award.\r\nDemonstrated aptitude in accounting and business as evidenced by prior course work and/or work experience.\r\nClear evidence that goals and a plan for achieving those goals, both personal and professional, have been established.\r\nFinancial need", sponsor: "The Educational Foundation for Women in Accounting", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.efwa.org/scholarships_undergraduate.php", opportunity_type: "Scholarship", created_at: "2016-09-26 22:46:57", updated_at: "2019-01-24 18:29:57", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 999, award_name: "MaxHome Scholarship", subject_area: "Business; Management; Advertising; Marketing", level: nil, deadline: "2019-09-01", other_req: "Submit an essay - prompt on website", sponsor: "MaxHome", amount: "$1,500", state: "All", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.maxhomenow.com/scholarship.html", opportunity_type: "Scholarship", created_at: "2016-09-27 16:42:57", updated_at: "2019-05-30 20:35:59", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 1000, award_name: "Future Journalism Teacher Scholarship", subject_area: "Education", level: nil, deadline: "2019-07-15", other_req: "The Journalism Education Association sponsors up to five $1,000 scholarships for education majors who intend to teach scholastic journalism. Each recipient must be a college junior, senior or master’s degree student in a program designed to prepare him/her for teaching at the secondary-school level. Current secondary-school journalism teachers who are in a degree program to improve their journalism teaching skills also are eligible.", sponsor: "Journalism Education Association", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://jea.org/home/awards-honors/future-teacher-scholarships/", opportunity_type: "Scholarship", created_at: "2016-09-27 16:54:32", updated_at: "2019-05-07 04:34:17", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "hobbsm"},
    {id: 1001, award_name: "DevelopIntelligence Scholarship for Promising Programmers", subject_area: "All fields", level: nil, deadline: "2019-09-01", other_req: "Selection is based on demonstrated passion for technology, academic excellence, and leadership while working to make a difference in the world and software industry. Our scholarship is open to any student who meets the following criteria:\r\nStudent is enrolled full time in an undergraduate or graduate degree program at a college or university in the United States.\r\nStudent has completed at least one computer science class with a grade of at least 3.4 out of 4.0, or the equivalent.\r\nStudent has concrete plans to take at least one computer science class in the upcoming school year.", sponsor: "DevelopIntelligence", amount: "$1,000", state: "All", min_gpa: "3.4", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.developintelligence.com/scholarships", opportunity_type: "Scholarship", created_at: "2016-09-27 17:08:55", updated_at: "2019-05-07 04:33:15", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "hobbsm"},
    {id: 1002, award_name: "Barbara Lotze Scholarship for Future Physics Teachers", subject_area: "Education; Physics", level: nil, deadline: "2019-12-01", other_req: "Undergraduate students enrolled, or planning to enroll, in physics teacher preparation curricula and high school seniors entering such programs are eligible.", sponsor: "American Association of Physics Teachers", amount: "$2,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.aapt.org/Programs/grants/lotze.cfm", opportunity_type: "Scholarship", created_at: "2016-09-27 17:20:50", updated_at: "2019-08-01 17:12:28", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 1006, award_name: "Surefire CPR Scholarship", subject_area: "Nursing", level: nil, deadline: "2018-12-10", other_req: "Our scholarship will be awarded to a student who displays superior academic achievement, outstanding leadership qualities and involvement with community service.", sponsor: "Surefire CPR", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.surefirecpr.com/surefire-cpr-scholarship/", opportunity_type: "Scholarship", created_at: "2016-09-27 18:30:53", updated_at: "2018-10-18 22:45:55", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 1008, award_name: "Ann Olson Doctoral Scholarship", subject_area: "Clinical Doctoral Nursing Degree (DNP)", level: nil, deadline: "2019-02-01", other_req: "The candidate must be currently enrolled in (or applying to) a PhD, DNSc or DNP nursing degree program.\r\nThe candidate must have a current license to practice as a registered nurse and must have an interest in and commitment to oncology nursing.\r\nTwo professional letters of support are required. One of these letters must address the applicant's ability to perform doctoral level work.\r\nAt the end of each year of scholarship participation, the nurse shall submit a summary describing the education activities in which he/she participated.", sponsor: "Oncology Nursing Society Foundation", amount: "Up to $7,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://onsfoundation.org/apply/ed/Doctoral", opportunity_type: "Scholarship", created_at: "2016-09-27 18:38:20", updated_at: "2018-10-18 22:46:53", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "walshm"},
    {id: 1009, award_name: "Bachelor's in Nursing Degree Scholarship", subject_area: "Nursing", level: nil, deadline: "2019-02-01", other_req: "To provide scholarships to individuals who are interested in and committed to oncology nursing and pursuing a baccalaureate degree in nursing. The candidate must be enrolled for their senior year of a bachelor of nursing degree program at an NLN or CCNE accredited School of Nursing for the academic year.", sponsor: "Oncology Nursing Society Foundation", amount: "Up to $5,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://onsfoundation.org/apply/ed/Bachelors", opportunity_type: "Scholarship", created_at: "2016-09-27 18:43:18", updated_at: "2018-10-18 22:47:48", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "walshm"},
    {id: 1010, award_name: "Good360 Sustainability Scholarship", subject_area: "All fields", level: nil, deadline: "2018-10-31", other_req: "Must have an interest in environmentalism or sustainability.", sponsor: "Good360", amount: "$1,000", state: "All", min_gpa: "3.3", contact: "financial.aid@example.edu", keywords: nil, website: "https://good360.org/sustainability-scholarship/", opportunity_type: "Scholarship", created_at: "2016-09-27 18:59:18", updated_at: "2018-09-21 19:43:50", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1011, award_name: "Money Metals Exchange Scholarship Program", subject_area: "All fields", level: nil, deadline: "2019-09-30", other_req: "This scholarship will be open to high school seniors, undergraduate students, and graduate students with an interest in economics, specifically the tradition of the Austrian school. You DO NOT have to be an economics major to be eligible to receive this scholarship.", sponsor: "Money Metals Exchange and the Sound Money Defense League", amount: "Up to $2,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.moneymetals.com/scholarship", opportunity_type: "Scholarship", created_at: "2016-09-27 19:14:06", updated_at: "2019-05-30 22:28:42", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-06-01", updated_by: "robertsm"},
    {id: 1012, award_name: "Future Counselors of America Scholarship", subject_area: "Psychology", level: nil, deadline: "2019-06-30", other_req: "Our annual scholarship awards $1,000 to U.S. undergraduates and graduates majoring in psychology who seek a career in relationship counseling or a related field.\r\n", sponsor: "DatingAdvice.com", amount: "$1,000", state: "All", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.datingadvice.com/scholarship", opportunity_type: "Scholarship", created_at: "2016-09-27 19:17:56", updated_at: "2019-03-11 17:49:40", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1022, award_name: "Education Matters Scholarship", subject_area: "All fields", level: nil, deadline: "2018-11-30", other_req: "Be thirteen (13) years of age or older at the time of application.\r\nBe legal residents of the fifty (50) United States or the District of Columbia.\r\nBe currently enrolled (or enroll no later than the fall of 2023) in an accredited post-secondary institution of higher education.\r\nSubmit an online short written response (250 words or less) for the question:\r\n\"What would you say to someone who thinks education doesn't matter, or that college is a waste of time and money? \"", sponsor: "Unigo", amount: "$5,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.unigo.com/scholarships/our-scholarships/education-matters-scholarship", opportunity_type: "Scholarship", created_at: "2016-09-28 21:20:54", updated_at: "2018-08-30 16:22:34", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1025, award_name: "Deputy Scholarship for Women in Technology", subject_area: "Computer Science, Technology", level: nil, deadline: "2019-07-31", other_req: "Female student.\r\nYou are a full-time student enrolled at an accredited public or private (non-profit) US-based college or university\r\nYou must have a GPA of 3.0 or greater\r\nYou must submit an unofficial copy of your transcript", sponsor: "Deputy.com", amount: "$1,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.deputy.com/deputy-scholarship", opportunity_type: "Scholarship", created_at: "2016-09-28 21:47:22", updated_at: "2018-12-14 17:29:14", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "two scholarships annually, July 31st and November 30th deadlines", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "walshm"},
    {id: 1026, award_name: "Einstein Moving Scholarship", subject_area: "All fields", level: nil, deadline: "2018-12-01", other_req: "Student must be enrolled for the January 2019 semester.  Submit an essay - prompt on website.", sponsor: "Einstein Moving", amount: "$1,000", state: "All ", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://einsteinmoving.com/scholarship/", opportunity_type: "Scholarship", created_at: "2016-09-28 21:55:22", updated_at: "2018-08-30 16:23:08", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1027, award_name: "#ShareTheGoals Scholarship", subject_area: "All fields", level: nil, deadline: "2018-07-01", other_req: "Current college students or high school seniors, attending school in the United States, or an educator at any level teaching in the United States.  Create a video, infographic or essay explaining why the UN Global Goals are important and link it on social media.  Monthly winners and one grand prize winner.", sponsor: "The University Network (TUN)", amount: "$500 - $5000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.tun.com/blog/sharetheglobalgoals-scholarship/", opportunity_type: "Scholarship", created_at: "2016-09-28 22:52:17", updated_at: "2019-03-11 17:52:09", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Not offered in 2019-2020; Check back next year", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1028, award_name: "Money-Saving Resources for College Students Essay Contest", subject_area: "All fields", level: nil, deadline: "2018-11-16", other_req: "We’re helping college students share and learn about the latest and most useful money-saving apps, websites, and tools - little-known tools that other students might not have heard of, but which can save you a bundle. To enter, you must publish a 500+ word essay introducing (to other students, who will read your essay) the most useful money-saving tools that can help save other college students money.", sponsor: "Dealspotr", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://dealspotr.com/scholarship", opportunity_type: "Scholarship", created_at: "2016-09-28 22:58:08", updated_at: "2019-05-30 20:34:48", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "two scholarships per year - 3/16 & 11/16\r\nSpring 2019 not avail as of 3/2019, check back to see if fall 2019 avail for Nov submission.", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "robertsm"},
    {id: 1029, award_name: "Discover Scholarship", subject_area: "All fields", level: nil, deadline: "2020-01-31", other_req: "Must be 16 years of age or older and a high school senior or current undergraduate student.  Entering will sign you up for e-mails containing helpful college tips and resources.", sponsor: "Discover Student Loans", amount: "$5,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.discover.com/student-loans/scholarships/award.html", opportunity_type: "Scholarship", created_at: "2016-09-29 16:43:02", updated_at: "2019-03-11 17:57:28", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2021-02-01", updated_by: "hobbsm"},
    {id: 1031, award_name: "NACE Scholarships", subject_area: "Engineering; Sciences", level: nil, deadline: "2019-01-01", other_req: "Various scholarships with individual criteria.These scholarships were created to recognize outstanding students in the NACE Sections who are interested in pursuing a career in the field of science and/or engineering. ", sponsor: "NACE Foundation", amount: "$1,000 - $10,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://nace.academicworks.com/", opportunity_type: "Scholarship", created_at: "2016-09-29 17:09:39", updated_at: "2018-08-30 16:27:18", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1032, award_name: "Jeff Krosnoff Scholarship", subject_area: "All fields", level: nil, deadline: "2019-01-24", other_req: "Four-year college bound California high school seniors with excellent academic credentials who have demonstrated a breadth of interests, a driving desire to succeed in their chosen endeavors, outstanding community citizenship and the ability to share their experiences through the written word.", sponsor: "Jeff Krosnoff Foundation", amount: "$10,000", state: "CA", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.jeffkrosnoffscholarship.com/Scholarship.htm", opportunity_type: "Scholarship", created_at: "2016-09-29 17:34:52", updated_at: "2018-12-14 17:32:07", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "walshm"},
    {id: 1034, award_name: "Stephen T. Marchello Scholarship for Childhood Cancer Survivors", subject_area: "Allf ields", level: nil, deadline: "2019-03-15", other_req: "This scholarship has been designed to be available to individuals who have had childhood cancer and were treated or currently reside in Colorado or Montana. ", sponsor: "Stephen T. Marchello Scholarship Foundation", amount: "Varies", state: "CO; MT", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.stmfoundation.org/criteria", opportunity_type: "Scholarship", created_at: "2016-09-29 18:11:43", updated_at: "2018-09-21 19:46:11", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 1035, award_name: "Hawaii Association of Broadcasters Scholarship", subject_area: "Journalism", level: nil, deadline: "2019-04-15", other_req: "The HAB offers scholarships for college tuition for students with the career goal of working in broadcasting in Hawaii. Scholarship applications are accepted March-April every year and funds are granted for tuition only.", sponsor: "Hawaii Association of Broadcasters", amount: "varies", state: "HI", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://hawaiibroadcasters.com/wp/index.php/scholarships/", opportunity_type: "Scholarship", created_at: "2016-09-29 18:23:41", updated_at: "2019-04-18 22:12:07", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1036, award_name: "Ukulele Festival Hawaii College Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-30", other_req: "Be a current graduating high school senior and resident of Hawaii. Be accepted for admission to an accredited college or university, Have a passion for the ukulele. Be of good character and provide meaningful community service. Demonstrate financial need.", sponsor: "Ukulele Festival Hawaii", amount: "$2,000", state: "HI", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.ukulelefestivalhawaii.org/en/scholarship-information.htm", opportunity_type: "Scholarship", created_at: "2016-09-29 18:29:23", updated_at: "2019-01-03 00:10:40", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1038, award_name: "Bar Preparation Scholarships", subject_area: "Law; diversity", level: nil, deadline: "2018-11-30", other_req: "WSAJ is committed to implementing strategies that will result in significant and measurable progress towards increasing diversity in the plaintiff's bar. To help achieve this endeavor, WSAJ has pledged scholarship monies to assist diverse individuals in covering the tuition cost of a Themis bar preparation course. Criteria varies based on scholarship.", sponsor: "Washington State Association for Justice", amount: "Varies", state: "WA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.washingtonjustice.org/index.cfm?pg=scholarship", opportunity_type: "Scholarship", created_at: "2016-09-29 18:59:41", updated_at: "2019-03-27 21:54:19", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Is this post helpful to our student population? Consider removing.", respect_deadline: true, date_reopens: "2019-08-15", updated_by: "hobbsm"},
    {id: 1039, award_name: "DAAD Graduate Programs (German Academic Exchange Service)", subject_area: "All Fields; German; International Experience", level: nil, deadline: "2018-11-04", other_req: "DAAD offers programs for graduate students to move to Germany and participate in study stays, research, internships, and learn German. Eligibility, program dates, and deadlines vary by program. You may apply at the earliest in the last year of your studies and you must satisfy all the academic requirements specified in the Call for Applications by the time the funded studies begin. You must be able to submit your degree certificate before funding begins.\r\nIt is important to look into each scholarship programs and see which are open to you, and whether you have to apply from your country of residence or country of origin. Under certain circumstances, persons with foreign citizenship can also be considered for funding programs intended for German individuals. DAAD Scholarships are awarded to qualified candidates who wish to engage in full-time face-to-face study in Germany. ", sponsor: "Deutscher Akademischer Austausch Dienst", amount: "Varies", state: "All", min_gpa: "None", contact: "scholars@up.edu", keywords: nil, website: "https://www.daad.org/en/find-funding/graduate-opportunities/", opportunity_type: "Fellowship", created_at: "2016-10-03 22:08:16", updated_at: "2018-04-17 19:22:26", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "Deadline varies, could not find clear 2018/2019 deadline", respect_deadline: true, date_reopens: "2018-09-01", updated_by: "honstu1"},
    {id: 1044, award_name: "AFSA Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-01", other_req: "The High School Senior College Scholarship Contest is open to high school seniors who are citizens or aliens legally residing in the USA.  Scholarship funds are payable to the winner’s college/university or certified trade school in the United States; winner must enroll for classes beginning no later than fall session.\r\nWinner selection is NOT based on financial need, GPA or demographic criteria.\r\nHome-schooled students may apply as long as course of study is equivalent to that of a senior in high school.\r\nRelatives of AFSA staff or NATIONAL board members may not enter.", sponsor: "AFSA", amount: "$2,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.afsascholarship.org/high-school-contest/hsstep1/", opportunity_type: "Scholarship", created_at: "2016-10-04 19:32:10", updated_at: "2018-09-20 21:45:48", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "walshm"},
    {id: 1045, award_name: "E-waste Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-30", other_req: "You must be a high school freshman, sophomore, junior, or senior or a current or entering college or graduate school student of any level. Home schooled students are also eligible. There is no age limit. You must also be a U.S. citizen or legal resident.  ", sponsor: "Digital Responsibility", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.digitalresponsibility.org/ewaste-scholarship", opportunity_type: "Scholarship", created_at: "2016-10-04 19:35:29", updated_at: "2018-09-21 19:47:04", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 1047, award_name: "Create-A-Greeting-Card Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-01", other_req: "Submit original photo, artwork or computer graphics for the front of a greeting card.  ust be 14 years or older at time of entry and be enrolled in High School, College, University or Homeschool.\r\n\r\nAll legal residents of the fifty (50) United States and the District of Columbia, as well as American Samoa, Guam, the Commonwealth of the Northern Mariana Islands, the U.S. Virgin Islands, and Puerto Rico. International students who have a student visa to attend school in the U.S. are considered legal residents and are therefore eligible.", sponsor: "The Gallery Collection", amount: "$10,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.gallerycollection.com/greeting-cards-scholarship.htm", opportunity_type: "Scholarship", created_at: "2016-10-04 22:19:30", updated_at: "2019-05-29 22:16:51", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-06-01", updated_by: "robertsm"},
    {id: 1051, award_name: "Oregon Trail Electric Co-op Scholarship", subject_area: "All fields", level: nil, deadline: "2019-02-01", other_req: "Scholarships are available to active members and their dependents who receive their electric service from Oregon Trail Electric Company (Baker, Union, Grant and Harney Counties).  Applicant must be of good character and successfully held a part-time job, internship or volunteer position during the last year.  Economic need, history of community involvement and potential for success will be considered. ", sponsor: "Oregon Trail Electric Company", amount: "$5,000", state: "OR", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.otecc.com/community/scholarships", opportunity_type: "Scholarship", created_at: "2016-10-06 18:58:45", updated_at: "2018-11-30 19:08:21", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 1052, award_name: "Southern Oregon Latino Scholarship", subject_area: "Minority", level: nil, deadline: "2019-03-01", other_req: "Latino/Hispanic students living in the Southern Oregon region (Jackson, Josephine or Klamath counties) who are entering freshmen or continuing college students seeking their first academic degree.  Must have a minimum of 3.0 cumulative high school GPA or a minimum combined verbal/math score on the SAT 1010 or a minimum of 21 on the ACT.  Continuing college students must have a minimum of a 3.0.  If awarded, must complete at least 30 hours of an approved community service activity.", sponsor: "Southern Oregon Latino Scholarship Fund", amount: "$500 - $1,000", state: "OR", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.solsf.org/application.html", opportunity_type: "Scholarship", created_at: "2016-10-06 19:04:19", updated_at: "2019-03-11 17:59:50", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "hobbsm"},
    {id: 1054, award_name: "Oregon Lakes Association Scholarship", subject_area: "Biology, Environmental Science", level: nil, deadline: "2019-05-31", other_req: "Interested applicants should be enrolled (or will be enrolled by the time the award is accepted) in an Oregon college or university graduate program in a field related to the study of Oregon lakes, ponds or reservoirs and their watersheds. An applicant may also be enrolled in a graduate college or university graduate program outside of Oregon if the study project will involve Oregon lakes, ponds or reservoirs. The award will be based on quality of research, its significance to the field of environmental science, particularly limnology and hydrology,and relevance to the applicant's interest and career goals", sponsor: "Oregon Lakes Association", amount: "$1,000", state: "OR", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.oregonlakes.org/scholarship", opportunity_type: "Scholarship", created_at: "2016-10-06 21:20:16", updated_at: "2019-05-07 04:35:23", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1055, award_name: "Asian-American Foundation of Oregon Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-15", other_req: "The Asian American Foundation of Oregon (AAFO) scholarship grants will be made to encourage students who have demonstrated interest in Asian American cultural activities, to continue to participate in Asian American community and cultural activities which help support and promote the mission statement of the AAFO. You must be a resident of Oregon and a U.S. citizen to be eligible for this award. A minimum 2.5 GPA is also required, as well as an essay and letters of recommendation.", sponsor: "Asian-American Foundation of Oregon", amount: "$1,000", state: "OR", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://aaforegon.org/", opportunity_type: "Scholarship", created_at: "2016-10-06 21:27:41", updated_at: "2019-04-18 22:13:02", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 1056, award_name: "Asphalt Pavement Association of Oregon Scholarship", subject_area: "Engineering", level: nil, deadline: "2018-11-02", other_req: "Students interested in our road and highway infrastructure and the materials and methods used to design our roads and highways are perfect candidates for an APAOEF scholarship. Applicants must demonstrate an interest in asphalt paving technology or a closely related field and be currently enrolled in an accredited engineering, construction engineering management, or construction trade program at a college, university, or professional trade school in Oregon.  Students pursuing advanced degrees are eligible. Academic performance, extracurricular activities, work experience, and financial need may be considered. Although letters of recommendation are not required, they will be considered if submitted.", sponsor: "Asphalt Pavement Association of Oregon Education Foundation", amount: "up to $3,500", state: "OR", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.apao.org/oregon_asphalt_scholarships.html", opportunity_type: "Scholarship", created_at: "2016-10-06 21:35:01", updated_at: "2018-09-20 22:07:17", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1058, award_name: "ACPE Northwest Scholarship", subject_area: "Computer Science; Technology", level: nil, deadline: "2019-03-04", other_req: "currently be a senior at an Oregon or Washington K–12 public or private educational institution\r\nhave demonstrated high interest and innovative use of technology during your high school career have demonstrated some community/school involvement, preferably with a technology focus \r\nplan to pursue studies in a technology-related field to obtain the minimum of a two-year degree\r\nhave created a simple website describing their own technology project and including links to evidence for that project. The evidence should be accessible via a standard browser and should not require installation of any additional software.", sponsor: "Association of Computer Professionals in Education", amount: "$2,000", state: "OR; WA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.acpenw.org/scholarships", opportunity_type: "Scholarship", created_at: "2016-10-07 16:19:50", updated_at: "2018-12-14 17:16:24", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-10", updated_by: "walshm"},
    {id: 1059, award_name: "Florida Navy Nurse Corps Association Scholarship - Military Preference", subject_area: "Nursing", level: nil, deadline: "2018-11-16", other_req: "Applicants:\r\n1.\tMust be enrolled in an accredited nursing program.\r\n2.\tMust be a Nursing Major.\r\n3.\tMay be a full or part time student.\r\n4.\tMust have a current grade point average of at least 3.0 on 4.0 scale.\r\n5.\tMust give evidence of successful completion of at least one clinical nursing course.\r\n\r\nPreference is given to applicants in the following categories:\r\n1.\tCurrent Active Duty/Reserve Service Member.\r\n2.\tVeteran of military service.\r\n3.\tFamily member of current or former member of the military service.\r\n4.\tCivil Service Employee.\r\n", sponsor: "Florida Navy Nurse Corps Association", amount: "$1,500", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://nnca.org/", opportunity_type: "Scholarship", created_at: "2016-10-07 16:28:58", updated_at: "2018-10-18 22:50:04", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Application under \"Membership Information\"", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 1068, award_name: "MyLEDLightingGuide Scholarship", subject_area: "Business; Engineering; Environmental Science", level: nil, deadline: "2018-08-15", other_req: "Only students located within the United States. You must be a US Citizen. Must be registered for the Fall 2018 semester. Content must be original and written by you. No plagiarism. Minimum GPA Requirement: 2.5. Submit an essay - prompt on website.", sponsor: "My LED Lighting Guide", amount: "$1,000", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.myledlightingguide.com/scholarship.aspx", opportunity_type: "Scholarship", created_at: "2016-10-07 19:16:27", updated_at: "2019-03-11 18:01:18", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "twice yearly\r\nNot offered in 19-20; check back next year.", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1070, award_name: "Duluth Superior Area Community Foundation Scholarships", subject_area: "All fields", level: nil, deadline: "2019-01-15", other_req: "Various scholarships for students from NE Minnesota and NW Wisconsin.  Requirements vary by individual scholarship.", sponsor: "Duluth Superior Area Community Foundation", amount: "Varies", state: "MN; WI", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.dsacommunityfoundation.com/apply-for-scholarships", opportunity_type: "Scholarship", created_at: "2016-10-12 18:35:41", updated_at: "2018-09-21 19:48:39", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 1071, award_name: "Society of Hispanic Professional Engineers Twin Cities Scholarships", subject_area: "STEM; Science; Technology; Engineering; Mathematics; Minority", level: nil, deadline: "2019-03-25", other_req: "To  be eligible for the SHPE-TC Academic Scholarship, you must: \r\n\r\nBe a resident of, or student in, Minnesota\r\nBe of Hispanic or Latino heritage\r\nHave a minimum cumulative high school or college grade point average (GPA) of 2.75 on a 4.0 scale.\r\nIs planning to, or already, attend an accredited U.S. college or university, or community college.\r\nIs planning to, or are currently on the way to, earn a degree focused on science, technology, engineering, or mathematics.", sponsor: "The Society of Hispanic Professional Engineers Twin Cities Professional Chapter", amount: "$1,000 - $3,000", state: "MN", min_gpa: "2.75", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.shpetwincities.org/scholarships.html", opportunity_type: "Scholarship", created_at: "2016-10-12 18:55:15", updated_at: "2019-03-11 18:06:33", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1073, award_name: "CelebrAsian Scholarships", subject_area: "Minority", level: nil, deadline: "2019-03-29", other_req: "Applicant must be:\r\n\r\nAt least 16 years of age at the time of application\r\nA high school senior\r\nOf Asian Pacific Island heritage (except for Bruce Lee Scholarship)\r\nA citizen or permanent resident of the United States\r\nBeginning full-time study at an accredited post-secondary educational institution in the United States in Fall 2017\r\n• Able to attend 2017 CelebrAsian Procurement Conference, May 31 – June 2, San Diego, CA\r\n\r\nApplicant should demonstrate: Academic achievement of 3.3 GPA or higher, leadership in extracurricular activities, involvement in community service and financial need.", sponsor: "USPAACC", amount: "Varies", state: "All", min_gpa: "3.3", contact: "financial.aid@example.edu", keywords: nil, website: "http://celebrasianconference.com/scholarships", opportunity_type: "Scholarship", created_at: "2016-10-12 19:11:06", updated_at: "2019-01-03 00:12:35", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
