    {id: 1076, award_name: "Minnesota Beat the Odds", subject_area: "All fields", level: nil, deadline: "2018-10-12", other_req: "For consideration in the Minnesota Beat the Odds scholarship program, an applicant must:\r\n\r\nBe a current high school senior in Minneapolis, St. Paul or surrounding area attending a public, charter or alternative high school; \r\nBe nominated or seek nomination from a teacher, counselor, caseworker, or other adult who can speak to the student’s challenges; \r\nHave overcome significant adversity such as, but not limited to, poverty, disability, homelessness or abuse; \r\nDemonstrate participation in school activities, community organizations, employment and/or community service", sponsor: "Children's Defense Fund - Minnesota", amount: "$5,000", state: "MN", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://cdf-mn.org/programs/beat-the-odds/", opportunity_type: "Scholarship", created_at: "2016-10-12 21:26:25", updated_at: "2018-09-20 22:10:43", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1077, award_name: "Family Fellowship Youth in Foster Care Scholarship", subject_area: "Foster Youth", level: nil, deadline: "2019-05-01", other_req: "Must be a foster youth between the ages of 17 and 23 and been in public or private foster care for the 12 consecutive months leading up to and including their 18th birthday; OR have been adopted or placed into legal guardianship from foster care after their 13th birthday; OR they have been orphaned for at least one year at the time of their 18th birthday.", sponsor: "Together We Rise", amount: "up to $90,000", state: "CO; MD; VA; DC", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://familyfellows.org/", opportunity_type: "Scholarship", created_at: "2016-10-13 15:48:10", updated_at: "2019-05-05 21:03:40", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1078, award_name: "Folds of Honor Scholarship", subject_area: "Military Family", level: nil, deadline: "2019-04-01", other_req: "The Higher Education Scholarship program is for spouses and dependents of service members who are enrolled, or planning to enroll, in an undergraduate program of study leading to a bachelor’s degree at an accredited U.S. college or university. No scholarship can be awarded to those pursuing a second undergraduate or graduate school (Master’s/Doctorate) degree. Dependent(s) of the service-member must be 24 years of age or younger and unmarried.  Service-member (of any branch; active duty or reserves) must be one of the following:\r\n\r\nKIA, killed in the line of duty, or suffered the loss of a limb; died of any cause while on active duty or after being classified as having a service-connected disability; or who has a 10% or higher combined service-connected evaluation, rated by the Veteran’s Administration. If applicant’s service-member is currently active duty, they can only be eligible to apply for a scholarship if the service-member has a Purple Heart or loss of limb, and provides current orders.", sponsor: "Folds of Honor", amount: "Up to $5,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.foldsofhonor.org/scholarships", opportunity_type: "Scholarship", created_at: "2016-10-13 21:17:10", updated_at: "2019-03-11 18:07:49", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1079, award_name: "Richie's Spirit Scholarship", subject_area: "All fields", level: nil, deadline: "2019-02-01", other_req: "A U.S. citizen or Lawful Permanent Resident currently enrolled in a U.S. - accredited high school who will graduate in the Spring of 2019;\r\nPlans to attend a vocational schools, community college, or four-year college full-time during the 2019 - 2020 academic year;\r\nHas a cumulative high school grade point average of 3.4 or higher on a 4.0 scale (or equivalent);\r\nHas taken challenging courses throughout his or her high school career;\r\nHas demonstrated strong leadership roles within his or her community.", sponsor: "Richie's Spirit Foundation", amount: "$5,000", state: "All", min_gpa: "3.4", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.richiesspirit.org/college-scholarships", opportunity_type: "Scholarship", created_at: "2016-10-13 21:23:03", updated_at: "2018-11-15 23:27:31", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-15", updated_by: "walshm"},
