    {id: 1100, award_name: "I Have a Dream Scholarship", subject_area: "All fileds", level: nil, deadline: "2019-01-31", other_req: "Submit an online short written response (250 words or less) for the question:\r\n\"We want to know... what do you dream about? Whether it's some bizarre dream you had last week, or your hopes for the future, share your dreams with us for a chance to win $1,500 for college.\"", sponsor: "Unigo", amount: "$1,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.unigo.com/scholarships/our-scholarships/i-have-a-dream-scholarship", opportunity_type: "Scholarship", created_at: "2016-10-17 21:24:04", updated_at: "2018-10-18 22:52:35", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 1101, award_name: "Sweet and Simple Scholarship", subject_area: "All fields", level: nil, deadline: "2019-02-28", other_req: "Submit an online short written response (250 words or less) for the question:\r\n\"Not every gift has to be expensive or extravagant. In fact, sometimes it's the sweet and simple things that make a real difference in our lives. Think back and tell us about something you received as a gift and why it meant so much to you.\"", sponsor: "Unigo", amount: "$1,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.unigo.com/scholarships/our-scholarships/sweet-and-simple-scholarship", opportunity_type: "Scholarship", created_at: "2016-10-17 21:25:31", updated_at: "2018-10-18 22:52:56", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
