    {id: 1104, award_name: "SunTrust Off To College Scholarship Sweepstakes", subject_area: "All fields", level: nil, deadline: "2019-05-13", other_req: "Two $500 scholarship winners will be randomly chosen every two weeks.  Entrants must be a U.S. Citizen or U.S. Permanent Resident, at least 13 years of age and have a permanent residence in one of the following states: Alabama, Arkansas, Florida, Georgia, Maryland, Mississippi, North Carolina, South Carolina, Tennessee, Virginia, West Virginia, or the District of Columbia (DC)", sponsor: "SunTrust Banks", amount: "$500", state: "AL; AR; FL; GA; MD; MS; NC; SC; TN; VA; WV; DC", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.suntrusteducation.com/scholarship-sweepstakes/index.html", opportunity_type: "Scholarship", created_at: "2016-10-17 21:31:44", updated_at: "2018-10-18 22:53:50", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1108, award_name: "Celebrate the West Art Competition", subject_area: "All fields", level: nil, deadline: "2019-04-30", other_req: "Entrants from WGA member states will create original two-dimensional artwork inspired by their state or informed by living in the West. Students may draw ideas from a variety of sources, including state history, landmarks, natural resources, National Parks and Monuments, people, communities, and culture.", sponsor: "Western Governors' Foundation", amount: "$1,200", state: "AK; AS; AZ; CA; CO; GU; HI; ID; KS; MP; MT; NE; NV; NM; ND; OK; OR; SD; TX; UT; WA; WY", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://westgov.org/celebrate-the-west", opportunity_type: "Scholarship", created_at: "2016-10-18 21:46:47", updated_at: "2019-03-27 21:57:17", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "hobbsm"},
    {id: 1109, award_name: "Grieg Lodge Scholarship", subject_area: "All fields", level: nil, deadline: "2019-02-15", other_req: "Eligibility is limited to students whose home address is in Multnomah, Clackamas, Columbia, Washington, and Yamhill Counties in Oregon, or Clark County, Washington. Applicants do not need to have any affiliation with Grieg Lodge. However, preference will be given to applicants with a connection to Scandinavian heritage, culture and/or activities.", sponsor: "Grieg Lodge Scholarship Fund", amount: "$1,500", state: "OR; WA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.glscholarshipfund.org/scholarships--grants.html", opportunity_type: "Scholarship", created_at: "2016-10-18 21:55:48", updated_at: "2018-10-18 22:54:57", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
