    {id: 1111, award_name: "George and Dorothy Marsden Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-31", other_req: "To be eligible for consideration an applicant must:\r\nHave a permanent legal residence within the Episcopal Diocese of Spokane (the state of Washington east of the Cascades and the state of Idaho north of the Salmon River). Have submitted a completed application on current year online form by March 31. Have arranged for any supplementary online forms (references) to be submitted by March 31. Be a high school senior.  NOTE: You do not have to be a member of an Episcopal church or any faith community.", sponsor: "The Cathedral of St. John the Evangelist", amount: "$7,500", state: "ID; WA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://stjohns-cathedral.org/marsden-scholarship", opportunity_type: "Scholarship", created_at: "2016-10-18 22:04:32", updated_at: "2019-03-11 18:13:27", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1113, award_name: "Sub Pop Loser Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-20", other_req: "Applicants must be a resident of Washington or Oregon, and a graduating senior on your way to full-time enrollment at an accredited university or college. We are looking for applicants who are involved and/or interested in music and/or the creative arts in some way. However, you do not need to be pursuing an education in the arts.", sponsor: "Sub Pop Records", amount: "up to $7,000", state: "OR; WA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.subpop.com/scholarship", opportunity_type: "Scholarship", created_at: "2016-10-18 22:22:28", updated_at: "2019-04-16 22:36:15", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "hobbsm"},
    {id: 1114, award_name: "Central Kansas Community Foundation Scholarships", subject_area: "All fields", level: nil, deadline: "2019-04-27", other_req: "Scholarships are available to BUTLER, ELK, HARVEY, MARION, RENO, SEDGWICK, SHAWNEE & WILSON County, Kansas residents only.\r\n\r\nAll other criteria and deadlines varies depending on the scholarship. ", sponsor: "Central Kansas Community Foundation", amount: "Varies", state: "KS", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://centralkansascf.org/non-profit-organizations/scholarships/", opportunity_type: "Scholarship", created_at: "2016-10-20 22:07:19", updated_at: "2019-03-11 18:15:32", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1115, award_name: "The HOTH Scholarship", subject_area: "Allfields", level: nil, deadline: "2019-12-31", other_req: "The HOTH is offering this scholarship to students in the United States who write a blog post on the topic “How Companies Can Take Advantage of Digital Marketing”", sponsor: "The HOTH", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.thehoth.com/seo-scholarship/", opportunity_type: "Scholarship", created_at: "2016-10-20 22:10:25", updated_at: "2019-08-01 17:13:54", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 1116, award_name: "Photojournalism Scholarship", subject_area: "All fields; Photojournalism; Journalism", level: nil, deadline: "2019-11-15", other_req: "Submit photography (high school or college students) or video (college only) that tells a story.\r\n\r\nHigh school students applying for these scholarships must have completed one year at an accredited high school (student must therefore be a sophomore or older) and should have taken at least one photography or related art class.\r\n\r\nCollege or technical school students applying for these scholarships must have completed one year at a recognized college, university or professional school (student must therefore be a sophomore or older), and have taken courses in photography or photojournalism.\r\n\r\nGraduate students applying for a scholarship should be enrolled in a journalism or photojournalism program.\r\n\r\nHigh school, college and graduate students should have at least one semester remaining at time of award.", sponsor: "The James Alan Cox Foundation", amount: "Varies", state: "All ", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.jamesalancoxfoundation.org/application.php", opportunity_type: "Scholarship", created_at: "2016-10-25 16:21:58", updated_at: "2019-07-17 22:44:09", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-07-15", updated_by: "robertsm"},
    {id: 1117, award_name: "National Space Club Keynote Scholarship", subject_area: "Engineering, Mathematics, Science, Technology", level: nil, deadline: "2019-12-02", other_req: "The applicant must be a U.S. citizen.\r\nThe scholarship is open to seniors in high school through graduate students.\r\nThe applicant must have the intention of pursuing a career in the STEM fields and plan to attend an accredited U.S. college or university to follow a course of study to pursue a career in the STEM field, with a preference for those with space related interests.\r\nThe applicant can only use the $10,000.00 scholarship towards tuition for the 2017-2018 academic year.\r\n", sponsor: "National Space Club Foundation", amount: "$10,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.spaceclub.org/scholarship/", opportunity_type: "Scholarship", created_at: "2016-10-25 16:25:24", updated_at: "2019-08-01 17:14:49", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 1118, award_name: "CGTrader Essay Contest", subject_area: "All fields", level: nil, deadline: "2019-12-02", other_req: "Applicant must be full-time enrolled in an undergraduate or graduate-level degree program at an accredited college or university, and should be able to present proof of status at the request of CGTrader. Applicant must be a U.S. Citizen or Permanent Legal Resident of the United States. The participation is not limited to any sphere of study: all essays submitted before the deadline will be considered irrespective of student discipline.\r\n\r\nAll you have to do is write and submit an original essay on the topic listed on the website.", sponsor: "CG Trader", amount: "$3,000", state: "All ", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.cgtrader.com/scholarships", opportunity_type: "Scholarship", created_at: "2016-10-25 16:30:26", updated_at: "2019-04-18 22:15:12", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 1120, award_name: "LNESC Emergency Scholarship Fund", subject_area: "All fields", level: nil, deadline: "2019-05-01", other_req: "The LNESC Emergency Scholarship Fund is a joint partnership between LNESC & Macy’s to provide financial resources to deserving students facing economic hardship and immediate monetary need that, if not met, could result in an inability to complete classes or a degree program.\r\n​\r\nEmergency financial need resulting from the following will qualify students for funding: \r\nchange in family income/support, loss of job, death of an immediate family member, natural disaster\r\npending eviction or home foreclosure, burglary,fire. *Poor financial choices do not constitute as emergency financial need (e.g. credit card debit, poor use of financial aid funding, personal loans to family or friends).  \r\n \r\nLNESC Emergency Scholarships are non-renewable and applicants cannot be recipients of other LULAC National Educational Service Centers (LNESC) Scholarships at the time of application. Award amounts vary based on need, but should not exceed $500 due to overwhelming number of applicants.", sponsor: "LNESC and Macy's", amount: "up to $500", state: "CA; FL; MO; NM; NY; OH; TX", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.lnesc.org/macys-scholarship?SEC=%7B3AEDB506-F425-4E58-B9F6-44867E2FD943%7D&Type=B_BASIC", opportunity_type: "Scholarship", created_at: "2016-11-02 21:32:25", updated_at: "2019-05-30 18:29:08", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "rolling deadline ", respect_deadline: true, date_reopens: "2020-05-02", updated_by: "robertsm"},
    {id: 1121, award_name: "Ford Emerging Voices Scholarship", subject_area: "Journalism; Communication; English", level: nil, deadline: "2019-05-04", other_req: "The AWM Foundation’s partnership with the Ford Motor Company Fund supports two female students based on an essay written on a suggested topic. Winning applicants will receive a scholarship of $2,000 each and write four blogposts for AWM. Winners are invited to accept their scholarships live at the Gracies Luncheon in New York City.", sponsor: "Alliance for Women in Media and Ford Motor Company", amount: "$2,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://allwomeninmedia.org/foundation/scholarships/", opportunity_type: "Scholarship", created_at: "2016-11-02 22:14:29", updated_at: "2019-05-05 21:04:36", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "hobbsm"},
    {id: 1122, award_name: "Ford Empowering America Scholarship", subject_area: "Journalism; English; Communication", level: nil, deadline: "2019-05-04", other_req: "The Alliance for Women in Media Foundation and the Ford Motor Company Fund are teaming together to\r\nhonor students telling the stories of women empowering others. AWMF and the Ford Motor Company\r\nFund will select one student winner to receive $3,000, payable to the winning student’s educational\r\ninstitution and one student runner up to receive $2,000 for the 2018 educational fall semester.\r\nThe winning students will also create two profiles/interview pieces for the AWM website over the 3rd and 4th quarters of the year with guidance from AWM staff. These pieces will be published on the AWM website and pushed through AWM’s social networks.\r\n", sponsor: "Alliance for Women in Media and Ford Motor Company", amount: "up to $3,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://allwomeninmedia.org/foundation/scholarships/", opportunity_type: "Scholarship", created_at: "2016-11-02 22:18:08", updated_at: "2019-05-05 21:05:13", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1126, award_name: "Design Thinking Scholarship", subject_area: "All fields", level: nil, deadline: "2019-12-31", other_req: "To apply for the Design Thinking scholarship submit an essay of between 500 and 1500 words describing how you anticipate design thinking or digital design tools will impact you and your career choice. The title of the essay must reflect how design thinking or design tools impacts either you or your career choice. Must be 16 years of age to enter. ", sponsor: "American Graphics Institute", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.agitraining.com/scholarships", opportunity_type: "Scholarship", created_at: "2016-11-09 18:53:42", updated_at: "2019-08-01 17:16:49", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "Deadlines are 7/31 and 12/31 annually.", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "robertsm"},
    {id: 1130, award_name: "The Clubs of America Scholarship Award for Career Success", subject_area: "All fields", level: nil, deadline: "2019-08-31", other_req: "Write an essay of no fewer than 600 words about their career aspirations and how their current course load will help them achieve success in their careers. Where do you see yourself 10 years from now? Thinking outside the box is encouraged!", sponsor: "Clubs of America", amount: "$1,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.greatclubs.com/scholarship-award-for-career-success.asp", opportunity_type: "Scholarship", created_at: "2016-11-09 19:58:10", updated_at: "2018-10-18 22:56:07", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 1131, award_name: "Wells Fargo Scholarship Program for People with Disabilities", subject_area: "All fields", level: nil, deadline: "2018-12-06", other_req: "Applicants to the Wells Fargo Scholarship Program for People with Disabilities must:\r\nHave an identified disability (defined as someone who has, or considers themselves to have, a long-term or recurring issue that impacts one or more major life activity)\r\nHave a minimum grade point average of 3.0 on a 4.0 scale or its equivalent\r\nBe a high school senior or graduate who plans to enroll or who is already enrolled in full-time or half-time (at least 6 credits per term) undergraduate study at an accredited two-year or four-year college or university in the United States for the entire 2018-2019 academic year.\r\n\r\nOnly the first 700 applications received will be processed.", sponsor: "Wells Fargo", amount: "$2,500 (renewable)", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://scholarsapply.org/pwdscholarship/", opportunity_type: "Scholarship", created_at: "2016-11-15 22:43:14", updated_at: "2018-10-23 16:47:38", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 1132, award_name: "LendEDU Scholarship", subject_area: "All fields", level: nil, deadline: "2019-10-18", other_req: "The LendEDU Scholarship is available for high school seniors and current college students. Answer the essay prompt on their website to enter.\r\n\r\nPlease see the eligibility criteria below:\r\nMust be a current high school senior or a full-time college student.\r\nMust be a U.S. Citizen.\r\nMust be earning a minimum 2.5 GPA in high school or college.", sponsor: "Lendedu.com", amount: "$1,000", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://lendedu.com/blog/scholarship-application/", opportunity_type: "Scholarship", created_at: "2016-11-17 17:52:06", updated_at: "2019-08-01 17:18:24", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-20", updated_by: "robertsm"},
    {id: 1135, award_name: "Murrietta Circuits Scholarship ", subject_area: "STEM field; Science; Engineering; Technology; Mathematics; Military Family", level: nil, deadline: "2018-09-10", other_req: "For the 2018 Spring Semester, Murrietta Circuits will be offering a $500 scholarship to a Student Veteran and/or Child Of A Veteran, who writes a winning essay on their college experience in a STEM related field.", sponsor: "Murrietta Circuits", amount: "$500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.murrietta.com/scholarship-opportunity.html", opportunity_type: "Scholarship", created_at: "2016-11-17 18:03:03", updated_at: "2019-05-29 22:18:17", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-06-01", updated_by: "robertsm"},
    {id: 1136, award_name: "Pretty Photoshop Actions Bi-annual Scholarship", subject_area: "All fields", level: nil, deadline: "2019-10-15", other_req: "The requirements for eligible student entries are:\r\n\r\nYou should presently be a senior in high school.\r\nOr be transitioning from high school to a college or university.\r\nOr be already enrolled in a college or university inside the United States or Canada.\r\nEmployees and their immediate family members of PhotoshopActions.com are not eligible to participate.", sponsor: "Pretty Photoshop Actions", amount: "$500", state: "All", min_gpa: "none", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.photoshopactions.com/pages/pretty-photoshop-actions-scholarship-program", opportunity_type: "Scholarship", created_at: "2016-11-17 18:07:48", updated_at: "2019-05-30 17:44:29", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "scholarships offered 10/15 and 4/15. ", respect_deadline: true, date_reopens: "2020-02-05", updated_by: "robertsm"},
    {id: 1137, award_name: "Davis New Mexico Scholarship", subject_area: "All fields", level: nil, deadline: "2018-10-19", other_req: "The scholarship application is open to students who are seniors in high school and are currently enrolled in one (or more) of the following program(s):\r\n\r\nAVID at Santa Fe Public Schools\r\nBreakthrough Santa Fe\r\nCollege Horizons (New Mexico students only)\r\nNew Mexico Simon Scholars\r\nThe MASTERS Program\r\nAcademy for Technology and the Classics\r\nSouth Valley Academy\r\nNACA Inspired Schools Network\r\nDavis New Mexico Scholars will receive a full-ride scholarship that will cover the cost of attendance to one of the following institutions:\r\n\r\nLoyola Marymount University (Los Angeles, CA)\r\nSt. Edward’s University (Austin, TX)\r\nSouthwestern University (Georgetown, TX)\r\nUniversity of Denver (Denver, CO)\r\nUniversity of Portland (Portland, OR)\r\nLawrence University (Appleton, WI)\r\n\r\nFamily income limited to 200% of federal poverty level.", sponsor: "Breakthrough Santa Fe; Shelby Cullom Davis Charitable Trust", amount: "Full Cost of Attendance", state: "NM", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://davisnm.org/", opportunity_type: "Scholarship", created_at: "2016-11-21 20:32:12", updated_at: "2018-09-20 22:11:37", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-10", updated_by: "walshm"},
    {id: 1139, award_name: "Arctic Physical Therapy Scholarship", subject_area: "All fields", level: nil, deadline: "2019-08-31", other_req: "Must attend college on a full or part-time basis in the U.S. or Canada.  Be a U.S. or Canadian citizen.", sponsor: "Arctic Physical Therapy Fairbanks", amount: "$500", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.physicaltherapyfairbanks.com/physical_therapy_fairbanks.php", opportunity_type: "Scholarship", created_at: "2016-11-23 19:53:37", updated_at: "2018-11-29 23:58:50", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-25", updated_by: "walshm"},
    {id: 1140, award_name: "Native Hawaiian Health Scholarship Program", subject_area: "Nursing; Minority", level: nil, deadline: "2019-03-01", other_req: "Merit-based scholarship with monthly stipend. Must be of Native Hawaiian ancestry and committed to providing primary health services to Native Hawaiians and their families in Hawai'i. Recipients are obligated to serve full-time in medically un- or under-served areas in Hawai'i for two to four years, depending upon the length of time of scholarship support. Note: this is a taxable scholarship.", sponsor: "HRSA", amount: "Tuition, books and stipend", state: "HI", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.nhhsp.org/", opportunity_type: "Scholarship", created_at: "2016-11-23 22:26:11", updated_at: "2019-06-04 16:57:59", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "2020-2021 Scholarship application opens 2/1/2020 and due 6 weeks later in mid-March. ", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "hobbsm"},
    {id: 1141, award_name: "Minnesota Masonic Charities Scholarships", subject_area: "All fields", level: nil, deadline: "2019-02-15", other_req: "No Masonic affiliation needed. Must have a strong character.", sponsor: "Minnesota Masonic Charities", amount: "Varies", state: "MN", min_gpa: "varies", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.mnmasoniccharities.org/what-we-do/scholarships/", opportunity_type: "Scholarship", created_at: "2016-12-01 18:56:01", updated_at: "2018-11-30 19:12:58", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 1144, award_name: "Back 2 School Illinois Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-01", other_req: "B2SI will award a cash grant of $2,500 for the freshman year of study to outstanding college-bound high school seniors, using leadership skills in both academic achievement as well as school and local community as the criteria to identify winners. ", sponsor: "Community Currency Exchange Association of Illinois, the Tufano Family, Payline Data, & Kits for Kidz", amount: "$2,500", state: "IL", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://b2si.org/college-sch/", opportunity_type: "Scholarship", created_at: "2016-12-01 22:29:26", updated_at: "2019-04-16 22:51:12", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "hobbsm"},
    {id: 1145, award_name: "Illinois PTA Scholarship", subject_area: "Education; Nursing; Social Work", level: nil, deadline: "2019-02-15", other_req: "Illinois high school senior from an Illinois public school who plans to study education or an education-related degree program such as librarians, school nurses, school psychologist or social workers.", sponsor: "Illinois PTA", amount: "Varies", state: "IL", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://illinoispta.org/scholarship/", opportunity_type: "Scholarship", created_at: "2016-12-01 22:34:09", updated_at: "2019-01-24 18:32:53", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "walshm"},
    {id: 1148, award_name: "Community Foundation of Northern Illinois Scholarships", subject_area: "All fields", level: nil, deadline: "2019-02-01", other_req: "Scholarships are for graduating high school seniors in Boone, Ogle, Stephenson and Winnebago Counties.", sponsor: "Community Foundation of Northern Illinois", amount: "Varies", state: "IL", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://cfnil.org/scholarships/", opportunity_type: "Scholarship", created_at: "2016-12-01 23:23:37", updated_at: "2018-11-30 19:13:42", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 1149, award_name: "Central Illinois Chapter of The Links Scholarship", subject_area: "Minority", level: nil, deadline: "2019-02-01", other_req: "Applicant must be an African American graduating senior planning to attend an accredited post-secondary institution. Applicant must have a minimum 3.0 cumulative GPA on a 4.0 scale or a 4.0 cumulative GPA on a 5.0 scale. Applicant must reside in the Bloomington/Normal, Peoria, or Decatur areas. Applicant cannot be a relative of any member of the Central Illinois Chapter of The Links, Incorporated.  Applicant must be a United States citizen.", sponsor: "Central Illinois Chapter of The Links, Incorporated", amount: "Varies", state: "IL", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.centralillinoislinksinc.org/scholarship.php", opportunity_type: "Scholarship", created_at: "2016-12-01 23:32:33", updated_at: "2018-11-30 19:14:07", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 1150, award_name: "Portland Links Academic and Arts Scholarships", subject_area: "Minority", level: nil, deadline: "2019-02-23", other_req: "Recipients will be selected from graduating African American high school seniors who have demonstrated scholastic potential, high achievement, and leadership ability.\r\n\r\nApplicants must have a minimum cumulative high school GPA of 3.0 and be a resident of the metropolitan area of Portland, Oregon (Multnomah County, Washington County, or Clackamas County) or Vancouver, Washington (Clark County).", sponsor: "Portland Chapter of The Links, Incorporated", amount: "Varies", state: "OR; WA", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://portlandlinksinc.org/2019-scholarship-application/", opportunity_type: "Scholarship", created_at: "2016-12-01 23:35:33", updated_at: "2018-12-14 17:34:23", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "walshm"},
    {id: 1154, award_name: "Love Your Career Scholarship", subject_area: "All fields", level: nil, deadline: "2019-09-10", other_req: "Submit an essay - prompt on website.\r\n\r\nYou must be a student enrolled in an accredited college or University located in the United States.", sponsor: "Jones T-Shirts", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.jonestshirts.com/scholarship", opportunity_type: "Scholarship", created_at: "2016-12-05 23:22:20", updated_at: "2019-05-05 21:06:21", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Twice yearly; 1/7 and 9/10", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "hobbsm"},
    {id: 1156, award_name: "Growing the Future Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-01", other_req: "Students must work at least 13 hours/week during the school year for an IDDBA-member company (list on website, over 100 companies).", sponsor: "International Dairy Deli Bakery Association (IDDBA)", amount: "$2,000", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.iddba.org/professional-resources/scholarships-grants/scholarship-for-growing-the-future", opportunity_type: "Scholarship", created_at: "2016-12-06 00:10:57", updated_at: "2019-01-03 00:13:11", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1157, award_name: "Freeman - Asia", subject_area: "All fields; International Experience; Study Abroad", level: nil, deadline: "2019-04-05", other_req: "An Applicant:\r\n- Must be a U.S. citizen or permanent resident at the time of application.\r\n- Must currently receive need-based financial aid or demonstrate a verifiable need for financial assistance to participate in the proposed study abroad program. The applicant is required to submit the Estimated Family Contribution (EFC) figure, calculated through FAFSA, with the statement of financial need through the online Freeman-ASIA application.\r\n- Must be an undergraduate student with a minimum GPA of 2.8, pursuing his or her first bachelor's degree (or associate's degree), at a two-year or a four-year institution of higher education in the United States.\r\n- Must apply through the U.S. home campus and have at least one term of enrollment remaining at the home institution in the U.S. upon returning from studying abroad in Asia.\r\n- Must have applied or have been accepted to a study abroad based program in: Cambodia, China, Hong Kong, Indonesia, Japan, Korea, Laos, Macao, Malaysia, Mongolia, Philippines, Singapore, Taiwan, Thailand, Vietnam. A multi-country program is eligible only if the applicant will spend at least 8 weeks in one of the countries stated above and will have intensive language study during that period.\r\n- Must have applied to or have been accepted by a study abroad based program that awards academic credits through the home campus or other U.S. accredited college or university. The proposed length of study in the host country must be a minimum of 8 weeks for a summer term, 10 weeks for a quarter term, and 12 weeks for a semester term.\r\n- Must have little or no previous experience in the country in which he or she plans to study. A summer term applicant must not have spent more than 4 weeks in the proposed country of study within the last 5 years. A semester or an academic year term applicant must not have spent more than 6 weeks in the proposed country of study within the last 5 years.", sponsor: "Institute of International Education", amount: "varies ", state: "All", min_gpa: "2.8", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.iie.org/Programs/Freeman-ASIA", opportunity_type: "Scholarship", created_at: "2016-12-14 19:19:42", updated_at: "2019-05-29 20:54:03", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "One application for all semesters within 20-21 Academic Year", respect_deadline: true, date_reopens: "2020-02-04", updated_by: "hobbsm"},
    {id: 1159, award_name: "Dental Scholarship", subject_area: "All fields; Pre-dental", level: nil, deadline: "2019-06-01", other_req: "Students of All Majors, High School and College; Any United States Citizen or Foreign Citizen residing legally in the USA.\r\n\r\nCreate a video telling \"what super power you would love to have and how you would use it to help create better dental health in all people!\"", sponsor: "Emergency Dentists", amount: "$1,000", state: "All", min_gpa: "none", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.emergencydentistsusa.com/dental-scholarship/#Scolarship%20Rules%20and%20Eligibility%20Requirements", opportunity_type: "Scholarship", created_at: "2016-12-16 21:54:05", updated_at: "2018-10-30 16:16:27", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 1161, award_name: "Pretty Lightroom Presets Scholarship", subject_area: "All fields", level: nil, deadline: "2020-04-15", other_req: "The requirements for eligible student entries are:\r\n\r\nYou should presently be a senior in high school or be already enrolled in a college or university inside the United States or Canada.", sponsor: "Pretty Lightroom", amount: "$500", state: "All", min_gpa: "none", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.lightroompresets.com/pages/pretty-lightroom-presets-scholarship-program", opportunity_type: "Scholarship", created_at: "2016-12-16 22:53:24", updated_at: "2019-08-01 17:20:25", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 1162, award_name: "Whitaker International Fellows Program ", subject_area: "Biomedical Engineering; Chemical Engineering; Electrical Engineering; Mechanical Engineering", level: nil, deadline: "2017-01-24", other_req: "This award provides funding for biomedical engineers to gain international experience. The stipend, commensurate with the recipient’s experience and expected expenses in the host country, includes round-trip international airfare, a monthly living stipend to commensurate with cost of living in host country, health & accident insurance, and some tuition fees.\r\n\r\nELIGIBILITY: Be in the field of biomedical engineering/bioengineering or a closely-related field (Chemical, Mechanical or Electrical Engineering with substantive interest and background in Biomedicine), no more than 3 years from the receipt of your most recent degree or be currently enrolled, and have the language ability to carry out the proposed project.", sponsor: "The Whitaker Foundation and The Institute for International Education (IIE)", amount: "Varies", state: "All", min_gpa: "None", contact: "scholars@up.edu", keywords: nil, website: "http://www.whitaker.org/grants/fellows-scholars", opportunity_type: "Fellowship", created_at: "2016-12-19 23:58:17", updated_at: "2016-12-19 23:58:17", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "Funding is not expected to be available beyond the 2017 application cycle.", respect_deadline: true, date_reopens: nil, updated_by: "leasor"},
    {id: 1163, award_name: "Killam Undergraduate Fellowship for Americans", subject_area: "All Fields, International Experience", level: nil, deadline: "2017-01-31", other_req: "This scholarshp is for exceptional undergraduate students from universities in the United States to spend either one semester or a full academic year as an exchange student in Canada and provides up to $5,000 U.S.  per semester.\r\n\r\nELIGIBILITY: full-time undergraduate students in good standing at a fully accredited degree granting college or university in the United States;  have a superior and competitive academic record.", sponsor: "The Foundation for Educational Exchange between Canada and the United States of America ", amount: "Varies", state: "All", min_gpa: "3.7", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.fulbright.ca/programs/killam-fellowships/americans.html", opportunity_type: "Scholarship", created_at: "2016-12-20 00:05:52", updated_at: "2019-05-29 21:11:45", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 1164, award_name: "Denny's Hungry for Education Scholarship", subject_area: "All fields", level: nil, deadline: "2018-12-31", other_req: "Multiple scholarships are offered, click on individual organizations to view sponsoring organization specific criteria.\r\n", sponsor: "Denny's", amount: "Varies", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.dennyshungryforeducation.com/", opportunity_type: "Scholarship", created_at: "2017-01-02 21:40:23", updated_at: "2018-09-20 21:01:15", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1167, award_name: "BMW/SAE Engineering Scholarship", subject_area: "Engineering", level: nil, deadline: "2019-03-15", other_req: "U.S. resident.\r\n3.75 or better grade point average on a 4.0 scale (required).\r\nRank in the 90th percentile in both math and critical reading on SAT I or composite ACT scores.\r\nPursue an engineering or related science degree through an ABET accredited program.", sponsor: "BMW/SAE", amount: "$1,500 (renewable)", state: "All", min_gpa: "3.75", contact: "financial.aid@example.edu", keywords: nil, website: "http://students.sae.org/scholarships/bmw/", opportunity_type: "Scholarship", created_at: "2017-01-03 17:14:12", updated_at: "2019-01-03 00:14:05", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1168, award_name: "Edward D. Hendrickson / SAE Engineering Scholarship", subject_area: "Engineering", level: nil, deadline: "2019-03-15", other_req: "U.S. resident.\r\n3.75 grade point average.\r\nRank in the 90th percentile in both math and critical reading on SAT I or composite ACT scores.\r\nPursue an engineering or related science degree through an ABET accredited program.", sponsor: "Hendrickson International", amount: "$5,000 (renewable)", state: "All", min_gpa: "3.75", contact: "financial.aid@example.edu", keywords: nil, website: "http://students.sae.org/scholarships/hendrickson/", opportunity_type: "Scholarship", created_at: "2017-01-03 17:17:10", updated_at: "2019-01-03 00:13:29", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1169, award_name: "Donald and Barbara Mozley Scholarship", subject_area: "Engineering", level: nil, deadline: "2019-03-15", other_req: "U.S. Resident\r\nOpen to all applicants - freshman through senior at an ABET accredited program college or university\r\n3.5 or better for high school applicants\r\nSAT I math of 600 or above and critical reading of 550 or above, and/or an ACT composite score of 27 or above\r\nFinancial need as determined by a completed FAFSA form\r\nOne letter of recommendation", sponsor: "Donald and Barbara Mozley / SAE", amount: "$5,000", state: "All", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://students.sae.org/scholarships/mozley/", opportunity_type: "Scholarship", created_at: "2017-01-03 17:19:06", updated_at: "2019-01-03 00:13:50", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1170, award_name: "Tau Beta Pi / SAE Engineering Scholarship", subject_area: "Engineering", level: nil, deadline: "2019-03-15", other_req: "U.S. Resident\r\n3.75 or better grade point average on a 4.0 scale (required)\r\nRank in the 90th percentile in both math and critical reading on SAT I or composite ACT scores.\r\nPursue an engineering or related science degree through an ABET accredited program.", sponsor: "Tau Beta Pi Association", amount: "$1,000", state: "All", min_gpa: "3.75", contact: "financial.aid@example.edu", keywords: nil, website: "http://students.sae.org/scholarships/taubetapi/", opportunity_type: "Scholarship", created_at: "2017-01-03 17:20:45", updated_at: "2019-01-03 00:14:22", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1171, award_name: "Fred M. Young Sr. / SAE Engineering Scholarship", subject_area: "Engineering", level: nil, deadline: "2019-03-15", other_req: "U.S. resident.\r\n3.75 or better grade point average on a 4.0 scale (required).\r\nRank in the 90th percentile in both math and critical reading on SAT I or composite ACT scores.\r\nPursuing an engineering degree through an ABET accredited program.", sponsor: "Young Radiator Company", amount: "$1,000 (renewable)", state: "All", min_gpa: "3.75", contact: "financial.aid@example.edu", keywords: nil, website: "http://students.sae.org/scholarships/young/", opportunity_type: "Scholarship", created_at: "2017-01-03 17:23:22", updated_at: "2019-01-03 00:14:33", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1172, award_name: "SAE/David Hermance Hybrid Technologies Scholarship", subject_area: "Engineering; Physics", level: nil, deadline: "2019-03-15", other_req: "U.S. resident.\r\nCollege sophomore at the time of application.\r\n3.50 or better grade point average on a 4.0 scale.\r\nPursue an engineering or related degree through an ABET accredited program.\r\nEnroll in a two- or four-year engineering or science program at an accredited college or university.", sponsor: "Toyota", amount: "$2,500", state: "All", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://students.sae.org/scholarships/hermance/", opportunity_type: "Scholarship", created_at: "2017-01-03 17:25:54", updated_at: "2019-01-03 00:15:12", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1173, award_name: "Ralph K. Hillquist Honoraray SAE Scholarship", subject_area: "Mechanical Engineering", level: nil, deadline: "2019-03-15", other_req: "U.S. Resident\r\nEnrolled full-time as a junior in a U.S. university accredited through ABET.\r\nHave a declared major in mechanical engineering or an automotive-related engineering discipline.\r\nPreference will be given to those individuals with studies/courses in the areas of expertise related to noise and vibration (ex: statics, dynamics, physics, vibration).", sponsor: "SAE Noise & Vibration Conference", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://students.sae.org/scholarships/hillquist/", opportunity_type: "Scholarship", created_at: "2017-01-03 17:28:19", updated_at: "2019-01-03 00:15:27", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "Awarded every other year", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1174, award_name: "Yanmar/SAE Scholarship", subject_area: "Engineering", level: nil, deadline: "2019-03-15", other_req: "U.S. Resident\r\nFull-time college junior or post-graduate student.\r\nPursue an engineering or related science degree through an ABET accredited program.\r\nPursue course of study or research related to the conservation of energy in transportation, agriculture & construction, and power generation. Emphasis will be placed on research or study related to the internal combustion engine.\r\nApplications will be judged on the basis of previous scholastic performance.\r\nAdditional consideration given for special study or honors in the field of the award, and for leadership achievement related to engineering or science.", sponsor: "SAE Foundation / Yanmar America Corporation", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://students.sae.org/scholarships/yanmar/", opportunity_type: "Scholarship", created_at: "2017-01-03 17:30:31", updated_at: "2019-01-03 00:15:38", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1175, award_name: "Greenhouse Scholars", subject_area: "All fields", level: nil, deadline: "2018-12-17", other_req: "We look for high-performing, under-resourced students who have already demonstrated true leadership and positive community contributions.\r\n\r\nTo be eligible, applicants must:\r\n\r\nBe a graduating high school senior planning to attend a four-year accredited academic institution.\r\nBe a U.S. citizen or permanent resident and a legal resident of Colorado, Georgia, Illinois or North Carolina.\r\nHave a cumulative, un-weighted GPA of 3.5 or above.\r\nDemonstrate financial need (annual household income no greater than $70,000).\r\nPossess excellent leadership skills, an ability to persevere through difficult circumstances, and a strong interest and commitment to their community.", sponsor: "Greenhouse Scholars", amount: "up to $5,000 (renewable)", state: "CO; GA; IL; NC", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://greenhousescholars.org/our-scholars/become-a-scholar/", opportunity_type: "Scholarship", created_at: "2017-01-03 20:01:54", updated_at: "2018-08-30 16:52:39", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1178, award_name: "Foundation for Science and Disability Award", subject_area: "STEM; Science; Technology; Engineering; Mathematics", level: nil, deadline: "2018-12-01", other_req: "A goal of the FOUNDATION for SCIENCE and DISABILITY is to increase opportunities in science for disabled students. To promote this goal, the FOUNDATION has established a Science Student Grant Fund, available to fourth year undergraduate (who have been accepted to graduate or professional school) and graduate students who have a disability.  The students must be United States citizens.  Awards of $1000 each will be made to college or university students for some special purpose in connection with a science project or thesis in any field of Mathematics, Science, Medicine, Engineering, or Computer Science.  An award could be given for assistive device or instrument, or as financial support to work with a professor on an individual research project or for some other special research need.", sponsor: "Foundation for Science and Disability", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.stemd.org/", opportunity_type: "Scholarship", created_at: "2017-01-04 18:02:56", updated_at: "2019-08-01 17:22:14", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Not updated as of 08/19", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "robertsm"},
    {id: 1179, award_name: "NBCUniversal Tony Coelho Media Scholarship for Students with Disabilities", subject_area: "Communication; Journalism; Theater; Music", level: nil, deadline: "2019-06-06", other_req: "Currently enrolled undergraduate or graduate students with disabilities who are interested in pursuing a career in the communications, media, or entertainment industry. ", sponsor: "NBCUniversal", amount: "$5,625", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.aapd.com/nbcuniversal-tony-coelho-media-scholarship-program/", opportunity_type: "Scholarship", created_at: "2017-01-04 18:08:04", updated_at: "2019-05-30 21:49:13", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-10", updated_by: "robertsm"},
    {id: 1180, award_name: "Fred Scheigert Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-15", other_req: "Scholarships are offered to students with low vision from 20/70 in the better eye with best possible correction, or a field restricted to no greater than 30 degrees and to those who have less vision but are still able to benefit from the use of low vision devices to perform daily visual tasks.", sponsor: "Council of Citizens with Low Vision International", amount: "$3,000", state: "All", min_gpa: "3.2", contact: "financial.aid@example.edu", keywords: nil, website: "https://cclvi.org/scheigert-scholarship", opportunity_type: "Scholarship", created_at: "2017-01-04 18:19:36", updated_at: "2019-01-03 00:15:58", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1181, award_name: "RiSE Scholarship", subject_area: "All fields", level: nil, deadline: "2019-01-31", other_req: "Must have a documented learning disability", sponsor: "RiSE Scholarship Foundation", amount: "$2,500", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://risescholarshipfoundation.org/rise-award/apply-now/", opportunity_type: "Scholarship", created_at: "2017-01-04 18:54:21", updated_at: "2018-12-14 17:45:35", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 1182, award_name: "iModules Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-01", other_req: "Students must meet the minimum qualification to be eligible for a scholarship:\r\n\r\n    Full-time student for the fall semester\r\n    Attending or will be attending a school that is an iModules client (University of Portland qualifies)\r\n    A minimum “C” grade point average\r\n", sponsor: "iModules", amount: "$1,500", state: "All", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://scholarships.imodules.com/s/891/update/start.aspx", opportunity_type: "Scholarship", created_at: "2017-01-04 19:31:05", updated_at: "2019-04-18 22:19:36", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "hobbsm"},
    {id: 1183, award_name: "Humane Studies Fellowship", subject_area: "All fields; Humanities; Social Sciences", level: nil, deadline: "2019-02-10", other_req: "The Humane Studies Fellowship is a renewable, non-residency award of up to $15,000 per year to support current or future students in PhD programs. Intended for graduate students with an interest in developing, teaching, and applying classical liberal ideas and the principles of a free society, this program supports research and teaching in the humanities and social sciences.", sponsor: "Institute for Humane Studies", amount: "$15,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://theihs.org/funding/humane-studies-fellowship/", opportunity_type: "Fellowship", created_at: "2017-01-04 23:19:38", updated_at: "2018-11-30 19:14:41", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 1184, award_name: "Aceable Agent Higher Education Scholarship", subject_area: "All fields", level: nil, deadline: "2019-12-15", other_req: "Submit a 500 - 1,000 word essay - prompt on website.\r\n\r\nApplicants must be currently enrolled at or planning to attend a 2-4 year university or community college, graduate school program, or trade school located in the continental US. ", sponsor: "Aceable Agent", amount: "$500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.aceableagent.com/scholarships/", opportunity_type: "Scholarship", created_at: "2017-01-05 17:31:13", updated_at: "2019-08-01 17:23:31", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "robertsm"},
    {id: 1185, award_name: "Bart Kamen Memorial FIRST Scholarship", subject_area: "Biomedical Engineering; Pre-med; Biology; Chemistry; Physics", level: nil, deadline: "2019-02-01", other_req: "Must have participated as a team member for a minimum of one year on a FIRST Robotics Competition Team, FIRST LEGO League or FIRST Tech Challenge. \r\n\r\nHave been accepted to, or applied for admission to, an eligible undergraduate program, which means a full-time program in Biomedical Engineering, Pre-medical Studies, or a program that allows students to pursue a chosen major while simultaneously completing a subset of medical school prep courses (e.g. biology, physics, chemistry and organic chemistry, so that the student will be qualified for admission to medical school upon graduation), at a college or university that (i) in the United States, is eligible to participate in the federal student financial assistance programs administered by the United States Department of Education under Title IV of the Higher Education Act of 1965 as amended, or (ii) outside the United States, is similarly accredited.", sponsor: "FIRST", amount: "$10,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.firstinspires.org/bart-kamen-scholarship", opportunity_type: "Scholarship", created_at: "2017-01-05 17:38:44", updated_at: "2018-11-30 00:00:33", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-25", updated_by: "walshm"},
    {id: 1186, award_name: "National Fluid Power Association FIRST Scholarship", subject_area: "Engineering", level: nil, deadline: "2019-05-01", other_req: "To be eligible for this scholarship, you must:\r\n\r\nBe a senior in high school.\r\nHave participated on a team during the FIRST Robotics Competition (FRC®) or National Robotics League (NRL) Competition.\r\nProvide evidence that your FRC or NRL used pneumatics on its competition robot.", sponsor: "National Fluid Power Association (NFPA)", amount: "$10,000 (renewable)", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://nfpa.submittable.com/submit", opportunity_type: "Scholarship", created_at: "2017-01-05 17:50:22", updated_at: "2019-01-11 18:42:17", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-05", updated_by: "walshm"},
    {id: 1187, award_name: "NBT Scholarships", subject_area: "Engineering, Business, Logistics", level: nil, deadline: "2019-09-30", other_req: "Since 1990, FMA’s foundation, Nuts, Bolts & Thingamajigs® (NBT), has awarded scholarships to students majoring in programs that lead to careers in manufacturing.", sponsor: "Nuts, Bolts & Thingamajigs (NBT)", amount: "Varies", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.nutsandboltsfoundation.org/scholarships", opportunity_type: "Scholarship", created_at: "2017-01-05 17:56:38", updated_at: "2019-07-17 22:10:54", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Deadlines are 3/31 and 9/30", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "robertsm"},
    {id: 1188, award_name: "ServoCity/Actobotics FIRST Scholarship Program", subject_area: "STEM", level: nil, deadline: "2019-04-30", other_req: "Our Scholarship Program offers two scholarships ($500 each) to high school seniors involved in either STEM (Science, Technology, Engineering & Math) or the Radio Control hobby!", sponsor: "ServoCity", amount: "$500", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.servocity.com/first-scholarship-application", opportunity_type: "Scholarship", created_at: "2017-01-05 17:59:38", updated_at: "2019-01-11 18:49:54", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-10", updated_by: "walshm"},
    {id: 1189, award_name: "Christermon Foundation Beverage Scholarship", subject_area: "All fields", level: nil, deadline: "2019-02-15", other_req: "Scholarships will be awarded to the children or grandchildren or legal guardians of persons who currently hold FULL TIME employment with a company with a valid California beer, liquor or wine license. This includes restaurants, hotels, retail and wholesale grocery, airlines, breweries, wineries, distributors, etc.  The student must have been involved in extra-curricular high school activities during both junior and senior years.", sponsor: "The Christermon Foundation", amount: "Varies", state: "CA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.christermon.com/scholarship/applications.php", opportunity_type: "Scholarship", created_at: "2017-01-05 18:12:54", updated_at: "2018-11-30 19:15:25", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 1191, award_name: "Dan Klepper Memorial Scholarship", subject_area: "Environmental Science; Biology; Chemistry; Engineering", level: nil, deadline: "2019-02-01", other_req: "Currently enrolled college students who are preparing for a career relating  to the outdoors, environmental conservation, or wildlife management and conservation and whose plans include communicating their findings, opinions, and observations with the general public through mass media are eligible to apply for the $2,000 scholarship. Communication can include print media, radio, television, presentations, photography, illustration, and electronic media.", sponsor: "Texas Outdoor Writers Association", amount: "$2,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://towa.org/dan-klepper-memorial-scholarship/", opportunity_type: "Scholarship", created_at: "2017-01-05 18:32:28", updated_at: "2019-01-03 00:17:00", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1192, award_name: "Engineering for Your Community", subject_area: "All fields", level: nil, deadline: "2019-02-01", other_req: "Submit an original essay that responds to prompt of website.", sponsor: "Engineer Girl", amount: "up to $500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.engineergirl.org/10209/Contest", opportunity_type: "Scholarship", created_at: "2017-01-05 18:39:44", updated_at: "2018-09-21 15:45:51", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1193, award_name: "eQuality LGBTQ Scholarship", subject_area: "All fields", level: nil, deadline: "2019-01-31", other_req: "Applicants for all scholarships must have demonstrated service to the LGBTQ community. Applicants of all sexual orientations and gender identities are eligible.  Must be a resident or northern or central California (counties specified on website).\r\n", sponsor: "eQuality Scholarship Collaborative", amount: "$6,000", state: "CA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.equalityscholarship.org/apply.html", opportunity_type: "Scholarship", created_at: "2017-01-05 18:43:47", updated_at: "2018-12-14 17:34:54", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "walshm"},
    {id: 1194, award_name: "Association of Food and Drug Officials Scholarships", subject_area: "Science; Education", level: nil, deadline: "2019-03-01", other_req: "Must be in your third year of college at time of application.  The recipients should have demonstrated a desire to serve in a career of research, regulatory work, quality control, or teaching in an area related to some aspect of foods, drugs or consumer product safety; should have demonstrated leadership capabilities; and must have at least a 3.0 grade point average during the first two years of undergraduate study.", sponsor: "Association of Food and Drug Officials", amount: "$1,500", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.afdo.org/page-1181300?", opportunity_type: "Scholarship", created_at: "2017-01-05 18:49:06", updated_at: "2019-01-03 00:17:30", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1195, award_name: "MusicAuthority Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-01", other_req: "Any student that is enrolled﻿ (or has been accepted) ﻿in a United States college as of Feb 2018 is eligible for this award.  Submit an essay (prompt on website).", sponsor: "MusicAuthority", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://musicauthority.org/scholarships/", opportunity_type: "Scholarship", created_at: "2017-01-05 19:14:10", updated_at: "2019-01-03 00:17:59", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1196, award_name: "Nashville Songwriting Scholarship", subject_area: "All fields", level: nil, deadline: "2019-01-01", other_req: "The Nashville Songwriting Scholarship is an annual, nationwide competition open to student songwriters of country music and related genres, including Americana, blues, bluegrass, contemporary Christian, folk, and roots.\r\nCurrent student at a U.S. college or university.\r\nBetween the ages of 17 and 24 as of time of submission.\r\nNo rights to the submitted work may have been assigned to a major music publisher or to a major record label.\r\nIs not a prior BMI Foundation Nashville Songwriting Scholarship winner (excluding Honorable Mentions).", sponsor: "BMI Foundation", amount: "$5,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://bmifoundation.org/programs/info/nashville_songwriting_scholarship", opportunity_type: "Scholarship", created_at: "2017-01-05 19:18:03", updated_at: "2018-10-30 16:17:08", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 1197, award_name: "John Lennon Scholarship", subject_area: "All fields", level: nil, deadline: "2019-01-01", other_req: "The John Lennon Scholarships are an annual competition open to student songwriters and composers of contemporary musical genres including alternative, pop, rock, indie, electronica, R&B, and experimental. \r\nCurrent student or alumnus/alumna at a U.S. college or university\r\n\r\nBetween the ages of 17 and 24 as of time of submission.\r\nNo rights to the submitted work may have been assigned to a major music publisher or to a major record label.\r\nIs not a prior BMI Foundation John Lennon Scholarship winner (excluding Honorable Mentions).", sponsor: "BMI Foundation", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://bmifoundation.org/programs/info/john_lennon_scholarships", opportunity_type: "Scholarship", created_at: "2017-01-05 19:20:39", updated_at: "2018-10-30 16:17:55", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 1198, award_name: "peermusic Latin Scholarship", subject_area: "All fields", level: nil, deadline: "2019-01-01", other_req: "The peermusic Latin Scholarship is an annual competition open to student songwriters and composers of Latin music.\r\nStudent enrolled at a college or university located in the United States or Puerto Rico. Between the ages of 17 and 24 as of time of submission. Must have never had any musical work commercially recorded or distributed. Is not a prior peermusic Latin Scholarship winner (excluding Honorable Mentions). ", sponsor: "BMI Foundation", amount: "$5,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://bmifoundation.org/programs/info/peermusic_latin_scholarship", opportunity_type: "Scholarship", created_at: "2017-01-05 19:25:58", updated_at: "2018-10-18 22:58:03", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 1199, award_name: "Poshified Scholarship", subject_area: "All fields", level: nil, deadline: "2019-06-30", other_req: "Female student.  Submit an essay, prompt on website.", sponsor: "Poshified.com", amount: "$500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://poshified.com/scholarships/", opportunity_type: "Scholarship", created_at: "2017-01-05 19:28:53", updated_at: "2019-05-30 21:44:57", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "awarded twice yearly", respect_deadline: true, date_reopens: "2020-04-15", updated_by: "robertsm"},
    {id: 1201, award_name: "PG&E Scholarships", subject_area: "All fields", level: nil, deadline: "2019-02-04", other_req: "Student or parent/guardian must reside in PG&E territory, established by uploading PG&E bill, driver's license, or phone bill from within the past six months.  Each individual scholarship has slightly different target audiences (ethnic group, extracurricular activity, etc.)", sponsor: "PG&E Employee Resource Groups", amount: "Varies", state: "CA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.pge.com/en_US/residential/in-your-community/education-programs/grants-and-scholarships/scholarship-opportunities/scholarship-opportunities.page", opportunity_type: "Scholarship", created_at: "2017-01-06 17:11:07", updated_at: "2019-01-03 00:18:42", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-12-15", updated_by: "walshm"},
    {id: 1202, award_name: "Drive2Life Contest", subject_area: "All fields", level: nil, deadline: "2019-02-04", other_req: "The Contest is open only to students who are currently enrolled in grades 6–12 in one of the 50 United States or the District of Columbia, who are legal residents of the United States, and who attend a public school, accredited private school, or home school (“Schools”) in compliance with the laws of its state. Employees of Scholastic and NRSF, and members of their immediate families living in the same household,their parents, subsidiaries, affiliates, and their advertising, promotion, and production agencies, are not eligible to enter.\r\n To enter the Contest, an individual student in grades 6–12 must create a storyboard or written script on 8.5 x 11-inch paper for a 30-second public service announcement (“PSA”) to help prevent distracted walking. ", sponsor: "Scholastic", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.scholastic.com/drive2life/", opportunity_type: "Scholarship", created_at: "2017-01-06 17:15:13", updated_at: "2018-11-01 18:26:45", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 1203, award_name: "Northrop Grumman Engineering Scholars Program", subject_area: "Engineering; Computer Science; Mathematics; Physics", level: nil, deadline: "2019-02-05", other_req: "Applicants to the Northrop Grumman Engineering Scholars Program must meet all of the following:\r\nBe United States citizens\r\nBe residents of one of the following counties/cities:\r\nAlabama - Huntsville City, Madison County, Madison City\r\nCalifornia (San Diego) - San Diego County\r\nCalifornia (South Bay) - Redondo Beach, Manhattan Beach, El Segundo, Hawthorne, Torrance\r\nCalifornia (Woodland Hills) - Antelope, Conejo, San Fernando, Simi Valley, Santa Clarita Valley, and Ventura County\r\nCalifornia (Sunnyvale) - Alameda or Santa Clara County\r\nColorado - Boulder County, El Paso County, Adams Country, Arapahoe County, Broomfield County, Denver County, Douglas County, Jefferson County\r\nFlorida - Orange or Seminole County\r\nIllinois - Cities of Arlington Heights, Hoffman Estates, Inverness, Mt. Prospect, Palatine or Rolling Meadows\r\nMaryland - all counties, plus Baltimore City\r\nNew York - Erie or Niagara County\r\nOhio - Butler, Clermont, Hamilton and Warren County\r\nUtah - Davis, Salt Lake, Utah or Weber County\r\nVirginia (Charlottesville) - Albemarle County\r\nVirginia (NOVA) - Fairfax County\r\nBe graduating seniors of a public or accredited private high school in a sponsoring location\r\nMust plan to attend an accredited four-year college or university as a full-time student in an approved engineering, computer science, mathematics or physics program\r\nHave a minimum composite SAT score of 1150 or ACT score of 27 (initial application only)\r\nHave a minimum GPA of 3.5 (unweighted) in grades 9-12 (initial application only)\r\nMay not be a recipient of any other Northrop Grumman Scholarship.", sponsor: "Northrop Grumman", amount: "$2,000 (renewable)", state: "AL; CA; CO; FL; IL; MD; NY; OH; UT; VA", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.scholarsapply.org/ngengineering/", opportunity_type: "Scholarship", created_at: "2017-01-06 17:25:32", updated_at: "2018-11-30 19:16:39", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 1205, award_name: "Courageous Persuaders Video Competition", subject_area: "All fields", level: nil, deadline: "2019-02-08", other_req: "Your commercial must be 30 seconds long or less, and your message must be about the dangers of underage drinking or the dangers of texting while driving. Students can enter separate videos in both categories. Middle School classrooms are your target audience. Videos will be judged on originality, creativity and persuasiveness.", sponsor: "Courageous Persuaders", amount: "Up to $3,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://courageouspersuaders.com/the-competition/", opportunity_type: "Scholarship", created_at: "2017-01-06 17:44:05", updated_at: "2018-11-30 19:17:24", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 1206, award_name: "California Strawberry Scholarship", subject_area: "All fields", level: nil, deadline: "2018-02-15", other_req: " First-time applicants must have a parent that is currently employed as a California strawberry fieldworker for the current and prior two harvest seasons. (Applicants may also qualify if they are employed as a California strawberry fieldworker).\r\n\r\n• Full-time enrollment in a trade school, community college, four-year university, or graduate/professional program during the period for which scholarship is requested.\r\n\r\n• Maintain a Grade Point Average (GPA) of 2.0 or greater.", sponsor: "California Strawberries", amount: "Varies", state: "CA", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.californiastrawberries.com/scholarships", opportunity_type: "Scholarship", created_at: "2017-01-06 18:14:59", updated_at: "2018-01-03 17:44:24", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 1209, award_name: "Scholars Helping Collars Scholarship", subject_area: "All fields", level: nil, deadline: "2020-02-01", other_req: "To apply, students will submit an essay with 2-3 photos of their volunteer efforts to help animals in need and how that involvement has changed their lives or shaped their perceptions on the importance of animal welfare.", sponsor: "P.L.A.Y.", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.petplay.com/scholarship/", opportunity_type: "Scholarship", created_at: "2017-01-06 18:36:45", updated_at: "2019-08-01 17:24:59", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 1210, award_name: "Transtutors Scholarship", subject_area: "All fields", level: nil, deadline: "2019-12-31", other_req: "Submit an essay - prompt on website", sponsor: "Transtutors", amount: "varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.transtutors.com/scholarship/", opportunity_type: "Scholarship", created_at: "2017-01-06 18:46:48", updated_at: "2019-03-11 18:19:37", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Many opportunities on one site.", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1211, award_name: "Columbus Citizens Foundation Italian College Scholarship Program", subject_area: "All fields", level: nil, deadline: "2019-02-15", other_req: " Students who are of Italian descent (at least 25% Italian) with a GPA of 3.0 (85% or B) or higher who are from households where the total gross income does not exceed $25,000 per capita ($25,000 per person in the household) are eligible. For example, for a household of four, the maximum total gross income is $100,000 to be eligible. Only seniors in high school who will enter college as freshmen in the Fall are eligible. Students who are already in college are NOT eligible to receive a CCF college scholarship.", sponsor: "Columbus Citizens Foundation", amount: "Varies", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.columbuscitizensfd.org/scholarships/college.html", opportunity_type: "Scholarship", created_at: "2017-01-06 20:21:34", updated_at: "2019-01-03 00:19:30", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1212, award_name: "Gordon A. Rich Memorial Scholarship", subject_area: "All fields", level: nil, deadline: "2019-02-20", other_req: "Applicants must be dependent children of full-time employees in the financial services industry (commercial banks, investment banks, securities brokerage firms, insurance companies, fund and asset management companies, credit card and finance companies and similar businesses as determined by the Foundation). Employees must be presently employed with five years of experience OR no longer employed in this field but had ten years of experience which ended no longer than five years prior to the GAR Scholarship application closing date (which is located on the top of the application). Students must also demonstrate financial need and rank in the top 20% of their class.", sponsor: "The Gordon A. Rich Memorial Foundation", amount: "$12,500 (renewable)", state: "All", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.gordonrich.org/html/apply.html", opportunity_type: "Scholarship", created_at: "2017-01-06 20:26:21", updated_at: "2019-01-03 00:19:49", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1213, award_name: "Active Life Scholarship to Tackle Your Weakness", subject_area: "All fields", level: nil, deadline: "2019-02-28", other_req: "Current high school or college students age 15 years or older.", sponsor: "Getupgetactive.org", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.getupgetactive.org/active-life-weakness/", opportunity_type: "Scholarship", created_at: "2017-01-06 22:41:26", updated_at: "2019-01-03 00:20:25", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1221, award_name: "Royal Business Bank Scholarship Program", subject_area: "All fields", level: nil, deadline: "2019-03-27", other_req: "High school seniors who reside in Los Angeles County, Orange County, Ventura County and Clark County-Nevada. Plan to attend a U.S. Accredited 4-Year College/ University or California/Nevada Community College as a 1st year student in the Fall (if selected, must submit college acceptance letter for verification). Have a minimum cumulative unweighted high school GPA of 3.0. Have a household income at or below the County Low Income Level. The scholarship is open to ALL MAJORS and there is NO ETHNICITY REQUIREMENT. Employees of Royal Business Bank and their immediate family members are NOT eligible to apply. ", sponsor: "Royal Business Bank and Asian Pacific Community Fund", amount: "$1,000", state: "CA; NV", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.apcf.org/programs/scholarships/", opportunity_type: "Scholarship", created_at: "2017-01-18 20:29:15", updated_at: "2019-03-27 22:04:06", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "hobbsm"},
    {id: 1222, award_name: "Northwest Farm Credit Services Minority Scholarships", subject_area: "Business; Accounting; Finance; Economics; Minority", level: nil, deadline: "2019-03-01", other_req: "Enrolled university students who meet all of the following qualifications are eligible to apply. Applicants must:\r\nBe attending an accredited four-year university located in one of the following Northwest states:  Washington, Oregon, Idaho, Montana, Alaska, or Utah.\r\nBe pursuing a degree in one of the following areas of study:  Business, Accounting, Agricultural Business, Finance, or Economics.\r\nBe a member of one of the following ethnic minority groups: African American or Black, American Indian or Alaska Native, Asian, Latino/Hispanic, or Pacific Islander.\r\nBe a U.S. citizen or legal resident of the United States.\r\nBe of sophomore standing or higher, and enrolled full time (12 or more credits).\r\nHave a minimum GPA of 3.0 on a 4.0 scale.", sponsor: "Northwest Farm Credit Services", amount: "$2,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.northwestfcs.com/Stewardship/Youth/Minority-Scholarships", opportunity_type: "Scholarship", created_at: "2017-01-19 00:14:33", updated_at: "2019-01-24 18:33:44", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 1225, award_name: "Azazie Scholarship", subject_area: "All fields", level: nil, deadline: "2019-05-31", other_req: "Share with us your thoughts on \"What is a problem within the industry you're currently majoring in, and how will you solve this issue\".\r\n\r\nAZAZIE Scholarships are available to high school seniors (graduating before July 1, 2017) and college freshmen and sophomore students in the U.S. and Canada. Students must be enrolled or accepted and seeking a degree at a U.S. or Canadian university or college.", sponsor: "Azazie", amount: "$1000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.azazie.com/scholarship", opportunity_type: "Scholarship", created_at: "2017-01-19 23:03:08", updated_at: "2019-03-27 22:05:11", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
    {id: 1227, award_name: "Redfin Scholarship", subject_area: "All fields", level: nil, deadline: "2019-07-31", other_req: "Submit an essay - prompt on website", sponsor: "Redfin", amount: "$2,500", state: "All", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.redfin.com/resources/scholarship", opportunity_type: "Scholarship", created_at: "2017-01-23 21:45:38", updated_at: "2019-04-18 22:21:04", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "two deadlines, 1/31 and 7/31\r\nThe scholarship application period will occur twice yearly with awards delegated in both the Spring and Fall. The Spring application period is from November 1-January 31 of each year. The Fall application period is from May 1-July 31 of each year. Complete the following form within the designated application periods.", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "hobbsm"},
    {id: 1228, award_name: "LGS Innovations STEM Scholarship", subject_area: "Engineering; Physics", level: nil, deadline: "2019-03-18", other_req: "Be current postsecondary undergraduates (junior or senior level in the academic year) or graduate-level students enrolled in an ABET-accredited STEM program seeking a degree in Computer Science, Computer Engineering, Electrical Engineering, Mechanical Engineering, or Physics.  Must be a full-time student.", sponsor: "LGS Innovations", amount: "$5,000", state: "All", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.scholarsapply.org/lgsinnovations/", opportunity_type: "Scholarship", created_at: "2017-01-23 21:51:12", updated_at: "2019-01-24 18:34:09", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 1229, award_name: "Armenian-American Citizens League Educational Scholarship", subject_area: "All fields", level: nil, deadline: "2018-03-01", other_req: "Must be of Armenian descent. Scholarships are awarded based on Grade Point Average (GPA), financial need, and community service/employment record. Must have been a permanent resident of California for the past two years and completed at least one semester of college.", sponsor: "Armenian-American Citizens League Educational and Scholarship Fund", amount: "Varies", state: "CA", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://aaclca.wordpress.com/", opportunity_type: "Scholarship", created_at: "2017-01-25 19:35:04", updated_at: "2019-03-11 22:17:32", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "Not offered since 2017. If not offered for 2020-2021, delete entry.", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1231, award_name: "Navy Anchor Scholarship", subject_area: "Military Family", level: nil, deadline: "2019-03-01", other_req: "The Anchor Scholarship is awarded to family members (children or spouses) of qualified Surface Navy sailors.  Must have served a minimum of 6 years in units under the administrative control of Commander, Naval Surface Force, U.S. Atlantic Fleet or U.S. Pacific Fleet. The six years need not be consecutive.", sponsor: "Anchor Scholarship Foundation", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.anchorscholarship.com/online-application.html", opportunity_type: "Scholarship", created_at: "2017-01-25 19:44:44", updated_at: "2019-01-03 00:21:59", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1232, award_name: "Blacks at Microsoft Scholarship", subject_area: "Engineering; Computer Science; Business; Finance; Marketing; Minority", level: nil, deadline: "2019-03-08", other_req: "To be considered for a BAM Scholarship, you must:\r\n\r\nBe a high-school senior of African descent (for example, African American, African, or Ethiopian).\r\nPlan to attend a four-year college or university in the fall of the year following high-school graduation.\r\nPlan to pursue a bachelor's degree in engineering, computer science, computer information systems, or select business programs (such as finance, business administration, or marketing).\r\nDemonstrate a passion for technology.\r\nDemonstrate leadership at school or in the community.\r\nHave a cumulative GPA of 3.3 or higher.\r\nRequire financial assistance to attend college.", sponsor: "Microsoft", amount: "$5,000", state: "All", min_gpa: "3.3", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.microsoft.com/en-us/diversity/programs/blacks-scholarships.aspx", opportunity_type: "Scholarship", created_at: "2017-01-25 19:48:16", updated_at: "2019-01-03 00:24:19", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-15", updated_by: "walshm"},
    {id: 1233, award_name: "Cheryl D. Conkling Memorial Scholarship", subject_area: "All fields", level: nil, deadline: "2019-05-31", other_req: "This scholarship supports students with hearing or other physical hardships who have demonstrated a love of education. Students must be a high school senior enrolling in an accredited college or university in the fall when the scholarship is awarded. Preference may be given to students not receiving other substantial financial aid, and to students in East Baton Rouge Parish. ", sponsor: "Baton Rouge Area Foundation", amount: "$3,000 (renewable)", state: "All", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.brafscholarships.org/", opportunity_type: "Scholarship", created_at: "2017-01-25 19:50:49", updated_at: "2019-01-24 19:10:14", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-31", updated_by: "walshm"},
    {id: 1235, award_name: "Emmett J. Doerr Memorial Scout Scholarship", subject_area: "All fileds", level: nil, deadline: "2019-03-01", other_req: "Be a practicing Catholic.\r\nBe a full time High-School Senior.\r\nBe a registered young man or woman actively involved with a Scout Troop, Varsity Scout Team, Venturing Crew or Sea Scout Ship.\r\nHeld or is currently holding a leadership role in his or her unit.\r\nEarned the Ad Altare Dei or Pope Pius XII Religious Award.\r\nEarned the Eagle Scout, Silver Award or Quartermaster Award.\r\nProvided service to his or her home parish (Altar Server, Lector, Extraordinary Minister of Holy Communion, staffing youth retreats, etc.)\r\nHeld or is currently holding a leadership role in a school or community organization other than scouting.", sponsor: "National Catholic Committee on Scouting", amount: "$2,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.nccs-bsa.org/index.php/college-scholarship", opportunity_type: "Scholarship", created_at: "2017-01-25 20:17:37", updated_at: "2019-01-03 00:23:35", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1236, award_name: "Foundation for Rural Service Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-01", other_req: "Each applicant must:\r\n• Be a graduating high school senior.\r\n• Be a United States citizen.\r\n• Be sponsored by a current NTCA–The Rural Broadband Association member.\r\n• Be accepted by an accredited two- or four-year college, university or vocational-technical school.\r\n• Have at least a C grade point average (GPA).\r\n• Express an interest to return to a rural community following graduation.", sponsor: "Foundation for Rural Service", amount: "Varies", state: "All", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.frs.org/youth-programs/college-scholarship-program", opportunity_type: "Scholarship", created_at: "2017-01-26 00:17:45", updated_at: "2018-10-30 16:20:36", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 1238, award_name: "Uncommon Goods Scholarship", subject_area: "Fine Arts; Design", level: nil, deadline: "2019-07-15", other_req: "We're looking for undergraduate art or design majors at accredited universities.", sponsor: "UncommonGoods.com", amount: "$1000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.uncommongoods.com/scholarships", opportunity_type: "Scholarship", created_at: "2017-01-27 17:24:14", updated_at: "2019-05-07 04:37:24", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Fall application period starts April 1st, with a final deadline of July 15th. \r\nSpring application period starts September 1st, with a final deadline of December 15th. ", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "hobbsm"},
    {id: 1240, award_name: "HonorsGradU Multimedia Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-28", other_req: "You must be a graduating high school senior who is applying to an accredited college or university, OR a currently enrolled college student with a year or more remaining in your education.\r\nYour accepted university must be in the United States of America.\r\n\r\nVisit their website for the prompt and multimedia requirements.", sponsor: "HonorsGraduation.com", amount: "$1000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.honorsgraduation.com/graduation-scholarship.htm", opportunity_type: "Scholarship", created_at: "2017-01-27 17:36:14", updated_at: "2018-11-30 19:18:10", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 1241, award_name: "Homethods Internet Marketing Scholarship", subject_area: "All fields ", level: nil, deadline: "2018-11-15", other_req: "Need to be currently enrolled in school or have been accepted to one that you'll attend next semester. Write a first-hand review of a tool or product that you have used that directly relates to home improvement. ", sponsor: "Homethods.com", amount: "$1000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://homethods.com/scholarship/", opportunity_type: "Scholarship", created_at: "2017-01-27 17:40:39", updated_at: "2019-03-11 22:18:57", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Website outdated; state accepting submissions for 2018 on 3/11/2019. Check back next year.", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1242, award_name: "Aspiring Educator Scholarship", subject_area: "Education", level: nil, deadline: "2018-03-31", other_req: "Applicants must 18 years or older, and enrolled in an accredited graduate or undergraduate Education program in the U.S. or Canada. Please attach an unofficial transcript as proof of enrollment.\r\n\r\nTell us how you plan to change the world through education. More specifically, will you promote student success in the classroom and beyond, through community engagement, emerging instructional practices, and/or educational technology?", sponsor: "MotivisLearning.com", amount: "$10,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://motivislearning.com/aspiring-educator-scholarship/", opportunity_type: "Scholarship", created_at: "2017-01-27 17:46:28", updated_at: "2019-03-11 22:25:34", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "Not offered in 2019; check back next year.", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1244, award_name: "The Peter Agris Memorial Greek Journalism Scholarship", subject_area: "Journalism; Communication", level: nil, deadline: "2019-03-01", other_req: "Criteria for candidates include: Being of Greek-American decent and a U.S. citizen. Current full-time enrollment as a journalism or communications major at the graduate or undergraduate level at an accredited college or university in the United States. Active participation in school, community, church organizations. A minimum of a 3.0 GPA and demonstrated financial need", sponsor: "The Alpha Omega Council", amount: "$5,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.alphaomegacouncil.org/scholarships/application-3/", opportunity_type: "Scholarship", created_at: "2017-01-27 23:56:13", updated_at: "2019-01-03 00:25:04", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1246, award_name: "Project Yellow Light Billboard Design ", subject_area: "All fields", level: nil, deadline: "2019-03-01", other_req: "Create a billboard advertisement to encourage safe driving.  You must be a high school junior or senior or full-time college student to participate.", sponsor: "Ad Council; Mazda; National Highway Traffic Safety Administration; National Organizations for Youth Safety; U-Haul; Clear Channel Outdoor and iHeartRadio", amount: "$2,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://projectyellowlight.com/apply#billboard", opportunity_type: "Scholarship", created_at: "2017-01-28 00:07:51", updated_at: "2018-10-30 16:22:53", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 1247, award_name: "Project Yellow Light Video and Radio Scholarships", subject_area: "All fields", level: nil, deadline: "2019-04-01", other_req: "Create a radio ad or video to encourage your friends to avoid distracted driving, specifically, texting while driving.", sponsor: "Ad Council; Mazda; National Highway Traffic Safety Administration; National Organizations for Youth Safety; U-Haul; Clear Channel Outdoor and iHeartRadio", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://projectyellowlight.com/", opportunity_type: "Scholarship", created_at: "2017-01-28 00:11:18", updated_at: "2018-10-30 16:21:58", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
