    {id: 1253, award_name: "Diversity Abroad Overseas Ambassador Scholarship", subject_area: "Study Abroad; International Experience", level: nil, deadline: "2019-05-31", other_req: "Economically disadvantaged students, first-generation, students with disabilities and ethnic and racially diverse students are strongly encouraged to apply. Must be currently enrolled full-time at your college or university based in the United States or a recent graduate (1-3 years out). Must participate in a semester or year long study, intern, volunteer, or teach abroad program for the fall or spring semester", sponsor: "DiversityAbroad.com", amount: "$500", state: "All", min_gpa: "2.75", contact: "financial.aid@example.edu", keywords: nil, website: "http://diversityabroad.terradotta.com/index.cfm?FuseAction=Programs.ViewProgram&Program_ID=26138", opportunity_type: "Scholarship", created_at: "2017-02-06 22:03:56", updated_at: "2019-05-30 21:26:19", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "robertsm"},
