    {id: 1264, award_name: "Building Peace Through Diplomacy Essay Contest", subject_area: "All fields", level: nil, deadline: "2019-03-15", other_req: "The winner receives $2,500, a trip to Washington, D.C. to meet the Secretary of State, and full tuition for a Semester at Sea educational voyage. The runner-up receives $1,250 and full tuition for the NSLC's International Diplomacy summer program.", sponsor: "American Foreign Service Associaton", amount: "$2,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.afsa.org/essay-contest", opportunity_type: "Scholarship", created_at: "2017-02-09 22:47:01", updated_at: "2019-01-03 16:37:11", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
