    {id: 1266, award_name: "Foodservice Communications Scholarship", subject_area: "Journalism; Communication; Marketing; Public Relations; English", level: nil, deadline: "2019-03-15", other_req: "Awards are intended to assist students planning to pursue careers as writers, editors, public relations practitioners, marketing communicators and similar within the food/foodservice industries.  Students in good standing in a degree-granting program of a post-secondary institution whose studies and work experience combine the fields of food/foodservice and the communication arts are considered eligible.", sponsor: "The International Foodservice Editorial Council", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.ifeconline.com/scholarships/", opportunity_type: "Scholarship", created_at: "2017-02-09 23:03:58", updated_at: "2019-01-03 16:37:39", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
