    {id: 1269, award_name: "UCT Heaston Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-15", other_req: "Based on evidence of hard work to overcome obstacles, academic success and extracurricular success in high school and commitment to community service.", sponsor: "The Order of United Commercial Travelers of America", amount: "Varies (renewable)", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.uct.org/uct-in-action/scholarship-programs/", opportunity_type: "Scholarship", created_at: "2017-02-09 23:58:17", updated_at: "2019-01-24 18:34:53", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 1270, award_name: "Heroes' Legacy Scholarship", subject_area: "Military Family", level: nil, deadline: "2019-03-15", other_req: "The \"Heroes' Legacy Scholarships\" program honors not only those who have fallen in battle, but all who have died or have become disabled through their active military service since September 11, 2001. The program is open to their dependent unmarried children under age 23. A disability is defined as one that results in the service member being eligible for, and receiving, Traumatic Servicemembers' Group Life Insurance (TSGLI) or a permanent and total disability compensation rating of 100%.  High school applicants must have a minimum 3.0 GPA, college applicants a 2.5 GPA.", sponsor: "Fisher House Foundation", amount: "Varies", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.militaryscholar.org/legacy/index.html", opportunity_type: "Scholarship", created_at: "2017-02-10 00:04:29", updated_at: "2018-12-14 17:36:41", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "walshm"},
    {id: 1272, award_name: "Cherzong V. Vang Memorial Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-30", other_req: "All students, race, nationalities, or ethnic backgrounds are eligible for this scholarship. Must have a GPA between 2.0 and 3.5 (in a 4.0 scale system).  A successful applicant must demonstrate a commitment to overcoming challenges and a clear vision of their personal goals.", sponsor: "Hmong American Education Fund", amount: "$500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.thehaef.org/scholarships-for-all-students.html", opportunity_type: "Scholarship", created_at: "2017-02-10 00:17:53", updated_at: "2019-03-11 22:29:58", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
