    {id: 1275, award_name: "Jerry Malloy Negro League High School Essay Contest", subject_area: "All fileds", level: nil, deadline: "2019-04-15", other_req: "Submit an essay - prompt on website.", sponsor: "Society for American Baseball Research Negro League", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://sabr.org/malloy", opportunity_type: "Scholarship", created_at: "2017-02-10 18:40:23", updated_at: "2019-01-24 18:51:04", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 1278, award_name: "GRHS Youth Essay Contest", subject_area: "All fields", level: nil, deadline: "2019-03-31", other_req: "An International GRHS Essay Contest, sponsored by the Germans from Russia Heritage Society, headquartered in\r\nBismarck, North Dakota, will be held to encourage students to learn about the history and culture of the German-Russians, people who emigrated from Germany into Russia during the 18th and 19th centuries. \r\n\r\nSee website for guidance on essays. ", sponsor: "Germans from Russia Heritage Society", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.grhs.org/youthn/current/current.html", opportunity_type: "Scholarship", created_at: "2017-02-10 19:00:31", updated_at: "2019-01-03 16:40:31", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1279, award_name: "The Alfred G. and Elma M. Milotte Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-31", other_req: "Are profoundly fascinated by nature, have been a careful observer of it and have successfully expressed your observations in an artistic way that engages the everyday person. Must have been a resident of the State of Washington for at least five years prior to applying.", sponsor: "The Alfred G. and Elma M. Milotte Scholarship Fund", amount: "up to $4,000", state: "WA", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.milotte.org/apply.html", opportunity_type: "Scholarship", created_at: "2017-02-10 19:14:25", updated_at: "2019-01-24 18:51:27", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 1281, award_name: "Crystal Green Memorial Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-01", other_req: " Scholarship applicants will be judged on a written application, high school transcript, school and community service, letters of recommendation, and a marketing plan for a blood drive.  Students must attend a “Project Lifeline” high school in one of the five states served by Blood Assurance, which include Tennessee, Georgia, Alabama, North Carolina and Virginia. Project Lifeline is the high school blood drive program specific to Blood Assurance. Financial need is also a consideration.  You must have at least a “B” average (equivalent GPA) and score at least 20 on the ACT or 1100 on the SAT (cumulative).", sponsor: "Blood Assurance", amount: "$1,500", state: "AL; GA; NC; TN; VA", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.bloodassurance.org/youth-programs/", opportunity_type: "Scholarship", created_at: "2017-02-10 19:43:44", updated_at: "2018-11-30 19:23:16", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 1282, award_name: "Elastic Band Co. Scholarship", subject_area: "Business; Entrepreneurship; Fashion", level: nil, deadline: "2019-05-31", other_req: "Must plan to pursue a career in fashion and/or entrepreneurship.  Must be a member or a minority group that is underrepresented in the fields of fashion and/or entrepreneurship OR have a documented disability as defined by the ADA. ", sponsor: "Elastic Band Co.", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://elasticbandco.com/pages/elastic-band-co-scholarship", opportunity_type: "Scholarship", created_at: "2017-02-10 19:52:16", updated_at: "2019-01-03 16:41:01", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1283, award_name: "Galvanize the Future: An Edgar K Schutz Memorial Scholarship", subject_area: "Civil Engineering", level: nil, deadline: "2019-03-31", other_req: "Submit an essay - prompt on website.", sponsor: "American Galvanizers Association", amount: "$2,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.galvanizeit.org/education-and-resources/education/university-program/scholarship", opportunity_type: "Scholarship", created_at: "2017-02-10 19:58:49", updated_at: "2019-01-24 18:51:49", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 1284, award_name: "Hearthstone Housing Foundation Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-31", other_req: "Be a resident of a Hearthstone Housing Foundation property or be a resident in a county where a Hearthstone Housing property is located. To view a list of eligible counties, click the on the Properties tab on the website.  Be from a low-income household or demonstrate financial need, be 15-25 years of age.  Maintain at least a 3.0 GPA for high school seniors or a 2.75 for current college students.", sponsor: "Hearthstone Housing Scholarship Fund", amount: "Varies", state: "CA; GA; NJ; OR; RI; WA", min_gpa: "2.75", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.hearthstonehousing.org/scholarship", opportunity_type: "Scholarship", created_at: "2017-02-10 20:07:59", updated_at: "2018-12-06 17:08:30", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-15", updated_by: "walshm"},
    {id: 1286, award_name: "Louie Family Foundation Scholarship", subject_area: "All fields", level: nil, deadline: "2019-02-28", other_req: "Applicants should have demonstrated outstanding personal achievements, academic merit, leadership qualities and/or community service. Special consideration will be noted for applicants: who have parents that are United States veterans or are currently in the U.S. military, or with a demonstrated financial need, or with parents who did not attend college, or with a documented significant disability.  Must have a minimum SAT score of 1200 (out of 1600) or 1800 (out of 2400) or an ACT score of 25.", sponsor: "Kim and Harold Louie Family Foundation", amount: "Varies", state: "All", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.louiefamilyfoundation.org/scholarship-application", opportunity_type: "Scholarship", created_at: "2017-02-10 20:18:39", updated_at: "2019-01-24 18:52:08", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 1287, award_name: "The Future is Female", subject_area: "All fields", level: nil, deadline: "2018-06-29", other_req: "Female student.  Recipient will win a $3,000 scholarship, $300 True&Co. gift card and a full feature and interview on the True&Co. Journal showcasing what makes you fabulous and feel beautiful.", sponsor: "True&Co", amount: "$3,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://trueandco.com/scholarship", opportunity_type: "Scholarship", created_at: "2017-02-10 20:32:59", updated_at: "2019-03-12 03:39:45", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "Not offered past 6/29/2018 application deadline..Check again next year.", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1288, award_name: "Lanzate! Travel Award", subject_area: "Minority", level: nil, deadline: "2019-04-30", other_req: "Must be enrolled in a college at least 200 miles from your designated home.  Must be of Hispanic origin and at least 18 years old.  Recipients may be awarded 1-4 roundtrip e-pass(es) for the student and/or parent to use when traveling to/from the college/university. The complimentary e-pass(es) can be used for travel to any of the Southwest Airlines destinations in the United States (void in Alaska, Hawaii, Puerto Rico and where prohibited or restricted by law) as listed on www.southwest.com.", sponsor: "Southwest Airlines and HACU", amount: "Airfare", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.hacu.net/hacu/Lanzate.asp", opportunity_type: "Scholarship", created_at: "2017-02-14 20:20:29", updated_at: "2019-03-27 22:37:08", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
    {id: 1289, award_name: "National Hispanic Business Group Scholarship", subject_area: "Business; Minority", level: nil, deadline: "2019-06-04", other_req: "Be of Hispanic-Latino heritage with financial need.", sponsor: "The National Hispanic Business Group", amount: "Varies", state: "CT; NJ; NY", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.nhbg.org/education-fund/", opportunity_type: "Scholarship", created_at: "2017-02-14 23:39:51", updated_at: "2019-05-30 20:33:31", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "robertsm"},
    {id: 1290, award_name: "National Association of Hispanic Journalists Scholarships", subject_area: "English; Journalism; Spanish", level: nil, deadline: "2019-02-22", other_req: "NAHJ scholarship opportunities are open to college-bound high school seniors, college undergraduates and graduate students pursuing careers in English or Spanish-language print, broadcast, digital or photojournalism.  Applications are judged based on commitment to the field of journalism; academic achievement; financial need; and awareness of the community.", sponsor: "National Association of Hispanic Journalists", amount: "Varies", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.nahj.org/nahj-scholarships/", opportunity_type: "Scholarship", created_at: "2017-02-14 23:45:35", updated_at: "2019-01-03 16:41:29", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1292, award_name: "Dr. Alma S. Adams Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-30", other_req: "Applicants will be judged on a competitive basis, based on (a) applicants’ ability to provide evidence of tobacco related community service in support of an underserved population\r\ndis-proportionally affected by tobacco. Community service or work must reflect one of the focus area listed below. Smoke free communities/environments: educate or organize groups to advocate, develop, implement smoke/tobacco free policies on college campuses, parks, schools, playgrounds, etc. Tobacco as a social justice issue: address how tobacco industry marketing tactics affect underserved communities. Flavors: inform or mobilize campaigns on the danger of flavored tobacco products, including menthol. Point of sale: examine or address tobacco advertising, purchasing patterns, and point of sale to youth and young adults. Must also have financial need.", sponsor: "Truth Initiative", amount: "$5,000", state: "All", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://truthinitiative.org/Adams-Scholarship", opportunity_type: "Scholarship", created_at: "2017-02-15 19:35:32", updated_at: "2019-03-27 20:56:38", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Applications closed before deadline 4/2019.  Maybe deadline earlier in 2020?", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "hobbsm"},
    {id: 1293, award_name: "Airport Minority Advisory Council Scholarship", subject_area: "Business; Accounting; Engineering; Communication; Finance", level: nil, deadline: "2019-04-22", other_req: "The applicant must demonstrate interest and desire to pursue a career in the aviation/airport industry and\r\nseeking a B.S. or B.A. in Aviation, Business Administration, Accounting, Architecture, Engineering, Communications or Finance.\r\n• Must be a high school student accepted or an undergraduate student enrolled at an approved accredited\r\ncollege or university with a minimum GPA of 2.5.\r\n• Involvement in community activities and extracurricular activities.\r\n• A commitment to involvement in furthering the mission of the Airport Minority Advisory Council by\r\nparticipating in the AMAC Student Program.\r\n• Successfully complete and submit application materials as further outlined", sponsor: "Airport Minority Advisory Council Foundation", amount: "$2,000", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://amac-org.com/foundation/scholarships/", opportunity_type: "Scholarship", created_at: "2017-02-15 19:39:11", updated_at: "2019-03-27 22:38:44", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1295, award_name: "Arkansas Community Foundation", subject_area: "All fields", level: nil, deadline: "2019-04-01", other_req: "Multiple scholarships for students from Arkansas.", sponsor: "Arkansas Community Foundation", amount: "Varies", state: "AR", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.arcf.org/Students/BrowseScholarships.aspx", opportunity_type: "Scholarship", created_at: "2017-02-15 19:53:00", updated_at: "2019-03-12 03:40:35", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1296, award_name: "Chief Petty Officer Scholarship", subject_area: "Military Family", level: nil, deadline: "2019-04-01", other_req: "Candidates submitting scholarship applications must, in the year of submission of their scholarship application:\r\nbe about to graduate or have graduated from an accredited high school, or equivalent educational institution or have successfully earned a General Equivalency Diploma (GED)\r\nmust intend to enter, or be currently enrolled in a community college, vocational college, college or university to complete the curriculum prescribed in or to be graduated with an AA, AS, BA or BS degree.\r\nmust be the immediate family member of either an active duty, retired, or reserve Chief Petty Officer (children may be natural, adopted or step-children)", sponsor: "Chief Petty Officer Scholarship Fund", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.cposf.org/scholarship", opportunity_type: "Scholarship", created_at: "2017-02-15 19:57:10", updated_at: "2019-03-12 03:41:37", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1297, award_name: "The Cover Guy Scholarship", subject_area: "All fields", level: nil, deadline: "2019-07-01", other_req: "he student must be enrolled in a program at a university, college or trade school in the United States or Canada.\r\nThe applicant must submit an article consisting of 500-1000 words.\r\nThe article must be in and around the applicants experience with hot tubs, backyard experiences, how hot tubs improve life, etc…\r\nOne submission per applicant. And should be sent by email only. Please include name, phone number, address, school name, program. Give an explanation of why you should be considered for the award (grades, volunteer work, etc..), student ID number, and the article.", sponsor: "thecoverguy.com", amount: "$500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.thecoverguy.com/the-cover-guy-annual-scholarship/", opportunity_type: "Scholarship", created_at: "2017-02-15 20:00:10", updated_at: "2019-03-12 03:42:31", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1298, award_name: "CVP Scholarship", subject_area: "All fields", level: nil, deadline: "2018-10-01", other_req: "To apply for our scholarship award, we are asking animal loving applicants to submit a 500+ word essay on one of the following questions:\r\n\r\nHow have animals positively affected your life or the life of someone you know?\r\nWhy are animal rights important to you?\r\nIf you had to choose one animal to be, what would you pick and why?", sponsor: "Community Veterinary Partners", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://cvpco.com/community/", opportunity_type: "Scholarship", created_at: "2017-02-15 20:02:44", updated_at: "2019-03-12 03:46:17", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "two deadlines 4/1 and 10/1\r\nNot offered for 2019-2020; check next year", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1299, award_name: "Drake Davis Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-15", other_req: "Each year the Foundation awards scholarships to graduating high school seniors who exemplify outstanding qualities in leadership, character and community service.", sponsor: "Drake Davis Foundation", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.drakedavis.com/scholarship.html", opportunity_type: "Scholarship", created_at: "2017-02-15 20:25:41", updated_at: "2019-03-27 22:44:08", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "hobbsm"},
    {id: 1301, award_name: "HomeLight Scholarship ", subject_area: "Business; Psychology; Economics; Sociology; Social Work", level: nil, deadline: "2019-11-15", other_req: "We want to support like-minded students who share our passion for improving the world of real estate. That’s why we’re offering a $1,000 scholarship to talented students who hold an interest in homes and homeownership. If you’re interested in designing homes, building homes, placing people in homes, combatting homelessness, or studying the housing market, we want to help fund your education.", sponsor: "HomeLight", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.homelight.com/scholarship/", opportunity_type: "Scholarship", created_at: "2017-02-15 20:35:28", updated_at: "2019-05-29 22:20:33", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "4/1 and 11/15 deadlines", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "robertsm"},
    {id: 1302, award_name: "Inspire Our Future Scholarship", subject_area: "Education", level: nil, deadline: "2019-04-01", other_req: "Must be at least 18.", sponsor: "Teacher.org", amount: "$500", state: "All", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.teacher.org/scholarship-entry-rules/", opportunity_type: "Scholarship", created_at: "2017-02-15 21:49:26", updated_at: "2019-03-12 03:47:00", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1303, award_name: "Italian Genealogical Group's Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-01", other_req: "Must have at least 1/4 Italian ancestry (one grandparent is Italian).", sponsor: "Italian Genealogical Group", amount: "$2,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://italiangen.org/xtra/scholarship_app.php", opportunity_type: "Scholarship", created_at: "2017-02-15 21:52:41", updated_at: "2019-01-24 18:52:29", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 1304, award_name: "Michigan Retailers Association Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-01", other_req: "Those eligible to apply are high school seniors and college freshmen, sophomores and juniors who are either:\r\n\r\nDependent sons and daughters of owners of MRA member businesses, or of full-time employees of Michigan Retailers Association member firms. The parent-employee must have been employed by a Michigan Retailers Association member firm for at least one year as of January 1 of the year in which the scholarships are awarded.  OR  Part-time employees of MRA member businesses who are full-time students. Part-time employees must have been employed by a Michigan Retailers Association member firm for at least six months as of January 1 of the year in which the scholarships are awarded.\r\nMichigan Retailers Association scholarships will be awarded to deserving students whose academic credentials fall within an average to above-average range. In general, average and above-average credentials are, for high school seniors, those that rank a student in the top half of their senior class. Standardized test scores should be at least 18 for the ACT Composite or, for the SAT combined Critical Reading and Math scores, at least 850. Students enrolled in college should present college GPAs that range from 2.50 to 4.00 on a 4.00 scale, in addition to having the proper high school credentials. Consideration also is given for extra curricular activities, including, but not limited to, part-time retail employment.", sponsor: "Michigan Retailers Association", amount: "$1,500", state: "MI", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.retailers.com/member-benefits/scholarship-program/", opportunity_type: "Scholarship", created_at: "2017-02-15 22:06:04", updated_at: "2019-01-03 16:43:10", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1307, award_name: "NRF Scholarships", subject_area: "Engineering; Computer Science; Marketing; Business; Economics", level: nil, deadline: "2018-10-30", other_req: "The Ray Greenly Scholarship is open to sophomore, junior and senior undergraduates and graduate students enrolled full-time at any accredited U.S. college or university (regardless of NRF member status) when the scholarship is awarded in September 2017. Applicants do not have to be in a retail program or major to apply, but should demonstrate how their chosen major or graduate program is relevant to digital retail.\r\n\r\nTo apply, you must:\r\n\r\nBe a U.S. citizen or legal U.S. resident eligible to work in the United States.\r\nHave a cumulative grade point average (GPA) of 3.0 or above on a 4.0 scale.\r\nBe available to attend SHOP.ORG, September 25-27 in Los Angeles.", sponsor: "National Retail Federation", amount: "up to $25,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://nrf.com/career-center/scholarships/ray-greenly-scholarship", opportunity_type: "Scholarship", created_at: "2017-02-15 22:45:19", updated_at: "2019-05-30 20:32:16", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "They offer multiple scholarships looking in spring for new offerings. ", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 1308, award_name: "John Kitt Memorial Scholarship", subject_area: "Chemistry; Biology", level: nil, deadline: "2019-03-25", other_req: "College Sophomore, Junior or Senior status (in 1920).\r\nHave a demonstrated interest in confectionery technology.\r\nAttend an accredited, four-year college or university within North America.\r\nBe majoring in a food science, chemical science, biological science, or related area.\r\nAchieved a 3.0 (out of 4.0) GPA (or equivalent on another scale).\r\nYour demonstrated interest in confectionery technology can include many activities including but not limited to research projects, work experience, and formal study.", sponsor: "American Association of Candy Technologists", amount: "$5,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.aactcandy.org/aactscholarship.asp", opportunity_type: "Scholarship", created_at: "2017-02-15 22:48:42", updated_at: "2019-01-24 18:53:19", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 1310, award_name: "A Voice for Animals", subject_area: "All fields", level: nil, deadline: "2019-04-30", other_req: "Entrants in the 16-18 year old essay section are invited to write an essay that addresses either the mistreatment of one animal species or one cause of animal suffering; or the preservation of one endangered species, occurring anywhere in the world, and potential solutions to alleviate animal suffering; or that addresses the impact of climate change on the animal population and discusses how one animal species has been affected by climate change and presents ideas to raise awareness of this species and what can be done to protect it.\r\n\r\nEntrants in the 16-18 year old Essay with Photos or Video section must become involved in a project (new or pre-existing) that addresses either the mistreatment of one animal species or one cause of animal suffering; or the preservation of one endangered species, occurring anywhere in the world; or that addresses the impact of climate change on the animal population and discusses how one animal species has been affected by climate change and presents ideas to raise awareness of this species and what can be done to protect it.", sponsor: "Humane Education Network", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.hennet.org/contest.php", opportunity_type: "Scholarship", created_at: "2017-02-15 23:39:34", updated_at: "2019-01-24 19:09:39", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 1311, award_name: "Futurama Foundation Scholarships", subject_area: "All fields", level: nil, deadline: "2019-04-13", other_req: "Must be a female student with financial need.", sponsor: "Futurama Foundation", amount: "$1,500", state: "ME", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://bpwmefoundation.org/scholarship-program/", opportunity_type: "Scholarship", created_at: "2017-02-15 23:46:40", updated_at: "2019-03-12 03:48:17", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "hobbsm"},
    {id: 1314, award_name: "The Lily Pabilona Emerging Entrepreneur Award", subject_area: "All fields; Entrepreneurship; Minority", level: nil, deadline: "2019-05-06", other_req: "Must be at least 50% Asian and/or Pacific Islander ethnicity.  Have demonstrated leadership abilities through participation in community service, extracurricular, or other activities.  This award recognizes highly motivated students who have demonstrated strong entrepreneurial spirit and initiative.", sponsor: "Against The Grain Productions", amount: "$5,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.againstthegrainproductions.com/lily-pabilona-emerging-entrepreneur-scholarship/", opportunity_type: "Scholarship", created_at: "2017-02-17 22:11:56", updated_at: "2019-03-27 22:45:37", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
    {id: 1315, award_name: "Lint Center for National Security Studies Scholarships", subject_area: "All fields", level: nil, deadline: "2020-01-31", other_req: "Students must be admitted to a University prior to submitting an application.  Submit an essay - prompt on website.  Student should be interested in a career in counterintelligence or national security. ", sponsor: "Lint Center for National Security Studies", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.lintcenter.org/scholarships/", opportunity_type: "Scholarship", created_at: "2017-02-17 23:28:35", updated_at: "2019-08-01 17:28:07", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "Some scholarships have a 1/31 deadline and others a 7/31.", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "robertsm"},
    {id: 1318, award_name: "Comerica Charitable Foundation Scholarship", subject_area: "Accounting; Business; Finance", level: nil, deadline: "2018-03-02", other_req: "Qualified applicants must be a resident of one of the following market areas -\r\n\r\n- Phoenix, ARIZONA\r\n\r\n- Los Angeles, Oakland, San Diego, San Francisco or San Jose, CALIFORNIA\r\n\r\n- Boca Raton, FLORIDA\r\n\r\n- Ann Arbor, Battle Creek, Detroit, Grand Rapids, Jackson, Kalamazoo, Lansing, Midland or Muskegon, MICHIGAN\r\n\r\n- Austin, Dallas/Ft. Worth, Houston or San Antonio, TEXAS.", sponsor: "Comerica", amount: "up to $2,200", state: "AZ; CA; FL; MI; TX", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://scholarships.uncf.org/Program/Details/37a0f200-34e2-4124-a408-2d956ecd923c", opportunity_type: "Scholarship", created_at: "2017-02-23 00:01:19", updated_at: "2019-03-12 03:54:13", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "Not available 19-20 AY", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1320, award_name: "Intel Scholarship Program", subject_area: "Electrical Engineering; Mechanical Engineering; Computer Science; Minority", level: nil, deadline: "2019-02-01", other_req: "Eligible applicants must:\r\n\r\n* Be an African American who is a U.S. Citizen;\r\n\r\n* Be college sophomores, juniors, seniors or graduate students attending any four-year accredited college or university at the time of application;\r\n\r\n* Maintain cumulative grade point average of 3.20 or higher on a 4.0 scale; \r\n\r\n* Major in Chemical Engineering, Mechanical Engineering, Computer Engineering, Computer Science or Electrical Engineering, \r\n\r\n* Complete a Free Application for Federal Student Aid (FAFSA)and have a demonstrated financial needs.", sponsor: "Intel, UNCF", amount: "$5,000", state: "All", min_gpa: "3.2", contact: "financial.aid@example.edu", keywords: nil, website: "https://scholarships.uncf.org/Program/Details/3907bdbe-5ddd-4a25-b358-d96be449da35", opportunity_type: "Scholarship", created_at: "2017-02-23 00:07:22", updated_at: "2019-03-12 03:56:18", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-26", updated_by: "hobbsm"},
    {id: 1323, award_name: "Army Scholarship Foundation", subject_area: "Military Family", level: nil, deadline: "2019-04-15", other_req: "Applicants must: Be sons or daughters of regular active duty, active duty Reserve, or active duty National Guard U.S. Army members in good standing, OR be spouses of serving enlisted regular active duty, active duty Reserve, or active duty National Guard U.S. Army members in good standing, OR be sons or daughters of former U.S. Army members who received an honorable discharge or medical discharge, or who were killed while serving in the U.S. Army.\r\nMust not have reached their 24th birthday by the application deadline if they are a child of an Army member. Not have previously earned a bachelor's degree from a college or university.", sponsor: "Army Scholarship Foundation", amount: "Varies", state: "All", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.armyscholarshipfoundation.org/apply.html", opportunity_type: "Scholarship", created_at: "2017-02-23 17:27:06", updated_at: "2019-03-27 22:49:16", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
    {id: 1325, award_name: "Women in STEM Academic Scholarship", subject_area: "STEM; Science; Biology; Chemistry; Physics; Computer Science; Engineering; Mathematics", level: nil, deadline: "2019-04-15", other_req: "Women who are pursuing an undergraduate or master's degree and are majoring in science, technology, engineering, or mathematics during the school year.  ", sponsor: "BHW Group", amount: "$3,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://thebhwgroup.com/scholarship", opportunity_type: "Scholarship", created_at: "2017-02-23 17:34:35", updated_at: "2019-03-12 03:57:03", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1327, award_name: "Driving Geeks College Scholarship", subject_area: "All fields", level: nil, deadline: "2018-04-15", other_req: "Submit an essay - prompt on website.  This scholarship can be used for summer or fall semesters.", sponsor: "Driving Geeks", amount: "$500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.drivinggeeks.com/for-students/", opportunity_type: "Scholarship", created_at: "2017-02-23 17:44:17", updated_at: "2019-03-12 03:58:04", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "Not avail 19-20 AY", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1328, award_name: "Fleet Reserve Military Association Scholarships", subject_area: "Military Family", level: nil, deadline: "2019-04-15", other_req: "You may apply for FRA Education Foundation Scholarships if you are affiliated with the USN, USMC or USCG through your own service or that of your spouse, parent, grandparent or great-grandparent.  Individual scholarships may have additional requirements.", sponsor: "FRA Education Foundation Scholarships", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.fra.org/fra/Web/Events_and_Programs/Fra_Education_Foundation_Scholarships/Web/Content/FRA_Education_Foundation.aspx", opportunity_type: "Scholarship", created_at: "2017-02-23 17:50:27", updated_at: "2018-09-20 22:13:55", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "walshm"},
    {id: 1329, award_name: "The Jackie Spellman Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-15", other_req: "The Jackie Spellman Scholarship is open to U.S. citizens who have been impacted in some way by leukemia or lymphoma, either as survivors, individuals diagnosed with leukemia or lymphoma, or individuals who have a member of his or her immediate family who have or had leukemia or lymphoma while living in the same household. Eligible students include high school seniors or those attending community college, a four-year university or graduate school. Students majoring in health or nursing related majors may receive priority.", sponsor: "The Jackie Spellman Scholarship Foundation", amount: "Varies", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://jackiespellmanbenefit.org/", opportunity_type: "Scholarship", created_at: "2017-02-23 17:59:23", updated_at: "2019-03-12 03:59:46", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1330, award_name: "Minnesota Association of Public Accountants Scholarship", subject_area: "Accounting", level: nil, deadline: "2019-04-15", other_req: "Undergraduate students entering their junior year, enrolled in a degree program at an accredited 4-year college or university, majoring in accounting with the intention to practice in the field of public accounting, and having at least a 2.5 or better grade point average.\r\nApplicants must be U.S. citizens attending a U.S. accredited school and a Minnesota resident.", sponsor: "Minnesota Association of Public Accountants", amount: "$750", state: "MN", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://mapa-mn.com/scholarship/", opportunity_type: "Scholarship", created_at: "2017-02-23 18:07:26", updated_at: "2019-01-03 16:44:02", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1331, award_name: "STEM Scholarship for Women", subject_area: "STEM; Science; Biology; Chemistry; Physics; Computer Science; Engineering; Mathematics", level: nil, deadline: "2019-05-01", other_req: "Incoming female college or university freshmen, sophomores, or juniors, who are majoring in the field of Science, Technology, Engineering, or Mathematics.  Applicant must be currently enrolled in a high school, college, university, or trade school.  Submit a 2-5 minute video - prompt on website.", sponsor: "South Jersey SEO", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.southjerseyseo.org/scholarship/", opportunity_type: "Scholarship", created_at: "2017-02-23 19:34:08", updated_at: "2019-03-12 04:01:20", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "hobbsm"},
    {id: 1333, award_name: "Armenian International Women's Association Scholarships", subject_area: "All fields", level: nil, deadline: "2019-04-19", other_req: "The scholarships are awarded to full-time female students of Armenian descent attending accredited colleges or universities.\r\nStudents entering their junior or senior year in college, as well as graduate students, are eligible to apply for the awards.  (The Hasmik Mgrdichian scholarships for California residents are also available to sophomores.)\r\nAwards are based on financial need and merit.", sponsor: "Armenian International Women's Association", amount: "Varies", state: "All", min_gpa: "3.2", contact: "financial.aid@example.edu", keywords: nil, website: "http://aiwainternational.org/content.aspx?page_id=22&club_id=616355&module_id=243124", opportunity_type: "Scholarship", created_at: "2017-02-23 19:42:37", updated_at: "2019-01-24 18:53:43", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 1335, award_name: "Susanna DeLaurentis Memorial Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-19", other_req: "The Susanna DeLaurentis Memorial Scholarships are awarded each year to college-bound high school seniors with superior academic and extracurricular achievements who contend with a chronic disease or other serious challenge to physical or mental health. ", sponsor: "The Susanna DeLaurentis Charitable Foundation", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://thesusannafoundation.org/scholarships/apply.php", opportunity_type: "Scholarship", created_at: "2017-02-23 20:15:02", updated_at: "2019-03-27 22:53:32", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
    {id: 1336, award_name: "Outlive Yourself", subject_area: "All fields", level: nil, deadline: "2018-04-13", other_req: "Taylor’s Gift Foundation strives to honor students with a giving spirit that strive to make the world a better place.\r\nThe Taylor’s Gift Scholarship is based on criteria that goes beyond academics and extracurricular activities,\r\nseeking students that are actively making a positive difference in the lives of others and embodying the “Outlive\r\nYourself” spirit.", sponsor: "Southwest Transplant Alliance (STA)", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://outliveyourself.org", opportunity_type: "Scholarship", created_at: "2017-02-23 20:18:55", updated_at: "2019-03-27 23:00:38", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "\"Taylor's Gift\" Scholarship not offered 2019-2020 AY because it became a new non-profit called the Outlive Yourself Foundation in 11/2018.  Check to see if scholarship offered after they have been an org for one year. ", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
    {id: 1338, award_name: "Teachers Make Teachers Scholarship", subject_area: "Education", level: nil, deadline: "2019-04-30", other_req: "Submit an essay about the teacher and/or event that inspired you to seek a degree in teaching.", sponsor: "School Furniture Depot", amount: "$1,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://schoolfurnituredepot.com/scholarship-application", opportunity_type: "Scholarship", created_at: "2017-02-23 20:26:28", updated_at: "2019-03-12 04:00:31", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1340, award_name: "Active Life Scholarship for Political Expression", subject_area: "All fields", level: nil, deadline: "2019-04-30", other_req: " This scholarship is designed to encourage students to explore and express their political opinions and become more active in both local and national politics.", sponsor: "Get Up! Get Active!", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.getupgetactive.org/active-life-political-awarenes/", opportunity_type: "Scholarship", created_at: "2017-02-24 18:42:52", updated_at: "2019-03-12 04:01:59", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1341, award_name: "Active Life Scholarship for Financial Literacy", subject_area: "All fields", level: nil, deadline: "2019-06-30", other_req: "This scholarship is designed to encourage students to increase their financial literacy skills and adopt positive habits for managing their personal finances both in college and beyond.", sponsor: "Get up! Get active!", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.getupgetactive.org/scholarship/", opportunity_type: "Scholarship", created_at: "2017-02-24 18:44:28", updated_at: "2019-05-30 20:30:11", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Multiple scholarships per year.", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "robertsm"},
    {id: 1346, award_name: "Devconhomesecurity Annual Scholarship", subject_area: "Business; Communications; Computer Science; Marketing", level: nil, deadline: "2019-08-15", other_req: "Applicant must be a full-time undergraduate or a graduate student attending a college or university in the U.S.\r\nApplicant must have a cumulative GPA of 3.0. A copy of your transcript is required.\r\nApplicant must be a US citizen or permanent resident and at least 18 years’ old\r\nApplicant must be able to provide proof of enrollment.", sponsor: "Devconhomesecurity.com", amount: "$2,500", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://devconhomesecurity.com/scholarship", opportunity_type: "Scholarship", created_at: "2017-02-24 19:24:39", updated_at: "2019-01-03 16:44:43", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
