    {id: 1365, award_name: "Army ROTC Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-04", other_req: "REQUIREMENTS\r\n\r\nBe a U.S. citizen.\r\nBe between the ages of 17 and 26.\r\nHave a high school GPA of at least 2.50.\r\nHave a high school diploma or equivalent.\r\nScore a minimum of 920 on the SAT (math/verbal) or 19 on the ACT (excluding the required writing test scores).\r\nMeet physical standards.\r\nAgree to accept a commission and serve in the Army on Active Duty or in a Reserve Component (Army Reserve or Army National Guard).", sponsor: "Army", amount: "Varies", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.goarmy.com/rotc/high-school-students/four-year-scholarship.html", opportunity_type: "Scholarship", created_at: "2017-03-06 23:34:32", updated_at: "2018-08-30 18:09:26", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1366, award_name: "US Air Force ROTC", subject_area: "All fields", level: nil, deadline: "2020-01-31", other_req: "To be eligible for scholarship consideration, you must achieve an SAT composite of 1240 or ACT composite of 26. Applicant must also attain a cumulative GPA of 3.0 or higher. There are no waivers or exceptions to the SAT/ACT or GPA requirements.\r\n\r\nSERVICE OBLIGATION\r\nYou’re under no obligation by simply applying for an Air Force ROTC scholarship. However, if you are awarded a scholarship, you become obligated when you accept and sign an agreement with the United States Air Force. If you are under legal age in the state where the school is located, your parent or legal guardian signs this agreement.\r\n\r\nYou will agree to:\r\nEnroll in the academic major for which the scholarship is offered.\r\nEnroll in Air Force ROTC beginning with the 2019 fall term.\r\nComplete a 24-day summer field training course at Maxwell AFB, Alabama (usually between your sophomore and junior years).\r\nComplete Air Force ROTC General Military Course (GMC) your freshman and sophomore years and the Professional Officer Course (POC) your junior and senior years.\r\nAccept a commission as an Air Force Officer and serve at least four years on active duty.", sponsor: "US Air Force", amount: "Varies", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.afrotc.com/scholarships", opportunity_type: "Scholarship", created_at: "2017-03-06 23:40:14", updated_at: "2019-07-17 22:12:08", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-07-01", updated_by: "robertsm"},
