    {id: 1369, award_name: "Presbyterian Student Opportunity Scholarship", subject_area: "All fields", level: nil, deadline: "2019-05-15", other_req: "Serves Presbyterian Church (U.S.A.) college students by providing need-based aid for sophomores, juniors and seniors who are full-time, first degree students attending accredited institutions in the United States. Must demonstrate financial need. Preference in this program is extended to racial ethnic students in order to promote diversity.", sponsor: "Presbyterian Mission Agency", amount: "Varies", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.presbyterianmission.org/ministries/theology-formation-and-evangelism/financialaid/undergraduate-opportunities/student-opportunity-scholarships/", opportunity_type: "Scholarship", created_at: "2017-03-06 23:56:28", updated_at: "2019-04-18 22:31:56", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 1370, award_name: "Build U. Scholarship", subject_area: "STEM; Science; Technology; Engineering; Mathematics", level: nil, deadline: "2019-11-01", other_req: "Fall 2019 Scholarship opens 10/1. Must be at least 18 and in good academic standing.  Submit an essay and video - prompt on website.", sponsor: "Buildium", amount: "$2,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.buildium.com/buildiums-build-u-scholarship/", opportunity_type: "Scholarship", created_at: "2017-03-07 00:30:50", updated_at: "2019-05-05 21:08:48", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Our Fall Scholarship opens on October 1st and closes on November 1st. \r\nSpring scholarship rotation on March 15 and closes on April 15\r\n\r\n**We operate under the same cycle every year.**", respect_deadline: true, date_reopens: "2020-03-15", updated_by: "hobbsm"},
    {id: 1372, award_name: "Science, Mathematics and Research for Transformation (SMART) Scholarship for Service", subject_area: "Biology; Biomedical Engineering; Chemical Engineering; Chemistry; Civil Engineering; Psychology; Computer Science; Electrical Engineering; Mathematics; Mechanical Engineering; Physics", level: nil, deadline: "2019-12-03", other_req: "The Science, Mathematics And Research for Transformation (SMART) Scholarship for Service Program is an opportunity for students pursuing an undergraduate or graduate degree in Science, Technology, Engineering, and Mathematics (STEM) disciplines to receive a full scholarship and be gainfully employed upon degree completion. Must be a citizen of the United States, Australia, Canada, New Zealand or the United Kingdom. and be 18 or older as of August 1st. THIS SCHOLARSHIP HAS A SERVICE COMMITMENT.  ", sponsor: "Department of Defense", amount: "full tuition and stipend", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://smartscholarshipprod.service-now.com/smart", opportunity_type: "Scholarship", created_at: "2017-03-08 22:19:45", updated_at: "2019-08-01 17:30:16", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
