    {id: 1378, award_name: "Bristol-Myers Squibb Scholarship for Cancer Survivors", subject_area: "All fields", level: nil, deadline: "2019-04-01", other_req: "Applicants to the Bristol-Myers Squibb Scholarship for Cancer Survivors must:\r\nBe cancer survivors, age 25 and under, who are high school seniors or graduates, or current postsecondary undergraduates.\r\nBe persons who have been diagnosed by a physician as having had treatment for cancer and survived (applicants must submit the following Diagnosis Verification Form to their physician to be completed and faxed directly to Scholarship America). ", sponsor: "Bristol-Myers Squibb", amount: "$10,000", state: "All", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://learnmore.scholarsapply.org/cancer-survivors/", opportunity_type: "Scholarship", created_at: "2017-03-15 16:58:53", updated_at: "2019-03-27 23:02:23", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
