    {id: 1396, award_name: "Western Union Scholarship", subject_area: "STEM; Business; Entrepreneurship; Science; Technology; Engineering; Mathematics", level: nil, deadline: "2019-04-30", other_req: "All applicants most be between the ages of 18 - 26 on June 1st. Recipients are awarded based on perseverance, aspiration and being community-minded.  Not eligible to be used for study abroad.", sponsor: "Western Union Foundation", amount: "$2,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://foundation.westernunion.com/wuscholars/index.html", opportunity_type: "Scholarship", created_at: "2017-04-03 21:46:02", updated_at: "2019-05-04 20:24:27", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1398, award_name: "Rachel Easton, R.N. Nursing Scholarship", subject_area: "Nursing", level: nil, deadline: "2019-04-30", other_req: "Residents of east Linn County are invited to apply for the Rachel Easton, R.N. Nursing Scholarship\r\noffered by the Lebanon Community Hospital Foundation. To qualify, applicants must have a family home in Brownsville, Cascadia, Crabtree, Crawfordsville, Foster, Halsey, Lacomb, Lebanon, Scio, Shedd, Sweet Home, Tangent or Waterloo. Additionally, applicants must be currently attending college and accepted in a nursing program. ", sponsor: "Lebanon Community Hospital Foundation", amount: "$1000", state: "OR", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.samhealth.org/careers-education/scholarships/linn-county", opportunity_type: "Scholarship", created_at: "2017-04-11 19:54:52", updated_at: "2019-03-12 22:38:12", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1399, award_name: "Asia SiVon Cottom Memorial Scholarship", subject_area: "STEM; Science; Technology; Engineering; Mathematics", level: nil, deadline: "2020-05-06", other_req: "Applicants must be an entering or returning student pursuing a degree with a concentration in STEM who is able to demonstrate academic merit, ambassadorial potential and leadership potential.", sponsor: "Asia SiVon Cottom Memorial Scholarship Fund", amount: "Varies", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://asiacottom.com/scholarship-fund/apply/", opportunity_type: "Scholarship", created_at: "2017-04-19 18:23:39", updated_at: "2019-08-01 17:34:15", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 1401, award_name: "Excellence in Student Religion Reporting (Chandler Award)", subject_area: "All fields; Journalism; Communication", level: nil, deadline: "2019-05-03", other_req: "Submit up to three religion stories published in the 2018-19 academic year (summer–spring) in campus newspapers and magazines or in general circulation newspapers during a student internship. Stories can be from the printed publication or its online edition. Stories may include the main text, related sidebars (one per story) and infographics. Photos and audio that appear with stories will not be judged, but they need not be removed from an entry. Stories published on class blogs or project pages will not be eligible.\r\nMultiple bylines are permitted, but if the entry wins, the award will be shared among all those credited in the byline.", sponsor: "Religion News Association", amount: "up to $600", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.rna.org/?page=all_Chandler_info", opportunity_type: "Scholarship", created_at: "2017-04-19 18:48:21", updated_at: "2019-03-27 23:03:13", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
    {id: 1402, award_name: "Hampton Roads Pride LGBTQ Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-01", other_req: "All LGBTQ and LGBTQ allies who are attending or have been accepted to an accredited higher educational\r\ninstitution are eligible and encouraged to apply; this includes high school seniors, community college students,\r\nundergraduate and graduate students, as well as students attending trade schools.", sponsor: "Hampton Roads Pride", amount: "$1,600", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.hamptonroadspride.org/scholarship/application/", opportunity_type: "Scholarship", created_at: "2017-04-19 18:55:23", updated_at: "2018-11-30 19:26:16", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 1405, award_name: "The Sara Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-30", other_req: "Female high school seniors who plan to pursue a college degree and who demonstrate academic achievement, excellence of character, financial need and active engagement with the sport of golf. Skill in playing golf is not a criterion.  Applicant must demonstrate financial need.", sponsor: "Henry & Sara Sheehan Foundation", amount: "$2,000 (renewable)", state: "All", min_gpa: "3.2", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.sarascholarship.org/", opportunity_type: "Scholarship", created_at: "2017-04-19 20:54:11", updated_at: "2019-01-24 18:54:48", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 1409, award_name: "Hawaii Softball Foundation Scholarship", subject_area: "All fields", level: nil, deadline: "2019-05-04", other_req: "Applicants must show participation in the sport of softball at a Hawaii high school.  Recipients are selected based on financial need, academic achievement, personal letter and recommendations.", sponsor: "Hawaii Softball Foundation", amount: "$1,000", state: "HI", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.hawaiisoftballfoundation.org/news/apply-now-2017-scholarships", opportunity_type: "Scholarship", created_at: "2017-04-20 16:54:51", updated_at: "2019-04-18 22:42:03", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1410, award_name: "JC Runyon Foundation Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-01", other_req: "JC Funyon Foundation scholarships are awarded to high school students who have successfully completed at least one stay in an accredited inpatient facility for psychiatric disorder, substance abuse, or both.", sponsor: "JC Runyon Foundation", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://jcrunyonfoundation.org/scholarship/", opportunity_type: "Scholarship", created_at: "2017-04-20 17:00:51", updated_at: "2018-08-29 22:12:29", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2019-08-15", updated_by: "walshm"},
    {id: 1411, award_name: "The Soozie Courter Hemophilia Scholarship", subject_area: "All fields", level: nil, deadline: "2019-05-03", other_req: "To be eligible for the scholarship, students must have either hemophilia A or hemophilia B, or be a carrier, and be a high school senior, have a high school diploma or general education development (GED) credential, or be currently enrolled in an accredited junior college, college (as an undergraduate or graduate student), or vocational school.", sponsor: "Pfizer", amount: "$2,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.hemophiliavillage.com/hemophilia-scholarship-program", opportunity_type: "Scholarship", created_at: "2017-04-20 17:03:45", updated_at: "2019-05-05 21:13:21", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1412, award_name: "The Models of Excellence LGBTQ Scholarship", subject_area: "All fields", level: nil, deadline: "2019-05-11", other_req: "Friends of Project 10 Inc. will be awarding $1,000, $2,000 and $3,000 scholarships to senior high school students, regardless of sexual orientation or gender identity, from public, private and parochial schools who have advanced the civil rights of the lesbian, gay, bisexual, and transgender (LGBT) population. Graduating students must be going onto higher education.  Applicants are limited to graduating senior high school students residing in these Southern California counties: Imperial, Kern, Los Angeles, Orange, Riverside, Santa Barbara, San Bernardino, San Diego, San Luis Obispo, Ventura.", sponsor: "Friends of Project 10", amount: "Varies", state: "CA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://friendsofproject10.org/scholarships.html", opportunity_type: "Scholarship", created_at: "2017-04-20 17:07:40", updated_at: "2019-04-18 22:42:54", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1414, award_name: "BDSA Golf Scholarship", subject_area: "All fields", level: nil, deadline: "2019-05-24", other_req: "High school senior who participates in golf and demonstrates leadership and community service involvement with financial need will be considered.", sponsor: "Bill Dickey Scholarship Association (BDSA)", amount: "Varies (renewable)", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://billdickey.org/scholarships/", opportunity_type: "Scholarship", created_at: "2017-04-20 18:45:31", updated_at: "2019-04-18 22:54:07", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-15", updated_by: "hobbsm"},
    {id: 1415, award_name: "Queens of the Castro LGBTQ+ Scholarships", subject_area: "All fields", level: nil, deadline: "2019-06-01", other_req: "We are seeking applicants, ages 16-25, who identify as members of the LGBTQ+ community and live in California. At some point in your life, you should have demonstrated a commitment to raising awareness about LGBTQ+ issues, combating homophobia and/or bullying or educating your community about similar topics.", sponsor: "Queens of Castro", amount: "Varies", state: "CA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://queensofthecastro.com/scholarships", opportunity_type: "Scholarship", created_at: "2017-04-20 18:53:35", updated_at: "2019-05-30 21:41:28", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-15", updated_by: "robertsm"},
    {id: 1417, award_name: "Mouse Hole Scholarships - vision impairment", subject_area: "All fields", level: nil, deadline: "2018-05-15", other_req: "Applicants or their parent or parents corrected vision must be 20/200 or worse in both eyes, i.e. legally visually impaired, to apply for this scholarship.  Submit an essay - prompt on website.", sponsor: "BlindMiceMegaMall.com", amount: "up to $2,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.blindmicemegamall.com/bmm/shop/Mouse_Hole_Scholarships", opportunity_type: "Scholarship", created_at: "2017-04-20 21:25:56", updated_at: "2019-03-12 22:39:52", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Not offered in 1920 AY; check next year.", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1418, award_name: "Lewis C. Hoffman Scholarship", subject_area: "Engineering", level: nil, deadline: "2019-05-15", other_req: "The award will be given to a junior or senior student who has acquired a total of at least 80 semester credits or equivalent quarter credits at the time of the application and is still a full-time undergraduate student by the time of the award (October).\r\n \r\nThe winner will be selected based on:\r\nTotal GPA, Science GPA (to be verified in faculty recommendation letter)\r\nPSAT/SAT/ACT scores, if available\r\nRecommendation letter from a faculty member in the department\r\nExtracurricular activities\r\nA 500-word essay on the topic: Low Dimensional Structures and Properties in Electronic Ceramics", sponsor: "The American Ceramic Society", amount: "$2,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://ceramics.org/?awards=lewis-c-hoffman-scholarship", opportunity_type: "Scholarship", created_at: "2017-04-20 21:28:54", updated_at: "2019-05-05 21:13:59", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-15", updated_by: "hobbsm"},
    {id: 1421, award_name: "Virginia Heinlein Memorial Scholarship", subject_area: "Engineering; Mathematics; Biology; Physics; Physical Sciences", level: nil, deadline: "2019-04-01", other_req: "Submit an essay - details on website", sponsor: "The Heinlein Society", amount: "$2,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.heinleinsociety.org/scholarship-program/", opportunity_type: "Scholarship", created_at: "2017-04-20 22:04:17", updated_at: "2019-05-04 20:22:47", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1422, award_name: "NANOG Scholarship Program", subject_area: "Computer Engineering; Computer Science; Electrical Engineering", level: nil, deadline: "2019-04-16", other_req: "Applicants to the NANOG Scholarship Program must meet the following criteria:\r\nBe a current postsecondary undergraduate or graduate student who is pursuing a degree in one of the following fields of study:\r\nComputer Engineering\r\nComputer Science\r\nElectrical Engineering\r\nNetwork Engineering\r\nTelecommunications (at the graduate-level only)\r\nPlan to enroll part-time (at least six credits) or full-time in undergraduate or graduate study at an accredited two- or four-year college or university for the entire academic year.\r\nHave a minimum grade point average of 3.0 on a 4.0 scale (or its equivalent).\r\nEach recipient of the scholarship agrees to allow the use of his or her biographical and academic information in publications of the university and NANOG respectively.", sponsor: "The North American Network Operators Group (NANOG)", amount: "$10,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.nanog.org/scholarships/home", opportunity_type: "Scholarship", created_at: "2017-04-28 19:25:51", updated_at: "2019-03-12 22:41:59", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1423, award_name: "Maui Filipino Chamber of Commerce Foundation Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-31", other_req: "Applicant must be a resident of the island of Maui with a minimum cumulative GPA of 3.5.  The scholarship judges decision will be based on the applicant’s grade point average (30%), the Applicant’s standardized test scores (20%), the Applicant’s high school activities, awards, honors, community activities,and employment (15%), a short essay (20%), financial need (10%) and two letters of recommendation (5%).", sponsor: "Maui Filipino Chamber of Commerce Foundation", amount: "$1,000", state: "HI", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.mauifilipinochamber.com/scholarship/", opportunity_type: "Scholarship", created_at: "2017-05-01 17:55:34", updated_at: "2019-03-12 22:44:45", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1426, award_name: "Action Behavior Centers ABA Therapy Scholarship", subject_area: "Psychology; Education; Sociology; Biology; Science", level: nil, deadline: "2019-11-30", other_req: "The Action Behavior Center ABA Therapy Scholarship is a merit-based scholarship for US-based students pursuing higher education studies in a field that will benefit the research or clinical therapy for Autism Spectrum Disorders (ASD).", sponsor: "Action Behavior Centers", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.actionbehavior.com/scholarship/", opportunity_type: "Scholarship", created_at: "2017-05-04 18:50:17", updated_at: "2019-08-01 17:35:37", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "Scholarship is offered twice yearly. 6/30 & 11/30", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "robertsm"},
    {id: 1427, award_name: "Lawn Care Pal Eco Marketing Scholarship", subject_area: "All fields", level: nil, deadline: "2018-11-30", other_req: "This scholarship program is for the undergraduate or postgraduate students with the passion of “Eco Marketing”", sponsor: "lawncarepal.com", amount: "$1,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.lawncarepal.com/eco-marketing-scholarship/", opportunity_type: "Scholarship", created_at: "2017-05-04 19:16:37", updated_at: "2019-05-30 20:27:16", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Not active as of 5/30/19", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "robertsm"},
    {id: 1429, award_name: "The Sleep Judge State of Sleep Scholarship", subject_area: "All fields", level: nil, deadline: "2019-10-30", other_req: "Submit a short video - prompt on website", sponsor: "The Sleep Judge", amount: "$1,500", state: "All; Canada", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.thesleepjudge.com/scholarship/", opportunity_type: "Scholarship", created_at: "2017-05-04 19:24:58", updated_at: "2019-05-30 20:26:09", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 1433, award_name: "Freedom Alliance Scholarship", subject_area: "Military Family", level: nil, deadline: "2019-07-31", other_req: "APPLICANTS MUST BE ONE OF THE FOLLOWING:\r\nThe dependent son or daughter of a U.S. Soldier, Sailor, Airman, Guardsman or Marine who has become 100% total & permanently disabled as a result of an operational mission or training accident. OR The dependent son or daughter of a U.S. Soldier, Sailor, Airman, Guardsman or Marine who has been killed in action. OR The dependent son or daughter of a U.S. Soldier, Sailor, Airman, Guardsman or Marine who has been classified as a Prisoner of War (POW) or Missing in Action (MIA).  All applicants must also be under the age of 26 at the time of application.\r\n\r\n", sponsor: "Freedom Alliance Scholarship Fund", amount: "Varies (renewable)", state: "All", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.fascholarship.com/apply/", opportunity_type: "Scholarship", created_at: "2017-05-09 21:13:44", updated_at: "2018-10-18 23:14:56", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "e-mailed wanda.cruz@freedomalliance.org for deadline. 5/9\r\n\r\nDeadline response Rachel,\r\n\r\nThank you for contacting me regarding our scholarship deadline. We actually accept applications on a rolling basis but would like new applications to arrive by July 31st to ensure the paperwork and scholarships are processed before school starts.\r\n\r\nV/r,\r\nWanda\r\n", respect_deadline: true, date_reopens: "2019-10-30", updated_by: "walshm"},
    {id: 1434, award_name: "Commander William S. Stuhr Scholarship", subject_area: "Military Family", level: nil, deadline: "2018-01-15", other_req: "This program is open to the dependent children of military personnel who are serving on active duty or retired with pay after 20 years' service (not merely separated from service). Applicants must be high school seniors who rank in the top 10% of their class and have an SAT score of at least 1900 or an ACT score of at least 27. They must plan to attend a 4-year accredited college. Selection is based on academic performance, extracurricular activities, demonstrated leadership potential, and financial need.  1 scholarship is awarded per military branch (6) per year and are renewable provided the recipient makes the dean's list at their college at least once during their first 2 years.  Applications may only be obtained by writing and enclosing a SASE.  The fund does not respond to telephone, fax, or e-mail inquiries.  Mailing Address: Attn: Executive Director 3292 Thompson Bridge Road, Suite 120, Gainesville, GA 30506", sponsor: "Commander William S. Stuhr Scholarship Fund", amount: "up to $2,000 (renewable)", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "", opportunity_type: "Scholarship", created_at: "2017-05-09 21:46:24", updated_at: "2018-08-30 18:18:10", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "stuhrstudents@earthlink.net", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1435, award_name: "Adrian & Corena Swanier Education Scholarship", subject_area: "Military Family", level: nil, deadline: "2018-03-31", other_req: "Applicants must be a dependent unmarried child under the age of 21 (23 if enrolled as a full time student) to any of the following: (1) Active duty personnel, (2) Military veteran, (3) Deceased military veteran, or (4) National Guard and Reserve. The following criteria must additionally be met: Enrolled in an accredited college full time, Plan to attend an accredited college towards a 4 year degree, vocational or technical certificate in the fall term, GPA of at least 2.5 (on a 4.0 scale).", sponsor: "Ketia 4 Kidz Foundation", amount: "Varies", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://ketia4kidz.org/scholarship-military-kids/adrian_and_corena_swanier_education_scholarship.html", opportunity_type: "Scholarship", created_at: "2017-05-09 21:54:10", updated_at: "2019-01-03 16:49:07", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "not available 1920 check for 2021", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 1438, award_name: "Fisher House Scholarships for Military Children", subject_area: "Military Family", level: nil, deadline: "2019-02-15", other_req: "Program is open to sons and daughters of active duty, reserve/guard, or retired military commissary customers.\r\nRecipient must be enrolled or planning to enroll full-time in a four-year undergraduate college or university,\r\naccredited in the U.S. or a two-year community college. They must have a minimum cumulative grade point average of 3.0 on a 4.0 basis.", sponsor: "Fisher House", amount: "$2,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://militaryscholar.org/sfmc/index.html", opportunity_type: "Scholarship", created_at: "2017-05-09 22:22:17", updated_at: "2018-12-14 17:37:53", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "walshm"},
    {id: 1439, award_name: "Dolphin Scholarships", subject_area: "Military Family", level: nil, deadline: "2019-03-15", other_req: "Dolphin Scholarship Foundation grants are available, on a competitive basis, to high school or college children/stepchildren and spouses of members or former members of the submarine force or those who have served in submarine support activities. Scholars are selected on the basis of academic proficiency, commitment and excellence in school and community activities as well as financial need.", sponsor: "Dolphin Scholarship Foundation", amount: "up to $3,400", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.dolphinscholarship.org/index.cfm/scholarships/", opportunity_type: "Scholarship", created_at: "2017-05-09 22:32:42", updated_at: "2018-09-26 21:42:36", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 1440, award_name: "Military Family Support Trust Scholarship", subject_area: "Military Family", level: nil, deadline: "2018-02-01", other_req: "The direct ancestor’s or legal guardian’s military service must have a rank of E-5 (Non-commissioned Officer) and above or comparable grade in a military service office.  This rank requirement is waived in the case of Purple Heart recipients or those who died while on active duty. Must be a High School Senior. Must have the recommendation of his/her principal. Must have achieved a minimum score on any of the following: 21 on the ACT or 1,000 on two-part SAT.  Must also have a GPA of 3 on a 4 point grading scale. Must demonstrate superior leadership skills in school and or community activities. Must possess moral and character attributes worthy of scholarship candidates.", sponsor: "Military Family Support Trust", amount: "Varies", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://mfst.us/our-programs/scholarships/", opportunity_type: "Scholarship", created_at: "2017-05-09 22:36:32", updated_at: "2019-03-12 22:47:12", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "No avail Feb 2019; check for 2020", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "hobbsm"},
    {id: 1441, award_name: "Sports Gear Lab Scholarship", subject_area: "All fields", level: nil, deadline: "2018-12-15", other_req: "Must be a full-time student in a college, university or high school\r\nMust be a U.S. Citizen\r\nIt is not required to study in a sports related field\r\nPrior recipients of the scholarship are not eligible for the scholarship in subsequent years", sponsor: "Sports Gear Lab", amount: "$500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.sportsgearlab.com/scholarship/", opportunity_type: "Scholarship", created_at: "2017-05-12 16:07:32", updated_at: "2019-05-30 21:32:41", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-06-01", updated_by: "robertsm"},
