    {id: 1451, award_name: "AICP Scholarship", subject_area: "Economics; Finance; Mathematics; Business", level: nil, deadline: "2018-06-01", other_req: "An undergraduate applicant must be a full-time student, as defined by the accredited educational institution the applicant is attending, and must have completed the first year and one semester of the second year in that educational institution.\r\nA graduate applicant must be taking at least two courses at an accredited educational institution and must have completed four (4) graduate credit courses in his/her chosen program.\r\nThe applicant's status must meet the above requirements for the term subsequent to when the scholarship is awarded.Applicants must have declared his/her major course work to be in the field of Insurance, Actuarial Science, Economics, Finance, Management, Mathematics, Risk Management, Statistics, or a Business-related field. Applicants must have a cumulative G.P.A. at the time of application of at least 3.00.", sponsor: "Association of Insurance Compliance Professionals", amount: "$1,500", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.aicp.net/careercenter/scholarship.cfm", opportunity_type: "Scholarship", created_at: "2017-05-19 21:23:16", updated_at: "2019-05-30 21:40:15", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-15", updated_by: "robertsm"},
    {id: 1452, award_name: "SMRP Legacy of Excellence Scholarship", subject_area: "Engineering", level: nil, deadline: "2019-06-01", other_req: "SMRP is committed to helping the next generation of maintenance, reliability and physical asset management students achieve their professional goals through our scholarship program. Because of this commitment, the SMRP Foundation was created to provide students with financial resources. Scholarship applicants are judged on grade point average, work experience, extra-curricular activities and merit. See below for the description of available scholarships and deadlines for application.", sponsor: "Society for Maintenance & Reliability Professionals", amount: "varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://smrp.org/Scholarships", opportunity_type: "Scholarship", created_at: "2017-05-19 21:26:41", updated_at: "2019-05-30 21:39:27", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-15", updated_by: "robertsm"},
