    {id: 1460, award_name: "GAPA LGBTQ Scholarship", subject_area: "Minority", level: nil, deadline: "2019-06-09", other_req: "Asian/Pacific Islander LGBTQ student who is interested in activism in the API and LGBTQ communities OR Applicants would have a strong history of activism within the API and/or LGBTQ communities; however, applicants do not need to identify as either to apply. \r\nPreference will be given to those who identify as both API and LGBTQ.", sponsor: "GAPA Foundation", amount: "up to $5,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://gapafoundation.org/scholarships/", opportunity_type: "Scholarship", created_at: "2017-05-24 17:04:01", updated_at: "2019-05-30 20:24:41", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "robertsm"},
    {id: 1462, award_name: "ILMA Foundation Scholarships", subject_area: "Mathematics; Science; Engineering", level: nil, deadline: "2019-06-30", other_req: "Must be a citizen of a North American country who will be enrolled as a full-time undergraduate student for the 2019-20 academic year.  All applicants must submit an essay on why they should receive this scholarship. Topics should include:\r\n• How the scholarship will benefit future education endeavors; and,\r\n• Any “special circumstances” (i.e., applicant is the first child to go to college, comes from a single parent household, or\r\nneed-based financial assistance, etc.).\r\nApplicants may also provide these items that may be taken into consideration:\r\n• Community involvement\r\n• Extracurricular activities and/or sports or athletic involvement\r\n• Letter(s) of recommendation from teacher(s) or advisor(s) ", sponsor: "Independent Lubricant Manufacturers Association", amount: "$3,000 (renewable)", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.ilma.org/ILMA/Scholarship-Foundation/ILMA/Scholarship/Scholarship-Program.aspx?hkey=5f276cff-a95b-4e15-9e51-a36e360311ba", opportunity_type: "Scholarship", created_at: "2017-05-24 17:19:03", updated_at: "2019-05-16 23:26:21", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "hobbsm"},
    {id: 1463, award_name: "Mays Mission for the Handicapped Scholarship", subject_area: "All fields", level: nil, deadline: "2019-06-30", other_req: "To qualify for a Mission scholarship one must be able to document a significant disability, score of 18 or better on the A.C.T or 870 on S.A.T., be enrolled in a four-year study program (under-graduate only) working toward a baccalaureate degree and provide proof of enrollment.\r\n\r\nUpon acceptance to our program, recipients agree to provide proof of full-time enrollment each semester, submit grades, maintain a GPA of 2.3 and write an \"update letter\" providing the Mission with information pertaining to grades, struggles, triumphs, campus life and a general \"how are you doing\" letter.", sponsor: "Mays Mission for the Handicapped, Inc.", amount: "Varies", state: "All", min_gpa: "2.3", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.maysmission.org/programs.html", opportunity_type: "Scholarship", created_at: "2017-05-24 17:24:06", updated_at: "2019-05-30 20:17:19", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
