    {id: 1497, award_name: "The Rocco Basile Giving Scholarship for Documentary Photography", subject_area: "All fields", level: nil, deadline: "2018-03-01", other_req: "The scholarship is meant to encourage personal involvement in social issues and promote socially conscious documentary photography.  To apply, please answer the following question: How can the power of photography change the world? Please also include one photograph you have taken that best exemplifies this scholarship to you. Applicants do not have to be pursuing a photography degree, nor have to be experts. We’re looking for students who will be inspired by the prompt and perhaps even continue photography and an interest in social consciousness long after they’ve submitted their application.", sponsor: "Rocco Basile Giving", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.roccobasilegiving.com/", opportunity_type: "Scholarship", created_at: "2017-06-08 18:32:52", updated_at: "2019-03-27 23:07:47", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Not offered March 2019; check back at end of year before deleting.", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "hobbsm"},
