    {id: 1500, award_name: "Educators for Fair Consideration Scholarship (Undocumented Students Only)", subject_area: "All fields", level: nil, deadline: "2019-03-08", other_req: "ELIGIBILITY REQUIREMENTS:    Foreign-born\u2028, Financial need\u2028, Do not have permanent residency (green card) or citizenship in the U.S.\u2028, Current or intended enrollment in an accredited college or graduate program for 2018-2019\u2028.  Minimum GPA requirement:\u2028 For high school students: 3.3 cumulative high school GPA\u2028,For college/graduate students: 3.0 cumulative college GPA\u2028.  Demonstrated academic preparation and community/extracurricular involvement.\u2028 San Francisco Bay Area residency requirements:\u2028You must fulfill at least one of the following:\u2028 previous or intended graduation from a San Francisco Bay Area high school, or current or expected enrollment in a San Francisco Bay Area college or university\u2028.  We define the San Francisco Bay Area as the following 11 counties: Alameda, Contra Costa, Marin, Napa, San Francisco, San Mateo, Santa Clara, Santa Cruz, Solano, Sonoma, and Yolo.\u2028\r\n", sponsor: "Educators for Fair Consideration", amount: "up to $7,000", state: "CA", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.e4fc.org/scholarsprogram/scholarsoverview.html", opportunity_type: "Scholarship", created_at: "2017-06-13 22:17:26", updated_at: "2019-03-27 23:09:03", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "hobbsm"},
    {id: 1504, award_name: "Good Colleges Study Abroad Award", subject_area: "Study Abroad; International Experience", level: nil, deadline: "2019-11-01", other_req: "The Study Abroad Award essay competition is open to students who want to study abroad at college level. The cash award can be used to pay for living expenses as an international student. You must be a U.S. or Canadian citizen enrolled, or seeking to enroll, in an accredited college or university. Write an essay following this rounds theme. ", sponsor: "Good Colleges", amount: "$2,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://goodcolleges.online/study-abroad-award/", opportunity_type: "Scholarship", created_at: "2017-06-19 22:29:32", updated_at: "2018-11-30 19:29:14", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 1505, award_name: "AORN Nursing Academic Scholarship", subject_area: "Nursing", level: nil, deadline: "2019-06-16", other_req: "Nursing students (applicant must be in an accredited program leading to initial licensure as an RN), baccalaureate, master, and doctoral candidates with a cumulative G.P.A. of 3.0 or higher. International students are welcome to apply.\r\n\r\nBecause we are the member association for perioperative nurses, the applicant must possess an interest in the field of perioperative/surgical nursing. This interest and/or experience must be clearly demonstrated in the personal statement.\r\n", sponsor: "Association of periOperative Registered Nurses", amount: "Varies", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.aorn.org/aorn-foundation/here-for-you", opportunity_type: "Scholarship", created_at: "2017-06-20 19:15:29", updated_at: "2019-04-25 23:19:32", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
