    {id: 1508, award_name: "Nurses First Scholarship", subject_area: "Nursing", level: nil, deadline: "2018-08-01", other_req: "This nursing scholarship recognizes an outstanding student enrolled at any level of nursing education. The recipient demonstrates dedication to nursing’s evolving role in the healthcare system, the drive to make nursing a lifelong career and a commitment to outstanding patient care.  Must be 18 years of age or older when submitting an application.", sponsor: "nursing.org", amount: "$1,000", state: "All", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.nursing.org/scholarships/#scholarships", opportunity_type: "Scholarship", created_at: "2017-06-21 23:08:55", updated_at: "2019-05-30 20:00:03", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 1509, award_name: "Breaking Barriers: Scholarship for Men in Nursing", subject_area: "Nursing", level: nil, deadline: "2018-08-01", other_req: "Unfortunately, nursing is too often viewed as a field meant solely for women. If we are going to meet future nursing needs, we need to change the perception that nursing can’t be manly and broaden the workforce. The recipient of this nursing scholarship will show outstanding character, confidence, and ability in nursing. Must be a male, 18 years of age or older when submitting an application who is actively enrolled in an accredited nursing program.", sponsor: "nursing.org", amount: "$500", state: "All", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.nursing.org/scholarships/#scholarships", opportunity_type: "Scholarship", created_at: "2017-06-21 23:10:47", updated_at: "2019-05-30 19:59:23", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
