    {id: 1513, award_name: "Spirit Button Academic Scholarship", subject_area: "All fields", level: nil, deadline: "2018-08-15", other_req: "To enter, students must submit a 700 – 1,000 word essay on the topic “what piece of literature has inspired my life the most and why?”", sponsor: "Spirit Button", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.spiritbutton.com/scholarship-2018/", opportunity_type: "Scholarship", created_at: "2017-06-22 23:04:47", updated_at: "2019-05-30 19:58:34", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
