    {id: 1518, award_name: "Masergy STEM Scholarship", subject_area: "STEM; Science; Technology; Engineering; Mathematics", level: nil, deadline: "2019-12-15", other_req: "Record a video of no more than 60 seconds in length telling us who you are and showing us a STEM-related innovation that you’ve created. Details and more information on website. ", sponsor: "Masergy", amount: "$5,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.masergy.com/about-us/masergy-stem-scholarship-program-2017/", opportunity_type: "Scholarship", created_at: "2017-06-30 17:08:09", updated_at: "2019-07-17 22:50:10", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "fall and spring scholarships", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "robertsm"},
    {id: 1520, award_name: "Asbestos.com Scholarship", subject_area: "All fields", level: nil, deadline: "2019-08-18", other_req: "Must be 18 years or older and submit an essay related to mesothelioma.", sponsor: "Asbestos.com", amount: "$5,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.asbestos.com/scholarship/", opportunity_type: "Scholarship", created_at: "2017-06-30 20:32:20", updated_at: "2019-05-29 22:52:02", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-06-01", updated_by: "robertsm"},
    {id: 1521, award_name: "LawnStarter Lawntrepreneur Scholarship", subject_area: "All fields", level: nil, deadline: "2018-12-31", other_req: "Student who currently owns a lawn care business, ran a lawn care business in the past, or plan on starting a business upon graduating college.  Passionate and ambitious. Has willpower, work ethic, and desire to build the next great business.", sponsor: "LawnStarter", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.lawnstarter.com/scholarship", opportunity_type: "Scholarship", created_at: "2017-06-30 22:06:49", updated_at: "2019-05-30 19:56:39", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Offered twice yearly", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "robertsm"},
    {id: 1523, award_name: "Italian Benvenuti Club of Portland Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-15", other_req: "Must attend an Oregon college and be of Italian American decent with at least one ancestor that can be certified to have emigrated from Italy.", sponsor: "Italian Benvenuti Club of Portland", amount: "$1,750", state: "OR", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://ibcpdx.org/scholarship", opportunity_type: "Scholarship", created_at: "2017-07-03 21:55:31", updated_at: "2019-01-03 16:50:31", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
