    {id: 1531, award_name: "Jamie Horn Memorial Softball Scholarship", subject_area: "All fields", level: nil, deadline: "2019-09-01", other_req: "A $1,000 scholarship is awarded each year to a second-semester freshman collegiate student (apply as a graduating high school senior) who played Babe Ruth Softball at one time. This scholarship is based neither on achievement nor need, but quality of life.", sponsor: "Babe Ruth Softball", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://baberuthleague.org/scholarships/jaime-horn-memorial-softball-scholarship.aspx", opportunity_type: "Scholarship", created_at: "2017-07-31 17:08:17", updated_at: "2019-05-29 22:54:27", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-06-01", updated_by: "robertsm"},
    {id: 1534, award_name: "The NETwork Scholarship", subject_area: "STEM; Art; Engineering; Science; Biology; Chemistry; Mathematics; Physics; Computer Science; Environmental Science", level: nil, deadline: "2018-08-31", other_req: "The NETwork Scholarship is directed towards undergraduate candidates enrolled at any accredited four-year college or university during the 2018-19 year. The NETwork BICP is a group of black professional within the communication industry, who are interested in supporting undergraduates with financial assistance during their enrollment. This program is seeking to encourage students to pursue a career within one of the STEAM fields. The selected recipients will receive a merit-based award up to $2,000. ", sponsor: "UNCF; The NETwork BICP", amount: "up to $2,000", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://scholarships.uncf.org/Program/Details/15394521-42fe-4504-82f9-13988b6f72eb", opportunity_type: "Scholarship", created_at: "2017-08-02 19:00:27", updated_at: "2019-05-30 22:32:34", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "Not active on 5/30/19", respect_deadline: true, date_reopens: "2020-07-31", updated_by: "robertsm"},
    {id: 1536, award_name: "Hiking Ambition Wellness Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-31", other_req: "Passion for a healthy lifestyle or hiking is a must.To participate in this scholarship, you will have to create a piece of content between 500 – 1,000 words promoting a practical approach to a healthy lifestyle during high school, college or university years (whichever is relevant to you) and how these habits can be sustained over a lifetime.", sponsor: "Hiking Ambition", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://hikingambition.com/scholarship/", opportunity_type: "Scholarship", created_at: "2017-08-16 22:16:01", updated_at: "2019-05-30 21:31:18", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "The Hiking Ambition Wellness Scholarship is available twice a year. The deadlines are below:\r\n\r\nThe final date for submission is March 31, 2018, and we will choose the winner by April 15, 2018. Winner will be contacted no later than April 30, 2019.\r\nThe final date for submission is September 30, 2018, and we will choose the winner by October 15, 2018. Winner will be contacted no later than October 30, 2019.", respect_deadline: true, date_reopens: "2020-06-01", updated_by: "robertsm"},
    {id: 1537, award_name: "BBB Student Video and Poster Contest", subject_area: "All fields", level: nil, deadline: "2018-09-28", other_req: "Submit a short film (30-60 seconds) or a poster.  Student must be in the service area of the BBB serving Louisville, Southern Indiana, and Western Kentucky. Those counties include: (Southern Indiana) Clark, Crawford, Floyd, Harrison, Jefferson, Orange, Scott, and Washington. (Kentucky) Adair, Ballard, Barren, Breckinridge, Bullitt, Butler, Caldwell, Calloway, Carlisle, Carroll, Crittenden, Daviess, Edmondson, Fulton, Graves, Grayson, Green, Hancock, Hardin, Hart, Henry, Hickman, Hopkins, Jefferson, Larue, Livingston, Lyon, McCracken, McLean, Marion, Marshall, Meade, Metcalf, Muhlenburg, Nelson, Ohio, Oldham, Shelby, Spencer, Taylor, Trimble, Warren, Washington, Webster.", sponsor: "Better Business Bureau", amount: "Vaires", state: "IN; KY", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.bbb.org/louisville/programs-services/student-contest/", opportunity_type: "Scholarship", created_at: "2017-08-16 22:27:14", updated_at: "2019-07-17 22:52:44", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "robertsm"},
    {id: 1540, award_name: "Joey Stowell Scholarship", subject_area: "All fields; Disability", level: nil, deadline: "2019-07-01", other_req: "Must be a college student living with a physical ailment, physical disease, and/or physical disability. Must be enrolled as full/part time student, and must not be on academic probation.", sponsor: "Bella Soul", amount: "$500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://livebellasoul.org/?scholarships=joey-stowell-scholarship", opportunity_type: "Scholarship", created_at: "2017-08-16 22:39:51", updated_at: "2019-03-29 22:58:19", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
