    {id: 1555, award_name: "StudyPug Math Help Scholarship", subject_area: "All fields", level: nil, deadline: "2018-12-15", other_req: "To the best of your ability, complete a 500-1000 word article discussing how a math teacher, a math class, a math tutor, or a math lesson has changed how you see the world around you.", sponsor: "StudyPug.com", amount: "$1,000", state: "All", min_gpa: "", contact: "Financial Aid", keywords: nil, website: "https://www.studypug.com/scholarship.html", opportunity_type: "Scholarship", created_at: "2017-08-29 15:57:17", updated_at: "2019-05-30 17:47:36", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-06-15", updated_by: "robertsm"},
