    {id: 1560, award_name: "Raytheon Patriot Scholarship", subject_area: "Computer Science; Computer Engineering; Electrical Engineering; Mechanical Engineering; Military Veteran", level: nil, deadline: "2019-04-26", other_req: "Be a US Army Veteran ( Active Duty, Reserves and National Guard members are not eligible to apply).\r\nBe entering their sophomore, junior or senior year of undergraduate study, or be enrolled in a graduate program for the current academic year.\r\nBe currently attending full-time at an accredited four-year college or university in the United States.\r\nDemonstrate a commitment to and passion for their chosen field of study.\r\nDemonstrate leadership and engagement in their community.\r\nBe a current student veteran, as proven by a DD 214 and transcript.\r\nHave received an honorable discharge.", sponsor: "Student Veterans of America and Raytheon Integrated Defense Systems", amount: "$10,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://studentveterans.org/programs/scholarships?layout=edit&id=752", opportunity_type: "Scholarship", created_at: "2017-09-01 17:24:04", updated_at: "2019-03-12 23:14:35", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1562, award_name: "BMO Capital Markets Lime Connect Equity Through Education Scholarship", subject_area: "Business; Engineering; Mathematics; Physics; Disability", level: nil, deadline: "2019-10-14", other_req: "Current full-time undergraduate or graduate students pursuing a degree in business/commerce, engineering, math, physics, statistics or a related discipline.  Interested in a career in Financial Services with a focus on Capital Markets preferred.  A person with a visible or non-visible disability (definition on website).", sponsor: "Lime Connect", amount: "$10,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.limeconnect.com/programs/page/bmo-capital-markets-lime-connect-equity-through-education-scholarship", opportunity_type: "Scholarship", created_at: "2017-09-01 17:37:32", updated_at: "2019-08-01 17:56:29", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-08-01", updated_by: "robertsm"},
    {id: 1567, award_name: "Veterans United Foundation Scholarship", subject_area: "Military Family", level: nil, deadline: "2018-03-30", other_req: "Applicant must be a surviving spouse or a surviving child of a deceased service member or Veteran of the U.S. Military with a 100% service connected disability who is currently enrolled or planning to enroll in a university by the fall semester of 2018.", sponsor: "Veterans United Foundation", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.enhancelives.com/scholarships", opportunity_type: "Scholarship", created_at: "2017-09-08 18:19:21", updated_at: "2019-03-12 23:29:15", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Not offered in 1920 AY", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1568, award_name: "Best Value Schools STEM Scholarship for Women", subject_area: "STEM; Science; Technology; Engineering; Mathematics", level: nil, deadline: "2018-10-31", other_req: "Be a female currently attending or enrolled at a college studying a STEM field.  Must posses a cumulative GPA of 3.0 or higher and rank within the top 30% of their class.  Have achieved the following standardized test scores: SAT Math 600, composition/reading 500 or ACT Math 29, English 25.", sponsor: "Best Value Schools", amount: "$2,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.bestvalueschools.com/stem-scholarship-for-women/", opportunity_type: "Scholarship", created_at: "2017-09-08 18:34:15", updated_at: "2018-09-21 15:53:21", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "Runs April 1 - 15 and October 15 - 31 each year", respect_deadline: true, date_reopens: "2019-09-29", updated_by: "walshm"},
    {id: 1569, award_name: "NAB Dollars for Scholars", subject_area: "All fields", level: nil, deadline: "2019-10-31", other_req: "Must be 18 years or older and must be currently enrolled in high school with the intent of attending a university in the following semester, or must be currently enrolled in college.  Submit an essay - prompt on website.", sponsor: "North American Bancard (NAB)", amount: "$1,000", state: "All", min_gpa: "2.8", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.northamericanbancard.com/springscholarship", opportunity_type: "Scholarship", created_at: "2017-09-08 19:34:17", updated_at: "2019-05-30 22:27:23", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "March 31 and October 31 deadline", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "robertsm"},
    {id: 1570, award_name: "National Rice Month Scholarship", subject_area: "All fields", level: nil, deadline: "2018-10-31", other_req: "Create awareness and promote U.S.-grown rice, National Rice Month, and the importance of rice to your state via video — and earn scholarship money in the process.", sponsor: "Think Rice", amount: "up to $4,000", state: "AR; CA; LA; MS; MO; TX", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.thinkrice.com/scholarship/", opportunity_type: "Scholarship", created_at: "2017-09-08 20:47:23", updated_at: "2018-08-30 21:45:32", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1571, award_name: "Steel Scholarship", subject_area: "Electrical Engineering; Mechanical Engineering; Chemical Engineering; Environmental Engineering; Computer Science", level: nil, deadline: "2019-10-31", other_req: "Applications will be accepted from university freshmen, sophomore and junior applicants.  Applicant must be a citizen of the USA, Canada or Mexico.  Application, essay and recommendation letters should express a strong interest in the iron and steel industry.", sponsor: "Association for Iron and Steel Technology (AIST)", amount: "$3,000", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.aist.org/students-faculty/scholarships/steel-internships-and-scholarships", opportunity_type: "Scholarship", created_at: "2017-09-08 23:15:43", updated_at: "2019-05-29 23:01:25", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-06-01", updated_by: "robertsm"},
    {id: 1573, award_name: "Women in Marketing Scholarship", subject_area: "Marketing; Communications", level: nil, deadline: "2018-10-31", other_req: "Female student with 60 or more college credits.", sponsor: "Blue Soda Promo", amount: "$500", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.bluesodapromo.com/scholarships", opportunity_type: "Scholarship", created_at: "2017-09-08 23:22:22", updated_at: "2019-05-30 21:30:42", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Offered twice yearly (7/1 and 10/31 deadlines)\r\nWas not offered when I checked 3/2019", respect_deadline: true, date_reopens: "2020-06-01", updated_by: "robertsm"},
    {id: 1576, award_name: "Generation Study Abroad Travel Grants", subject_area: "Study Abroad, International Experience", level: nil, deadline: "2018-03-07", other_req: "U.S. citizen or permanent residents.\r\nEnrolled in an undergraduate degree program (associate’s or baccalaureate) at a U.S. college or university that is a Generation Study Abroad Commitment Partner (as of October 17, 2017).\r\nParticipating in a program abroad for academic credit, including academic study, internship, research, or service-learning during the spring, summer and fall 2018 terms.\r\nDemonstrates financial need.", sponsor: "Institute of International Education", amount: "$2,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.iie.org/en/Programs/Generation-Study-Abroad/UtilityNav/Funding/Travel-Grants#Eligibility", opportunity_type: "Scholarship", created_at: "2017-09-22 19:58:10", updated_at: "2019-05-30 17:40:47", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "Deadlines in Oct and March each year. \r\nCurrently not accepting applications as of 3/2019", respect_deadline: true, date_reopens: "2020-06-01", updated_by: "robertsm"},
    {id: 1578, award_name: "Design Your Future Schoalrship", subject_area: "Engineering; Design", level: nil, deadline: "2020-01-01", other_req: "This scholarship is open to students from all underrepresented or disadvantaged backgrounds. Examples of ideal applicants include, but are not limited to, students from racial minorities typically underrepresented in higher education, first generation college students, women pursuing a degree in a STEM or typically male-dominated industries, students with disabilities, and or similar situations.  Students from all majors are encouraged to apply, but preference is given to applicants pursuing design and engineering-related fields.", sponsor: "Chairish.com", amount: "$2,500", state: "All", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.chairish.com/pages/scholarship", opportunity_type: "Scholarship", created_at: "2017-10-05 16:56:09", updated_at: "2019-07-17 22:54:20", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "01/01 and 6/30 deadlines", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "robertsm"},
    {id: 1581, award_name: "AGC Education and Research Undergraduate Scholarship", subject_area: "Engineering", level: nil, deadline: "2018-11-01", other_req: " Applicant MUST be a second-year student at a two year school who is planning to transfer to a four-year program for the Fall 2019 term, or a rising college sophomore or junior in a four-year program or rising senior (for Fall 2019) in a five-year program. Junior and senior level applicants MUST have one full academic year of coursework remaining at the time of application deadline in the fall of 2018 term (i.e. earliest graduation date of December 2019). High school seniors are not eligible. Applicant MUST desire a career in the construction industry. Applicant MUST be a full-time student. Applicant MUST be enrolled or intend to enroll in either an ABET or an ACCE accredited (or candidate status) program. Applicant MUST pursue a B.S. degree in construction or construction-related engineering. A dual degree with construction or construction-related engineering as one part is acceptable. 6. Applicant MUST be a U. S. citizen or documented permanent resident of the United States (i.e. must possess a \"permanent resident\" card). Applicant MUST have a minimum GPA of 2.0.", sponsor: "AGC Education and Research Foundation", amount: "$2,500 (renewable)", state: "All", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.agc.org/learn/education-and-research-foundation/scholarship-program", opportunity_type: "Scholarship", created_at: "2017-10-05 22:34:12", updated_at: "2018-09-21 15:50:14", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-10", updated_by: "walshm"},
    {id: 1582, award_name: "Berrien Fragos Thorn Arts Scholarship for Migrant Farmworkers", subject_area: "Drama; Music; Art", level: nil, deadline: "2019-11-01", other_req: "A creative arts scholarship to foster and encourage the creative talents of individuals with a history of migration to obtain work in agriculture. Two grant levels in visual, media, or performing arts.", sponsor: "Geneseo Migrant Center", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://migrant.net/scholarships/", opportunity_type: "Scholarship", created_at: "2017-10-05 22:41:31", updated_at: "2019-07-17 22:59:22", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "6/1 and 11/1 deadlines", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "robertsm"},
    {id: 1586, award_name: "FIGHT THE FEAR SCHOLARSHIP SLAM", subject_area: "All fields", level: nil, deadline: "2019-03-19", other_req: "Must be 25 or younger and submit a poem - prompt on website.", sponsor: "Powerpoetry.org and The One Love Foundation", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.powerpoetry.org/content/power-poetry-scholarships", opportunity_type: "Scholarship", created_at: "2017-10-09 16:47:43", updated_at: "2019-05-30 17:50:22", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-06-15", updated_by: "robertsm"},
    {id: 1587, award_name: "Columbian Club Scholarship - Italian lineage", subject_area: "All fields", level: nil, deadline: "2018-11-15", other_req: "Applicants must be currently enrolled or entering as a 1st, 2nd, 3rd, or 4th year college student or a Graduate student at the time of application. Applicant must be a U.S. citizen, a permanent resident of the State of Illinois, and at least 25% of Italian lineage.", sponsor: "Columbian Club Charitable Foundation", amount: "up to $5,000", state: "IL", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://columbianclub.org/scholarship/", opportunity_type: "Scholarship", created_at: "2017-10-09 16:51:18", updated_at: "2018-10-18 23:06:57", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 1588, award_name: "David B. Goldberg Music Scholarship", subject_area: "All fields", level: nil, deadline: "2018-11-14", other_req: "Must be at least 16 years of age and currently enrolled in an accredited high school or college.  Dave was a true innovator and had a deep love of music. He was also passionate about music education, so in his honor we’re offering two $5,000 scholarships to students pursuing their own love of music. Show us how you are creating, innovating, writing or performing music through a short essay and a one-minute video (uploaded to Instagram or YouTube) of your own original content. Videos will be judged on their creativity and how well they demonstrate your work in music production, creation or innovation.", sponsor: "Chegg", amount: "$5,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.chegg.com/scholarships/david-b-goldberg-5000-music-scholarship-13138/apply", opportunity_type: "Scholarship", created_at: "2017-10-09 16:58:22", updated_at: "2018-08-30 20:28:46", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1589, award_name: "ACES Education Fund Scholarships", subject_area: "All fields; Journalism; English; Marketing; Communication", level: nil, deadline: "2018-11-15", other_req: "Applicants must be seeking college or university degrees and be enrolled as juniors, seniors or graduate students during the summer and/or fall term in 2018. Scholarships are awarded without regard to the student’s major or field of academic concentration. Previous scholarship winners are not eligible. Students in countries other than the United States may apply as well. ", sponsor: "ACES Education Fund", amount: "up to $3,000", state: "All", min_gpa: "", contact: "fianid@up.edu", keywords: nil, website: "https://aceseditors.org/awards/scholarships", opportunity_type: "Scholarship", created_at: "2017-10-09 17:09:45", updated_at: "2018-08-30 20:49:08", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1590, award_name: "CME Beef Industry Scholarship", subject_area: "All fields", level: nil, deadline: "2018-11-09", other_req: "Applicants must be a graduating high school senior or full-time undergraduate student enrolled at a two or four-year institution for the 2019-20 school years.  Applicants must have demonstrated a commitment to a career in the beef industry through classes, internships or life experiences. \r\n", sponsor: "National Cattlemen's Foundation and CME Group", amount: "$1,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.nationalcattlemensfoundation.org/cmebeefindustryscholarship.aspx", opportunity_type: "Scholarship", created_at: "2017-10-09 17:15:23", updated_at: "2018-10-01 22:09:34", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 1592, award_name: "Hagan Scholarship", subject_area: "All fields", level: nil, deadline: "2018-11-15", other_req: "The Hagan Scholarship is a need-based merit scholarship for high achieving, self-motivated students in need of financial assistance in order to attend college. These students will graduate from a public high school located in a county in the United States having fewer than 50,000 residents.  Must score a minimum of 23 on the ACT or 1,200 on the SAT.  Must work 240 hours in the twelve months prior to the start of college.  Must file a FAFSA and have an EFC less than $6,500.", sponsor: "Hagan Scholarship Foundation", amount: "unmet need up to $5,000 per semester", state: "All", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://haganscholarships.org/", opportunity_type: "Scholarship", created_at: "2017-10-09 18:26:34", updated_at: "2018-08-30 20:55:37", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1593, award_name: "Nancy Larson Foundation College Scholarship", subject_area: "Elementary Education", level: nil, deadline: "2018-11-15", other_req: "Must be a college junior, senior, or graduate student who have declared an elementary education major.", sponsor: "Nancy Larson Foundation", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.thenancylarsonfoundation.org/scholarships/scholarship-application/", opportunity_type: "Scholarship", created_at: "2017-10-09 18:39:29", updated_at: "2018-09-26 21:48:39", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 1595, award_name: "Start Standing Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-15", other_req: "Enrolled in good standing as a senior in high school or current undergraduate student.  Submit an essay - prompt on website.  Must be 16 or older.", sponsor: "startstanding.org", amount: "$1,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.startstanding.org/scholarship/", opportunity_type: "Scholarship", created_at: "2017-10-09 19:22:10", updated_at: "2019-05-30 17:53:43", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "March 31 and November 15 deadlines", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "robertsm"},
    {id: 1596, award_name: "UCT Scholarship Program", subject_area: "Special Education", level: nil, deadline: "2018-11-15", other_req: "Recipients must meet one or more of the following criteria:  Be a teacher of people with intellectual disabilities who needs additional course work to be certified or to retain certification. Be an experienced teacher who wishes to become certified to teach people with intellectual disabilities.\r\nHave a bachelor’s or master’s degree and wish to pursue graduate work in special education with an emphasis on teaching people with intellectual disabilities.\r\nBe a college junior or senior whose undergraduate course of study is special education specifically focusing on teaching people with intellectual disabilities.\r\nBe enrolled in courses to become a certified instructor under a structured trade, vocational or recreation program at a facility for people with intellectual disabilities.\r\nBe in the second year of a two-year associate’s degree program in an accredited school, with the course of study specifically focusing on teaching people with intellectual disabilities.", sponsor: "The Order of United Commercial Travelers of America (UCT)", amount: "up to $2,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.uct.org/uct-in-action/scholarship-programs/", opportunity_type: "Scholarship", created_at: "2017-10-09 19:30:50", updated_at: "2018-09-20 22:21:46", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "walshm"},
    {id: 1597, award_name: "My Story Essay Contest", subject_area: "All fields", level: nil, deadline: "2018-10-31", other_req: "Must be at least 18 years of age and currently enrolled in a non-profit accredited college or university.  Must also set up a CashCourse account (free) and submit an essay about your earliest money memory.", sponsor: "National Endowment for Financial Education, CashCourse", amount: "up to $2,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.cashcourse.org/my-story", opportunity_type: "Scholarship", created_at: "2017-10-09 19:35:23", updated_at: "2018-08-30 20:56:45", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1598, award_name: "Surety & Fidelity Industry Intern and Scholarship Program for Minority Students", subject_area: "Accounting; Economics; Business; Finance; Minority", level: nil, deadline: "2018-11-23", other_req: "Minority student who has satisfactorily completed at least 30 semester hours or equivalent of college work, including at least six semester hours (or equivalent) in your major field; and Ideally, a declared accounting, business/finance or Insurance/risk management major.  Must be a full-time student and commit to participating in a six-week(minimum) paid internship during the summer following notification of selection and prior to disbursement of scholarship funds.", sponsor: "The Surety Foundation", amount: "up to $5,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.thesuretyfoundation.org/application", opportunity_type: "Scholarship", created_at: "2017-10-09 22:06:50", updated_at: "2018-09-20 22:23:15", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-10", updated_by: "walshm"},
    {id: 1599, award_name: "RewardExpert Financial Wellness Scholarship", subject_area: "Accounting, Business, Finance, Mathematics", level: nil, deadline: "2018-11-15", other_req: "Must be a future or current college student who is applying to or attending a 2- or 4- year accredited U.S. university during the 2017-18 school year. Minimum cumulative GPA must be 3.3/4.0. Applicants must be working towards earning degrees Finance, Accounting, Business, and Mathematics, and other fields related to personal finance careers.", sponsor: "RewardExpert.com", amount: "$1,000", state: "All", min_gpa: "3.3", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.rewardexpert.com/scholarship", opportunity_type: "Scholarship", created_at: "2017-10-09 22:58:26", updated_at: "2018-08-30 21:13:20", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1600, award_name: "Direct Energy Live Brighter Scholarship", subject_area: "All fields", level: nil, deadline: "2018-12-15", other_req: "Must be a registered college student for the 2018-2019 school year. \r\nMust be 18 years of age or older. Must be a resident of any of the states where Direct Energy offers energy services: Connecticut, Delaware, Illinois, Indiana, Maryland, Massachusetts, Michigan, New Jersey, New York, Ohio, Pennsylvania, Texas, New Hampshire, Rhode Island and D.C.\r\nMust have a minimum of 3.0 GPA on a 4.0 scale. ", sponsor: "Direct Energy", amount: "$2,500", state: "CT; DE; IL; IN; MD; MA; MI; NJ; NY; OH; PA; TX; NH; RI; DC", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.directenergy.com/scholarship", opportunity_type: "Scholarship", created_at: "2017-10-09 23:25:09", updated_at: "2018-09-26 21:50:24", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
