    {id: 1602, award_name: "Small Business, Big Impact Scholarship", subject_area: "All fields", level: nil, deadline: "2018-03-31", other_req: "Submit a 500-750 word essay about your favorite small business.", sponsor: "insureon", amount: "$2,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.insureon.com/insureonu/small-business-scholarship", opportunity_type: "Scholarship", created_at: "2017-10-10 16:49:24", updated_at: "2018-12-14 17:39:18", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1606, award_name: "Chuan Ai Lu Engstrom Memorial Scholarship", subject_area: "Engineering; Business", level: nil, deadline: "2019-08-01", other_req: "Any current, full-time student of an accredited American university or college, with a minimum cumulative GPA of at least 2.5, is welcome to apply. There is no age requirement.  Write an essay of no fewer than 800 words about the topic: Discuss your vision of electronic design, engineering and manufacturing in the global economy.", sponsor: "PCB Solutions", amount: "$1,000", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.pcb-solutions.com/chuan-ai-lu-engstrom-memorial-scholarship/#", opportunity_type: "Scholarship", created_at: "2017-10-11 19:52:54", updated_at: "2019-05-30 19:57:51", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "robertsm"},
