    {id: 1608, award_name: "Thermaxx Jackets Scholarship", subject_area: "Engineering", level: nil, deadline: "2019-12-01", other_req: "The Thermaxx Scholarship is available to full-time undergraduate engineering or pre-engineering students pursuing a Bachelor of Science or trade school students in a course of study for the HVAC&R profession with a GPA of at least 2.5. Winner must be a full time student and a resident of the United States.", sponsor: "Thermaxx Jackets", amount: "$1,000", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.thermaxxjackets.com/about-us/thermaxx-scholarship/", opportunity_type: "Scholarship", created_at: "2017-10-11 22:28:03", updated_at: "2019-05-05 21:14:38", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-15", updated_by: "hobbsm"},
    {id: 1609, award_name: "TiMOTION Scholarship", subject_area: "Engineering; Technology", level: nil, deadline: "2018-12-01", other_req: "Full-time student enrolled in an Engineering, Ergonomics, or Technology-focused program at an accredited undergraduate university or college. Must provide transcripts indicating strong academic performance with a GPA of 3.0 or higher. Must provide information regarding extracurricular activities, volunteering opportunities, or other community-involvement experience.", sponsor: "TiMOTION", amount: "Varies", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.timotion.com/career/5", opportunity_type: "Scholarship", created_at: "2017-10-11 22:47:06", updated_at: "2019-07-17 23:00:56", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "19-20 offer not possibly updated; recheck again in Sept before delete", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "robertsm"},
    {id: 1610, award_name: "Military Child of the Year", subject_area: "Military Family", level: nil, deadline: "2018-12-05", other_req: "Operation Homefront's annual awards recognize six outstanding young people ages 13 to 18. Each of them represent a branch of the armed forces for their scholarship, volunteerism, leadership, extracurricular involvement, and other criteria while facing the challenges of military family life. Nominations may be made by parents, other family members, teachers, counselors, coaches, community officials, church leaders, neighbors and others.  Anyone may nominate a child for this award, so long as the child meets the following eligibility requirements:\r\nChild must be a legal military dependent.  Status confirmed by Military ID or DEERS enrollment form.\r\nChild must be between the ages of 13 and 18, at the time of nomination.", sponsor: "Operation Homefront", amount: "up to $10,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.militarychildoftheyear.org/", opportunity_type: "Scholarship", created_at: "2017-10-11 22:54:24", updated_at: "2018-09-20 21:02:44", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-10", updated_by: "walshm"},
    {id: 1611, award_name: "The Risk Management Association Scholarship", subject_area: "Business; Economics", level: nil, deadline: "2018-10-21", other_req: "The Risk Management Association Foundation (RMA Foundation) has established a scholarship program to assist students who have completed at least two years of college education who plan to continue their education at an accredited four-year college or university in the U.S. or Canada.  Must have an intent to work in the banking industry following graduation.", sponsor: "RMA Foundation", amount: "Varies", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.scholarsapply.org/rma/", opportunity_type: "Scholarship", created_at: "2017-10-16 18:37:27", updated_at: "2018-09-20 22:30:16", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "walshm"},
    {id: 1613, award_name: "Dunkin' Donuts Scholarship Program", subject_area: "All fields", level: nil, deadline: "2018-04-30", other_req: "The Dunkin’ Donuts Scholarship Program is open to high school seniors living in Rhode Island & Bristol County, Massachusetts who plan to enroll in full-time undergraduate study at an accredited two- or four-year college or university or vocational-technical school for the entire upcoming academic year.", sponsor: "Dunkin' Donuts", amount: "$10,000", state: "RI; MA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.scholarsapply.org/ddonuts/", opportunity_type: "Scholarship", created_at: "2017-10-16 21:21:39", updated_at: "2019-05-30 18:12:10", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-15", updated_by: "robertsm"},
    {id: 1615, award_name: "Data Processing Management Association Portland Chapter Scholarship", subject_area: "Computer Engineering; Information Technology", level: nil, deadline: "2018-05-31", other_req: "High school senior from Oregon or Clark County, Washington who enrolls in a major directly related to the Information Technology industry in Oregon or Washington.  In addition to the initial scholarship award, there is a potential for an additional $500 award for each subsequent year the recipient qualifies.", sponsor: "Data Processing Management Association Portland Chapter ", amount: "$1,000", state: "OR; WA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://dpmapc.com/how-do-i-apply/", opportunity_type: "Scholarship", created_at: "2017-10-16 23:05:21", updated_at: "2019-04-25 23:25:56", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Not offered 19-20 AY\r\nDelete if not offered 20-21", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 1616, award_name: "Government Finance Professional Development Scholarship", subject_area: "Accounting; Finance; Economics; Business", level: nil, deadline: "2019-01-18", other_req: "Part-time graduate level student who has been employed at least 2 years by one or more state or local government.  Recommendation by your employer and someone who can speak to your commitment to the public sector.   Course of Study: Public administration, (governmental) accounting, finance, economics, or business administration (with specific focus on government). ", sponsor: "GFOA", amount: "$10,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.gfoa.org/scholarships", opportunity_type: "Scholarship", created_at: "2017-10-16 23:25:21", updated_at: "2018-11-01 18:20:52", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 1617, award_name: "Making a Difference for Autism Scholarship", subject_area: "All fields", level: nil, deadline: "2020-04-27", other_req: "Must have an autism diagnosis (i.e. Aspergers, PDD-NOS, ASD, etc.)  By submitting an application, you are agreeing to let your essay potentially be published as part of a book to highlight members of the autism community.", sponsor: "KFMMakingADifference.org", amount: "$500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://kfmmakingadifference.org/scholarship-programs-for-adults-with-autism/", opportunity_type: "Scholarship", created_at: "2017-10-17 23:41:57", updated_at: "2019-05-30 18:11:05", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "3 scholarships per year.", respect_deadline: true, date_reopens: "2020-05-15", updated_by: "robertsm"},
    {id: 1618, award_name: "Stephen J. Brady Stop Hunger Scholarship", subject_area: "All fields", level: nil, deadline: "2018-12-05", other_req: "Must be between ages 5-25 as of October 5, 2018.  All applicants must have demonstrated an on-going commitment to their community by performing unpaid volunteer services impacting hunger in the US within the last 12 months. Each student selected as a national Stephen J. Brady Stop Hunger Scholarship recipient will receive a $5,000 scholarship, as well as a $5,000 grant made in their name to the hunger-related charity of their choice in their local community. If the student selected is in school, but is not yet enrolled in an institution of higher education, then in lieu of a scholarship, a contribution in the amount of $5,000 shall be made to a qualified 529 Plan established by the family of that student for the benefit of that student. ", sponsor: "Sodexo", amount: "$5,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://us.stop-hunger.org/home/grants.html", opportunity_type: "Scholarship", created_at: "2017-10-17 23:49:24", updated_at: "2018-10-18 18:32:13", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-05", updated_by: "walshm"},
    {id: 1620, award_name: "AvaCare Medical Scholarship", subject_area: "Nursing; Laboratory Science", level: nil, deadline: "2018-12-15", other_req: "Applicants must be pursuing a degree in the medical field such as therapy, nursing, medicine, nutrition, laboratory science, dentistry, etc.", sponsor: "AvaCare", amount: "$1,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://avacaremedical.com/scholarship", opportunity_type: "Scholarship", created_at: "2017-10-25 16:04:53", updated_at: "2018-10-18 23:08:07", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 1623, award_name: "Dwayne Graves Online Entrepreneur Spirit Scholarship", subject_area: "Business; Marketing; Computer Engineering; Communication; Entrepreneurship", level: nil, deadline: "2018-12-15", other_req: "Students applying must submit the URL of a video they’ve uploaded to YouTube where you explain why you deserve to win this scholarship. The video can be anything that you feel will compel us to choose your entry.  Tell us why you want to be an entrepreneur, what inspires you, and of course, show us your entrepreneur spirit!  Studying in the fields of Business, Marketing, Computer Science, Communications, or IT are recommended but not required.", sponsor: "dwaynegravesonline.com", amount: "$500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.dwaynegravesonline.com/scholarship/", opportunity_type: "Scholarship", created_at: "2017-10-25 17:33:23", updated_at: "2018-10-18 23:10:24", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 1625, award_name: "Scarlett Family Foundation Scholarship", subject_area: "Business; Accounting; Economics; Entrepreneurship; Finance; Marketing; STEM; Biology; Chemistry; Environmental Science; Physics; Computer Engineering; Engineering; Mathematics; Nursing", level: nil, deadline: "2018-12-15", other_req: "Scarlett Family Foundation Scholarships are open to high school seniors and college freshmen, sophomores, and juniors who will graduate or have graduated from a public, independent or homeschool association high school in 40 Middle Tennessee counties.  Must be majoring in business or STEM related fields (eligible majors are listed on the website).  Must demonstrate financial need.", sponsor: "Scarlett Family Foundation", amount: "up to $15,000 (renewable)", state: "TN", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://scarlettfoundation.org/Scholarships/", opportunity_type: "Scholarship", created_at: "2017-10-25 18:15:19", updated_at: "2018-09-20 22:31:34", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "walshm"},
    {id: 1626, award_name: "Senior Planning Social Work and Eldercare Award", subject_area: "Social Work", level: nil, deadline: "2019-07-31", other_req: "High School Senior or Undergraduate with less than 90 credit hours.", sponsor: "seniorplanning.org", amount: "$900", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.seniorplanning.org/senior-planning-social-work-eldercare-award/", opportunity_type: "Scholarship", created_at: "2017-10-25 18:19:46", updated_at: "2019-04-25 23:27:00", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "July 31 and December 15 deadlines.", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "hobbsm"},
    {id: 1627, award_name: "Tutor the People Pre-MBA Scholarship", subject_area: "Business", level: nil, deadline: "2019-08-01", other_req: "Undergraduate student who is planning to pursue an MBA.  Scholarship funds may be used towards your undergraduate degree or saved and applied to your future MBA.", sponsor: "Tutor the People", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://tutorthepeople.com/test-prep/gmat/#scholarships", opportunity_type: "Scholarship", created_at: "2017-10-25 18:28:11", updated_at: "2018-09-26 21:57:28", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
