    {id: 1630, award_name: "The National WWII Museum Essay Contest", subject_area: "All fields", level: nil, deadline: "2018-12-28", other_req: "Only the first 500 essays will be accepted.  Submit an essay responding to prompt on website.  There are two tracts (grades 5-8 and grades 9-12).", sponsor: "The National WWII Museum", amount: "$500 - $1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.nationalww2museum.org/students-teachers/school-programs/essay-contest", opportunity_type: "Scholarship", created_at: "2017-10-25 19:01:12", updated_at: "2018-09-20 22:32:51", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "walshm"},
    {id: 1632, award_name: "DocuTAP Scholarship", subject_area: "All fields", level: nil, deadline: "2018-12-02", other_req: "You must be currently enrolled in an accredited undergraduate program in the United States.\r\nApplicants must be 18 years or older and in good academic standing with their college or university.\r\nSubmit an essay - prompt on website.", sponsor: "DocuTAP", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://docutap.com/company/docutap-scholarship-program", opportunity_type: "Scholarship", created_at: "2017-10-26 18:08:21", updated_at: "2018-09-26 21:59:28", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 1635, award_name: "Fallen Heroes Scholarship", subject_area: "Military Family", level: nil, deadline: "2019-12-24", other_req: "Unmarried dependent children of  enlisted and commissioned men and women of the U.S. Coast Guard that lost  their lives in Coast Guard land, air, or sea operations.\r\nStudents applying to college or currently  in college may apply if working towards their first undergraduate degree  program, are listed in the CG DEERS system, and are under the age of 23 when  applying. \r\nApplicants must be a  college bound high school senior entering an accredited college or technical  school for the fall semester of this year; or a full-time undergraduate student  already enrolled in an accredited undergraduate program or technical school for  the fall semester of this year. If currently attending college, both high school  and college transcripts must be submitted.  ", sponsor: "Coast Guard Foundation", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://1coastguardfoundationscholars.communityforce.com/Funds/Search.aspx", opportunity_type: "Scholarship", created_at: "2017-10-26 19:28:31", updated_at: "2019-05-05 21:15:57", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 1636, award_name: "North American Van Lines Logistics Scholarship", subject_area: "Business; Logistics; Supply Chain Management", level: nil, deadline: "2019-12-15", other_req: "Submit a brief essay of between 400 and 800 words, detailing why a career in logistics/supply chain management is your college major of choice. ", sponsor: "North American Van Lines", amount: "$5,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.northamerican.com/scholarship", opportunity_type: "Scholarship", created_at: "2017-10-27 15:56:31", updated_at: "2019-05-05 21:16:39", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-15", updated_by: "hobbsm"},
    {id: 1638, award_name: "NACA Scholarship for Student Leaders", subject_area: "All fields", level: nil, deadline: "2018-12-31", other_req: "Only the first 75 applications received will be considered.  Applicants for the Scholarships for Student Leaders Program must:\r\n\r\n- Be matriculated undergraduate students in good standing at the time of the application and during the semester in which the award is received.\r\n- Hold significant leadership positions on their campuses.\r\n- Have made significant contributions to their campus communities.\r\n- Have demonstrated leadership skills and ability.", sponsor: "National Association for Campus Activities (NACA)", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://thenaca.wufoo.com/forms/wiqhljl1pw0oim/", opportunity_type: "Scholarship", created_at: "2017-10-27 17:36:57", updated_at: "2018-09-26 22:00:42", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 1639, award_name: "Alan Davis Scholarship", subject_area: "All fields", level: nil, deadline: "2019-06-30", other_req: "The Alan Davis Scholarship recipient possesses an inspired spirit and creative spark. This individual is innovative and forward thinking in regards to the events and opportunities available to the student body. The awarded scholar embodies the core qualities of both NACA and Fluent: creativity, originality, pride for his/her school and unparalleled ambition and vision. \r\n- Be matriculated full time undergraduate students, sophomore or higher, in good standing at the time of application and during the academic term in which the scholarship is awarded.\r\n- Maintain and GPA of 3.0 or higher.\r\n- Be active in at least two on-campus student organizations or activities and hold a significant leadership position in one organization.\r\n- Have demonstrated creative efforts (on or off campus).\r\n- Have made significant contributions to their campus communities.\r\n- Have demonstrated leadership skills and abilities.", sponsor: "NACA and Fluent", amount: "$5,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://thenaca.wufoo.com/forms/p1qvw5580gv181f/", opportunity_type: "Scholarship", created_at: "2017-10-27 17:39:23", updated_at: "2019-05-03 18:06:53", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
