    {id: 1651, award_name: "Mat-Su Health Foundation Scholarships", subject_area: "Nursing; Psychology; Business; Social Work; Non-Profit Management", level: nil, deadline: "2019-03-01", other_req: "The Mat-Su Health Foundation (MSHF) awards Academic Scholarships and Vocational Scholarships to residents of the Mat-Su Borough interested in pursuing health-related careers and nonprofit management careers.  Must be eligible for the Alaska Permanent Fund Dividend and complete a FAFSA.", sponsor: "Mat-Su Health Foundation", amount: "up to $20,000", state: "AK", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.healthymatsu.org/grants/scholarships", opportunity_type: "Scholarship", created_at: "2017-11-09 17:28:54", updated_at: "2019-01-03 16:52:27", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1652, award_name: "Pinnacol Foundation Scholarships", subject_area: "All fields", level: nil, deadline: "2019-02-15", other_req: "Be the natural child, adopted child, stepchild or full dependent of a worker who was injured or killed in a compensable work-related accident during the course and scope of employment with a Colorado-based employer and was entitled to receive benefits under the Colorado Workers’ Compensation Act. It doesn’t matter which insurance company covered your parent’s claim.  Must be between the ages of 16 and 25 at the time of the application deadline.", sponsor: "Pinnacol Foundation", amount: "varies", state: "CO", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.pinnacolfoundation.org/apply-scholarship", opportunity_type: "Scholarship", created_at: "2017-11-09 17:48:15", updated_at: "2018-10-30 16:38:26", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
