    {id: 1654, award_name: "Curtis E. Huntington Memorial Actuarial Scholarship", subject_area: "Business; Finance; Economics; Mathematics", level: nil, deadline: "2019-04-01", other_req: "The Scholarship is awarded annually to undergraduate students who will receive their degree in December 2018, spring/summer 2019 and no later than August 31, 2019. Students must be enrolled as a full-time student at a U.S. accredited educational institution, have successfully completed at least one actuarial examination, have a minimum cumulative GPA of 3.0 (on 4.0 scale) and must be nominated by a professor at their school (you can ask them to be nominated). ", sponsor: "Actuarial Foundation", amount: "$2,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://actfnd.academicworks.com/opportunities/125", opportunity_type: "Scholarship", created_at: "2017-11-10 17:01:06", updated_at: "2018-10-30 16:38:59", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 1655, award_name: "Actuarial Diversity Scholarship", subject_area: "Business; Finance; Mathematics; Minority", level: nil, deadline: "2019-03-01", other_req: "The Actuarial Diversity Scholarship promotes diversity within the profession through an annual scholarship program for Black/African American, Hispanic, Native North American and Pacific Islander students. The scholarship award recognizes and encourages the academic achievements of full-time undergraduate students pursuing a degree that may lead to a career in the actuarial profession. Each applicant must fulfill all the requirements listed: Must have at least one birth parent who is a member of one of the following minority groups: \r\nBlack/African American, Hispanic, Native North American, Pacific Islander. Enrolling as or enrolled as a full-time undergraduate student at a U.S. accredited educational institution. Minimum GPA of 3.0 (on a 4.0 scale), emphasis on math or actuarial courses. Entering college freshmen must have a minimum ACT math score of 28 or SAT math score of 620. Intent on pursuing a career in the actuarial profession.", sponsor: "Actuarial Foundation", amount: "Varies by grade level", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://actfnd.academicworks.com/opportunities/126", opportunity_type: "Scholarship", created_at: "2017-11-10 17:16:07", updated_at: "2018-10-30 16:39:39", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
