    {id: 1660, award_name: "The McConnell Foundation Scholars Program", subject_area: "All fields", level: nil, deadline: "2019-03-05", other_req: "The purpose of The McConnell Foundation Scholars Program is to identify and support students qualified to bring about positive change in their communities. Ideal candidates are high-achieving students, are among the first generation in their family to attend college, have overcome personal challenges, have positive influence on younger siblings or community members, and demonstrate commitment to the values of giving back and caring for others. Special consideration is given for those who have overcome significant challenges such as homelessness, participation in the foster-care system, or multi-generational poverty. Other excellent candidates are high-achieving students who come from more advantaged backgrounds, but who are very aware of their advantages and have shown extraordinary personal commitment to serving others. Must live or attend high school in our service area of Modoc, Shasta, Siskiyou, Tehama or Trinity County or you attend Big Valley High School in Lassen County or Hoopa Valley High School in Humboldt County.  Your EFC from the FAFSA or the California Dream Act Application is $8,600 or less.", sponsor: "The McConnell Foundation", amount: "up to $7,500 (renewable)", state: "CA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.mcconnellfoundation.org/mcconnell-scholars-program/", opportunity_type: "Scholarship", created_at: "2017-11-10 18:54:24", updated_at: "2018-10-30 16:40:51", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 1661, award_name: "The Springboard Foundation Scholarships", subject_area: "All fields", level: nil, deadline: "2019-06-15", other_req: "The Springboard Foundation is proud to extend scholarships to full-time college students who have documented disabilities of any type that are protected under the ADA and or the Rehabilitation Action of 1973. Our scholarship recipients attend colleges and universities across the United States and have a GPA of 3.0 or above. We expect our Springboard Foundation Scholarship recipients to Achieve, Give Back and Make an Impact!", sponsor: "The Springboard Foundation", amount: "Varies", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://thespringboardfoundation.org/#who-we-help", opportunity_type: "Scholarship", created_at: "2017-11-10 18:58:43", updated_at: "2019-03-29 23:04:46", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
