    {id: 1664, award_name: "Watson-Brown Foundation", subject_area: "All fields", level: nil, deadline: "2019-02-15", other_req: "Eligible students must be from one of the 18 counties listed: Burke (GA), Columbia (GA), Elbert (GA), Glascock (GA), Hart (GA), Jefferson (GA), Lincoln (GA), McDuffie (GA), Richmond (GA), Taliaferro (GA), Warren (GA), Wilkes (GA), Aiken (SC), Abbeville (SC), Edgefield (SC), Greenville (SC), McCormick (SC), or Spartanburg (SC). Current high school seniors or current undergraduate students may apply for the scholarship. Students must plan to attend a 4 year, accredited, non-profit college.", sponsor: "Watson Brown Foundation", amount: "$3,000", state: "GA; SC", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.watson-brown.org/scholarship/", opportunity_type: "Scholarship", created_at: "2017-11-10 19:18:36", updated_at: "2018-10-30 16:41:30", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
