    {id: 1667, award_name: "Senior Caregiver Scholarship", subject_area: "All, Nursing", level: nil, deadline: "2019-07-15", other_req: "Students must be attending a two or four year university or college in the Spring of 2019. They must have been involved in caregiving for a family member or friend. SeniorAdvice.com employees and their family members are not eligible to apply for this scholarship.", sponsor: "SeniorAdvice.com", amount: "$2,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.senioradvice.com/senior-caregiver-scholarship-spring-2019", opportunity_type: "Scholarship", created_at: "2017-11-13 17:22:12", updated_at: "2019-05-03 18:12:46", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "two scholarships a year, 1/15 & 7/15", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "hobbsm"},
    {id: 1668, award_name: "HRIS Payroll Software Scholarship", subject_area: "Business, Human Resources, Organizational Development", level: nil, deadline: "2018-02-15", other_req: "Be currently enrolled at an accredited college or university in the United States of America (U.S.) or living in the U.S. and attending an accredited online college or university. Be pursuing an undergraduate or graduate degree in Human Resources or an HR-related program. Business, Organizational Development, and Labor Relations are examples of qualifying degree programs.Have completed at least one HR management course and have a cumulative grade point average of at least 2.5 on a 4.0 scale if you are an undergraduate student. Be enrolled in or have completed at least one HR class with at least a 3.00 cumulative grade point average on a 4.0 scale if you are a graduate student.", sponsor: "HRIS Payroll Software", amount: "$1,000", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.hrispayrollsoftware.com/hr-scholarship/", opportunity_type: "Scholarship", created_at: "2017-11-13 17:29:38", updated_at: "2019-03-29 23:06:57", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Not offered in 2019-2020 AY; check back", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
    {id: 1669, award_name: "St. Andrew's Society Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-01", other_req: "An applicant for a St. Andrew’s Society Scholarship must be a graduating high school senior from\r\nOregon or Clark County, Washington AND applicants must be one of the following:\r\n1. Born in Scotland, OR\r\n2. The child or grandchild or someone born in Scotland, OR\r\n3. Someone who has demonstrated substantial commitment to Highland dancing, piping, drumming,\r\nor playing the Celtic harp or the Highland fiddle. \r\n\r\nTo get to application, click on \"Scholarship Through OCF\"", sponsor: "Oregon Community Foundation and St. Andrew's Society", amount: "Varies", state: "OR; WA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.oregoncf.org/grants-scholarships/scholarships", opportunity_type: "Scholarship", created_at: "2017-11-15 22:59:18", updated_at: "2018-11-15 23:43:03", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-15", updated_by: "walshm"},
    {id: 1673, award_name: "Seneca Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-01", other_req: "Applicants must be a senior in an Oregon high school institution, or a student pursuing a high school diploma or general education degree at an equivalent grade level, and a legal Oregon resident.\r\n\r\nThe awardee of the Seneca Scholarship will be chosen solely based on what we judge to be the most outstanding essay.", sponsor: "Seneca Sawmill", amount: "$10,000", state: "OR", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.senecascholarship.org/", opportunity_type: "Scholarship", created_at: "2017-12-05 17:23:16", updated_at: "2018-10-30 16:45:29", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 1674, award_name: "Men's Italian American Civic League Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-15", other_req: "An applicant must be of recent Italian ancestry and a graduate of a Utah High School in the current graduating year.  This scholarship is awarded based on ACT/SAT, high school academic ability and extracurricular activity involvement, and Italian heritage and involvement with an Italian Cultural Organization. Scholarships are awarded by both Men’s and Women’s Chapters of the Italian American Civic League. You are encouraged to apply for each chapter’s scholarship. However, one recipient may not receive both scholarships.", sponsor: "Men's Italian American Civic League", amount: "Varies", state: "UT", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://italianamericancivicleague.com/scholarships/", opportunity_type: "Scholarship", created_at: "2018-01-09 23:25:57", updated_at: "2019-01-11 18:50:23", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-10", updated_by: "walshm"},
    {id: 1675, award_name: "CPR Near Me Scholarship", subject_area: "Education; Nursing", level: nil, deadline: "2019-09-01", other_req: "CPR Near Me has created a Scholarship Program that is for all students who are either currently studying or aspiring to study healthcare or education.  Must be at least 18 years of age and studying in the United States.  This scholarship has a rolling monthly deadline (new application period each month).", sponsor: "CPR Near Me, healthery", amount: "$250", state: "All", min_gpa: "2.8", contact: "financial.aid@example.edu", keywords: nil, website: "https://healthery.com/scholarship/", opportunity_type: "Scholarship", created_at: "2018-01-10 00:00:45", updated_at: "2019-08-01 18:11:37", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "The scholarship will be awarded on a monthly basis", respect_deadline: true, date_reopens: "2019-09-02", updated_by: "robertsm"},
    {id: 1676, award_name: "Tillamook Branch AAUW University Scholarship", subject_area: "All fields; STEM", level: nil, deadline: "2019-03-15", other_req: "The applicant must be a female resident of Tillamook County attending, or intending to attend, a four-year university or college during the academic year. The applicant must supply a high school and/or college academic transcript to the AAUW Scholarship Committee. The applicant must have earned a minimum 3.0 grade point average (GPA) on high school or college coursework. \r\n\r\nPreference will be given to candidates pursing STEM fields.\r\n\r\n", sponsor: "Tillamook Branch American Association For University Women ", amount: "$2,250", state: "OR ", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://tillamook-or.aauw.net/", opportunity_type: "Scholarship", created_at: "2018-01-10 19:10:52", updated_at: "2019-01-24 18:01:55", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 1677, award_name: "Autauga Area Community Foundation Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-01", other_req: "Multiple scholarships for students from Alabama - criteria varies by scholarship", sponsor: "Autauga Area Community Foundation ", amount: "Varies", state: "AL", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.aacfinfo.org/scholarships.html", opportunity_type: "Scholarship", created_at: "2018-01-10 20:31:21", updated_at: "2018-12-14 17:43:09", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "walshm"},
    {id: 1678, award_name: "American Council of Engineering Companies Scholarship", subject_area: "Engineering", level: nil, deadline: "2019-03-15", other_req: "Students must be entering their junior, senior, fifth, or master's degree year in the fall studying engineering.  Applications are submitted to the state Member Organizations (contact information on website) and the state organizations forward their top applications for consideration.", sponsor: "American Council of Engineering Companies (ACEC)", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.acec.org/awards-programs/scholarships/", opportunity_type: "Scholarship", created_at: "2018-01-10 21:45:19", updated_at: "2019-01-03 16:53:54", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1679, award_name: "ADA Central Annual College Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-01", other_req: "Write an original essay about your experiences with, or what the Americans with Disabilities Act (ADA) means to you. The essay must be between 750-1,000 words.", sponsor: "ADA Central", amount: "$500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://adacentral.com/ada-central-annual-college-scholarship.html", opportunity_type: "Scholarship", created_at: "2018-01-10 21:48:35", updated_at: "2019-03-14 14:52:07", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "hobbsm"},
    {id: 1680, award_name: "Bodie McDowell Scholarship", subject_area: "Communication; Journalism", level: nil, deadline: "2019-03-01", other_req: "Each candidate should have clear, significant goals in outdoor communications, examples of work and letters of recommendation. Academic achievement is considered but is not among the top three selection criteria.", sponsor: "Outdoor Writers Association of America", amount: "Up to $5,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://owaa.org/programs/scholarships-fellowships/bodie-mcdowell-scholarship/", opportunity_type: "Scholarship", created_at: "2018-01-10 21:58:39", updated_at: "2019-01-03 16:54:26", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1682, award_name: "Knights of Columbus Scholarships", subject_area: "All fields", level: nil, deadline: "2019-03-01", other_req: "US applicants must apply to a Catholic college or university.  Undergraduate scholarships are awarded to incoming freshmen and are normally renewed for a total of four years. Applications must be requested (form on website).", sponsor: "Knights of Columbus", amount: "varies (renewable)", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.kofc.org/uns/en/members/programs/scholarships/index.html", opportunity_type: "Scholarship", created_at: "2018-01-10 23:52:30", updated_at: "2018-10-18 23:12:00", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 1683, award_name: "Baton Rouge Area Foundation Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-01", other_req: "Multiple scholarships for students from Louisiana, see specific scholarships for criteria", sponsor: "Baton Rouge Area Foundation", amount: "varies", state: "LA", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.brafscholarships.org/", opportunity_type: "Scholarship", created_at: "2018-01-11 00:01:07", updated_at: "2019-01-03 16:57:06", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1684, award_name: "SEMA Automotive Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-01", other_req: "Pursuit of degree or certification that leads to a career in automotive. All disciplines welcome.", sponsor: "SEMA", amount: "up to $5,000", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.sema.org/scholarships/", opportunity_type: "Scholarship", created_at: "2018-01-11 00:22:50", updated_at: "2018-10-30 16:44:34", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 1685, award_name: "\"Stand Up Men\" Award", subject_area: "All fields", level: nil, deadline: "2019-01-20", other_req: "Submit your original 3 to 6 minute film on any man you know who is taking a stand to prevent violence against women and/or standing up for women's rights.\r\n\r\nYou may want to profile and interview athletes who are getting involved in this issue, who are changing attitudes and preventing violence against women.\r\n\r\nYou may want to profile men who are working to unlearn gender bias.\r\n\r\nYou may want to explore ideas such as: What is the best way for men to stand in support of women without coopting the conversation of male violence against women?\r\n\r\nYou might want to address what role male musicians and artists play in tackling the rampant objectification of women in media or you may want to profile a male musician who is taking a stand against misogynistic lyrics.", sponsor: "connecther, Girls Impact the World Film Festival", amount: "$2,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.connecther.org/gitw/standupmen", opportunity_type: "Scholarship", created_at: "2018-01-11 00:29:32", updated_at: "2018-10-30 16:46:47", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 1686, award_name: "Bridging the Dream Scholarship", subject_area: "All Fields ", level: nil, deadline: "2019-02-15", other_req: "The Sallie Mae Bridging the Dream Scholarship Program for Graduate Students Contest is open only to  legal residents of the fifty (50) United States, Puerto Rico and the District of Columbia who are currently enrolled or plan to enroll in at least half-time postgraduate study at an accredited two- or four-year college or university in the United States for the entire academic year; are over the age of majority in the jurisdiction in which they reside; and have a minimum grade point average of 3.0 on a 4.0 scale. See website for essay prompts.", sponsor: "Sallie Mae", amount: "$20,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.salliemae.com/landing/bridging-the-dream-for-graduates/?dtd_cell=SMPLCADCOTDOOTOTOTHOTHRN010014", opportunity_type: "Scholarship", created_at: "2018-01-12 18:00:57", updated_at: "2019-01-11 18:43:38", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-05", updated_by: "walshm"},
    {id: 1687, award_name: "Tortoise Young Entrepreneurs Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-01", other_req: "The Tortoise Young Entrepreneurs Scholarship seeks to award students who have typically started their own business or have drafted a detailed business plan.  Be a permanent resident of Kansas or Missouri who is enrolled or plans to enroll in a full-time undergraduate course of study towards a bachelor's degree. Recommended minimums include a 3.3 grade-point average (on a 4.0 scale) and a minimum 24 ACT or minimum SAT score of 1680 (including writing section).  Applicants will be judged on demonstrated entrepreneurial success/accomplishments, academic record, extracurricular activity and anticipated future potential.", sponsor: "Tortoise Capital Advisors", amount: "up to $3,000", state: "KS; MO", min_gpa: "3.3", contact: "financial.aid@example.edu", keywords: nil, website: "http://tortoiseadvisors.com/scholarship/", opportunity_type: "Scholarship", created_at: "2018-01-12 23:28:27", updated_at: "2019-03-14 14:53:05", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "hobbsm"},
    {id: 1688, award_name: "Kaplun Essay Contest", subject_area: "All fields", level: nil, deadline: "2019-03-03", other_req: "Submit an essay, prompt on website.  Contest is open to students in grades 7 - 12 at two levels (grades 7-9 and 10-12).  ", sponsor: "The Morris J & Betty Kaplun Foundation", amount: "up to $1,800", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.kaplunfoundation.org/upload/essay.html", opportunity_type: "Scholarship", created_at: "2018-01-12 23:37:20", updated_at: "2018-11-30 21:12:27", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 1689, award_name: "Chicago Roofing Contractors Association Scholarship", subject_area: "Liberal Arts; Science; Engineering; Business", level: nil, deadline: "2019-03-01", other_req: "Must be a high school senior, accepted into an undergraduate degree program in one of the following fields of study - liberal arts and sciences, engineering, architecture, or business.  Must be a US citizen residing in Cook or other area counties with an ACT composite of 29 or greater or SAT equivalent.", sponsor: "Chicago Roofing Contractors Association (CRCA)", amount: "$4,000 (renewable)", state: "IL", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.crca.org/crca_scholarship/index.htm", opportunity_type: "Scholarship", created_at: "2018-01-12 23:42:21", updated_at: "2019-01-03 16:58:40", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1690, award_name: "Growing Up Asian in America Scholarship", subject_area: "Minority", level: nil, deadline: "2019-05-01", other_req: "You must live in Alameda, Contra Costa, Marin, Napa, San Francisco, San Mateo, Santa Clara, Solano or Sonoma County. Students of all backgrounds including Chinese, Filipino, Indian, Japanese, Korean, Vietnamese, and other Asian, Pacific Islander and multiracial ethnicities are invited to submit entries. There are three categories (art, essay and video) and applicants may submit one entry in each category.", sponsor: "Asian Pacific Fund", amount: "$500", state: "CA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://asianpacificfund.org/what-we-do/awards/growing-up-asian-in-america/", opportunity_type: "Scholarship", created_at: "2018-01-12 23:54:05", updated_at: "2019-01-24 18:56:55", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "walshm"},
    {id: 1691, award_name: "Tzu Chi USA Scholars", subject_area: "All fields", level: nil, deadline: "2019-03-01", other_req: "Tzu Chi USA Scholars are selected on the basis of their financial need, academic achievement, and community involvement. ", sponsor: "Buddhist Tzu Chi Foundation", amount: "$1,000", state: "All", min_gpa: "3.0", contact: "fianid@up.edu", keywords: nil, website: "http://www.tzuchi.us/scholarships/", opportunity_type: "Scholarship", created_at: "2018-01-13 00:01:52", updated_at: "2019-01-03 16:59:16", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1692, award_name: "Joe Cleres Scholarship", subject_area: "All fields", level: nil, deadline: "2018-03-15", other_req: "Provides financial assistance to physically or intellectually challenged students.  Application is towards bottom of the page.", sponsor: "New Outlook Pioneers", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.newoutlookpioneers.org/", opportunity_type: "Scholarship", created_at: "2018-01-15 18:12:16", updated_at: "2019-05-30 17:56:24", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "Web page looks inactive 3/2019", respect_deadline: true, date_reopens: "2020-06-15", updated_by: "robertsm"},
    {id: 1693, award_name: "Live Deliberately Essay Contest", subject_area: "All fields", level: nil, deadline: "2019-03-15", other_req: "Each year, the Live Deliberately Essay Contest invites youth from around the world, ages 14-21, to consider a selected Henry David Thoreau quotation and accompanying prompt. Contestants are asked to write a thoughtful essay that uses personal experience and observation to demonstrate how that year's quotation and prompt relate to their own lives and to the world around them. Like Thoreau, these young people use the power of their words to convey vivid stories, personal conviction and human compassion.", sponsor: "The Thoreau Institute at Walden Woods", amount: "$250", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.walden.org/education/essay-contest/", opportunity_type: "Scholarship", created_at: "2018-01-15 18:18:09", updated_at: "2019-01-03 17:01:44", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1694, award_name: "Joseph James Morelli Scholarship", subject_area: "STEM; Science; Technology; Engineering; Mathematics", level: nil, deadline: "2019-03-14", other_req: "To be eligible to apply for a Joseph James Morelli Scholarship, you must meet the following requirements: High school or college student who is pursuing a career in STEM: science, technology, engineering, or math. Have a demonstrated learning disability of dyslexia, dysgraphia, and/or dyscalculia", sponsor: "Park City Community Foundation", amount: "up to $2,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://parkcitycf.org/morelli/", opportunity_type: "Scholarship", created_at: "2018-01-15 18:22:50", updated_at: "2019-01-03 17:02:07", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1695, award_name: "Richard Holland Memorial Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-15", other_req: "High school applicants must have a minimum 3.5 GPA, college applicants a 3.0.  The selection board will evaluate applications considering the following criteria: prior academic performance, SAT/ACT scores, demonstrated leadership and personal attributes, applicant's goals and aspirations, extracurricular activities, awards and recognition, special talents and other noteworthy activities, recommendations, community service and work history, and financial need.", sponsor: "Holland Family Legacy Foundation", amount: "$2,500 (renewable)", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.rjhollandscholarship.org/", opportunity_type: "Scholarship", created_at: "2018-01-15 18:33:33", updated_at: "2019-01-03 17:03:02", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1696, award_name: "RCI Foundation Scholarships", subject_area: "Engineering", level: nil, deadline: "2019-02-28", other_req: "Be a current undergraduate or graduate student who has completed a minimum of 24 credit hours and is planning to enroll full-time at an accredited college, university or vocational-technical school for the entire 2018-19 academic year in an accredited program of architecture, engineering, construction or building sciences leading to a career in the construction or building envelope industry.", sponsor: "RCI Foundation", amount: "Varies", state: "All; Canada", min_gpa: "2.75", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.scholarsapply.org/rcif/", opportunity_type: "Scholarship", created_at: "2018-02-05 17:21:36", updated_at: "2019-01-11 18:35:48", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-03", updated_by: "walshm"},
    {id: 1697, award_name: "iQ Credit Union Scholarship Application", subject_area: "All fields ", level: nil, deadline: "2019-03-09", other_req: "Must be a primary member of iQ Credit Union prior to applying for scholarship. Be a graduating high school senior or have completed high school equivalency. Be enrolling at a community college or 4-year university for the fall of 2018 as either a freshman or continuing student. Have a 3.0 cumulative GPA. Plan to enroll as a full-time student (12 credits or more per quarter, or 13 credits or more per semester) for the upcoming academic year. Be intent upon completing an academic transfer, baccalaureate or graduate program, depending upon the\r\nscholarship for which the application is being considered.", sponsor: "iQ Credit Union ", amount: "$2,000", state: "WA", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://iqcu.com/community", opportunity_type: "Scholarship", created_at: "2018-02-08 18:06:43", updated_at: "2019-01-03 17:03:20", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1698, award_name: "The Home Team Hawaii Scholarship", subject_area: "All fields", level: nil, deadline: "2018-08-01", other_req: "Please write a 1500-2000 word essay about a life changing experience. How did this experience change you as an individual? What lessons did you learn from this experience? ", sponsor: "Home Team Hawaii", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.hawaiipropertyfinder.com/blog/detail/5/1/The_Home_Team_Hawaii_Scholarship", opportunity_type: "Scholarship", created_at: "2018-02-19 17:45:43", updated_at: "2019-03-14 14:58:03", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Not offered 2019-2020 AY", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1699, award_name: "Empowered Future Teachers Scholarship", subject_area: "Elementary Education; Special Education; MAT; MED", level: nil, deadline: "2019-06-30", other_req: "Must be pursuing a career as a preschool-5th grade teacher (any discipline) and age 17 or older.", sponsor: "Education.com", amount: "$10,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.education.com/scholarships/", opportunity_type: "Scholarship", created_at: "2018-02-19 18:00:11", updated_at: "2019-05-03 18:15:41", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "two deadlines per year", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "hobbsm"},
    {id: 1700, award_name: "Paradise Ridge Scholarship", subject_area: "All fields", level: nil, deadline: "2019-12-31", other_req: "In 750 words or less, describe a plan that you would implement to grow a small business using technology.", sponsor: "Paradise Ridge Dentistry", amount: "$1,000", state: "All", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://phoenixarizonadentistry.com/paradise-ridge-scholarship/", opportunity_type: "Scholarship", created_at: "2018-02-19 18:13:02", updated_at: "2019-03-29 23:10:49", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "This was offered in June and Dec in 2019.", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "hobbsm"},
    {id: 1701, award_name: "Michael Moody Fitness Scholarship", subject_area: "Nursing; Biology", level: nil, deadline: "2019-07-15", other_req: "Be current high school senior, undergraduate, or graduate students who plan to enroll full-time in an accredited two-year or four-year college or university in the United States for the entire 2018-2019 academic year. Demonstrate ambition and self-drive as evidenced by outstanding achievement in school, and participation and leadership in school activities and work experience. Demonstrate interest in pursuing a career in a related health and fitness related field (including medicine, nursing, physical therapy, education, fitness, nutrition, biology, kinesiology, dentistry, and more). Be enrolled in the following majors: Athletic Training, Personal Training, Physical Education Teaching and Coaching, Health and Physical Fitness, Exercise Science, Sports and Recreation Management, Health Sciences, Physical Therapist, or another related major.  Only the first 1,000 applications will be considered.", sponsor: "Michael Moody Fitness", amount: "$1,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.michaelmoodyfitness.com/student-scholarship-chicago/", opportunity_type: "Scholarship", created_at: "2018-02-19 18:21:46", updated_at: "2019-07-17 23:02:22", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-15", updated_by: "robertsm"},
    {id: 1702, award_name: "Northwestern Mutual Childhood Cancer Sibling Scholarship", subject_area: "All fields", level: nil, deadline: "2018-03-30", other_req: "To apply, students must be U.S. citizens, 25 years or younger and siblings of individuals who are in current treatment, have survived or passed away from pediatric childhood cancer. Applicants must plan to enroll in full-time undergraduate study at an accredited two- or four-year college, university or vocational-technical school for the entire upcoming academic year. Students must have a minimum grade point average of 2.5 on a 4.0 scale (or the equivalent) and demonstrate financial need.", sponsor: "Northwestern Mutual", amount: "$5,000", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.scholarsapply.org/nmsibling/", opportunity_type: "Scholarship", created_at: "2018-02-23 18:10:16", updated_at: "2019-03-29 23:11:45", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "hobbsm"},
    {id: 1703, award_name: "Bernie Varnadore Baseball Scholarship Program", subject_area: "All fields", level: nil, deadline: "2019-04-01", other_req: "Outstanding High School Seniors who have participated in a franchised Dixie Boys Baseball, Incorporated program and plan to pursue undergraduate studies at a college or university may apply. Dixie Boys Baseball, Incorporated programs include Dixie Boys Baseball for boys 13 and 14 years old; Dixie Pre-Majors Baseball for boys 15 thru 17 years old; and Dixie Majors Baseball for boys 15 thru 19 years old.  Application is under \"News\" in the top menu.\r\n", sponsor: "Dixie Baseball", amount: "$1,250", state: "AL; AR; FL; GA; LA; MS; NC; SC; TN; TX; VA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://baseball.dixie.org/", opportunity_type: "Scholarship", created_at: "2018-02-26 17:37:37", updated_at: "2019-01-03 17:04:10", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1704, award_name: "Bachelor's Degree Scholarship in Communication and Journalism", subject_area: "Communication; Journalism", level: nil, deadline: "2019-04-01", other_req: "Selection is based on academic history, extracurricular activities, and employment history. Eligible students must be full-time students during the academic year the scholarship is received. Financial need is not considered.", sponsor: "Learn.org", amount: "$500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://learn.org/pages/Communications_and_Journalism_Bachelors_Degree_Scholarship.html", opportunity_type: "Scholarship", created_at: "2018-02-26 17:42:13", updated_at: "2019-03-14 14:58:50", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
