    {id: 1707, award_name: "Master's Degree Scholarship in Education and Teaching", subject_area: "Education, Teaching; Educational Leadership", level: nil, deadline: "2019-04-01", other_req: "Selection is based on academic history, extracurricular activities, and employment history. Eligible students must be full-time students during the academic year the scholarship is received. Financial need is not considered.", sponsor: "Learn.org", amount: "$500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://learn.org/pages/Education_and_Teaching_Masters_Degree_Scholarship.html", opportunity_type: "Scholarship", created_at: "2018-02-26 17:48:16", updated_at: "2019-03-14 14:59:59", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1708, award_name: "Herman J. Smith Scholarship", subject_area: "Engineering; Business", level: nil, deadline: "2019-03-31", other_req: "The applicant must be registered as a full-time undergraduate or graduate student for the Fall 2018 term and have at least one full academic year of course work remaining after the scholarship is awarded. Note: Students who will be a fifth year senior during the award year are NOT eligible.  The applicant must demonstrate an interest in obtaining employment in the construction industry, mortgage finance, or a construction related field upon graduation.", sponsor: "National Housing Endwoment", amount: "Varies", state: "TX", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.nationalhousingendowment.org/page.aspx/generic/sectionID=2569/channelID=17352", opportunity_type: "Scholarship", created_at: "2018-02-26 18:20:44", updated_at: "2019-03-27 20:29:05", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1709, award_name: "My 2 Sons: John/Sean Memorial Scholarship", subject_area: "Minority", level: nil, deadline: "2019-04-01", other_req: "Must be an ethnic minority student who resides in Chicago and surrounding suburbs.", sponsor: "Giving God the Glory Ministries", amount: "$1,000", state: "IL", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.gggministries.com/scholarship-1.html", opportunity_type: "Scholarship", created_at: "2018-02-26 18:26:30", updated_at: "2019-01-03 17:05:18", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1710, award_name: "Polish American Arts Association of Washington DC Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-01", other_req: "Applicant must be an American Citizen, either by birth or naturalization. Consideration will also be given to ten-year green card permanent residents who express desire to one day become Unites States citizens.\r\nApplicant must be of Polish or Polish-American descent and demonstrate his/her descent with a family tree.\r\nApplicant must be a resident of Washington D.C.; Maryland or Virginia or be a student at an institution in one these jurisdictions. Applicant must be a full time college student, currently enrolled at an accredited college or university in the United States, with confirmed future attendance at an institution in the summer or fall semester. Applicant must describe his/her involvement with the Polish community - past, present, or future.", sponsor: "Polish American Arts Association", amount: "up to $5,000", state: "MD; VA; DC", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.paaa.us/scholarship/", opportunity_type: "Scholarship", created_at: "2018-02-26 18:30:52", updated_at: "2019-03-27 20:29:48", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1711, award_name: "Wergle Flomp Humor Poetry Contest", subject_area: "All fields", level: nil, deadline: "2019-04-01", other_req: "This contest seeks today's best humor poems.  Submit published or unpublished work, length limit: 250 lines.", sponsor: "Winning Writers", amount: "up to $1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://winningwriters.com/our-contests/wergle-flomp-humor-poetry-contest-free", opportunity_type: "Scholarship", created_at: "2018-02-26 23:34:45", updated_at: "2018-08-29 22:16:29", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-08-15", updated_by: "walshm"},
    {id: 1712, award_name: "CRSI Foundation Scholarship", subject_area: "Civil Engineering", level: nil, deadline: "2018-04-03", other_req: "Applicants must be qualified senior students during the entire scholarship period, and enrolled in a Civil\r\nEngineering, Construction Engineering, or Architectural Engineering curriculum which is accredited by the\r\nAccreditation Board for Engineering and Technology (ABET).  Applicants should demonstrate a career goal in becoming employed in the reinforced concrete construction industry.", sponsor: "Concrete Reinforcing Steel Institute (CRSI)", amount: "$3,000", state: "All", min_gpa: "3.25", contact: "financial.aid@example.edu", keywords: nil, website: "http://crsi-foundation.org/index.cfm/scholarships/programs", opportunity_type: "Scholarship", created_at: "2018-02-26 23:52:12", updated_at: "2019-03-29 23:12:54", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "No offered in spring 2019; check back", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "hobbsm"},
    {id: 1714, award_name: "Brown & Kysar, Inc. Engineering Scholarship", subject_area: "Engineering", level: nil, deadline: "2018-06-30", other_req: "Our goal is to further engineering education in the Pacific Northwest. All engineering students presently enrolled in colleges or universities in Oregon and Washington; all engineering disciplines are eligible to apply. ", sponsor: "Brown & Kysar, Inc.", amount: "$1,500", state: "OR, WA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "", opportunity_type: "Scholarship", created_at: "2018-03-08 17:00:29", updated_at: "2019-03-27 20:34:53", citizenship: "No Requirement", website_link_text: "https://bki.cc/careers/", is_published: true, admin_notes: "scholarship not offered for 2019-2020 AY", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1715, award_name: "ESA Youth Scholarship", subject_area: "All fields", level: nil, deadline: "2019-03-01", other_req: "Scholarships to Support the Futures of the Sons and Daughters of First Responders.  Parent or guardian must be an active duty police officer, firefighter, paramedic, or EMT (public sector).  Applicants must be at least 15 and not older than 20.  Awards are based on a combination of academic achievement, national test scores, extracurricular participation and the essay. In addition to completing the application and submitting the appropriate documentation, each student must write an essay explaining “What it means to me to have my parent or guardian involved in securing our community.”  ", sponsor: "Electronic Security Association (ESA)", amount: "up to $7,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://esaweb.org/Programs/Youth-Scholarship", opportunity_type: "Scholarship", created_at: "2018-03-08 20:02:29", updated_at: "2019-03-29 23:14:35", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "hobbsm"},
    {id: 1716, award_name: "America's 911 Foundation College Scholarship Fund", subject_area: "All fields", level: nil, deadline: "2020-03-19", other_req: "Any child of active First Responders.  First Responders can be Either Volunteer or Paid.", sponsor: "America's 911 Foundation", amount: "$2,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.americas911foundation.org/scholarship/scholarship_main.html", opportunity_type: "Scholarship", created_at: "2018-03-08 20:12:08", updated_at: "2019-03-27 20:36:36", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-31", updated_by: "hobbsm"},
    {id: 1717, award_name: "Federal Law Enforcement Officers Scholarship", subject_area: "All fields", level: nil, deadline: "2019-06-28", other_req: "High school senior who is the child of a current, retired or deceased member of the Federal Law Enforcement Officers Association", sponsor: "Federal Law Enforcement Officers Association (FLEOA)", amount: "up to $1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.fleoa.org/scholarshipapplication.aspx", opportunity_type: "Scholarship", created_at: "2018-03-08 20:20:25", updated_at: "2019-05-03 18:16:47", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 1718, award_name: "First Responders Children's Foundation Scholarship", subject_area: "All fields", level: nil, deadline: "2019-07-01", other_req: "The First Responders Children’s Foundation awards scholarships to children of law enforcement officers or firefighters lost in the line of duty or permanently disabled in the line of duty. These awards recognize financial need as well as academic and overall achievement and help students by providing financial support for their education at qualified institutions.  Multiple scholarships available with different qualifications.", sponsor: "First Responders Children's Foundation", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://nleafcf.org/scholarships/", opportunity_type: "Scholarship", created_at: "2018-03-08 20:25:34", updated_at: "2019-05-04 16:35:48", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 1720, award_name: "NASA Graduate Student Researchers Program", subject_area: "Research; Earth Science; Space Science; Physics; Math", level: nil, deadline: "2018-02-01", other_req: "This program supports graduate students in basic and applied research in Earth science and space science. Students are offered $45,000 per year for up to three years. Candidates must be enrolled in a full-time Master's or Doctoral degree program.", sponsor: "NASA", amount: "$45,000", state: "All", min_gpa: "", contact: "scholars@up.edu", keywords: nil, website: "https://science.nasa.gov/learners/learner-opportunities#gradops", opportunity_type: "Scholarship", created_at: "2018-03-21 23:02:27", updated_at: "2018-03-21 23:04:13", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-11-01", updated_by: "honstu1"},
    {id: 1721, award_name: "American Association of Colleges of Nursing Scholarship", subject_area: "Nursing", level: nil, deadline: "2019-09-30", other_req: "Please note that all applicants must already be enrolled (not just accepted) at an AACN member institution (UP is a member institution). The AfterCollege-AACN Scholarship Fund supports students who are seeking a baccalaureate, master’s or doctoral degree in nursing. Special consideration will be given to students in a graduate program with the goal of becoming a nurse educator; students completing an RN-to-BSN or RN-to-MSN program; and those enrolled in an accelerated program.", sponsor: "AACN/AfterCollege", amount: "$2,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.aftercollege.com/content/article/aftercollege-aacn-scholarship/?source=ur-sch-nursing-aacn", opportunity_type: "Scholarship", created_at: "2018-03-28 17:16:35", updated_at: "2019-07-17 22:13:39", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "4 deadlines per year, 3/31, 6/30, 9/30, 12/31", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "robertsm"},
    {id: 1722, award_name: "Undergraduate Research Opportunities Programme of RWTH Aachen University", subject_area: "All Fields; German", level: nil, deadline: "2018-01-05", other_req: "UROP International is designed for students who wish to gain research experience by conducting research projects at RWTH Aachen University in Germany. It is ten-weeks and takes place between the middle of May and the end of July. In addition to the research project, students are offered an intensive German course and workshops on intercultural learning, scientific methods, and research practice to prepare them for their respective research project.", sponsor: "RWTH Aachen University", amount: "varies; potential scholarship of 1850 euros", state: "All", min_gpa: "3.2", contact: "scholars@up.edu", keywords: nil, website: "http://www.rwth-aachen.de/cms/root/Forschung/Angebote-fuer-Forschende/Angebote-fuer-Studierende/UROP/~wmy/UROP-INternational/lidx/1/", opportunity_type: "Undergraduate Research", created_at: "2018-04-04 22:23:43", updated_at: "2018-04-04 22:24:33", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-10-18", updated_by: "honstu1"},
    {id: 1723, award_name: "Coro Fellows Program in Public Affairs", subject_area: "All Fields", level: nil, deadline: "2018-01-17", other_req: "Selected applicants will join a cohort of 12 participants for a nine-month program, during which each Fellow participates in a series of full-time projects in various sectors in public affairs, such as Government, Business, Electoral Politics, Organized Labor, Media, Non-profit/Philanthropy.\r\n\r\n2 letters of recommendation required. ", sponsor: "Coro Fellowship", amount: "Not Specified", state: "All", min_gpa: "N/A", contact: "scholars@up.edu", keywords: nil, website: "http://www.corofellowship.org/about-the-coro-fellowship/", opportunity_type: "", created_at: "2018-04-06 21:52:41", updated_at: "2018-04-06 21:52:41", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-10-01", updated_by: "honstu1"},
    {id: 1724, award_name: "Raytheon Patriot Scholarship", subject_area: "All; Military Veteran", level: nil, deadline: "2019-04-26", other_req: "All successful candidates must:\r\nBe a U.S. Army veteran\r\nBe entering their sophomore, junior, or senior year of undergraduate study, or be enrolled in a graduate program for the current academic year\r\nBe attending full-time at an accredited four-year college or university in the U.S.\r\nDemonstrate a commitment to and passion for their chosen field of study\r\nDemonstrate leadership and engagement in their community\r\nBe a current student veteran (includes members of the National Guard or Reserve), as demonstrated by a DD 214 and current transcript\r\nHave received an honorable discharge; must be a veteran in good standing", sponsor: "Student Veterans of America and Raytheon", amount: "$10,000", state: "All", min_gpa: "none", contact: "financial.aid@example.edu", keywords: nil, website: "https://studentveterans.org/programs/scholarships", opportunity_type: "Scholarship", created_at: "2018-04-09 19:15:29", updated_at: "2019-05-04 16:43:35", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 1725, award_name: "Migrant Farmworker Baccalaureate Scholarship", subject_area: "All fields", level: nil, deadline: "2019-07-01", other_req: "Must be a student with a recent history of movement for agricultural employment, scholastic achievement, and financial need who has successfully completed at least one year at an accredited post-secondary institution.", sponsor: "Geneseo Migrant Center", amount: "up to $20,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://migrant.net/scholarships/", opportunity_type: "Scholarship", created_at: "2018-04-09 19:22:56", updated_at: "2019-05-05 21:17:26", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-15", updated_by: "hobbsm"},
    {id: 1726, award_name: "Students Affected By Cancer ", subject_area: "All fields ", level: nil, deadline: "2019-12-31", other_req: "You must be currently enrolled in, or were accepted to, an accredited college/university in the U.S. Undergraduate and graduate students are both welcome, as are incoming first-year students.\r\nYour GPA is 3.0 or higher.\r\nYou are either a current/former cancer patient, or have stood by a loved one who was diagnosed with cancer.", sponsor: "Ambient Edge ", amount: "$1,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.ambientedge.com/2018-students-affected-by-cancer-scholarship/", opportunity_type: "Scholarship", created_at: "2018-04-10 22:41:30", updated_at: "2019-03-27 20:37:39", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1727, award_name: "Ernest F. Hollings Scholarship Program", subject_area: "All Fields; ", level: nil, deadline: "2018-01-31", other_req: "This program provides a scholarship award for two academic years of full-time study and a 10-week, full-time internship ($700/week) during the summer at a NOAA or partner facility. It includes educational training experience in NOAA-related science, research, technology, policy, management, and education activities. ELIGIBILITY: Be currently enrolled or accepted as a full-time 2nd year student in a four-year undergraduate program or as a full-time 3rd year student in a five-year undergraduate program at an accredited college or university within the United States or U.S. territories.", sponsor: "National Oceanic and Atmospheric Administration", amount: "up to $9500", state: "All", min_gpa: "3.0", contact: "scholars@up.edu", keywords: nil, website: "http://www.noaa.gov/office-education/hollings-scholarship/prospective/faq#FAQB2", opportunity_type: "Scholarship", created_at: "2018-04-17 18:45:33", updated_at: "2018-04-17 18:45:33", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2018-09-01", updated_by: "honstu1"},
    {id: 1730, award_name: "AAMN Nursing Scholarship", subject_area: "Nursing", level: nil, deadline: "2019-02-01", other_req: "Applicants must be a current AAMN member.\r\nApplicants must be a male student currently enrolled in an accredited nursing program and must have completed at least one academic term.\r\nApplicants must submit evidence of formal acceptance into nursing program as well as completion of at least one academic semester.\r\nGraduate nursing student includes: RN student pursuing a masters, doctor of nursing practice, PhD\r\nApplicants must be attending an accredited university.", sponsor: "AAMN Advancing Men in Nursing", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.aamn.org/scholarships", opportunity_type: "Scholarship", created_at: "2018-04-19 21:03:44", updated_at: "2019-08-01 18:04:41", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "wasn't open when added so double check criteria; still was not open August 2019", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "robertsm"},
    {id: 1731, award_name: "Minority Nurse Faculty Scholarship", subject_area: "Nursing; Minority", level: nil, deadline: "2018-05-31", other_req: "Be a member of an Underrepresented Minority Group, meaning those racial and ethnic populations that are underrepresented in the nursing profession relative to their numbers in the general population. In Nursing, this is typically defined as individuals from the following backgrounds: American Indian, Alaskan Native, Asian American, Black or African American, Hispanic or Latino, Native Hawaiian or other Pacific Islander. Caucasian/non-Hispanic applicants are not eligible candidates; gender does not apply to minority status for the purposes of this scholarship. \r\nBe a U.S. citizen, permanent resident, refugee or qualified immigrant.\r\nBe a full-time student that is enrolled or already accepted into a doctoral nursing program (i.e. PhD, DNP) or clinically-focused nursing master’s program", sponsor: "American Association of Colleges of Nursing", amount: "varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.aacnnursing.org/Students/Financial-Aid-Scholarships/Minority-Nurse-Faculty-Scholarship", opportunity_type: "Scholarship", created_at: "2018-04-19 21:14:42", updated_at: "2019-05-30 19:54:09", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "In March 2019: The 2018 application cycle is closed. ​Stay tuned for information regarding the 2019 application cycle.\r\nIn June 2019: \"There is no application cycle for 2019\"", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 1732, award_name: "Nursing Scholarship for BSN Degree", subject_area: "Nursing", level: nil, deadline: "2019-07-01", other_req: "Students must be enrolled full-time, in good academic standing with a cumulative GPA of 2.5 or better, and continuing their education at an accredited institution. Must be 18 years or older and a licensed Registered Nurse.\r\n", sponsor: "Travel Nurse Across America ", amount: "$2,500", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.nurse.tv/scholarship/index.php", opportunity_type: "Scholarship", created_at: "2018-04-19 21:21:45", updated_at: "2019-05-04 16:45:59", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 1733, award_name: "F.A. Davis Nursing Scholarship", subject_area: "Nursing", level: nil, deadline: "2019-04-01", other_req: "Undergraduate degree leading to NCLEX®‐eligibility LPN/LVN, RN, BSN, or RN‐BSN. Graduate degree leading to MSN, DNP, or PhD.\r\nMust be enrolled in a nursing program for the 2018‐2019 school year. \r\nMust be a student in good standing with an overall GPA of 3.0 or higher. \r\nMust be a student in the U.S. or Canada. (Must be a citizen, legal resident, or holder of a valid student Visa)", sponsor: "F.A. Davis", amount: "$1,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.fadavis.com/scholarship", opportunity_type: "Scholarship", created_at: "2018-04-19 21:26:31", updated_at: "2019-03-27 20:39:19", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "hobbsm"},
    {id: 1734, award_name: "NBNA Scholarship Program", subject_area: "Nursing", level: nil, deadline: "2019-04-15", other_req: "Must be a member of NBNA and a member of a local chapter (if one exists in your area). If a chapter does not exist within a 50-radius of your location you can join NBNA as a Direct Member. Candidate must be currently enrolled in a nursing program (B.S.N., A.D., Diploma or L.P.N./ L.V.N. Masters , and Doctoral) and in good scholastic standing at the time of application. Applicant must have at least one full year of school remaining.", sponsor: "National Black Nurses Association", amount: "$1,000 - $6,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.nbna.org/content.asp?contentid=82", opportunity_type: "Scholarship", created_at: "2018-04-19 21:32:02", updated_at: "2019-03-27 20:40:17", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "hobbsm"},
    {id: 1735, award_name: "NAHN Scholarship Program", subject_area: "Nursing; Minority", level: nil, deadline: "2019-04-01", other_req: "Selection of recipients is based on many factors including need, current academic standing, and NAHN membership, course of study, supporting documentation and other factors. Scholarship recipients are a select group of Hispanic nursing students who demonstrate promise of professional contributions to the nursing profession and who have the potential to act as role models for other aspiring nursing students.", sponsor: "National Association of Hispanic Nurses", amount: "varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://nahnnet.org/NAHN/About/Scholarships___Awards/NAHN/Content/Scholarships.aspx?hkey=fd884e96-f8b4-4d57-abeb-ace7225e888d", opportunity_type: "Scholarship", created_at: "2018-04-19 21:34:48", updated_at: "2019-03-29 23:19:36", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "hobbsm"},
    {id: 1736, award_name: "DecisionDay1K", subject_area: "All fields", level: nil, deadline: "2018-05-06", other_req: "Now that you know what college you're going to, it's time to let the world know in the Citizens Bank DecisionDAY1K contest.  Just post a pic of you showing off your college pride by visiting us on Facebook @ CitizensBank or on Twitter or Instagram with #DecisionDay1K and you could be one of 5 winners.  Winners will be selected based on creativity, originality and passion.  Must be 17+.", sponsor: "Citizens Bank", amount: "$1,000 Amazon Gift Card", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.citizensbank.com/promotion/DecisionDay1KContestRules.aspx", opportunity_type: "Scholarship", created_at: "2018-04-26 16:02:50", updated_at: "2019-05-30 21:35:09", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-16", updated_by: "robertsm"},
    {id: 1737, award_name: "Deserve Scholarship for International Students", subject_area: "All fields; International", level: nil, deadline: "2018-09-30", other_req: "Students studying in the U.S. on an F1, J1, or M1 visa during the 2018-2019 academic year.\r\nMust be accepted to study or continuing to study at an eligible college or university.\r\nMust submit a valid I-20 or DS-2019 form.\r\nMust score in the top 15% on a standardized U.S. college entrance exam (SAT, ACT, GRE, or GMAT).\r\nMust have a 3.0 GPA, or higher, or the equivalent from your prior studies.", sponsor: "Deserve.com", amount: "$5,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.deserve.com/scholarship", opportunity_type: "Scholarship", created_at: "2018-05-02 20:24:32", updated_at: "2019-05-30 22:05:57", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "robertsm"},
    {id: 1738, award_name: "PMI Foundation Scholarships", subject_area: "Business; Computer Science; Engineering; History; Political Science; Sciences", level: nil, deadline: "2020-05-01", other_req: "One scholarship application for over 40 scholarships, specific criteria varies per scholarship. ", sponsor: "Project Management Institute Educational Foundation", amount: "varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://pmief.org/scholarships/academic-scholarships", opportunity_type: "Scholarship", created_at: "2018-05-02 20:30:02", updated_at: "2019-01-03 17:05:52", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Scholarship wasnt open when posting so review criteria", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1739, award_name: "Pelican Water Sustainability Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-15", other_req: "Must be legal US residents, must be currently enrolled full-time at an accredited university in the US.  High School Graduate (or equivalent): 3.5 or higher cumulative GPA or University: 3.5 or higher cumulative GPA. Unofficial Transcripts are acceptable.", sponsor: "Pelican Water Sustainability", amount: "$1,500", state: "All", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.pelicanwater.com/scholarship.php", opportunity_type: "Scholarship", created_at: "2018-05-02 23:24:16", updated_at: "2019-05-30 21:23:47", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "two deadlines 10/15 & 4/15", respect_deadline: true, date_reopens: "2020-06-01", updated_by: "robertsm"},
    {id: 1740, award_name: "KAT Team Foundation Scholarship", subject_area: "All fields", level: nil, deadline: "2018-05-11", other_req: "Be entering your freshmen year of college during the 2018-2019 academic school year. Complete a Free Application for Federal Student Aid (“FAFSA”) form and have a demonstrated unmet, financial need verified by the university financial aid department", sponsor: "KAT Team Foundation", amount: "$1,000 (renewable)", state: "All", min_gpa: "2.8", contact: "financial.aid@example.edu", keywords: nil, website: "https://scholarships.uncf.org/Program/Details/a84fcea3-d3c2-44f2-8418-fc1c44039ceb", opportunity_type: "Scholarship", created_at: "2018-05-03 23:14:07", updated_at: "2019-05-04 20:25:46", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "Not offered 2019-2020 AY", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 1741, award_name: "AGC Scholarships", subject_area: "Engineering", level: nil, deadline: "2019-11-01", other_req: "Applicant must be a full-time rising college sophomore or junior in a four-year program with at least one full year of coursework remaining and desire a career in the construction industry.  Applicant must be enrolled in an ABET or ACCE accredited program, pursuing a degree in construction-related engineering.", sponsor: "AGC Education and Research Foundation", amount: "Varies", state: "All", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.agc.org/learn/education-and-research-foundation/scholarship-program", opportunity_type: "Scholarship", created_at: "2018-05-08 18:20:16", updated_at: "2019-07-17 22:16:20", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-07-01", updated_by: "robertsm"},
    {id: 1742, award_name: "CURE - Cancer Support Scholarship for Cancer Survivors", subject_area: "All fields", level: nil, deadline: "2019-06-01", other_req: "The scholarship is designated for students who were diagnosed with cancer in childhood and whose disease and related treatments placed a significant financial burden on them and their families.", sponsor: "Lep Foundation and CURE Media Group", amount: "$5,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.lepfoundation.org/applications", opportunity_type: "Scholarship", created_at: "2018-05-08 18:31:32", updated_at: "2019-05-30 21:38:02", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-15", updated_by: "robertsm"},
    {id: 1745, award_name: "Feldco Windows, Siding and Doors Scholarship", subject_area: "All fields", level: nil, deadline: "2019-06-15", other_req: "Feldco Windows, Siding and Doors is awarding a $1,000 scholarship to a current or prospective college student that submits a winning essay on the topic, “How has your family contributed to who you are today?”", sponsor: "Feldco Windows, Siding and Doors", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.4feldco.com/scholarship/", opportunity_type: "Scholarship", created_at: "2018-05-08 23:06:03", updated_at: "2019-05-30 22:07:13", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "robertsm"},
    {id: 1746, award_name: "Women in Aerospace Scholarship", subject_area: "Engineering; Math; Science", level: nil, deadline: "2019-06-18", other_req: "To be eligible for the WIA Foundation Scholarship, an applicant must be interested in pursuing a career in the aerospace field and be a rising junior or senior working towards a bachelor’s degree in engineering, math or science. An applicant must have completed at least two and a half academic years of full-time college work at the time of application and must be currently enrolled in an accredited college or university in the United States or its territories, and plan to be enrolled in the subsequent academic year. Each applicant must have a college grade point average of at least 3.0 on a 4.0 scale. Applicants must be female of any nationality.", sponsor: "Women in Aerospace Foundation (WIA Foundation)", amount: "Varies", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.womeninaerospacefoundation.org/foundation/", opportunity_type: "Scholarship", created_at: "2018-05-08 23:12:07", updated_at: "2018-12-14 17:44:52", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-20", updated_by: "walshm"},
    {id: 1747, award_name: "Dear Abby College Columnist Scholarship", subject_area: "Communication; English; Journalism", level: nil, deadline: "2019-06-28", other_req: "Undergraduates (including seniors) writing bylined general interest, editorial or specialized (humor, sports, business, arts, culture, etc.) columns appearing in print or online editions of college publications. Columns carrying dual bylines are eligible, but only one prize will be awarded.", sponsor: "National Society of Newspaper Columnists Education Foundation", amount: "$5,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.uexpress.com/dearabby/scholarship", opportunity_type: "Scholarship", created_at: "2018-05-09 19:13:03", updated_at: "2019-05-30 22:09:10", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "robertsm"},
    {id: 1748, award_name: "Catina Rose Memorial Scholarship", subject_area: "All fields", level: nil, deadline: "2019-06-30", other_req: "In order to be eligible, the applicant must be a victim or victim survivor of a crime, must be a high school graduate or a current high school senior, must be active in community service and must have no arrests or convictions.", sponsor: "Crime Victims United of California", amount: "Varies", state: "CA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://crimevictimsunited.com/scholarships", opportunity_type: "Scholarship", created_at: "2018-05-09 19:25:36", updated_at: "2019-05-30 22:11:06", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "robertsm"},
    {id: 1749, award_name: "Designing Happiness Nursing Scholarship", subject_area: "Nursing", level: nil, deadline: "2018-06-30", other_req: "We’re looking for a special nursing student who embodies passion and compassion in their everyday life. The scholarship is a one-time, non-renewable grant of $5,000. An additional $500 allowance for koi clothing and accessories will be awarded as a one-time use promo code at koihappiness.com.  Applicants must be 18 years of age or older at time of entry.", sponsor: "koi Design LLC", amount: "$5,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.koihappiness.com/koischolarship/", opportunity_type: "Scholarship", created_at: "2018-05-11 23:04:01", updated_at: "2019-07-17 23:03:28", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "Not offered as of 5/2019; check back later in the year as stated on website.", respect_deadline: true, date_reopens: "2019-11-15", updated_by: "robertsm"},
    {id: 1750, award_name: "Simply Pets Scholarship", subject_area: "Biology; Environmental Science", level: nil, deadline: "2018-06-30", other_req: "Must be enrolled in an academic program in a field related to veterinary sciences, animal science, or biology and at least 18 years old at the time of scholarship disbursement.", sponsor: "Simply Pets", amount: "$1,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.simplypets.com/veterinary-animal-science-biology-scholarship/", opportunity_type: "Scholarship", created_at: "2018-05-11 23:08:22", updated_at: "2019-05-30 22:02:50", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "Not active as of 5/30/19", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "robertsm"},
    {id: 1752, award_name: "General Education Scholarship", subject_area: "All fields", level: nil, deadline: "2019-07-01", other_req: "If you are a current student in any accredited college you are eligible to enter.", sponsor: "Paradigm San Francisco", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://paradigmsanfrancisco.com/general-education-scholarship/", opportunity_type: "Scholarship", created_at: "2018-05-14 22:07:24", updated_at: "2019-05-30 22:01:16", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "robertsm"},
    {id: 1753, award_name: "KB Delta Scholarship Program", subject_area: "All fields", level: nil, deadline: "2019-07-01", other_req: "Must be currently enrolled in an accredited college.", sponsor: "KB Delta Compressor Valve Parts", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://kbdelta.com/scholarship.html", opportunity_type: "Scholarship", created_at: "2018-05-14 22:10:22", updated_at: "2019-05-30 21:36:23", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-15", updated_by: "robertsm"},
    {id: 1754, award_name: "Texas Dental Specialists Health Professions Scholarship", subject_area: "Nursing; Dental; Pre-Med", level: nil, deadline: "2019-07-01", other_req: "Must be working towards a profession in patient care.", sponsor: "Dr. Lauren Brownfield", amount: "$500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://drbrownfield.com/scholarship/", opportunity_type: "Scholarship", created_at: "2018-05-14 22:14:47", updated_at: "2019-05-30 22:11:55", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "robertsm"},
    {id: 1755, award_name: "Dream Warriors Scholarship", subject_area: "Art; Creative Writing; Drama; Music; Theater; Minority", level: nil, deadline: "2018-07-01", other_req: "The Dream Warriors Scholarship encourages college bound and current undergraduate Native American / Alaska Native / Native Hawaiian seniors to pursue their creative curiosities and passions by providing a scholarship geared towards these endeavors. A Dream Warrior is someone who uses their passion, dream or gift to provide for their loved ones and community. Educated Warriors are vital to war. A Dream Warrior has integrity and respect. A Dream Warrior relentlessly pursues his or her dreams, passions, and goals, stopping at nothing until he/she is living them. A Dream Warrior takes action so that at the end of the day there is no room for regret or questioning of his/her own effort. A Dream Warrior understands the responsibility in using the gifts he/she has been given. A Dream Warrior always acts out of and from a place of love. Above all, a Dream Warrior does not step on others in order to reach his/her destination, but rather uplifts others in fulfilling their life paths.", sponsor: "Dream Warriors", amount: "$1,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://dreamwarriors.co/dream-warriors-scholarship/", opportunity_type: "Scholarship", created_at: "2018-05-14 22:19:25", updated_at: "2019-05-30 21:59:52", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Not active as of 5/30/19", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "robertsm"},
    {id: 1756, award_name: "Aall In Limo and Party Bus Scholarship Program", subject_area: "All fields", level: nil, deadline: "2019-07-31", other_req: "The $2000 scholarship will be awarded to a student who will successfully write an essay regarding the following topic: Why you shouldn't drink and drive?", sponsor: "Aall In Limo and Party Bus", amount: "$2,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.aallinlimo.com/scholarship/", opportunity_type: "Scholarship", created_at: "2018-05-14 22:34:49", updated_at: "2019-05-04 16:52:16", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 1757, award_name: "Richard R. Tufenkian Armenian Scholarship", subject_area: "All fields", level: nil, deadline: "2019-07-31", other_req: "Must be of Armenian Descent (Father and/or mother and/or grandparent of Armenian origin) with financial need.  Applicants should have Armenian community service.", sponsor: "Armenian Educational Foundation", amount: "$3,000", state: "CA", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://aefweb.org/index.php/scholarships", opportunity_type: "Scholarship", created_at: "2018-05-14 22:39:51", updated_at: "2019-05-30 22:13:02", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "robertsm"},
    {id: 1758, award_name: "Families of Freedom Scholarship", subject_area: "All fields;", level: nil, deadline: "2019-12-31", other_req: "Families of Freedom registrants must be dependent children, spouses or domestic partners of 9/11 victims, including airplane crew and passengers; World Trade Center and Pentagon workers and visitors; and relief workers, including firefighters, emergency medical personnel, and law enforcement personnel, that were involved in the rescue efforts.  Families of Freedom Scholarships are available for children, including those born after September 11, 2001, who enroll in a program of postsecondary study by age 24. Children must have been born prior to September 30, 2008 to be eligible.", sponsor: "Families of Freedom Scholarship Fund", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.familiesoffreedom.org/", opportunity_type: "Scholarship", created_at: "2018-05-31 15:48:39", updated_at: "2019-01-03 17:06:49", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Rolling deadline", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1759, award_name: "Wells Fargo Veterans Emergency Grant Program", subject_area: "Military Veteran", level: nil, deadline: "2019-12-31", other_req: "The Wells Fargo Veterans Emergency Grant Program provides emergency financial grants to veterans already enrolled in postsecondary education who might otherwise be forced to drop out of college because of unforeseen financial emergencies.These grants will help veterans meet their household expenses and ensure they are able to stay in school without creating undue financial hardship for themselves or their families.\r\nApplicants to the Wells Fargo Veterans Emergency Grant Program must:\r\n\r\nBe honorably-discharged (no longer drilling) veterans or spouses of disabled veterans who have served in the United States military, including the Reserves and National Guard, and have received a Certificate of Eligibility from the Department of Veterans Affairs or another document of service. (Limit one emergency grant per family)\r\nBe students who are already enrolled in full-time undergraduate (first Bachelor's) or graduate (first Master’s degree) study at an accredited two-year or four-year college, university, or vocational-technical school*.\r\n*College must not be on warning or probationary status with the federal government, or must not be in litigation with the federal government or a state.\r\nBe Pell-eligible and have applied for Title IV and completed FAFSA to ensure full discovery of actual unmet need.\r\nUse any military education benefits for which they are eligible in the current academic year.\r\nHave a minimum cumulative grade point average of 2.5 on a 4.0 scale, or its equivalent.", sponsor: "Wells Fargo", amount: "up to $1,000", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.scholarsapply.org/wellsfargoveteransemergency/", opportunity_type: "Scholarship", created_at: "2018-05-31 15:52:00", updated_at: "2019-01-11 18:38:46", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-04", updated_by: "walshm"},
    {id: 1760, award_name: "AbbVie Immunology Scholarship", subject_area: "All fields", level: nil, deadline: "2018-12-13", other_req: "The AbbVie Immunology Scholarship is designed to provide financial support for exceptional students living with chronic inflammatory diseases.  cholarships of up to $15,000 each will be awarded, dependent upon type of degree pursued. Applicants must be legal residents of the U.S. and diagnosed by a healthcare professional with one of the following: ankylosing spondylitis (AS), Crohn’s disease (CD), hidradenitis suppurativa (HS), juvenile idiopathic arthritis (JIA), psoriasis (Ps), psoriatic arthritis (PsA), rheumatoid arthritis (RA), ulcerative colitis (UC), or uveitis (UV). Qualified applicants must plan to enroll in undergraduate (associate’s, bachelor’s) or graduate (master’s, MD, JD, doctorate) study at an accredited two- or four-year college, university or vocational-technical school in the U.S. for the entire upcoming academic year. Scholarships will be awarded based on academic excellence, community involvement, and ability to serve as a positive role model in the immunology community.", sponsor: "AbbVie Immunology", amount: "up to $15,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://abbvieimmunologyscholarship.com/?utm_source=SAOpenSchol&utm_medium=SASite&utm_campaign=2018AIS", opportunity_type: "Scholarship", created_at: "2018-05-31 15:55:51", updated_at: "2018-10-30 16:49:16", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 1761, award_name: "Richard D. Rogers Military Scholarship", subject_area: "Military Family", level: nil, deadline: "2018-08-31", other_req: "Available to students younger than 18 years old, with the permission of a parent or guardian, who are the children of active duty or prior service United States Military members.  In 250 words or less, explain your experience as a military child.", sponsor: "Rush and Kathryn Adams Limbaugh", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://challenges.rushrevere.com/index.php/richarddouglasrogersmilitaryscholarship/", opportunity_type: "Scholarship", created_at: "2018-06-07 16:31:08", updated_at: "2019-05-30 19:52:51", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 1762, award_name: "The Adventures of Rush Revere Student of American History Scholarship", subject_area: "All fields", level: nil, deadline: "2018-08-31", other_req: "This scholarship was established in 2017 by #1 New York Times Bestselling authors Rush and Kathryn Adams Limbaugh to promote a love of American history and reading. Knowing that a true understanding of our history is vital to a free society, this scholarship provides financial assistance to young people for education. Available to students younger than 18 years old, with the permission of a parent or guardian, who are in private, public, or alternative (homeschool) schools.", sponsor: "Rush and Kathryn Adams Limbaugh", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://challenges.rushrevere.com/index.php/studentofamericanhistoryscholarship/", opportunity_type: "Scholarship", created_at: "2018-06-07 16:33:58", updated_at: "2019-05-30 19:51:54", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 1763, award_name: "The Adventures of Rush Revere Student-Athlete and Musician Scholarship ", subject_area: "All fields", level: nil, deadline: "2018-08-31", other_req: "The Adventures of Rush Revere Student-Athlete and Musician Scholarship provides $1,000 educational scholarships to especially deserving students. This scholarship was established in 2017 by #1 New York Times Bestselling authors Rush and Kathryn Adams Limbaugh to promote the combination of reading and extracurricular activities, specifically sports and music. Knowing that students with a wide variety of interests are more successful in school, this scholarship provides financial assistance to young people for education. Available to students younger than 18 years old, with the permission of a parent or guardian, who are in private, public, or alternative (homeschool) schools.", sponsor: "Rush and Kathryn Adams Limbaugh", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://challenges.rushrevere.com/index.php/studentathleteandmusicianscholarship/", opportunity_type: "Scholarship", created_at: "2018-06-07 16:36:46", updated_at: "2019-05-30 19:50:50", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 1765, award_name: "Citizens Bank Undergraduate Scholarship", subject_area: "All ", level: nil, deadline: "2019-08-01", other_req: "Be 17 years of age or older at the time of application.\r\nBe legal residents of the fifty (50) United States or the District of Columbia.\r\nBe enrolled as an undergraduate in accredited post-secondary institution of higher learning for the school year  2019-2020.\r\nSubmit an online written response to the essay question.", sponsor: "Citizens Bank", amount: "$2,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.unigo.com/m/scholarships/citizensbank", opportunity_type: "Scholarship", created_at: "2018-06-08 16:20:39", updated_at: "2019-05-04 17:11:28", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 1766, award_name: "Citizens Bank Graduate Scholarship", subject_area: "All", level: nil, deadline: "2019-08-01", other_req: "Be 17 years of age or older at the time of application.\r\nBe legal residents of the fifty (50) United States or the District of Columbia.\r\nBe enrolled as a graduate student in accredited post-secondary institution of higher learning for the school year 2019-2020.\r\nSubmit an online written response to the essay question.", sponsor: "Citizens Bank", amount: "$5,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.unigo.com/m/scholarships/citizensbankgraduate", opportunity_type: "Scholarship", created_at: "2018-06-08 16:22:13", updated_at: "2019-05-04 20:03:20", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 1767, award_name: "The Nurse Kelley Scholarship ", subject_area: "Nursing", level: nil, deadline: "2019-07-15", other_req: "Write a one page essay detailing, \"Why you want to be a nurse? What does nursing mean to you?\" \r\nNurse Kelley will select a winner based on a combination of merit and financial need. ", sponsor: "Wanderly.us", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.wanderly.us/blog/nurse-kelley-scholarship-application/", opportunity_type: "Scholarship", created_at: "2018-06-08 16:26:54", updated_at: "2018-09-26 22:19:14", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 1768, award_name: "COGIC Charities Scholarship", subject_area: "All fields", level: nil, deadline: "2019-08-01", other_req: "Scholarships are open to all high school graduates that will be attending a college/university full-time in the fall as well as those already enrolled and attending full-time in an accredited college/university pursuing an undergraduate degree. Graduate and/or doctoral degree student must be taking a minimum of 9 credit hours without exception. Applicants are selected based on exemplary traits including leadership, community involvement, academic excellence and responses to the essay questions. ", sponsor: "Church Of God In Christ Scholarship", amount: "Varies", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.cogic.org/cogiccharities/scholarships/", opportunity_type: "Scholarship", created_at: "2018-06-11 16:45:35", updated_at: "2019-05-30 17:32:03", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-06-01", updated_by: "robertsm"},
    {id: 1769, award_name: "King Green Scholarship", subject_area: "Biology; Environmental Science", level: nil, deadline: "2019-08-01", other_req: "Full-time, U.S. undergraduate student seeking a degree in Agriculture, Environmental Sciences, Biology, or related fields. Must maintain a 3.5 cumulative GPA and provide a copy of their school transcript.", sponsor: "King Green", amount: "$1,000", state: "All", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.kinggreen.com/scholarship/", opportunity_type: "Scholarship", created_at: "2018-06-11 17:00:53", updated_at: "2019-05-30 19:46:00", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 1770, award_name: "Hispanic Academic Achievers Scholarships", subject_area: "Minority", level: nil, deadline: "2019-03-15", other_req: "HAAP scholarships are based on Hispanic heritage, financial need, leadership, civic and extra-curricular activities, academic achievement and higher education goals.  Applicants must be from one of the participating school districts for the Tri-Cities HAAP Program. ", sponsor: "HAAP ", amount: "varies", state: "WA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.haap.org/scholarships.html", opportunity_type: "Scholarship", created_at: "2018-06-19 16:56:25", updated_at: "2018-12-21 19:21:04", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "scholarship wasn't open when added so please review carefully", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "walshm"},
    {id: 1771, award_name: "BooksRun Scholarship", subject_area: "All", level: nil, deadline: "2018-09-30", other_req: "High school graduates, a current undergraduate, or graduate student in the United States.\r\nStudents with a minimum cumulative grade point average of 2.75.\r\nApplicants must be 17 years of age or older.", sponsor: "Booksrun.com", amount: "$1,000", state: "All", min_gpa: "2.75", contact: "financial.aid@example.edu", keywords: nil, website: "https://booksrun.com/scholarship", opportunity_type: "Scholarship", created_at: "2018-06-19 20:00:32", updated_at: "2019-05-30 21:56:58", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Not active as of 5/30/19", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "robertsm"},
    {id: 1772, award_name: "Earl and Kathryn Congdon Family Foundation Scholarship", subject_area: "All fields ", level: nil, deadline: "2019-02-15", other_req: "Be dependent children, age 26 and under, of full time Old Dominion Freight Line non-executive employees who have a minimum of three years of full-time employment with the company as of the application deadline date. \r\nBe high school seniors or high school graduates who plan to enroll for the first time or students who are already enrolled in full-time undergraduate study.\r\nPlan to enroll in full-time undergraduate study at an accredited “bricks and mortar” two- or four-year college, university or vocational-technical school for the entire upcoming academic year. Online only colleges and universities are excluded.", sponsor: "Earl and Kathryn Congdon Family Foundation", amount: "varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.scholarsapply.org/congdonodfl/", opportunity_type: "Scholarship", created_at: "2018-06-19 21:26:46", updated_at: "2019-01-03 17:08:37", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "Application/requirements not visible when added to database but current student is receiving so worth looking into.", respect_deadline: true, date_reopens: "2020-01-01", updated_by: "walshm"},
    {id: 1773, award_name: "Northwest Indian Housing Association Scholarship", subject_area: "Minority", level: nil, deadline: "2019-03-25", other_req: "Applicant must be an enrolled Tribal member of an NWIHA Voting Member Tribe.  Applicant must be less than 24 years old as of the deadline submission date.", sponsor: "Northwest Indian Housing Association", amount: "Varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.nwiha.org/youth-scholarship-program", opportunity_type: "Scholarship", created_at: "2018-06-25 23:28:14", updated_at: "2019-03-29 23:21:03", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "hobbsm"},
    {id: 1774, award_name: "The Muslim Educational Trust Dr. Riyza Ahmed Scholarship", subject_area: "Law; Journalism; Psychology; Counseling; Social Work", level: nil, deadline: "2018-05-18", other_req: "The Muslim Educational Trust Dr. Riyaz Ahmed Scholarship Fund awards several scholarships to the students who best exemplify scholastic leadership and who demonstrate active participation in the American Muslim community. Consideration is given to the type of volunteer activity as well as the amount of commitment demonstrated in terms of time and self-sacrifice.   Recipients commit to 12 hours of volunteer work with the Muslim Educational Trust.  Parent or student must be a member of at least one Islamic Centers or Organizations in Oregon or SW Washington (options are listed on the scholarship application).", sponsor: "The Muslim Educational Trust Dr. Riyza Ahmed Scholarship Fund", amount: "Varies", state: "OR; WA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.metpdx.org/index.php/scholarship", opportunity_type: "Scholarship", created_at: "2018-06-29 16:53:17", updated_at: "2019-05-30 21:55:36", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "robertsm"},
    {id: 1775, award_name: "Society for Marketing Professional Services Educational Scholarship", subject_area: "Marketing; Engineering; Communication", level: nil, deadline: "2018-04-30", other_req: "The SMPS Educational Scholarship was established to support students who are pursuing a career in marketing professional services or project management for A/E/C firms. The scholarship is awarded in May of each year for the following academic year.  Scholarship candidates must meet the following criteria: currently a Senior in High School, graduating Spring, with a GPA of 3.0 or higher and will be pursuing higher education with a focus in Architecture (includes architecture-related disciplines, i.e. Interior Design or Landscape Architecture), Engineering, Construction Management, or Marketing/Communications/Business Development\r\n", sponsor: "Society for Marketing Professional Services - Oregon", amount: "$2,500", state: "OR", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.smps.org/about/smps-foundation/memorial-leadership-endowment/", opportunity_type: "Scholarship", created_at: "2018-06-29 17:10:53", updated_at: "2019-05-04 20:11:38", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "Not given 19-20 AY", respect_deadline: true, date_reopens: "2020-03-01", updated_by: "hobbsm"},
    {id: 1776, award_name: "The Skanner Foundation Scholarship", subject_area: "All fields", level: nil, deadline: "2019-10-31", other_req: "Undergraduate student or high school student transitioning to college. Minimum grade point average of 2.5. Attending a post secondary, accredited institution or planning to attend. Plans to attend school for entire academic year, beginning in the fall, 12 credit hours per quarter. Completed 20 hours of “active” community service within past 12-months with certified documentation. Leadership involvement.", sponsor: "The Skanner Foundation", amount: "Varies", state: "OR; WA", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.theskanner.com/foundation/scholarship", opportunity_type: "Scholarship", created_at: "2018-07-10 15:39:51", updated_at: "2019-05-30 17:52:38", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-07-10", updated_by: "robertsm"},
    {id: 1777, award_name: "Paul Martin's American Grill Scholarship", subject_area: "Marketing; Business; Management", level: nil, deadline: "2019-09-01", other_req: "U.S. undergraduate, seeking a degree in hospitality management, management, marketing, business administration or related field.\r\nMinimum 3.5 GPA with proof of transcript.\r\nA passion for taking care of people.", sponsor: "Paul Martin's American Grill", amount: "$1,000", state: "All", min_gpa: "3.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://paulmartinsamericangrill.com/scholarship/", opportunity_type: "Scholarship", created_at: "2018-07-27 16:35:40", updated_at: "2019-05-30 22:26:07", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-07-01", updated_by: "robertsm"},
    {id: 1778, award_name: "Horatio Alger National Scholarships", subject_area: "All fields", level: nil, deadline: "2018-10-25", other_req: "To be eligible to apply for the Horatio Alger National Scholarship, applicants must meet the following criteria:\r\nBe enrolled full time as a high school senior in the United States; be progressing normally toward graduation in spring/summer of 2019 with plans to enter a college in the United States no later than the fall following graduation. Exhibit a strong commitment to pursue and complete a bachelor’s degree at an accredited non-profit public or private institution in the United States (students may start their studies at a two-year institution and then transfer to a four-year institution). Demonstrate critical financial need ($55,000 or lower adjusted gross family income is required). Be involved in co-curricular and community service activities. Display integrity and perseverance in overcoming adversity. Maintain a minimum grade point average (GPA) of 2.0; and be a United States citizen.", sponsor: "Horatio Alger", amount: "$25,000", state: "All", min_gpa: "2.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://scholars.horatioalger.org/scholarships/about-our-scholarship-programs/national-scholarships/", opportunity_type: "Scholarship", created_at: "2018-08-01 18:49:47", updated_at: "2018-08-01 18:49:47", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: nil, updated_by: "geigerr"},
    {id: 1780, award_name: "Procter & Gamble General Scholarship", subject_area: "Business; Information Technology; Public Relations", level: nil, deadline: "2018-08-20", other_req: "The Procter & Gamble General Scholarship is directed towards academically achieving undergraduate students at any accredited four-year colleges or universities within the United States. The Procter & Gamble General Scholarship will focus on targeted fields in business, information technology and public relations. The candidates must be enrolled as an undergraduate student. Lastly, the recent high school graduates from the Class of 2018 may apply as well.", sponsor: "Procter & Gamble; UNCF", amount: "Up to $5,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://scholarships.uncf.org/Program/Details/54f45439-d2a7-422c-8745-ed71b9b4db0e", opportunity_type: "Scholarship", created_at: "2018-08-01 19:04:17", updated_at: "2019-05-30 22:31:25", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-18", updated_by: "robertsm"},
    {id: 1781, award_name: "The Western Digital Scholarship for STEM", subject_area: "Computer Science; Engineering; Mathematics; Science", level: nil, deadline: "2019-04-03", other_req: "Traditionally under-represented populations in the STEM disciplines, including females and individuals of African-American or Latino descent in the United States. Must have financial need.  Scholarships are currently awarded to deserving students in the following countries: United States, China, India, Israel, Japan, Malaysia, Philippines, and Thailand.", sponsor: "Western Digital", amount: "up to $5,000", state: "All", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.wdc.com/about-wd/philanthropy/scholarship.html", opportunity_type: "Scholarship", created_at: "2018-08-02 19:14:19", updated_at: "2019-05-04 20:18:50", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-15", updated_by: "hobbsm"},
    {id: 1782, award_name: "Zip Recruiter Scholarship", subject_area: "All Fields", level: nil, deadline: "2019-10-31", other_req: "For the ZipRecruiter 2019 Scholarship Promotion, we’re asking high school and college students (18+) to write about their favorite ZipRecruiter feature.\r\n\r\nAt the conclusion of the specific Entry Period for each biannually Promotion, you must (i) be a legal resident of one of the fifty (50) United States or the District of Columbia, (ii) be 18 years of age or older (or at least the age of majority in your jurisdiction of residence), and (iii) be enrolled as a student at an accredited high school, college or university in the United States.", sponsor: "Zip Recruiter ", amount: "$3,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.ziprecruiter.com/scholarship", opportunity_type: "Scholarship", created_at: "2018-08-06 16:51:29", updated_at: "2019-03-27 20:42:51", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-15", updated_by: "hobbsm"},
    {id: 1783, award_name: "Couponing in College Scholarship Contest", subject_area: "All fields", level: nil, deadline: "2018-11-16", other_req: "You must be a resident of the 50 United States and the District of Columbia.\r\nApplicants must be currently enrolled in a college program.\r\nYou must provide a valid .edu email address with your application.", sponsor: "Dealspotr.com", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://dealspotr.com/scholarship", opportunity_type: "Scholarship", created_at: "2018-08-22 22:32:22", updated_at: "2019-05-30 19:44:46", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 1784, award_name: "Google SVA Scholarship", subject_area: "Computer Science; Engineering; Electrical Engineering", level: nil, deadline: "2018-11-01", other_req: "Be currently enrolled as an undergraduate or graduate student at an accredited four-year university for the 2018-2019 academic year.\r\nIntend to be enrolled in or accepted as a full-¬time student at a university in the United States for the 2018-¬2019 academic year.\r\nMaintain strong academic performance. \r\nBe pursuing a Computer Science or Computer Engineering degree, or a degree in a closely related technical field.\r\nBe a current student veteran (includes members of the National Guard or Reserve), as proven by a DD-214 and transcript, OR be a student on Active Duty as proven by submission of Active Duty orders and a Memorandum of Understanding from your commanding officer indicating that you are in good standing with your unit, and transcript.\r\nHave received an honorable discharge, or currently be in good standing with his/her branch of service.", sponsor: "", amount: "$10,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://studentveterans.org/programs/scholarships?layout=edit&id=733", opportunity_type: "Scholarship", created_at: "2018-08-30 20:15:04", updated_at: "2018-09-28 17:06:54", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1785, award_name: "The Global Citizenship Scholarship", subject_area: "International", level: nil, deadline: "2019-07-15", other_req: "Scholarship entrants must meet the following requirements:\r\n- The student must have been accepted to a full-time program at a U.S. college or university or must be currently enrolled full time in a U.S. college or university.\r\nThe student must be an international student on F1 visa status, Green Card holder (permanent resident), or a DACA recipient. \r\n- The student must be 18 years or older.", sponsor: "MPower", amount: "$1,000", state: "All", min_gpa: "", contact: "", keywords: nil, website: "https://www.mpowerfinancing.com/scholarships/", opportunity_type: "Scholarship", created_at: "2018-08-30 22:55:15", updated_at: "2019-05-30 17:39:42", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "4/15 & 10/15 deadlines", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "robertsm"},
    {id: 1786, award_name: "2nd Chance Scholarship", subject_area: "All fields", level: nil, deadline: "2018-08-31", other_req: "The Second Chance College Scholarships Contest is open to citizens and aliens legally residing in the USA with High School Diploma, GED or equivalent.\r\nScholarship funds are payable to the winner’s college/university or certified trade school in the United States; winner must enroll or already be enrolled for Spring 2019 session.\r\nWinner selection is NOT based on financial need, GPA or demographic criteria.\r\nRelatives of AFSA staff or NATIONAL board members may not enter.\r\nPast winners of AFSA’s High School Senior Scholarship Contest or AFSA’s Second Chance College Scholarships Contest are not eligible to win this contest.", sponsor: "AFSA ", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.afsascholarship.org/secondchance/scstep1/", opportunity_type: "Scholarship", created_at: "2018-09-20 21:48:20", updated_at: "2019-05-30 21:54:50", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "", respect_deadline: true, date_reopens: "2020-02-01", updated_by: "robertsm"},
    {id: 1787, award_name: "ABC Fundraising Volunteer Recognition Scholarship", subject_area: "All fields ", level: nil, deadline: "2019-06-30", other_req: "Current high school junior, high school senior, college undergraduate, or graduate students that have participated in consistent volunteer work.", sponsor: "ABC Fundraising", amount: "$2,500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.abcfundraising.com/college-scholarship", opportunity_type: "Scholarship", created_at: "2018-09-21 21:56:32", updated_at: "2018-09-21 21:56:33", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1788, award_name: "Academic Hero Scholarship", subject_area: "All fields ", level: nil, deadline: "2019-10-31", other_req: "age 16 and over; A detailed and well-written essay response; Enrollment in a US high school or college. ", sponsor: "Course Hero", amount: "$10,000", state: "All ", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.coursehero.com/scholarships/1000068/academic-hero-2018-scholarship/", opportunity_type: "Scholarship", created_at: "2018-09-21 22:04:46", updated_at: "2019-05-30 21:53:44", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-04-01", updated_by: "robertsm"},
    {id: 1789, award_name: "AMS Scholarships and Fellowships", subject_area: "Biology; Sciences", level: nil, deadline: "2019-02-08", other_req: "Applicants must be U.S. citizens or hold permanent resident status. Other criteria varies depending on scholarship. ", sponsor: "American Meteorological Society", amount: "varies", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.ametsoc.org/ams/index.cfm/information-for/students/ams-scholarships-and-fellowships/", opportunity_type: "Scholarship", created_at: "2018-09-21 22:15:03", updated_at: "2018-09-21 22:15:03", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-09-01", updated_by: "walshm"},
    {id: 1790, award_name: "Biology Dictionary Scholarship", subject_area: "All fields ", level: nil, deadline: "2019-12-31", other_req: "Any current college going student currently enrolled in any educational program is eligible to apply. Student must be enrolled at an accredited college, university or trade school. All students from all countries are welcome. A Minimum GPA of 2.5 is required to apply for this program.", sponsor: "Biology Dictionary", amount: "$1,000", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://biologydictionary.net/biology-dictionary-scholarship/", opportunity_type: "Scholarship", created_at: "2018-09-21 22:48:58", updated_at: "2019-05-30 19:43:35", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 1792, award_name: "Bookmundi's Travel the World Scholarship", subject_area: "All fields; International", level: nil, deadline: "2019-10-01", other_req: "All applicants must be enrolled, or due to be enrolled, as a full-time student at an accredited college or university for the semester they are applying to receive the scholarship. Applicants are not required to have a minimum GPA. Domestic, international, and undocumented students are eligible to apply.\r\n\r\nAnswer essay prompt on website. ", sponsor: "Bookmundi", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.bookmundi.com/scholarship", opportunity_type: "Scholarship", created_at: "2018-09-21 22:55:39", updated_at: "2018-12-06 16:56:46", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "new scholarship see if repost", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 1793, award_name: "ASDSO Scholarship Program", subject_area: "Civil Engineering", level: nil, deadline: "2019-03-29", other_req: "Successful recipients must be U.S. citizens and enrolled full-time at the senior level during the 2019-20 academic term in an accredited civil engineering program, or in a related field as determined by ASDSO, and must demonstrate an interest in pursuing a career in hydraulics, hydrology or geotechnical disciplines, or in another discipline related to the design, construction and operation of dams.", sponsor: "Association of State Dam Safety Officials", amount: "$5,000-$10,000", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://damsafety.org/apply-scholarship", opportunity_type: "Scholarship", created_at: "2018-10-23 19:40:37", updated_at: "2018-10-23 19:41:39", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-15", updated_by: "walshm"},
    {id: 1794, award_name: "Pop Your Pup Scholarship", subject_area: "Pre-Vet; Graphic Design; Fine Arts; Marketing", level: nil, deadline: "2018-12-15", other_req: "Pop Your Pup, one of the leading custom pet art companies in the world, is excited to offer a 2018 scholarship program aimed at students whose area of study focuses on Veterinarian and Graphic Design fields. We are committed to growing our industry as well as supporting the brightest students committing themselves to making an impact in animals lives.\r\n\r\nSubmit a brief essay of between 400 and 800 words, detailing why a career in Graphic Design or Veterinarian is your college major of choice. A personalized tone, referencing sincere firsthand experience and sentiment, is best—no need to be too formal. We want to know why you truly believe in graphic design or Veterinarian is the best career path for you!", sponsor: "Pop Your Pup!", amount: "$500", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://popyourpup.com/pages/pypscholarship", opportunity_type: "Scholarship", created_at: "2018-10-23 19:46:09", updated_at: "2019-05-30 19:42:13", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "Not available as of 5/30/19", respect_deadline: true, date_reopens: "2020-05-01", updated_by: "robertsm"},
    {id: 1795, award_name: "Scholarship for Women in Finance", subject_area: "Business; Finance; Accounting Economics", level: nil, deadline: "2019-03-31", other_req: "Be a female or identify themselves as females.\r\nPlan to enroll as a full-­time student at an accredited university in the United States for the 2019-2020 academic year.\r\nBe pursuing a degree in Finance, Business Administration, Accounting, Economics or a degree in a closely related financial field.\r\nBe a U.S. citizen or legal resident.", sponsor: "Money Under 30", amount: "$1,000 to $2,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.moneyunder30.com/mu30-scholarship-for-women-in-finance", opportunity_type: "Scholarship", created_at: "2018-10-23 19:49:38", updated_at: "2019-05-30 17:35:02", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "robertsm"},
    {id: 1796, award_name: "Beaverton Arts Foundation Scholarship", subject_area: "Visual Arts; Performing Arts", level: nil, deadline: "2019-01-20", other_req: "High school and homeschooled students must currently be in their senior year and must attend a public, private, or alternative high school within Beaverton School District boundaries. \r\n\r\nOutstanding Achievement in the Visual Arts, which includes traditional 2D and 3D media, graphic design, video and film, and digital arts/media.\r\n\r\nOutstanding Achievement in the Performing Arts, which includes music, dance, theater, improv/comedy, tech crew (studio recording and production) and stage crew (lighting, sounds, rigging).", sponsor: "Beaverton Arts Foundation", amount: "$1,500", state: "OR", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.beavertonartsfoundation.org/grants-and-scholarships/", opportunity_type: "Scholarship", created_at: "2018-11-07 23:35:45", updated_at: "2018-11-07 23:35:45", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-05", updated_by: "walshm"},
    {id: 1797, award_name: "Future Business Leaders Scholarship", subject_area: "All fields", level: nil, deadline: "2019-04-20", other_req: "Rank in the top 50 percent of their high school class; Have a 1,000 combined SAT score or the equivalent ACT score; Have a 2.5 GPA or better; Demonstrate school and community activity. \r\n\r\nThe applicant must meet at least one of the following qualifications:\r\n(a) The child, stepchild, legal foster child, grandchild or spouse of a member of the law enforcement community who has lost their life in the performance of their duties.  (b) The child, stepchild, legal foster child, grandchild or spouse of a member in good standing of the National Pawnbrokers Association who has lost their life in the performance of their duties as a pawnbroker. (c) A customer, employee, or individual sponsored by a member in good standing of the National Pawnbrokers Association for at least 12 months prior to the application. (d) The child, stepchild, legal foster child, grandchild or spouse of a member in good standing of the National Pawnbrokers Association for at least 12 months prior to the application. ", sponsor: "National Pawnbrokers Association", amount: "varies", state: "All", min_gpa: "2.5", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.nationalpawnbrokers.org/community-outreach/future-business-leaders-scholarship-fbl/", opportunity_type: "Scholarship", created_at: "2018-11-07 23:45:42", updated_at: "2018-11-07 23:45:42", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 1798, award_name: "Irish Cultural Centre of California Scholarship", subject_area: "All fields ", level: nil, deadline: "2019-03-17", other_req: "", sponsor: "Irish Cultural Centre of California", amount: "", state: "CA", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://irishcentersf.org/scholarships/", opportunity_type: "Scholarship", created_at: "2018-11-07 23:56:49", updated_at: "2019-03-27 20:47:58", citizenship: "US Citizen", website_link_text: "", is_published: false, admin_notes: "not open when posting look at criteria", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "hobbsm"},
    {id: 1799, award_name: "PNC Education Loan Center Achiever Scholarship ", subject_area: "All fields", level: nil, deadline: "2019-05-31", other_req: "", sponsor: "PNC Bank", amount: "$2000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://pnc.financialliteracy101.org/scholarship/", opportunity_type: "Scholarship", created_at: "2018-11-15 00:11:28", updated_at: "2018-11-26 22:39:15", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: false, admin_notes: "emailed them to clarify a couple of points - our students are not currently eligible since we are not in one of the states listed even though we are on the list of schools. She said they were potentially going to change so i am oging to leave this in here to look at next year. ", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 1801, award_name: "Doyle Foundation Scholarships", subject_area: "All fields ", level: nil, deadline: "2019-02-01", other_req: "You are a graduating senior or past graduate (G.E.D. is acceptable) of the Huntington Beach Union High School District in Southern California. You are a graduate or student of the Huntington Beach Adult School in the Huntington Beach Union High School District in Southern California. You are a graduating senior or past graduate (G.E.D. is acceptable) of the Washoe County School District in Northern Nevada. You are a graduate or student of the Washoe Adult High School in the Washoe County School District in Northern Nevada. You are a graduate/current or previous student of any of the following Community Colleges in Southern California: Coastline, Cypress, Fullerton, Golden West, Irvine Valley, Orange Coast, Saddleback, Santa Ana or Santiago Canyon, or Truckee Meadows Community College in Nevada. ", sponsor: "Doyle Foundation", amount: "varies", state: "CA, NV", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://doylefound.org/scholarships/applications/", opportunity_type: "Scholarship", created_at: "2018-11-16 00:09:19", updated_at: "2018-11-16 00:09:19", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 1802, award_name: "Mariah's Challenge Scholarship", subject_area: "All fields ", level: nil, deadline: "2019-03-31", other_req: "Be a graduating senior and a resident of Butte-Silver Bow County;\r\nBe a full-time undergraduate student for an entire academic year at an accredited four year college, trade school, or vocational school; Have accepted Mariah’s Challenge and must have refrained from drinking since taking the challenge. No applicant will be accepted that has a minor in possession or any other alcohol related offense after February 2, 2008 (the official launch date of Mariah’s Challenge);\r\nHave refrained from the use of illegal drugs. ", sponsor: "Mariah McCarthy Scholarship Foundation", amount: "varies", state: "MT", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "http://mariahschallenge.com/scholarship/applications/", opportunity_type: "Scholarship", created_at: "2018-11-16 00:12:41", updated_at: "2018-11-16 00:12:41", citizenship: "No Requirement", website_link_text: "", is_published: false, admin_notes: "not open when posting, verify criteria", respect_deadline: true, date_reopens: "2019-12-01", updated_by: "walshm"},
    {id: 1803, award_name: "PNACAC Student Scholarship", subject_area: "All fields ", level: nil, deadline: "2019-03-01", other_req: "3.00 cumulative unweighted GPA or higher.\r\nCurrently enrolled student who is in their senior year of high school in the states of Alaska, Idaho, Montana, Oregon or Washington and plans to attend a regionally accredited college or university in the fall -OR- Currently enrolled student who attends a two-year college in the states of Alaska, Idaho, Montana, Oregon or Washington and plans to attend a regionally accredited college or university in the fall.\r\nSubmitted the video essay submission form by the deadline of March 1, 2019. ", sponsor: "Pacific Northwest Association for College Admission Counseling", amount: "$1,000", state: "AK, ID, MT, OR, WA", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.pnacac.org/pnacac-student-scholarship", opportunity_type: "Scholarship", created_at: "2018-12-05 18:21:36", updated_at: "2018-12-05 18:21:36", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-10-01", updated_by: "walshm"},
    {id: 1804, award_name: "Marketing Scholarship Program", subject_area: "All fields", level: nil, deadline: "2019-05-30", other_req: "You must be able to prove that you are a US citizen or legal US resident. You must be enrolled in or pursuing a college degree at an accredited University or United States college.\r\n\r\nSee essay prompt on website. ", sponsor: "Oregon Web Solutions", amount: "$1,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.oregonwebsolutions.com/scholarship-program/", opportunity_type: "Scholarship", created_at: "2018-12-06 17:11:51", updated_at: "2018-12-06 17:11:51", citizenship: "US Citizen or Permanent Resident", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "walshm"},
    {id: 1805, award_name: "Washington State Opportunity Scholarship", subject_area: "STEM field; science; technology; engineering; math; health care", level: nil, deadline: "2019-02-28", other_req: "Plan to get an eligible 4-year degree in STEM or health care (even if you start in a 2-year program). Enroll in an eligible Washington state college or university beginning in the fall of 2019. Be a Washington state resident and have earned your high school diploma in Washington", sponsor: "WSOS", amount: "Up to $22,500", state: "WA", min_gpa: "2.75", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.waopportunityscholarship.org/", opportunity_type: "Scholarship", created_at: "2019-02-22 21:48:22", updated_at: "2019-02-23 00:02:14", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2020-01-03", updated_by: "hobbsm"},
    {id: 1806, award_name: "Generation Google Scholarship", subject_area: "Computer Science; Computer Engineering; Minority", level: nil, deadline: "2019-03-18", other_req: "To be eligible to apply, applicants must:\r\nBe a current high school senior. Intend to be enrolled as a full-time student in a 4-year BA/BS program in the US (excluding territories) or Canada in Fall 2019. Intend to be enrolled at a university in a computer science, computer engineering, software engineering or related area department for the 2019-2020 academic year. Be able to demonstrate an interest in and motivation for studying computer science. The program is open to qualified students who meet the above criteria and we strongly encourage students from historically underrepresented groups, including Black/African American, Hispanic/Latino, American Indian, or Filipino/Native Hawaiian/Pacific Islander, to apply.", sponsor: "Google", amount: "$10,000", state: "All", min_gpa: "", contact: "financial.aid@example.edu", keywords: nil, website: "https://buildyourfuture.withgoogle.com/scholarships/generation-google-scholarship/#!?detail-content-tabby_activeEl=high-school-seniors", opportunity_type: "", created_at: "2019-03-11 17:43:55", updated_at: "2019-03-11 17:44:44", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "current college student deadline December 1st, high school senior application becomes available in January deadline in March.", respect_deadline: true, date_reopens: "2019-11-01", updated_by: "hobbsm"},
    {id: 1807, award_name: "Renaissance Scholars Program", subject_area: "All fields; FGEN", level: nil, deadline: "2019-12-15", other_req: "Students may apply if they are:\r\n\r\nA high school senior or high school graduate in Oregon planning to attend a fully accredited 4-year U.S. college or university; or\r\nA college freshman or sophomore continuing their higher education, with no more than 60 college credits\r\nStudents must also meet the following requirements:\r\n\r\nMust be the first member of their immediate family to attend an accredited U.S. 4-year college or university\r\nMust have demonstrated financial need\r\nMust have a minimum cumulative GPA of 3.0 and have shown academic achievement\r\nMust be seeking a bachelor’s degree and plan to attend an accredited U.S. 4 year college or university on a full-time basis time. Recipient may attend a community college, but only with the intention of transferring and obtaining a bachelor’s degree (NOTE: TRF will not award funds while attending community college, only after transferring to a four year institution)\r\nHave demonstrated good character either through leadership potential (school, home and/or community activities); a concern for others (through contributions to volunteer projects and/or family needs); and/or work ethic (responsibility, initiative and skill-building through paid or unpaid work experiences)", sponsor: "The Renaissance Foundation", amount: "$4,000 renewable", state: "OR", min_gpa: "3.0", contact: "financial.aid@example.edu", keywords: nil, website: "http://www.trfwebsite.org/renaissance-scholars-program/", opportunity_type: "Scholarship", created_at: "2019-07-11 16:10:28", updated_at: "2019-07-11 16:13:40", citizenship: "No Requirement", website_link_text: "", is_published: true, admin_notes: "DEADLINES\r\nThere are 3 opportunities to apply for a scholarship through the Renaissance Scholars Program. \r\nRound 1: Dec 15\r\nRound 2: Feb 1\r\nRound 3: May 1", respect_deadline: true, date_reopens: "2019-12-16", updated_by: "hobbsm"},
    {id: 1808, award_name: "National Institutes of Health (NIH) Undergraduate Scholarship Program ", subject_area: "Biomedical; Behavioral; Social Sciences", level: nil, deadline: "2019-03-18", other_req: "For each full or partial scholarship year, you are committed to two NIH service obligations. The obligations are actually benefits of the UGSP, providing you with invaluable research training and experience at the NIH; Undergraduate University Grade Point Average of 3.3 or higher on a 4.0-point scale or within the top 5 percent of your class; Having 'Exceptional Financial Need' as certified by your undergraduate institution financial aid office\r\n\r\n\r\n\r\n", sponsor: "The National Institutes of Health (NIH)", amount: "Up to $20,000 renewable", state: "All", min_gpa: "3.3", contact: "financial.aid@example.edu", keywords: nil, website: "https://www.training.nih.gov/programs/ugsp", opportunity_type: "Scholarship", created_at: "2019-07-15 21:50:15", updated_at: "2019-07-15 21:58:08", citizenship: "US Citizen", website_link_text: "", is_published: true, admin_notes: "", respect_deadline: true, date_reopens: "2019-12-15", updated_by: "hobbsm"},
